INSERT INTO `quest_request_items` VALUES (5, 1, 0, 0, 0, 'Oh, a shipment from my brother? Splendid! Fortune truly shines on me today!', 0);
INSERT INTO `quest_request_items` VALUES (6, 1, 6, 0, 0, 'Did you find Garrick\'s shack? Are we finally free of that villain?', 0);
INSERT INTO `quest_request_items` VALUES (7, 1, 0, 0, 0, 'How goes the hunting, $N? Have you found and defeated those vermin?', 0);
INSERT INTO `quest_request_items` VALUES (8, 1, 0, 0, 0, 'Yes? Yes? What is it? The forsaken; they certainly do have huge appetites. Make yourself at home... yes, rest those weary bones. My name\'s Renee if you need anything at all. ', 0);
INSERT INTO `quest_request_items` VALUES (9, 1, 0, 0, 0, 'Ah, I see you\'re back! I hope you\'ve been hard at work clearing those fields of those Harvest Watchers. Have you killed twenty yet?', 0);
INSERT INTO `quest_request_items` VALUES (10, 6, 0, 0, 0, 'Well, what news do you have?  You look like you\'ve been in quite the fight... is Scrimshank alive?', 0);
INSERT INTO `quest_request_items` VALUES (11, 0, 0, 0, 0, 'Hail, $n.  Have you been killing Gnolls...? ', 0);
INSERT INTO `quest_request_items` VALUES (12, 1, 0, 0, 0, 'Perhaps I did not make myself clear, pledge. In order to prove your worth as a servant to The People\'s Militia and to the Light you need to slay 15 Defias Trappers and 15 Defias Smugglers then return to me when the deed is done.', 0);
INSERT INTO `quest_request_items` VALUES (13, 1, 0, 0, 0, 'We have not time to talk, $N. The Defias Pillagers are denying the people of Westfall the peace and prosperity they deserve. Make sure at least 15 Defias Pillagers and 15 Defias Looters have been killed. That will send a clear message that corruption is not welcome here.', 0);
INSERT INTO `quest_request_items` VALUES (14, 1, 66, 0, 0, '$N, now is no time for idle chatter. If you still wish to prove yourself to The People\'s Militia you need to slay the Defias I notified you about earlier. Return to me when you have completed your duty.', 0);
INSERT INTO `quest_request_items` VALUES (15, 1, 0, 0, 0, 'Have you been to the mines? Are you ready to report?', 0);
INSERT INTO `quest_request_items` VALUES (16, 0, 0, 0, 0, 'Farming is thirsty work, and I\'m always looking for refreshing spring water.$B$BIf you have any, then I\'m willing to make a trade.', 0);
INSERT INTO `quest_request_items` VALUES (17, 1, 0, 0, 0, 'Have you obtained the magenta fungus caps I need for my alchemical work? No caps - no reward!', 0);
INSERT INTO `quest_request_items` VALUES (18, 1, 6, 0, 0, 'Have you gathered those bandanas for me yet?', 0);
INSERT INTO `quest_request_items` VALUES (19, 1, 0, 0, 0, 'Orc pressure from Blackrock is still tense. But have you at least rid us of Tharil\'zun?', 0);
INSERT INTO `quest_request_items` VALUES (20, 1, 0, 0, 0, 'Have you been slaying orcs, $N? If so, then show me...', 0);
INSERT INTO `quest_request_items` VALUES (21, 1, 0, 0, 0, 'I know it\'s bloody work, $N, but it\'s vital to the safety of Northshire. Are you ready to report?', 0);
INSERT INTO `quest_request_items` VALUES (22, 5, 4, 0, 0, 'All I need for my famous meat pie are 8 Goretusk Livers!', 0);
INSERT INTO `quest_request_items` VALUES (23, 1, 0, 0, 0, 'Ah - $N - I was just thinking about you! How goes your hunting?', 0);
INSERT INTO `quest_request_items` VALUES (24, 1, 0, 0, 0, 'Greetings once again, $N! Have you come to show me proof of your hunt?', 0);
INSERT INTO `quest_request_items` VALUES (25, 1, 0, 0, 0, 'You back already? What\'s the situation out there - all cleared up now, thanks to you?', 0);
INSERT INTO `quest_request_items` VALUES (26, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (27, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (30, 1, 0, 0, 0, 'Have you formed your pendant for me to inspect, $N? If you need help in locating the parts, try asking the local populace for information. Not only will you find what you seek, but it will give you a reason to explore this wondrous and sacred glade.', 0);
INSERT INTO `quest_request_items` VALUES (31, 1, 0, 0, 0, 'Your return to Thunder Bluff is not without heralding, though I will need proof of your lessons learned in Moonglade before I will teach you your aquatic form.$B$BDo you have the Pendant of the Sea Lion?', 0);
INSERT INTO `quest_request_items` VALUES (32, 1, 0, 0, 0, 'I\'m sorry. I don\'t know you... but from the look of things you have at least heard something of me. Now, what can I help you with? Do you have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (33, 6, 6, 0, 0, 'Hey $N. I\'m getting hungry...did you get that tough wolf meat?', 0);
INSERT INTO `quest_request_items` VALUES (34, 1, 4, 0, 0, 'Is Bellygrub still at it or were you able to rid Lakeshire of the pest once and for all?', 0);
INSERT INTO `quest_request_items` VALUES (35, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (36, 1, 0, 0, 0, 'I\'m going to miss that Verna Furlbrow so much. I don\'t suppose you happened to see her on your way here?', 0);
INSERT INTO `quest_request_items` VALUES (37, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (38, 1, 0, 0, 0, 'Come back with the following ingredients: $b $b 3 Stringy Vulture Meat $b 3 Goretusk Snouts $b 3 Murloc Eyes $b 3 Okra', 0);
INSERT INTO `quest_request_items` VALUES (39, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (40, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (45, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (46, 0, 0, 0, 0, 'How goes the hunting, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (47, 0, 0, 0, 0, 'Psst!  You have that Gold Dust for me...for me? ', 0);
INSERT INTO `quest_request_items` VALUES (48, 1, 0, 0, 0, 'Hiccup! Ho ho! You want an encore?$B$BIn the land to the south where vines twist and creep$BLies a hidden well where the water runs deep$BPure as the Light\'s sacred Daughter$BBring to me now some Holy Spring Water.', 0);
INSERT INTO `quest_request_items` VALUES (49, 1, 0, 0, 0, 'Encore? Well, sure!$B$BAmber is the hue of my life\'s longest love$BLike the last embers of dusk in the sky above$BRetrieve for me so that my love shall be born$BOne sack of each: barley, rye and corn.', 0);
INSERT INTO `quest_request_items` VALUES (50, 1, 0, 0, 0, 'An encore for you? Well sure friend!$B$BI\'ll mix and mix till we have a mash$BFor this will be our own private stash$BA still must be fashioned of metal strong$BBring me some Truesilver so I can finish this song.', 0);
INSERT INTO `quest_request_items` VALUES (51, 1, 0, 0, 0, 'An encore? Why for you, anything!$B$BNot yet filtered but freshly distilled$BLike unseeded land waiting there tilled.$BNext I will fashion our pile of charcoal$BDeliver a sycamore branch, that is your next goal.', 0);
INSERT INTO `quest_request_items` VALUES (52, 1, 0, 0, 0, 'Have you killed those wolves and bears?', 0);
INSERT INTO `quest_request_items` VALUES (53, 1, 0, 0, 0, 'Sure, I\'ll sing it again for you, friend!$B$BMellifluous liquid clear as a baby\'s tears$BTurns a lovely deep amber over the years$BBut before we proceed to get lit to the hilt$BA barrel of charred oak must be built.', 0);
INSERT INTO `quest_request_items` VALUES (54, 1, 0, 0, 0, 'You have word from McBride?  Northshire is a garden compared to Elwynn Forest, but I wonder what Marshal McBride has to report. Here, let me have his papers... ', 0);
INSERT INTO `quest_request_items` VALUES (55, 1, 0, 0, 0, 'Is Morbent Fel defeated?!', 0);
INSERT INTO `quest_request_items` VALUES (56, 1, 21, 0, 0, 'Have you killed those warriors and mages?', 0);
INSERT INTO `quest_request_items` VALUES (57, 1, 21, 0, 0, 'Return to me once you have killed 15 Skeletal Fiends and 15 Skeletal Horrors, $N.', 0);
INSERT INTO `quest_request_items` VALUES (58, 1, 66, 0, 0, 'I need your assistance, $N. Travel to the cemetery to the northwest and rid the eastern mausoleum of 20 Plague Spreaders.$B$BReturn to me when your task is complete.', 0);
INSERT INTO `quest_request_items` VALUES (59, 0, 0, 0, 0, 'I have been commissioned by the Stormwind Army to supply their people with cloth and leather armor. If you have a marker for me, then I\'d be happy to make you something. ', 0);
INSERT INTO `quest_request_items` VALUES (60, 0, 0, 0, 0, 'Did you gather those candles yet? ', 0);
INSERT INTO `quest_request_items` VALUES (61, 0, 0, 0, 0, 'Oh, a shipment from my brother?  Splendid!  Fortune truly shines on me today! ', 0);
INSERT INTO `quest_request_items` VALUES (62, 1, 0, 0, 0, 'What do you have to report, $N? Have you been to the Fargodeep Mine?', 0);
INSERT INTO `quest_request_items` VALUES (63, 1, 0, 0, 0, 'The brazier still reflects the ambient light from the are, and the flame shifts slightly as you move closer.$B$BThe corruption along the hills seems to have kept its distance, and besides the missing components, the brazier looks prepared for the ritual to summon a cleansed manifestation of water.', 0);
INSERT INTO `quest_request_items` VALUES (64, 1, 0, 0, 0, 'Don\'t suppose you were able to get my watch?', 0);
INSERT INTO `quest_request_items` VALUES (65, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (66, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (67, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (68, 1, 0, 0, 0, 'Ah, I remember you. You\'re the one who was asking about that Stalvan fellow. Did you ever find what you were looking for?', 0);
INSERT INTO `quest_request_items` VALUES (69, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (70, 1, 0, 0, 0, 'What have ya got there? Let me take a look at that. . .', 0);
INSERT INTO `quest_request_items` VALUES (71, 0, 0, 0, 0, 'Hello, $n.  Have you discovered the fates of Rolf and Malakai? ', 0);
INSERT INTO `quest_request_items` VALUES (72, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (74, 6, 0, 0, 0, 'What have you got there? I cannot see. My eyesight is very bad. Put it in my hands.', 0);
INSERT INTO `quest_request_items` VALUES (75, 6, 0, 0, 0, 'Did you find that page I mentioned, $N?', 0);
INSERT INTO `quest_request_items` VALUES (76, 1, 0, 0, 0, 'Hail, $N. What do you have to report? Have you scouted the Jasperlode Mine?', 0);
INSERT INTO `quest_request_items` VALUES (77, 6, 0, 0, 0, 'I trust that your arrival here at our camp is to deliver the bottles of ripple that are integral to the task at hand, yes?', 0);
INSERT INTO `quest_request_items` VALUES (78, 6, 5, 0, 0, 'Marshal Haggard sent you? Why didn\'t you say so?$B$BAh, good ol\' Haggard. Poor chap is going to be completely blind before long. Anyway, let me see what you\'ve got there.', 0);
INSERT INTO `quest_request_items` VALUES (79, 1, 0, 0, 0, 'This better be good, $C. Let me see what you have and tell me your tale. But by the Light, be quick about it. Darkshire\'s defense is my number one priority. I have not the time to squander on dead-end leads.', 0);
INSERT INTO `quest_request_items` VALUES (80, 1, 5, 0, 0, 'Back again, $N? What do you have this time?', 0);
INSERT INTO `quest_request_items` VALUES (81, 1, 0, 0, 0, 'If you\'re not here to buy anything, and you\'re not here to deliver anything, then you\'re wasting my time! You better have that ripple!', 0);
INSERT INTO `quest_request_items` VALUES (82, 1, 0, 0, 0, 'You\'re Junior Surveyor $N, yes? Quickly now, there is a dire situation at hand! Do you have the insect parts that Fizzledowser said you would?!', 0);
INSERT INTO `quest_request_items` VALUES (83, 0, 0, 0, 0, 'I\'m running low on linen, $n.  Do you have any for me? ', 0);
INSERT INTO `quest_request_items` VALUES (84, 0, 0, 0, 0, 'Ugh... I\'m starving!  Do you have that pie for me, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (85, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (86, 0, 0, 0, 0, 'I don\'t think it\'s right feeding the boy who stole my necklace in the first place, but if that\'s what it takes to get back what\'s mine, then so be it! Do you have that boar meat? ', 0);
INSERT INTO `quest_request_items` VALUES (87, 0, 0, 0, 0, 'Hello, $n.  Have you found my necklace? ', 0);
INSERT INTO `quest_request_items` VALUES (88, 0, 0, 0, 0, 'Did you see her yet?  Did you get her? ', 0);
INSERT INTO `quest_request_items` VALUES (89, 1, 0, 0, 0, 'This bridge isn\'t going to build itself! Now where are those iron pikes and iron rivets?', 0);
INSERT INTO `quest_request_items` VALUES (90, 1, 2, 0, 0, 'Were you able to find 10 Lean Wolf Flanks yet? How about the herbs from Felicia in Stormwind?', 0);
INSERT INTO `quest_request_items` VALUES (91, 1, 0, 0, 0, 'Turn in 10 Shadowhide Pendants to me, and you shall be rewarded.', 0);
INSERT INTO `quest_request_items` VALUES (92, 1, 0, 0, 0, 'I still need five pieces of Tough Condor Meat, five Great Goretusk Snouts and five helpings of Crisp Spider Meat.', 0);
INSERT INTO `quest_request_items` VALUES (93, 1, 0, 0, 0, 'Hail, $N. Did you get those Gooey Spider Legs yet?', 0);
INSERT INTO `quest_request_items` VALUES (94, 1, 0, 0, 0, 'This Lion Statue has sat here for decades, and keeps a lonely watch over the infamous Tower of Ilgalar.$B$BThere is a depression at the base of the statue, where a gem or glyph might be set...', 0);
INSERT INTO `quest_request_items` VALUES (95, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (96, 1, 0, 0, 0, 'You\'ve returned. Splendid!$B$BHow went your journey to Silverpine? Did it take you long?$B$BIt is hard for me to tell if you were successful there because so much of the land has become corrupt. Its stench overwhelms any good that you might have done. But small successes are sometimes as important as large ones. Purifying the water there was instrumental for you, and for all shamans.', 0);
INSERT INTO `quest_request_items` VALUES (97, 1, 5, 0, 0, 'Yes, $N?', 0);
INSERT INTO `quest_request_items` VALUES (98, 1, 0, 0, 0, 'Yes, $N?', 0);
INSERT INTO `quest_request_items` VALUES (99, 1, 0, 0, 0, 'Have you secured the Pyrewood Shackles yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (100, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (101, 1, 0, 0, 0, 'Bring to me 10 ghoul fangs, 10 skeleton fingers and 5 vials of spider venom. For you I shall enchant a Totem of Infliction which will harm those who attempt violent acts against you.', 0);
INSERT INTO `quest_request_items` VALUES (102, 1, 0, 0, 0, 'Have you collected 8 paws from those treacherous Gnolls yet?', 0);
INSERT INTO `quest_request_items` VALUES (103, 1, 0, 0, 0, 'The flame will not burn for long without oil, $N.', 0);
INSERT INTO `quest_request_items` VALUES (104, 1, 0, 0, 0, 'Have you laid waste to the menace known as Old Murk-Eye yet? He has been spotted roaming the coastline of Westfall.$B$BReturn to me when the foul beast is dead.', 0);
INSERT INTO `quest_request_items` VALUES (105, 1, 0, 0, 0, 'Your task has been given to you, $N. Do you have a shard from the lich\'s phylactery as proof of the task being accomplished?', 0);
INSERT INTO `quest_request_items` VALUES (106, 0, 0, 0, 0, 'You have what??  Maybell is the light of my dull life.  Hurry, let me see her letter! ', 0);
INSERT INTO `quest_request_items` VALUES (107, 0, 0, 0, 0, 'You have a note from \"Gramma\" Stonefield, eh?  I haven\'t seen Mildred in years!  I wonder what she has to say... ', 0);
INSERT INTO `quest_request_items` VALUES (109, 1, 0, 0, 0, 'An... Any luck??', 0);
INSERT INTO `quest_request_items` VALUES (110, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (111, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (112, 0, 0, 0, 0, 'Do you have that crystal kelp?  I\'m sure Maybell is anxious to see her beau... ', 0);
INSERT INTO `quest_request_items` VALUES (113, 6, 0, 0, 0, 'Well Junior Surveyor $n, has ol\' Pestlezugg got that report ready yet?', 0);
INSERT INTO `quest_request_items` VALUES (114, 0, 0, 0, 0, 'Did you deliver my letter to Tommy Joe?  What did he say?? ', 0);
INSERT INTO `quest_request_items` VALUES (115, 1, 0, 0, 0, 'How goes your conflict with the shadowcasters? Did you find the midnight orbs?', 0);
INSERT INTO `quest_request_items` VALUES (116, 1, 0, 0, 0, 'I need you to pick up a keg of Thunderbrew Lager from Grimbooze Thunderbrew in the Westfall hills, a cask of Merlot from Stormwind, a bottle of Moonshine from Darkshire and a skin of Sweet Rum from Goldshire. Bring those back to me and I will see to it you are rewarded.', 0);
INSERT INTO `quest_request_items` VALUES (117, 1, 0, 0, 0, 'Hurry, my friend, move with haste $bIn order for our rich lager to taste $bMore like beer and less like stew, $bHops are needed to make the brew.', 0);
INSERT INTO `quest_request_items` VALUES (118, 1, 0, 0, 0, 'What\'s that? Verner sent you, you say? Well give me his note. And SPEAK UP!', 0);
INSERT INTO `quest_request_items` VALUES (119, 1, 0, 0, 0, 'Great, you\'re back! Did you get the shoes?', 0);
INSERT INTO `quest_request_items` VALUES (120, 1, 0, 0, 0, 'What have you there?', 0);
INSERT INTO `quest_request_items` VALUES (121, 1, 0, 0, 0, 'Did the General send news? Are reinforcements on the way?', 0);
INSERT INTO `quest_request_items` VALUES (122, 1, 0, 0, 0, 'I know that greedy Argus will send someone to collect his scales if I don\'t give them to him soon. Have you found those scales yet?', 0);
INSERT INTO `quest_request_items` VALUES (123, 0, 0, 0, 0, 'What?!?  We haven\'t had our people working the Elwynn mines for months! Let me see that note you have... ', 0);
INSERT INTO `quest_request_items` VALUES (124, 1, 0, 0, 0, 'Yes? Is there something I can do for you?', 0);
INSERT INTO `quest_request_items` VALUES (125, 1, 0, 0, 0, 'Were you able to find my tools?', 0);
INSERT INTO `quest_request_items` VALUES (126, 1, 0, 0, 0, 'Yowler is a dangerous creature, $N. If you\'re not ready for him, I understand.', 0);
INSERT INTO `quest_request_items` VALUES (127, 1, 0, 0, 0, 'You have some sunfish for me, eh?', 0);
INSERT INTO `quest_request_items` VALUES (128, 1, 0, 0, 0, 'Return once you have slain 15 Blackrock Champions.', 0);
INSERT INTO `quest_request_items` VALUES (129, 1, 0, 0, 0, 'Darcy sent me a lunch, did she? Such a kind heart she has. Well...let\'s have it!', 0);
INSERT INTO `quest_request_items` VALUES (130, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (131, 1, 0, 0, 0, 'Hello again, $N. Did Parker like the lunch I sent him?', 0);
INSERT INTO `quest_request_items` VALUES (132, 1, 0, 0, 0, 'Good to see you back, $N. What did Wiley have to say for himself?', 0);
INSERT INTO `quest_request_items` VALUES (133, 1, 0, 0, 0, 'I think I hear a pack of Ghouls scurrying around the back of the house - I better put that effigy up quick! Did you get those Ghoul Ribs for me?', 0);
INSERT INTO `quest_request_items` VALUES (134, 1, 0, 0, 0, 'Do you have my crate? If so, then please...give it to me quickly!', 0);
INSERT INTO `quest_request_items` VALUES (135, 1, 0, 0, 0, 'What business do you have with me? I am a very busy man. . .', 0);
INSERT INTO `quest_request_items` VALUES (136, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (138, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (139, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (140, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (141, 1, 0, 0, 0, 'Did Master Shaw shed any light on things?', 0);
INSERT INTO `quest_request_items` VALUES (142, 1, 0, 0, 0, '$N, were you able to gather any information? Did you locate the messenger?', 0);
INSERT INTO `quest_request_items` VALUES (143, 1, 0, 0, 0, 'Hail, $C. What business do you have with The People\'s Militia?', 0);
INSERT INTO `quest_request_items` VALUES (144, 1, 0, 0, 0, 'Shall we expect the People\'s Militia soon? Does Lord Stoutmantle\'s news bode well?', 0);
INSERT INTO `quest_request_items` VALUES (145, 1, 0, 0, 0, 'You appear to have traveled from afar, $C. What business do you have here in Darkshire?', 0);
INSERT INTO `quest_request_items` VALUES (146, 1, 0, 0, 0, 'Ah, good to see you back, messenger. Shall I inform the Marshal that the Night Watch is on its way from Darkshire?', 0);
INSERT INTO `quest_request_items` VALUES (147, 0, 0, 0, 0, 'Did you find the Collector?  Did you discover whom he\'s working for? ', 0);
INSERT INTO `quest_request_items` VALUES (148, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (149, 1, 0, 0, 0, 'Oh please, don\'t look at me! I tore out these eyes with my own hands, but I can still feel your gaze!$B$BI\'m hideous! Hideous! Please, look away!!', 0);
INSERT INTO `quest_request_items` VALUES (150, 1, 0, 0, 0, 'Do you have those fins? Hurry, we need those murlocs driven from the lake!', 0);
INSERT INTO `quest_request_items` VALUES (151, 1, 0, 0, 0, 'Old Blanchy is on her last leg. Did you happen to find any oats for her?', 0);
INSERT INTO `quest_request_items` VALUES (152, 1, 0, 0, 0, 'Kill 7 Tidehunters, 7 Warriors, 7 Oracles and 7 Coastrunners and I will see to it that you are rewarded.', 0);
INSERT INTO `quest_request_items` VALUES (153, 1, 0, 0, 0, 'Bring me 15 red leather bandanas and I\'ll pay you well.', 0);
INSERT INTO `quest_request_items` VALUES (154, 1, 0, 0, 0, 'I sense that you have seen Blind Mary. You have my Comb...?', 0);
INSERT INTO `quest_request_items` VALUES (155, 1, 0, 0, 0, 'What business do you have with me? I am a very busy man...', 0);
INSERT INTO `quest_request_items` VALUES (156, 6, 2, 0, 0, 'Hi, $N. You have that rot blossoms for me yet?', 0);
INSERT INTO `quest_request_items` VALUES (157, 1, 0, 0, 0, 'I need to string the Ghost Hair Thread along my door and my windows to keep out unwanted spirits. Did you get it for me?', 0);
INSERT INTO `quest_request_items` VALUES (158, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (159, 1, 0, 0, 0, 'I need that Zombie Juice to keep me warm on these cold, dark nights. Did you get it for me?', 0);
INSERT INTO `quest_request_items` VALUES (160, 1, 0, 0, 0, 'Abercrombie...? I don\'t know a person of that name. You say you have a letter for me from this Abercrombie fellow?$B$BWell let\'s have it then...', 0);
INSERT INTO `quest_request_items` VALUES (161, 1, 0, 0, 0, 'You say somethin\', sonny? Can\'t hear a bloody thing besides the ringin\' in me ears. Say, what\'s that you got there?', 0);
INSERT INTO `quest_request_items` VALUES (162, 2, 0, 0, 0, 'Peace and tranquility be upon you, stranger.  Why have you sought me out this day?', 0);
INSERT INTO `quest_request_items` VALUES (163, 1, 0, 0, 0, 'Ah, $N! Back so soon? No doubt you\'ve been at the hunt again? Don\'t worry if you\'ve had some setbacks, in the long run it will make you better!$B$B...You couldn\'t get much worse, anyway...', 0);
INSERT INTO `quest_request_items` VALUES (164, 1, 0, 0, 0, 'You look a sturdy type, $C. Have you come to join our fight?', 0);
INSERT INTO `quest_request_items` VALUES (165, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (166, 1, 0, 0, 0, 'How goes the hunt for Edwin VanCleef?', 0);
INSERT INTO `quest_request_items` VALUES (167, 1, 0, 0, 0, 'Did you find any sign of my brother? Is there any hope after all this time?', 0);
INSERT INTO `quest_request_items` VALUES (168, 1, 0, 0, 0, 'Were you able to retrieve any of my old co-worker\'s Miners\' Union Cards?', 0);
INSERT INTO `quest_request_items` VALUES (169, 1, 0, 0, 0, 'What do you have there, $R?', 0);
INSERT INTO `quest_request_items` VALUES (170, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (171, 6, 0, 0, 0, 'It is a pleasure to see you again, $N. Have you attended to the duties you\'ve volunteered for during Children\'s Week?', 0);
INSERT INTO `quest_request_items` VALUES (172, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (173, 1, 0, 0, 0, '$N, how fares the hunt?', 0);
INSERT INTO `quest_request_items` VALUES (174, 1, 0, 0, 0, 'Have you found a skilled engineer to create a bronze tube yet?', 0);
INSERT INTO `quest_request_items` VALUES (175, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (176, 1, 0, 0, 0, 'Yes, Hogger has been a real pain for me and my men. You have something to report about the beast?', 0);
INSERT INTO `quest_request_items` VALUES (177, 1, 0, 0, 0, 'I showed Cog the beginnings of our star-viewing machine. He was impressed. Did you happen to find a reflective device?', 0);
INSERT INTO `quest_request_items` VALUES (178, 1, 0, 0, 0, 'I spoke to you through a pendant, you say? Hmm...give it to me, so that I might study it.', 0);
INSERT INTO `quest_request_items` VALUES (179, 11, 11, 0, 0, 'Wolves giving you a bit of trouble? You\'d do well to avoid the fangs and claws and other sharp bits, yes? ', 0);
INSERT INTO `quest_request_items` VALUES (180, 1, 0, 0, 0, 'What news do you bring before the Court?', 0);
INSERT INTO `quest_request_items` VALUES (181, 1, 0, 0, 0, 'Were you able to convince Zzarc\'Vul to lend us his monocle for our experiment?', 0);
INSERT INTO `quest_request_items` VALUES (182, 6, 0, 0, 0, 'From what I\'ve learned, these trolls hail from the Frostmane clan. I\'m afraid I don\'t know much else about them that would be of any use to you, $N.', 0);
INSERT INTO `quest_request_items` VALUES (183, 2, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (184, 1, 0, 0, 0, 'You have the deed to my farm?? That\'s good news! Some ruffians stole it days ago... I thought it was gone for good!$b$bPlease, let me have it. We\'re on our way out of Westfall and ain\'t coming back any time soon, but if we do then we\'ll need those papers...', 0);
INSERT INTO `quest_request_items` VALUES (185, 1, 1, 0, 0, 'I don\'t feel confident in training you further, $n, until you have proven yourself skilled in slaying the youngest of the tigers first.', 0);
INSERT INTO `quest_request_items` VALUES (186, 1, 0, 0, 0, 'If you strive for greater challenges you must first prove yourself with the task at hand. Return to me after you\'ve killed 10 Stranglethorn Tigers.', 0);
INSERT INTO `quest_request_items` VALUES (187, 1, 0, 0, 0, 'You must kill 10 Elder Stranglethorn Tigers before I give you the final challenge that will determine if you are a true tiger hunting master.', 0);
INSERT INTO `quest_request_items` VALUES (188, 6, 0, 0, 0, 'How goes the hunt for Sin\'Dall?', 0);
INSERT INTO `quest_request_items` VALUES (189, 6, 0, 0, 0, 'You\'ve had success I hope? All over the place, those trolls. Filthy devils.$b$bOh yes, that reminds me! Be sure to tell your friends, yes? We could use much assistance!', 0);
INSERT INTO `quest_request_items` VALUES (190, 1, 25, 0, 0, 'A true panther hunter would be out in the fields, trying to stalk his prey. Show some commitment to your goal, $c, and get back out there.', 0);
INSERT INTO `quest_request_items` VALUES (191, 1, 0, 0, 0, 'Bhag\'thera can prove to be an elusive beast. How fairs the hunt?', 0);
INSERT INTO `quest_request_items` VALUES (192, 1, 0, 0, 0, 'Bhag\'thera can prove to be an elusive beast. How fairs the hunt?', 0);
INSERT INTO `quest_request_items` VALUES (193, 1, 0, 0, 0, 'Bhag\'thera can prove to be an elusive beast.  How fares the hunt?', 0);
INSERT INTO `quest_request_items` VALUES (194, 1, 0, 0, 0, 'I never met a hunter who got any kills by standing around the campfire - well, except for my father. Were you planning on killing those Stranglethorn Raptors or were you hoping they would die of old age?', 0);
INSERT INTO `quest_request_items` VALUES (195, 1, 0, 0, 0, 'A true hunter sets his focus on his prey. You, my friend, seem more concerned with chit-chatting around the campfire. Now get out there and kill 10 Lashtails before I go and rid the entire bloody jungle of them in one hunt.', 0);
INSERT INTO `quest_request_items` VALUES (196, 1, 0, 0, 0, 'Bah! What are you doing standing around, $N! A true big game hunter never gives up once his prey is in his sights. Those Jungle Stalkers aren\'t going to come running up to this campfire and throw themselves in it. Silly bloke.', 0);
INSERT INTO `quest_request_items` VALUES (197, 1, 0, 0, 0, 'How goes the hunt for Tethis?  Tracked her all the way back to camp, did you?', 0);
INSERT INTO `quest_request_items` VALUES (198, 1, 0, 0, 0, 'Yes? What do you want? Oh, supplies from the goblins. Strange seeing a $R delivering them, usually they send their own. No matter... you didn\'t touch them did you? Good good... we wouldn\'t want anything to happen to our mines, oh no.', 0);
INSERT INTO `quest_request_items` VALUES (199, 1, 0, 0, 0, 'Did you happen to discover any clues, $N?', 0);
INSERT INTO `quest_request_items` VALUES (200, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (201, 1, 6, 0, 0, 'Well?  Did you have any luck in locating the camp?', 0);
INSERT INTO `quest_request_items` VALUES (202, 1, 0, 0, 0, 'Dare I hope that Kurzen and his defenders are dead, $N?', 0);
INSERT INTO `quest_request_items` VALUES (203, 1, 0, 0, 0, 'I hope you\'ve been successful in your hunting, $N. We won\'t last long against him without your help.', 0);
INSERT INTO `quest_request_items` VALUES (204, 1, 0, 0, 0, 'I\'m waiting on those remedies and that extract, $N.', 0);
INSERT INTO `quest_request_items` VALUES (205, 1, 0, 0, 0, 'Do you have those fetishes, $N? They might hold the secret to Kurzen\'s degradation...I must know!', 0);
INSERT INTO `quest_request_items` VALUES (206, 0, 0, 0, 0, 'I give you my blessing. Mai\'Zoth\'s strength is matched only by his evil.', 0);
INSERT INTO `quest_request_items` VALUES (207, 1, 0, 0, 0, '$N! Do you have the troll legends? I must know their secrets!', 0);
INSERT INTO `quest_request_items` VALUES (208, 1, 0, 0, 0, 'I see you\'re back, $g old bloke : lass;.  King Bangalash has caused me to come crawling back to camp many times.  Hang in there.', 0);
INSERT INTO `quest_request_items` VALUES (209, 1, 0, 0, 0, 'Tough buggers, aren\'t they? Well, have you had any luck? Sorry to seem impatient, but this has been a huge thorn in my side! Well?', 0);
INSERT INTO `quest_request_items` VALUES (210, 1, 0, 0, 0, 'Hello! You brought me something?', 0);
INSERT INTO `quest_request_items` VALUES (211, 6, 0, 0, 0, 'Your task has been given to you, $N.  Do you have a shard from the lich\'s phylactery as proof of the task being accomplished?', 0);
INSERT INTO `quest_request_items` VALUES (212, 1, 0, 0, 0, '$N! Do you have that haunch? I must begin preparing it soon, or the banquet will be ruined!', 0);
INSERT INTO `quest_request_items` VALUES (213, 0, 0, 0, 0, 'I need those stones, $n. By whatever means necessary! Just do it, don\'t give me the details!$b$bIt\'s about results, $n, nothing more, nothing less.', 0);
INSERT INTO `quest_request_items` VALUES (214, 1, 0, 0, 0, 'Have you been reclaiming our land from the Defias gang? If so show me 10 Red Silk Bandanas as proof.', 0);
INSERT INTO `quest_request_items` VALUES (215, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (216, 1, 6, 0, 0, 'Have you taken the fight to the Thistlefur?  With a clear path between our bases, our chances of claiming the whole of Ashenvale increase dramatically.', 0);
INSERT INTO `quest_request_items` VALUES (217, 1, 0, 0, 0, 'Grawmug and his two guards, Gnasher and Brawler, are still alive. Your mission is not complete until all 3 have been brought to death. The Dwarven empire is counting on you, $N.', 0);
INSERT INTO `quest_request_items` VALUES (218, 1, 0, 0, 0, '$N ! Any luck?', 0);
INSERT INTO `quest_request_items` VALUES (219, 1, 0, 0, 0, 'Yes?', 0);
INSERT INTO `quest_request_items` VALUES (220, 1, 0, 0, 0, 'Hello again, $N. You\'re looking well.$B$BWhat brings you back to me so soon?', 0);
INSERT INTO `quest_request_items` VALUES (221, 1, 0, 0, 0, 'Back so soon, $N? I hope you haven\'t come to tell me you\'ve given up.', 0);
INSERT INTO `quest_request_items` VALUES (222, 1, 0, 0, 0, 'Intimidating beasts aren\'t they? But have no fear, $N, those who stand for the Light will never fall!', 0);
INSERT INTO `quest_request_items` VALUES (223, 1, 0, 0, 0, 'Yes, what is it? Make it quick, I\'ve pressing matters to attend to.', 0);
INSERT INTO `quest_request_items` VALUES (224, 1, 0, 0, 0, 'Loch Modan is under siege, $N!  We need every able-bodied member of the Alliance to aid our cause.  Have you killed 10 Stonesplinter Troggs and 10 Stonesplinter Scouts yet?', 0);
INSERT INTO `quest_request_items` VALUES (225, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (226, 1, 0, 0, 0, 'You still hunting wolves...?', 0);
INSERT INTO `quest_request_items` VALUES (227, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (228, 1, 0, 0, 0, 'I don\'t blame you if you\'re having trouble with him, $N. Some of our strongest Watchers have been lost to Mor\'Ladim.', 0);
INSERT INTO `quest_request_items` VALUES (229, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (230, 1, 0, 0, 0, 'You found what?? Please, let me see it...', 0);
INSERT INTO `quest_request_items` VALUES (231, 1, 0, 0, 0, 'Leave me be...', 0);
INSERT INTO `quest_request_items` VALUES (232, 6, 0, 0, 0, 'Yes, and what may I assist you with?  Are you here on business for the Royal Apothecary Society, or have you arrived here merely to brighten my day?', 0);
INSERT INTO `quest_request_items` VALUES (233, 6, 0, 0, 0, 'Yes? Do you have something for me? ', 0);
INSERT INTO `quest_request_items` VALUES (234, 1, 0, 0, 0, 'Is there something I can help you with? ', 0);
INSERT INTO `quest_request_items` VALUES (235, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (236, 0, 0, 0, 0, 'Well? Did you manage to find the embers or did the Horde beat you to it and leave you crying?', 0);
INSERT INTO `quest_request_items` VALUES (237, 1, 0, 0, 0, 'We need more time, $r. Your orders are to kill 10 Stonesplinter Skullthumpers and 10 Stonesplinter Seers. Keep the enemy under pressure until we are granted reinforcements. This is no time for idle behavior.', 0);
INSERT INTO `quest_request_items` VALUES (238, 1, 0, 0, 0, 'Yes, I think Luca is as disturbing as you do. It matters not - hand me the field sampling kit. I will need to make some adjustments to it in order to survey for the proper base materials.$b$bYou have the kit, don\'t you?', 0);
INSERT INTO `quest_request_items` VALUES (239, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (240, 1, 0, 0, 0, '$N, you\'re here! Do you have my food?!?', 0);
INSERT INTO `quest_request_items` VALUES (243, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (244, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (245, 1, 0, 0, 0, 'You\'d best be careful when dealing with the spiders, I\'ve lost a few of my men to them, and trust me, it isn\'t a pleasant sight to see a man hanging upside down in their webs after the venom has started to soften them up.$B$BI wouldn\'t want to see one of the bugs having you for lunch.', 0);
INSERT INTO `quest_request_items` VALUES (246, 1, 0, 0, 0, 'Excuse me, $N, but we have a lot to keep our hands tied here. If you have nothing to report, then I must put my mind to other matters.', 0);
INSERT INTO `quest_request_items` VALUES (247, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (248, 1, 0, 0, 0, 'This jar once held a foul-smelling liquor, but now lies empty and forgotten on a pair of barrels.', 0);
INSERT INTO `quest_request_items` VALUES (249, 1, 0, 0, 0, 'Hurry, $N, before my fears of Morganth spreading his power are made real!', 0);
INSERT INTO `quest_request_items` VALUES (250, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (251, 1, 0, 0, 0, 'A note from Abercrombie the hermit, eh? I don\'t know him, though if he lives out at the graveyard then I do know his brains have rotted out!', 0);
INSERT INTO `quest_request_items` VALUES (252, 1, 0, 0, 0, 'Ah, is the note translated? Please, let me see it...', 0);
INSERT INTO `quest_request_items` VALUES (253, 1, 0, 0, 0, 'Have you yet found Eliza\'s grave? Do you have the Embalmer\'s heart?', 0);
INSERT INTO `quest_request_items` VALUES (254, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (255, 1, 0, 0, 0, 'Have you had any luck?', 0);
INSERT INTO `quest_request_items` VALUES (256, 1, 0, 0, 0, 'Yes? Is there something I can do for you?', 0);
INSERT INTO `quest_request_items` VALUES (257, 1, 0, 0, 0, 'No luck? Don\'t feel too bad, $N...$B$BNot everyone can be me.', 0);
INSERT INTO `quest_request_items` VALUES (258, 1, 0, 0, 0, 'It\'s only natural to feel sorry for yourself when shown up by someone so new to this world. You shouldn\'t feel bad, $N.$B$BHm? Did I get your name wrong?', 0);
INSERT INTO `quest_request_items` VALUES (261, 1, 0, 0, 0, 'The Scourge grows in power with the passing of each day. If you truly wish to halt its advances, then show me.', 0);
INSERT INTO `quest_request_items` VALUES (262, 1, 0, 0, 0, 'If you have something that belongs to the shadowy figure for whom you seek, then let me see it. I may be able to divine something of its owner.', 0);
INSERT INTO `quest_request_items` VALUES (263, 1, 0, 0, 0, 'Back so soon? In case I didn\'t make myself clear we need you to kill 10 Stonesplinter Shaman and 10 Stonesplinter Bonesnappers, <Name>. Now go get \'em, Trogg-Slayer!', 0);
INSERT INTO `quest_request_items` VALUES (264, 1, 0, 0, 0, 'The stone is cold to the touch, but has obviously been abused. Trash litters the area; nicks and gashes decorate the relief atop the coffin; and the foliage around the grave has started to grow over the site.$b$bNo one cares for whoever is buried here, especially not any victims of the plague.', 0);
INSERT INTO `quest_request_items` VALUES (265, 1, 0, 0, 0, 'Sometimes I\'ll sell blank books to scholars and mages, or to anyone who wants to keep a journal.$B$BI remember well everyone to whom I sold a book within the last few months...', 0);
INSERT INTO `quest_request_items` VALUES (266, 1, 0, 0, 0, 'The Scarlet Raven doesn\'t see the business it used to, but we still do get travelers passing through.$B$BIf you can describe the person you\'re looking for, maybe I\'ll remember him.', 0);
INSERT INTO `quest_request_items` VALUES (267, 1, 0, 0, 0, 'Do you have 8 Trogg Stone Teeth to show me?  If not, there is still work to be done, $N.', 0);
INSERT INTO `quest_request_items` VALUES (268, 1, 0, 0, 0, 'Did you find who the Shadowy Figure was?', 0);
INSERT INTO `quest_request_items` VALUES (269, 1, 0, 0, 0, 'Rest, $gbrother:sister;. I can tell you have traveled far, and you bear a heavy burden. Can you tell me what casts that dark shadow over you?', 0);
INSERT INTO `quest_request_items` VALUES (270, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (271, 1, 0, 0, 0, 'Ah, $N! Back so soon? No doubt you\'ve been at the hunt again? Don\'t worry if you\'ve had some setbacks, in the long run it will make you better!$B$B... You couldn\'t get much worse, anyway...', 0);
INSERT INTO `quest_request_items` VALUES (272, 1, 0, 0, 0, 'Have you formed your pendant for me to inspect, $N? If you need help in locating the parts, try asking the local populace for information. Not only will you find what you seek, but it will give you a reason to explore this wondrous and sacred glade.', 0);
INSERT INTO `quest_request_items` VALUES (273, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (274, 1, 0, 0, 0, 'What is that you bring from Ashlan?', 0);
INSERT INTO `quest_request_items` VALUES (275, 1, 0, 0, 0, 'The Wetlands still weep, and the Fen Creepers still rage. Return to me when your task is done.', 0);
INSERT INTO `quest_request_items` VALUES (276, 1, 0, 0, 0, 'Your task is still at hand, young $C.', 0);
INSERT INTO `quest_request_items` VALUES (277, 1, 0, 0, 0, 'Do you have the Gnolls\' tools for fire?', 0);
INSERT INTO `quest_request_items` VALUES (278, 1, 0, 0, 0, 'Do you have the needed items? Time is of the essence!!', 0);
INSERT INTO `quest_request_items` VALUES (279, 1, 0, 0, 0, 'Our merchants will not be safe until we are rid of Gobbler and those Murlocs.', 0);
INSERT INTO `quest_request_items` VALUES (280, 1, 0, 0, 0, 'The top of the keg slowly twists off.', 0);
INSERT INTO `quest_request_items` VALUES (281, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (282, 113, 0, 0, 0, 'Hail! Have a care, $N, the tunnel to Dun Morogh is infested with troggs and is not safe for travel.$B$BIf you haven\'t any pressing business in Dun Morogh, I\'ll have to ask you to remain in Anvilmar until the tunnel is safer.', 0);
INSERT INTO `quest_request_items` VALUES (283, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (284, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (285, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (286, 1, 0, 0, 0, 'Do you have the statuette?', 0);
INSERT INTO `quest_request_items` VALUES (287, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (288, 1, 0, 0, 0, 'Oh, I\'m so very thirsty! Won\'t you buy a drink for this poor, pathetic fool?', 0);
INSERT INTO `quest_request_items` VALUES (289, 1, 0, 0, 0, 'In my dreams, I can sometimes hear the doomed moans of my brethren! Please, good sir, free them from the bonds and quiet their cries.', 0);
INSERT INTO `quest_request_items` VALUES (290, 1, 0, 0, 0, 'This chest is securely locked.', 0);
INSERT INTO `quest_request_items` VALUES (291, 1, 0, 0, 0, 'Hmm... it would seem that my guards are becoming less discriminatory with petitioners. Well, what do you want? Make it quick. ', 0);
INSERT INTO `quest_request_items` VALUES (292, 1, 0, 0, 0, 'That drunk Fitzsimmons sent you to me? Well, you can tell him I don\'t have any extra ale. He\'s going to have to panhandle someone else!', 0);
INSERT INTO `quest_request_items` VALUES (293, 1, 0, 0, 0, 'What is that orb you have? It looks...soiled.', 0);
INSERT INTO `quest_request_items` VALUES (294, 1, 0, 0, 0, 'Kill 10 Mottled Raptors and 10 Mottled Screechers, $N. My co-workers did not deserve the fate that was brought upon them. It\'s time to even the score.', 0);
INSERT INTO `quest_request_items` VALUES (295, 1, 21, 0, 0, 'I want to make those Mottled Scytheclaws and Mottled Razormaws pay for what they did. Have you killed 10 of each yet?', 0);
INSERT INTO `quest_request_items` VALUES (296, 6, 2, 0, 0, 'Is Sarltooth dead? Have you redeemed the memory of the fallen?', 0);
INSERT INTO `quest_request_items` VALUES (297, 1, 0, 0, 0, 'Do you have those Idols? We must study them and report our findings to Ironforge!', 0);
INSERT INTO `quest_request_items` VALUES (298, 1, 0, 0, 0, 'Oh, a progress report from the site? Very good!', 0);
INSERT INTO `quest_request_items` VALUES (299, 6, 0, 0, 0, 'Have you uncovered the four fragments yet, $N?  Ados, Modr, Golm and Neru...', 0);
INSERT INTO `quest_request_items` VALUES (301, 1, 0, 0, 0, 'We Stormpikes don\'t like being bothered with trivial matters, $C. I hope you brought news worthy of my valuable attention.', 0);
INSERT INTO `quest_request_items` VALUES (302, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (303, 1, 0, 0, 0, 'Roggo has been unable to contact the reserve forces. We need offensive pressure on that Dark Iron encampment, $c. Now get back out there and serve your duty to King Magni!', 0);
INSERT INTO `quest_request_items` VALUES (304, 1, 0, 0, 0, 'Were you able to locate Balgaras the Foul yet, $C? He has been evading us for quite some time.', 0);
INSERT INTO `quest_request_items` VALUES (305, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (306, 1, 0, 0, 0, 'Were you able to find Merrin? Did she send word?', 0);
INSERT INTO `quest_request_items` VALUES (307, 1, 0, 0, 0, 'Do you have that Miners\' Gear, $N?', 0);
INSERT INTO `quest_request_items` VALUES (308, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (309, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (310, 1, 0, 0, 0, 'The date on this barrel shows that it\'ll soon be tapped. ', 0);
INSERT INTO `quest_request_items` VALUES (311, 1, 0, 0, 0, 'Did you make the switch? ', 0);
INSERT INTO `quest_request_items` VALUES (312, 1, 0, 0, 0, 'Were you able to get into my meat locker, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (313, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (314, 1, 0, 0, 0, 'Vagash still terrorizes the herd!  Please help us by killing the wretched beast. ', 0);
INSERT INTO `quest_request_items` VALUES (315, 1, 0, 0, 0, 'Do you have that shimmerweed?  I almost have a batch of stout ready to brew, and I want to try throwing the weed in with this mixture. ', 0);
INSERT INTO `quest_request_items` VALUES (317, 1, 0, 0, 0, 'Preparations are going well.  How goes your hunting? ', 0);
INSERT INTO `quest_request_items` VALUES (318, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (319, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (320, 1, 0, 0, 0, 'Did you get that Evershine? ', 0);
INSERT INTO `quest_request_items` VALUES (321, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (322, 1, 0, 0, 0, 'How might I ply my craft for you, $C?', 0);
INSERT INTO `quest_request_items` VALUES (323, 1, 0, 0, 0, 'Battle hard, $Nn. And do not despair, for despair is evil\'s greatest weapon.', 0);
INSERT INTO `quest_request_items` VALUES (324, 1, 0, 0, 0, 'Did you find the lightforge iron you need?', 0);
INSERT INTO `quest_request_items` VALUES (325, 1, 0, 0, 0, 'Hello, $N. You haven\'t been gone that long, but I see a fire in your eyes I did not see before.', 0);
INSERT INTO `quest_request_items` VALUES (328, 1, 0, 0, 0, 'The strongbox is bound in bronze, very sturdy, and very heavy.', 0);
INSERT INTO `quest_request_items` VALUES (329, 1, 0, 0, 0, 'Did you discover who knew Thorsen\'s secret? Is there a traitor among us?', 0);
INSERT INTO `quest_request_items` VALUES (330, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (331, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (332, 1, 0, 0, 0, 'Greetings and welcome, $N. Have you yet tried one of our fine wines?', 0);
INSERT INTO `quest_request_items` VALUES (333, 1, 0, 0, 0, 'You bring word from Mr. Bagley?', 0);
INSERT INTO `quest_request_items` VALUES (334, 1, 0, 0, 0, 'Are you here to buy clothes?', 0);
INSERT INTO `quest_request_items` VALUES (335, 1, 0, 0, 0, 'Wishock will soon garner enough support to cause us much grief. Were you able to obtain the Tear of Tilloa or Musquash Root yet?', 0);
INSERT INTO `quest_request_items` VALUES (336, 1, 0, 0, 0, 'Can you not see that I am busy? My words must be heard! I am very important to the future of this Kingdom!$B$BOh... what have you there? Why it looks like a refreshing drink...', 0);
INSERT INTO `quest_request_items` VALUES (337, 1, 0, 0, 0, 'Ooh! What\'s that old book you have there? Can I see it??', 0);
INSERT INTO `quest_request_items` VALUES (338, 1, 0, 0, 0, 'Have you assembled the chapters yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (339, 6, 0, 0, 0, 'I don\'t suppose you were able to track down pages 1, 4, 6 and 8?  Those four are all we need to piece Chapter I back together.', 0);
INSERT INTO `quest_request_items` VALUES (340, 1, 0, 0, 0, 'We still need pages 10, 11, 14 and 16 to complete Chapter II, $N.', 0);
INSERT INTO `quest_request_items` VALUES (341, 6, 0, 0, 0, 'Any luck with pages 18, 20, 21 or 24?  Those are the only ones we need to piece together Chapter III.', 0);
INSERT INTO `quest_request_items` VALUES (342, 6, 0, 0, 0, 'We just need three pages to finish off Chapter IV, $N.  Do you have pages 25, 26 or 27 yet?', 0);
INSERT INTO `quest_request_items` VALUES (343, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (344, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (345, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (346, 1, 0, 0, 0, 'Were you able to find the book?', 0);
INSERT INTO `quest_request_items` VALUES (347, 1, 0, 0, 0, 'Do you have the Rethban Ore?', 0);
INSERT INTO `quest_request_items` VALUES (348, 0, 0, 0, 0, '....mother?$b$b...so cold...$b$b...heading into the Twisting Nether...h-h-h-hold me mother....', 0);
INSERT INTO `quest_request_items` VALUES (349, 1, 0, 0, 0, 'Witch Doctor Unbagwa know what Mokk the Savage like.  Yes, yes!$b$bMe speak with spirits and make he come, I do.$b$bBut other Gorilla-beast like spirit talkin\' too.  You protect Witch Doctor Unbagwa and I make he come to you.$b$bWitch Doctor Unbagwa want something first.  You bring a Gorilla Fang and me start spirit talking!', 0);
INSERT INTO `quest_request_items` VALUES (350, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (351, 1, 0, 0, 0, 'You appear to have uncovered the wreckage of... a robotic chicken?  The voice from within the egg crackles to life again:$B$B\"Yes, excellent work!  This is indeed my homing robot, though my sensors indicate that it needs a jump start before it can fly back to Booty Bay for repairs.  Go ahead and place the beacon inside the rover.  The beacon will take care of the rest!\"', 0);
INSERT INTO `quest_request_items` VALUES (353, 1, 0, 0, 0, 'You come all the way from Stormwind? I hear it\'s getting dicey down there in the human lands, with brigands and orcs running about. A perfect place for a $C to prove his worth!', 0);
INSERT INTO `quest_request_items` VALUES (354, 1, 0, 0, 0, 'Do you have the remains of the Agamands?  Are those cursed beasts finally destroyed? ', 0);
INSERT INTO `quest_request_items` VALUES (355, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (356, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (357, 1, 0, 0, 0, '$N, have you acquired the book?', 0);
INSERT INTO `quest_request_items` VALUES (358, 1, 0, 0, 0, 'Is your task complete?  Have you destroyed those dog-things and drained them of their ichor?', 0);
INSERT INTO `quest_request_items` VALUES (359, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (360, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (361, 1, 0, 0, 0, 'Yes? ', 0);
INSERT INTO `quest_request_items` VALUES (362, 1, 0, 0, 0, 'Did you find Devlin? ', 0);
INSERT INTO `quest_request_items` VALUES (363, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (364, 1, 0, 0, 0, 'You will not go far in this new life if you are unable to kill even the weakest of zombies, $N. Do not return until you have success to report.', 0);
INSERT INTO `quest_request_items` VALUES (365, 1, 0, 0, 0, 'Deathguard Simmer sent word that you were going to provide me with some much needed reagents.  Were you able to gather 10 pumpkins yet, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (366, 1, 0, 0, 0, 'Your masters are fools to send you here, for I will never again be a Scourge slave! ', 0);
INSERT INTO `quest_request_items` VALUES (367, 1, 0, 0, 0, 'Have you collected 5 vials of darkhound blood yet, $n? Time is fleeting! ', 0);
INSERT INTO `quest_request_items` VALUES (368, 1, 0, 0, 0, '$n, were you able to obtain 5 Vile Fin Scales from the Murlocs? ', 0);
INSERT INTO `quest_request_items` VALUES (369, 1, 0, 0, 0, 'Do you have some venom from a Vicious Night Web Spider yet, $n?  It\'s the final component I need in order to test my experiment. ', 0);
INSERT INTO `quest_request_items` VALUES (370, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (371, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (372, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (373, 1, 0, 0, 0, 'Yes? Is there something I can help you with?', 0);
INSERT INTO `quest_request_items` VALUES (374, 1, 0, 0, 0, 'Have you collected 10 Scarlet Insignia Rings yet, $c? ', 0);
INSERT INTO `quest_request_items` VALUES (375, 1, 0, 0, 0, 'Do you have five Duskbat Pelts and some Coarse Thread yet, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (376, 1, 0, 0, 0, 'Do try your best to keep yourself unharmed until I get you some armor.', 0);
INSERT INTO `quest_request_items` VALUES (377, 1, 0, 0, 0, 'So long as a molester of the dead like Dextren Ward is permitted to live, justice stands betrayed. Return to me once Lord Ebonlocke\'s sentence of death is carried out on that defiler, Ward. We shall give the families of the dead the closure they deserve and better yet, we will send a clear message to the House of Nobles in Stormwind.', 0);
INSERT INTO `quest_request_items` VALUES (378, 1, 0, 0, 0, 'I won\'t let foolish Human bureaucracy interfere with Dwarven matters, $N. Kam Deepfury is a proven conspirator in the Thandol Span attack. King Magni\'s good people lost their lives because of Deepfury\'s deceit. The Humans might be content to let Deepfury rot in The Stockade but I will not sleep soundly at night until Deepfury is slain.', 0);
INSERT INTO `quest_request_items` VALUES (379, 1, 0, 0, 0, 'Well, did the nomads \'volunteer\' up those water pouches for you?', 0);
INSERT INTO `quest_request_items` VALUES (380, 1, 0, 0, 0, 'Be wary of the spiders\' venom, $N. If you feel a sharp burning, you may want to have it looked at.', 0);
INSERT INTO `quest_request_items` VALUES (381, 1, 0, 0, 0, 'Those fools... They happily send themselves to their own graves. ', 0);
INSERT INTO `quest_request_items` VALUES (382, 1, 0, 0, 0, 'How goes your mission, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (383, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (384, 1, 0, 0, 0, 'I\'m going to need those crag boar ribs and a mug of Rhapsody Malt, $n. ', 0);
INSERT INTO `quest_request_items` VALUES (385, 1, 0, 0, 0, 'Did I tell you about the time I almost lost my hand to one of the crocs? Nasty bugger it was, teeth like knives. But I was lucky... Jammed the brute\'s jaw shut with my knife. Still have the knife around here somewhere...', 0);
INSERT INTO `quest_request_items` VALUES (386, 1, 0, 0, 0, 'Have you been to Stormwind yet, to The Stockade? I fear whatever trickery that has kept Targorr the Dread alive for this long will eventually bring about his freedom. He was sentenced to die, $N, not act as some political pawn on a noble\'s whim.', 0);
INSERT INTO `quest_request_items` VALUES (387, 1, 0, 0, 0, 'The Stockade is still overrun! These Defias Rats must be shown that their actions will not be tolerated. Now get back down there and show some force!', 0);
INSERT INTO `quest_request_items` VALUES (388, 1, 0, 0, 0, 'I see you are back, $c.  Have you collected 10 Red Wool Bandanas from those Defias Scum in The Stockade yet?', 0);
INSERT INTO `quest_request_items` VALUES (389, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (391, 1, 0, 0, 0, 'Either you bring me Thredd\'s head, or I\'ll take yours, understand, $N?', 0);
INSERT INTO `quest_request_items` VALUES (392, 1, 0, 0, 0, 'Yes, $N? What have you found?', 0);
INSERT INTO `quest_request_items` VALUES (393, 1, 0, 0, 0, 'Greetings. Of what service can I be to you, $C?', 0);
INSERT INTO `quest_request_items` VALUES (394, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (395, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (396, 1, 0, 0, 0, '$N, yes? I was informed by Baros Alexston that you would be coming. I must say, I am most interested in what you have to say.', 0);
INSERT INTO `quest_request_items` VALUES (397, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (398, 1, 0, 0, 0, 'Yes? ', 0);
INSERT INTO `quest_request_items` VALUES (399, 1, 0, 0, 0, '$N! Did you have any luck?', 0);
INSERT INTO `quest_request_items` VALUES (400, 1, 0, 0, 0, 'Hm?  You look a little young to be a siege engine pilot.  But no matter...do you need something fixed? Well take a number and get comfortable.  I\'m working on a couple engines right now and won\'t have time for another job for at least a few days. Or, were you here for something else...? ', 0);
INSERT INTO `quest_request_items` VALUES (401, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (403, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (404, 1, 0, 0, 0, 'Have you completed the task with which I have charged you?  Do you have those putrid claws? ', 0);
INSERT INTO `quest_request_items` VALUES (405, 1, 0, 0, 0, 'Greetings.  Either you do not know who I am, or your business with me is urgent.$B$BBecause if neither of these were true, then you would not be foolish enough to disturb me...', 0);
INSERT INTO `quest_request_items` VALUES (407, 1, 0, 0, 0, 'Stay away, foul and unholy creature!  May the Light protect me!  The Scarlet Crusade shall rid Azeroth of your. . .$B$B. . .oh wait.  Is that food for me?  I am so hungry. . .', 0);
INSERT INTO `quest_request_items` VALUES (408, 1, 0, 0, 0, 'Time is not a luxury we have, $n.  With each passing hour, the Scourge\'s hold on Tirisfal Glades grows more firm. ', 0);
INSERT INTO `quest_request_items` VALUES (409, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (410, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (411, 1, 0, 0, 0, 'Have you returned Gunther\'s book?  Has he responded? ', 0);
INSERT INTO `quest_request_items` VALUES (412, 1, 0, 0, 0, 'Those pilots can\'t wait to get back into their steam tanks and take to the field again. Let\'s not let them down. ', 0);
INSERT INTO `quest_request_items` VALUES (413, 1, 0, 0, 0, 'Hello, $c!  And what business takes you all the way out here? Something exciting, I hope.  I haven\'t been in a good fight in days, and this barrel of ale is almost dry... ', 0);
INSERT INTO `quest_request_items` VALUES (414, 1, 0, 0, 0, 'Greetings, $c, and welcome to Thelsamar! ', 0);
INSERT INTO `quest_request_items` VALUES (415, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (416, 1, 0, 0, 0, 'Hail, $N. How goes the rat catching?', 0);
INSERT INTO `quest_request_items` VALUES (417, 1, 0, 0, 0, 'Hello, $n.  Do you have word of my friend Hildelve? ', 0);
INSERT INTO `quest_request_items` VALUES (418, 1, 0, 0, 0, 'I\'m all ready to start cooking, do you have the ingredients for me?', 0);
INSERT INTO `quest_request_items` VALUES (419, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (420, 1, 0, 0, 0, 'How are you? Like to share a drink with me, perhaps? Not much else to do in the cold. ', 0);
INSERT INTO `quest_request_items` VALUES (421, 1, 1, 0, 0, 'If you wish to prove yourself to me, you must kill 5 Moonrage Whitescalps.  Accomplish that task, and I will see to it your skill is put to more worthy assignments.', 0);
INSERT INTO `quest_request_items` VALUES (422, 1, 0, 0, 0, 'Before I know what we are dealing with here, $C, I need to study the spell known as Remedy of Arugal. Bring it to me now or I shall be forced to find myself a worthy servant.', 0);
INSERT INTO `quest_request_items` VALUES (423, 1, 0, 0, 0, 'I will need 6 Glutton Shackles and 3 Darksoul Shackles before I can assess the situation and devise a final solution for Arugal. Now heed your bidding and slay Moonrage Gluttons and Moonrage Darksouls until you have what I need.', 0);
INSERT INTO `quest_request_items` VALUES (424, 1, 0, 0, 0, 'Has Grimson the Pale been slain? Varimathras will not be pleased if we ignore his bidding.', 0);
INSERT INTO `quest_request_items` VALUES (425, 1, 0, 0, 0, 'Have you killed Ivar the Foul? If you won\'t do it for me and my brother, then do it for the Forsaken.', 0);
INSERT INTO `quest_request_items` VALUES (426, 1, 0, 0, 0, 'Our battles with the Scourge wage on, $n.  Do your part and throw those cursed, mindless undead back into the Plaguelands! ', 0);
INSERT INTO `quest_request_items` VALUES (427, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (428, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (429, 0, 0, 0, 0, 'My time is short, $c, for the Dark Lady has charged me with a grave task.', 0);
INSERT INTO `quest_request_items` VALUES (430, 1, 0, 0, 0, 'My sister told me you were here to aid us. Is that true?', 0);
INSERT INTO `quest_request_items` VALUES (431, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (432, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (433, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (434, 1, 0, 0, 0, 'Yes, $N? Are things going well with Tyrion? He apprised me of the situation and I\'ve helped him trick Marzon into going to the castle.$B$BMarzon has been a thorn in the side of many people in Stormwind; many of which are close friends of mine. No one messes with my friends... not if they know what\'s healthy for them.$B$BIt\'s just a shame I\'m indirectly doing a favor for Shaw and SI:7 in the meantime. Oh well, not every plan is perfect.', 0);
INSERT INTO `quest_request_items` VALUES (435, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (436, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (437, 1, 0, 0, 0, 'Have you defeated Nightlash, $N?  Our success against the rot hides depends on her destruction!', 0);
INSERT INTO `quest_request_items` VALUES (438, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (439, 1, 0, 0, 0, '$N. You return, so I assume your investigations bore fruit?', 0);
INSERT INTO `quest_request_items` VALUES (440, 1, 0, 0, 0, 'Hello, $N. What brings you back to Brill?', 0);
INSERT INTO `quest_request_items` VALUES (441, 1, 0, 0, 0, 'Do I know you?', 0);
INSERT INTO `quest_request_items` VALUES (442, 1, 0, 0, 0, 'The Scourge cannot be allowed to remain in Silverpine, $N. Come back to me when you have proof of Thule\'s death.', 0);
INSERT INTO `quest_request_items` VALUES (443, 1, 0, 0, 0, 'Do you have the rot hide ichor, $N?', 0);
INSERT INTO `quest_request_items` VALUES (444, 1, 0, 0, 0, 'My studies require great concentration. So I hope your visit is not a frivolous one.', 0);
INSERT INTO `quest_request_items` VALUES (445, 1, 0, 0, 0, 'What business do you have with me, $c? ', 0);
INSERT INTO `quest_request_items` VALUES (446, 1, 0, 0, 0, 'Greetings, $N. What did Bethor have to say?', 0);
INSERT INTO `quest_request_items` VALUES (447, 1, 0, 0, 0, 'Hail, $C. What business do you have with the Royal Apothecary Society?', 0);
INSERT INTO `quest_request_items` VALUES (448, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (449, 1, 0, 0, 0, 'Did you discover the fate of the Deathstalkers?', 0);
INSERT INTO `quest_request_items` VALUES (450, 1, 0, 0, 0, 'I see you are back, $N.', 0);
INSERT INTO `quest_request_items` VALUES (451, 1, 0, 0, 0, 'What brings you back to the Undercity, $N?', 0);
INSERT INTO `quest_request_items` VALUES (452, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (453, 1, 0, 0, 0, 'Who are you?? Leave me be!', 0);
INSERT INTO `quest_request_items` VALUES (454, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (455, 1, 0, 0, 0, 'You\'re coming from Loch Modan? How is the orc situation at Algaz Gate?', 0);
INSERT INTO `quest_request_items` VALUES (456, 1, 21, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (457, 25, 21, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (459, 0, 0, 0, 0, 'Satisfy my suspicions, $N.  Bring to me 8 Fel Moss.', 0);
INSERT INTO `quest_request_items` VALUES (460, 1, 0, 0, 0, 'This grave was hastily dug.', 0);
INSERT INTO `quest_request_items` VALUES (461, 1, 0, 0, 0, 'This is the spot! Bring me closer...', 0);
INSERT INTO `quest_request_items` VALUES (463, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (464, 1, 0, 0, 0, 'Have you attacked the Dragonmaw encampment?', 0);
INSERT INTO `quest_request_items` VALUES (465, 1, 0, 0, 0, 'The first catapult is before you. Will you set it aflame?', 0);
INSERT INTO `quest_request_items` VALUES (466, 0, 0, 0, 0, 'Where is that ore, $n?! ', 0);
INSERT INTO `quest_request_items` VALUES (467, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (468, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (469, 1, 0, 0, 0, 'Hello there, $C. Could I interest you in a pair of boots? Perhaps some newly cured skins?', 0);
INSERT INTO `quest_request_items` VALUES (470, 1, 0, 0, 0, 'Did you find my bag?', 0);
INSERT INTO `quest_request_items` VALUES (471, 18, 11, 0, 0, 'My apprentice is like a son to me. It\'s going to be hard for him to live his life with only one leg.$b$bAh, $N, how goes it? Do you have my skins?', 0);
INSERT INTO `quest_request_items` VALUES (472, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (473, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (474, 1, 0, 0, 0, 'Have you killed Nek\'rosh?', 0);
INSERT INTO `quest_request_items` VALUES (476, 0, 5, 0, 0, 'By the stars!  This is quite disturbing indeed! $B $B We\'ve had troubles in the past with the corruption of the furbolgs, but such troubles should be long past since the cleansing of Teldrassil. I fear for our all people if the blessings of the aspects themselves cannot redeem our great tree.', 0);
INSERT INTO `quest_request_items` VALUES (477, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (478, 1, 0, 0, 0, 'Have you learned anything useful, $N?', 0);
INSERT INTO `quest_request_items` VALUES (479, 1, 0, 0, 0, 'We must hurry, their plans must not come to fruition, or we may lose our hold on Silverpine Forest.', 0);
INSERT INTO `quest_request_items` VALUES (480, 1, 0, 0, 0, 'Quickly, time runs short, $N!', 0);
INSERT INTO `quest_request_items` VALUES (481, 1, 0, 0, 0, 'Yes, $C? What is it?', 0);
INSERT INTO `quest_request_items` VALUES (482, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (483, 1, 0, 0, 0, '$n, the kidnapped Druids of the Talon will be forever trapped in the Emerald Dream if we cannot retrieve the Relics of Wakening from the Ban\'ethil Barrow Den to the west. For every minute we delay their fate comes one step closer to eternal doom. ', 0);
INSERT INTO `quest_request_items` VALUES (484, 1, 0, 0, 0, '$N, right? Do you have my skins?', 0);
INSERT INTO `quest_request_items` VALUES (485, 1, 0, 0, 0, 'You appear to have uncovered the wreckage of... a robotic chicken? The voice from within the egg crackles to life again:$b$b\"Yes, excellent work! This is indeed my homing robot, though my sensors indicate that it needs a jump start before it can fly back to Booty Bay for repairs. Go ahead and place the beacon inside the rover - the beacon will take care of the rest!\"', 0);
INSERT INTO `quest_request_items` VALUES (486, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (487, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (488, 0, 0, 0, 0, 'Have you been a busy little bee, $n?  I\'ve been waiting for you to bring me what I need. ', 0);
INSERT INTO `quest_request_items` VALUES (489, 0, 0, 0, 0, 'What do you have for me, $n?  A lovely snack I presume? ', 0);
INSERT INTO `quest_request_items` VALUES (491, 1, 0, 0, 0, '$N. Have you defeated Thule Ravenclaw?', 0);
INSERT INTO `quest_request_items` VALUES (492, 1, 0, 0, 0, 'Why if I had my trusted rifle you\'d be as good as dead, $c.  Just wait until the Steam Tank Brigade arrives to rescue me! ', 0);
INSERT INTO `quest_request_items` VALUES (493, 1, 0, 0, 0, 'You have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (494, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (495, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (496, 1, 0, 0, 0, 'I see you are back. I hope you were able to gather the agents I need. Another deathless day will put me in such a gloomy mood.', 0);
INSERT INTO `quest_request_items` VALUES (498, 1, 0, 0, 0, 'You must make haste, $C. I shudder to think what the humans might be doing to Drull and Tog\'thar.', 0);
INSERT INTO `quest_request_items` VALUES (499, 1, 0, 0, 0, 'Ribbit!', 0);
INSERT INTO `quest_request_items` VALUES (500, 1, 0, 0, 0, '$N, are you still hunting ogres? Do you have the knucklebones I had you gather?', 0);
INSERT INTO `quest_request_items` VALUES (501, 1, 0, 0, 0, 'I remember you, $N. You were going to help me out in concocting my latest elixir. I\'ll need that blood before I can bring my own special brand of misery to the inhabitants of Hillsbrad.', 0);
INSERT INTO `quest_request_items` VALUES (502, 1, 0, 0, 0, 'Woof?', 0);
INSERT INTO `quest_request_items` VALUES (503, 1, 0, 0, 0, 'Give me the key, $C, I will undo the lock myself.', 0);
INSERT INTO `quest_request_items` VALUES (504, 1, 0, 0, 0, 'You have more Warmongers to slay, $N. You should be up on the mountains on your task, not down here with your weapon stowed.', 0);
INSERT INTO `quest_request_items` VALUES (505, 1, 0, 0, 0, 'You have slain those Syndicate thugs, I trust?', 0);
INSERT INTO `quest_request_items` VALUES (506, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (507, 1, 0, 0, 0, 'W-what do you want?', 0);
INSERT INTO `quest_request_items` VALUES (508, 1, 0, 0, 0, 'You\'ve returned, $N. Success to report?', 0);
INSERT INTO `quest_request_items` VALUES (509, 1, 0, 0, 0, 'Any luck at Nethander Stead?', 0);
INSERT INTO `quest_request_items` VALUES (510, 1, 0, 0, 0, '$N, you look anxious. Is there something you wish to tell me?', 0);
INSERT INTO `quest_request_items` VALUES (511, 1, 0, 0, 0, 'Yes, $N? Do you have some business with me?', 0);
INSERT INTO `quest_request_items` VALUES (512, 1, 0, 0, 0, 'Have you been hunting the Syndicate? Do you have those rings?', 0);
INSERT INTO `quest_request_items` VALUES (513, 1, 0, 0, 0, 'Can you not see I am busy, $C? The Dark Lady insists on a new plague before the Scourge advance from Northrend overwhelms us. And with the human threat pressing from the south, time becomes my most precious commodity. This better be important!', 0);
INSERT INTO `quest_request_items` VALUES (514, 1, 0, 0, 0, 'Dibbs from Southshore sent you, did he? How is the old bookworm doing?', 0);
INSERT INTO `quest_request_items` VALUES (515, 1, 0, 0, 0, 'So glad to see you back, $N. I was growing so terribly bored here. Not a single entertaining thing to do besides poison and disease Umpi and reanimate her. . .over and over and over again.$b$bHow went the trip to the Undercity? Were you fortunate enough to slaughter any humans along the way?', 0);
INSERT INTO `quest_request_items` VALUES (516, 1, 0, 0, 0, 'Have you located their base yet, $n? Time is of the essence!', 0);
INSERT INTO `quest_request_items` VALUES (517, 1, 0, 0, 0, 'Sometimes I get so bored out here in Tarren Mill I like to open up the formaldehyde jar and let the lovely aroma waft through the air. Makes Umpi a little nervous though.$b$bSo were you able to get a keg from the Dwarves? I swear if I have to stare at this deadly elixir without using on it someone for another day I am going to scream.', 0);
INSERT INTO `quest_request_items` VALUES (518, 1, 0, 0, 0, 'I note that your task is unfinished, $N. Shall I inform Sharlindra of your ineptitude?', 0);
INSERT INTO `quest_request_items` VALUES (519, 1, 0, 0, 0, 'I want their heads, $N, not excuses.', 0);
INSERT INTO `quest_request_items` VALUES (520, 1, 0, 0, 0, 'Three heads I have, a fourth I need. It will be Mug\'Thol\'s, or it will be yours, $N. That I promise.', 0);
INSERT INTO `quest_request_items` VALUES (521, 1, 0, 0, 0, 'Yes? Do you have something to report?', 0);
INSERT INTO `quest_request_items` VALUES (522, 1, 0, 0, 0, 'You look out of breath! Do you have something to report?', 0);
INSERT INTO `quest_request_items` VALUES (523, 1, 0, 0, 0, 'Baron Vardus cannot think Southshore will allow him to send his thugs against us with impunity. I want his head!', 0);
INSERT INTO `quest_request_items` VALUES (524, 1, 0, 0, 0, 'A musty smell emanates from the rug.', 0);
INSERT INTO `quest_request_items` VALUES (525, 1, 0, 0, 0, '$N. Have you been traveling through the foothills and mountains again? What news do you bring?', 0);
INSERT INTO `quest_request_items` VALUES (526, 1, 0, 0, 0, 'Did you find the lightforge iron you need?', 0);
INSERT INTO `quest_request_items` VALUES (527, 1, 0, 0, 0, 'As High Executor of Tarren Mill, under the direct command of Varimathras and the Dark Lady, you are subject to follow my command.$B$BPerhaps you take this war with the Alliance lightly? If such is the case I should behead you right here and now. Otherwise, travel west to the town of Hillsbrad and wage battle against the humans, as ordered.$B$BDismissed.', 0);
INSERT INTO `quest_request_items` VALUES (528, 1, 0, 0, 0, 'You have your orders, $c. Quit dawdling here in Tarren Mill when there is work to be done elsewhere.', 0);
INSERT INTO `quest_request_items` VALUES (529, 1, 0, 0, 0, 'Were you able to carry out your orders, $C? Did you dispose of Verringtan and his assistants? And where is that iron shipment?', 0);
INSERT INTO `quest_request_items` VALUES (530, 1, 0, 0, 0, 'Do you have those hands, $N?', 0);
INSERT INTO `quest_request_items` VALUES (531, 1, 0, 0, 0, 'Great job, $N! We really showed him! Here, give me the head and I\'ll take care of it.', 0);
INSERT INTO `quest_request_items` VALUES (532, 1, 0, 0, 0, 'What news have you?', 0);
INSERT INTO `quest_request_items` VALUES (533, 1, 0, 0, 0, 'Have you found anything? I fear Gol\'dir\'s prospects grow worse by the day...', 0);
INSERT INTO `quest_request_items` VALUES (535, 1, 0, 0, 0, 'Did you bring me something to drink or did you just come back to finish the job?', 0);
INSERT INTO `quest_request_items` VALUES (536, 1, 0, 0, 0, 'Another ale, please, the last one just seemed to have disappeared!$B$BLight, how much longer am I going to be stuck out here?$B$BOh, it\'s you, $N. Have you killed those murlocs yet?', 0);
INSERT INTO `quest_request_items` VALUES (537, 1, 0, 0, 0, 'Did you find the envoys of The Argus Wake?', 0);
INSERT INTO `quest_request_items` VALUES (538, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (539, 1, 0, 0, 0, 'You were given direct orders to attack the Azureload Mine. Your reasons for loafing about Tarren Mill better be good or I will behead you for treason.', 0);
INSERT INTO `quest_request_items` VALUES (540, 1, 0, 0, 0, 'I wish I could search the ruins too, but I fear these bones wouldn\'t hold me during my climb up the mountains. However, how does your hunt for knowledge progress, $N?', 0);
INSERT INTO `quest_request_items` VALUES (541, 1, 0, 0, 0, 'Dun Garok proves to be too much of an obstacle for you, $C? And here I thought you had established yourself valiantly in Hillsbrad.$B$BIf you\'re not up to handle the mission assigned to you, I will find another who can produce better results. As for you, well, I am sure the Dark Lady could always use more grave diggers back in Tirisfal Glades.', 0);
INSERT INTO `quest_request_items` VALUES (542, 1, 0, 0, 0, '$N, you\'ve returned! How did your foray into Alterac go? Did you bring anything back with you?', 0);
INSERT INTO `quest_request_items` VALUES (543, 1, 0, 0, 0, 'Salutations, $N. Do try to avoid stepping on my pant cuffs. This outfit is newly tailored.', 0);
INSERT INTO `quest_request_items` VALUES (544, 0, 0, 0, 0, 'Did you find the thieves?  And more importantly, did you find what they stole?', 0);
INSERT INTO `quest_request_items` VALUES (545, 1, 0, 0, 0, 'Have you yet thinned the Dalaran patrols around their ruins?', 0);
INSERT INTO `quest_request_items` VALUES (546, 1, 0, 0, 0, 'So the lucky $N returns? How many humans have you slaughtered today? Hundreds I do hope!$b$bHave you any skulls for me?', 0);
INSERT INTO `quest_request_items` VALUES (547, 1, 0, 0, 0, 'Were you able to retrieve my sword, $N? High Executor Darthalia will hang me from the rafters if she discovers my folly.', 0);
INSERT INTO `quest_request_items` VALUES (549, 1, 0, 0, 0, 'Do you have nothing better to do than stand here before me, $c? As High Executor, I have more pressing matters than to stare at your rotting visage.', 0);
INSERT INTO `quest_request_items` VALUES (550, 1, 0, 0, 0, 'What brings a $C all the way to the Undercity from the battlefield?', 0);
INSERT INTO `quest_request_items` VALUES (551, 1, 0, 0, 0, 'Oh. You have something you\'d like me to look at? Some scrap of lore gathered from up in the mountains, I hope...', 0);
INSERT INTO `quest_request_items` VALUES (552, 1, 0, 0, 0, 'Have you recovered Helcular\'s Rod yet? There are so many Yeti in this region, it will be very difficult to locate. But we must have it in order to proceed.', 0);
INSERT INTO `quest_request_items` VALUES (553, 1, 0, 0, 0, 'Helcular\'s grave teems with a mystical energy.', 0);
INSERT INTO `quest_request_items` VALUES (554, 1, 0, 0, 0, 'More interruptions?$B$BAh, this parchment is covered with a very intricate, finely woven spell. I can untangle it, of course, but it\'s going to take time. And time is very valuable to me...$B$BPerhaps I will just purchase it from you?', 0);
INSERT INTO `quest_request_items` VALUES (555, 1, 0, 0, 0, 'Any luck finding the ingredients? I\'ll tell you, this territory isn\'t the peaceful place it once was. Ah, if only this unrest never occurred...', 0);
INSERT INTO `quest_request_items` VALUES (556, 0, 0, 0, 0, 'Do you have the Worn Stone Tokens, $N?  The Magus is eager to unlock their secrets.', 0);
INSERT INTO `quest_request_items` VALUES (557, 1, 0, 0, 0, 'Hello, $N. Elementals are tough quarry, but I know you\'re up to the task. Do you have those bracers of binding?', 0);
INSERT INTO `quest_request_items` VALUES (558, 0, 0, 0, 0, 'Someday, I wanna be a hero just like Jaina... well, a boy hero that is.', 0);
INSERT INTO `quest_request_items` VALUES (559, 1, 0, 0, 0, 'Did you get those heads for me, $N?', 0);
INSERT INTO `quest_request_items` VALUES (560, 1, 0, 0, 0, 'Greetings, citizen. Have you come to lend your arm to upholding the safety of Southshore?', 0);
INSERT INTO `quest_request_items` VALUES (561, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (562, 1, 0, 0, 0, 'I\'ve a letter ready to go to Major Samuelson in Stormwind. All I need are the results.', 0);
INSERT INTO `quest_request_items` VALUES (563, 1, 0, 0, 0, 'Greetings, citizen. May the Stormwind city guard be of assistance?', 0);
INSERT INTO `quest_request_items` VALUES (564, 1, 0, 0, 0, 'Mountain Lions killin\' off our horses left and right and here you are wantin\' to jibber-jabber about the weather and what not.$B$BOught to go and find myself a real hero. More killin\' and less talkin\'.', 0);
INSERT INTO `quest_request_items` VALUES (565, 1, 0, 0, 0, 'So you have returned to the great Bartolo. Perhaps you have finished gathering the materials needed for your Yeti Fur Cloak? Or maybe you just enjoy basking in the greatness of me, Bartolo!', 0);
INSERT INTO `quest_request_items` VALUES (566, 1, 0, 0, 0, 'Ah, $N. Perhaps you\'ve come to collect the bounty on the head of Baron Vardus?', 0);
INSERT INTO `quest_request_items` VALUES (567, 1, 0, 0, 0, 'Yes?', 0);
INSERT INTO `quest_request_items` VALUES (568, 1, 0, 0, 0, 'Our supply efforts are still being hampered by the indigenous raptor population, $c.', 0);
INSERT INTO `quest_request_items` VALUES (569, 1, 0, 0, 0, 'Have you made any progress with the ogres of the Mizjah Ruins yet, $C?', 0);
INSERT INTO `quest_request_items` VALUES (570, 1, 0, 0, 0, 'What news do you bring?', 0);
INSERT INTO `quest_request_items` VALUES (571, 1, 0, 0, 0, 'Has fortune been on your side, $N? Were you able to obtain an aged gorilla sinew?', 0);
INSERT INTO `quest_request_items` VALUES (572, 1, 0, 0, 0, 'Did your gathering efforts prove fruitful?', 0);
INSERT INTO `quest_request_items` VALUES (573, 1, 0, 0, 0, 'I am almost ready to complete the enchantment. Have you performed my bidding?', 0);
INSERT INTO `quest_request_items` VALUES (574, 1, 0, 0, 0, 'Sergeant Yohwa tells me you are skilled and brave, $C. Do you have something to report?', 0);
INSERT INTO `quest_request_items` VALUES (575, 0, 0, 0, 0, 'My equipment is all ready to go, $n, I just need those skins. We don\'t want to keep Riddlevox waiting, that\'s for sure.$b$bIt\'s not a good idea for anyone to keep the chief inventor of the Tinkers\' Union unsatisfied.', 0);
INSERT INTO `quest_request_items` VALUES (576, 1, 0, 0, 0, 'Ahoy, me bucko!  Might not be able to see but I can smell ye from halfway across port.$b$bCould really use me eye back.  Captain\'s going to keelhaul me when he finds out me peeper is in the hands of them dirty Bloodsail Buccaneers.$b$bWhat good is a lookout who can\'t see?  The crow\'s nest used to be me home...without me deadlights I\'d be lucky to scrub the bilge.', 0);
INSERT INTO `quest_request_items` VALUES (577, 1, 0, 0, 0, 'Drizzlik\'s Excelsior leather boots, finest workmanship, one-hundred percent high quality saltwater crocilisk skin boots. None finer!$b$bCan\'t beat a glowing description like that, can you?$b$bExcept, maybe, if you have those skins for me?', 0);
INSERT INTO `quest_request_items` VALUES (578, 1, 0, 0, 0, 'The trolls truly possessed some amazing magical objects, $N. And now, perhaps, I have the opportunity to add one to my extensive collection. Did you have any luck finding the source of the rumor?', 0);
INSERT INTO `quest_request_items` VALUES (579, 1, 0, 0, 0, 'King Varian has placed great importance on learning, and thus has provided funds for making copies of various tomes and writings available to the public. It\'s very simple. You bring me a library scrip, and I can give you a copy of one of the available books.', 0);
INSERT INTO `quest_request_items` VALUES (580, 5, 0, 0, 0, 'Sink me!  I\'m almost outta booze here!  Cap\'n is goin\' to weigh anchor and Ol\' Slim will be caught dry as the Tanaris Desert.  And once he discovers his port is missing. . . blimey!', 0);
INSERT INTO `quest_request_items` VALUES (581, 1, 0, 0, 0, '$C. Show me you have made prey of the Bloodscalp tribe.$b$bShow me your trophies.', 0);
INSERT INTO `quest_request_items` VALUES (582, 1, 0, 0, 0, '$N. I fear for our chief\'s son. Do you have the shrunken heads so I may inspect them?', 0);
INSERT INTO `quest_request_items` VALUES (583, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (584, 1, 0, 0, 0, 'The greenish broth within the cauldron bubbles.', 0);
INSERT INTO `quest_request_items` VALUES (585, 0, 0, 0, 0, 'I await the skulls...', 0);
INSERT INTO `quest_request_items` VALUES (586, 1, 0, 0, 0, 'Although my own flesh boils off my skull, I can still smell your fear.$B$BHah!  You will never complete my task...', 0);
INSERT INTO `quest_request_items` VALUES (587, 1, 0, 0, 0, 'Any luck finding the goods, matey?', 0);
INSERT INTO `quest_request_items` VALUES (588, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (589, 1, 0, 0, 0, 'Do you have the shards, $N? They are needed for my final ritual, after we have the Mind\'s Eye.', 0);
INSERT INTO `quest_request_items` VALUES (590, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (591, 1, 0, 0, 0, 'Greetings, $N. The spirits sing praise of your bravery, yet they tell me no tales of your quest against Mai\'Zoth.$b$bDo you have the Eye?', 0);
INSERT INTO `quest_request_items` VALUES (592, 1, 0, 0, 0, '$N. Kin\'weelay told me you set out to capture Yenniku.$b$bIs it true? Do you have him?', 0);
INSERT INTO `quest_request_items` VALUES (593, 1, 0, 0, 0, 'Yenniku stands stunned before you, his mind in another place...', 0);
INSERT INTO `quest_request_items` VALUES (594, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (595, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (596, 1, 0, 0, 0, 'The Bloodscalps will one day be crushed by the Darkspears! Do you have the necklaces of our doomed foe?', 0);
INSERT INTO `quest_request_items` VALUES (597, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (598, 1, 0, 0, 0, 'The Skullsplitters will curse the day they brought us to war! Is your task complete?', 0);
INSERT INTO `quest_request_items` VALUES (599, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (600, 1, 0, 0, 0, 'Do you have those crystals?? I need them!!$b$bI mean...I need to know the evil Venture Company is losing ground in Stranglethorn. Because, you know, we honest folk have to make a living!', 0);
INSERT INTO `quest_request_items` VALUES (601, 1, 0, 0, 0, 'Have you had any luck, $N?', 0);
INSERT INTO `quest_request_items` VALUES (602, 1, 0, 0, 0, 'If you wouldn\'t mind, I am rather busy right now.', 0);
INSERT INTO `quest_request_items` VALUES (603, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (604, 1, 0, 0, 0, 'Ahoy, $n.  What word do you bring of the Bloodsail encampment to the south?', 0);
INSERT INTO `quest_request_items` VALUES (605, 0, 0, 0, 0, 'Do you have those shards yet?  I\'ll give you a decent cut from the profits!', 0);
INSERT INTO `quest_request_items` VALUES (606, 1, 0, 0, 0, 'Hey!  I don\'t like the look you\'re giving me, $gmister:lady;.', 0);
INSERT INTO `quest_request_items` VALUES (607, 1, 0, 0, 0, 'Here here, $N.  Did you get Shaky\'s payment?', 0);
INSERT INTO `quest_request_items` VALUES (608, 1, 0, 0, 0, 'What\'s the problem, $N? We need to attack before the Bloodsail Buccaneers do!', 0);
INSERT INTO `quest_request_items` VALUES (609, 0, 0, 0, 0, '$N, did you find those three dogs? Did you collect their valuables?', 0);
INSERT INTO `quest_request_items` VALUES (610, 1, 0, 0, 0, 'I\'d never been beat before, you know, $N? Sure I\'d been cut, can\'t get in a knife fight without that, but he just smacked me on the side of the head, blacked me out. When I came to my blade was gone.$B$BAs much as my nickname might indicate, I still need a knife to fight, and for me, it has to be that one.', 0);
INSERT INTO `quest_request_items` VALUES (611, 1, 0, 0, 0, 'Have you retrieved the Stone of the Tides for me, $N? I\'ve already cleared out a space and purchased a fine stand for it.', 0);
INSERT INTO `quest_request_items` VALUES (613, 1, 0, 0, 0, 'Ahoy, $N! Have you yet found Maury\'s Key?', 0);
INSERT INTO `quest_request_items` VALUES (614, 1, 0, 0, 0, 'Ahoy, $N! Did you find Gorlash? That chest was my favorite, and it has a hidden compartment that held my greatest treasures!', 0);
INSERT INTO `quest_request_items` VALUES (615, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (616, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (617, 1, 0, 0, 0, 'If ya got no business with me, then move along, $N.', 0);
INSERT INTO `quest_request_items` VALUES (618, 1, 0, 0, 0, 'Did you get my cutlass, $N?', 0);
INSERT INTO `quest_request_items` VALUES (619, 1, 0, 0, 0, 'This is an abandoned lifeboat.  Printed along its side in scratched, faded paint are the words:$B$B\"Smotts\' Revenge\"', 0);
INSERT INTO `quest_request_items` VALUES (620, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (621, 0, 0, 0, 0, 'Do you have the samples of Zanzil\'s Mixture??', 0);
INSERT INTO `quest_request_items` VALUES (622, 1, 0, 0, 0, 'Hello, $N. Did you make it to Booty Bay? Did the goblin Krazek fix my pot??', 0);
INSERT INTO `quest_request_items` VALUES (623, 1, 0, 0, 0, 'Yeah?', 0);
INSERT INTO `quest_request_items` VALUES (624, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (625, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (626, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (627, 1, 0, 0, 0, 'Hello, $N. Did you have luck getting the bloodstone?', 0);
INSERT INTO `quest_request_items` VALUES (628, 1, 0, 0, 0, 'I read somewhere that the saltwater crocilisks are slowly dying out... bad news for my business, isn\'t it?$b$bAnyways, I hope you have that elder saltwater crocolisk skin for me!', 0);
INSERT INTO `quest_request_items` VALUES (629, 1, 0, 0, 0, 'I await the Tablet Shard, $N.', 0);
INSERT INTO `quest_request_items` VALUES (630, 1, 0, 0, 0, 'I thank my ancestors someone has come to aid me. Do you have the key that will free me?', 0);
INSERT INTO `quest_request_items` VALUES (631, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (632, 1, 0, 0, 0, 'Any sign of Ol\' Rustlocke, $N?', 0);
INSERT INTO `quest_request_items` VALUES (633, 1, 0, 0, 0, 'The cache of explosives must be destroyed!', 0);
INSERT INTO `quest_request_items` VALUES (634, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (635, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (636, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (637, 1, 0, 0, 0, 'You look as though you have traveled a great distance and seen much turmoil in your time, $C. These times we live in are trying on the soul. What news do you bring to me now?', 0);
INSERT INTO `quest_request_items` VALUES (638, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (639, 1, 0, 0, 0, 'Have you located the first sigil yet? It is most likely carried on the person of one of the Syndicate agents in Stromgarde.', 0);
INSERT INTO `quest_request_items` VALUES (640, 0, 0, 0, 0, 'Throm\'ka, $c. Zengu informed me that you required my assistance?', 0);
INSERT INTO `quest_request_items` VALUES (641, 1, 0, 0, 0, '$N! Do you have the second sigil?', 0);
INSERT INTO `quest_request_items` VALUES (642, 0, 0, 0, 0, 'This cluster of shards looks much like the Shards of Myzrael.  But the same feeling of security does not pulse through them.', 0);
INSERT INTO `quest_request_items` VALUES (643, 1, 0, 0, 0, 'Valorcall will not be easy to track down, $N. Mounted on horseback, he can cover ground quickly. Nonetheless, we must have his sigil.', 0);
INSERT INTO `quest_request_items` VALUES (644, 1, 0, 0, 0, 'You\'ve returned, $N. Is the line of Ignaeus Trollbane broken?', 0);
INSERT INTO `quest_request_items` VALUES (645, 1, 0, 0, 0, 'Etchings in the stone upon the face of the tomb of Trollbane match the glowing lines of the Sigil of Ignaeus...', 0);
INSERT INTO `quest_request_items` VALUES (646, 1, 0, 0, 0, '$N! Have you taken the sword?', 0);
INSERT INTO `quest_request_items` VALUES (647, 1, 0, 0, 0, 'What\'s the good word, $R?', 0);
INSERT INTO `quest_request_items` VALUES (648, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (649, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (650, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (651, 1, 0, 0, 0, 'This is the Stone of Inner Binding. It is the strongest of the binding stones and must be unlocked for the others to open.', 0);
INSERT INTO `quest_request_items` VALUES (652, 1, 0, 0, 0, 'The Keystone is charged with tremendous geomantic energy.', 0);
INSERT INTO `quest_request_items` VALUES (653, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (654, 1, 5, 0, 0, 'Well, did you get everything you needed? If you didn\'t and the power runs out, everything inside will be ruined and you\'ll have to start over.$B$BHey, don\'t look to me for sympathy; I\'m all about the Gadgetzan Water Company making a profit, and if that means selling you power sources until we can afford to import water in from the icy springs of Dun Morogh, so be it!', 0);
INSERT INTO `quest_request_items` VALUES (655, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (656, 1, 0, 0, 0, 'The Shards of Myzrael are now strangely quiet.', 0);
INSERT INTO `quest_request_items` VALUES (657, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (658, 1, 0, 0, 0, 'We appreciate your help in looking for that courier, $N.$B$BWhile you were gone, Kin saw an apothecary come out of that same house to the south of here. I\'m confident that they\'re up to no good--I just need proof of it before we go off and do something rash.$B$BHave you had any luck yet?', 0);
INSERT INTO `quest_request_items` VALUES (659, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (660, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (661, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (662, 0, 0, 0, 0, 'How goes the search and recovery mission, $n?  We really need to get those Logs and Charts back from the Maiden\'s Folly and Spirit of Silverpine.$b$bIf the information from those sources were to fall into enemy hands, Fleet Master Seahorn would force us down the plank.$b$bThat is if we ever get out of this mess...', 0);
INSERT INTO `quest_request_items` VALUES (663, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (664, 1, 0, 0, 0, 'Bah, maybe I should go kill those naga scum myself. It\'s obvious you\'re not goin\' to do it.$B$BMaybe I can find some knitting needles so you can keep yourself busy.', 0);
INSERT INTO `quest_request_items` VALUES (665, 1, 0, 0, 0, 'This is no time to talk! The goggles need to be charged with the power of the stone!', 0);
INSERT INTO `quest_request_items` VALUES (666, 1, 0, 0, 0, 'How did the goggles work? Did everything function properly? Adjustments can be made if necessary.$b$bOh, and I\'ll need those goggles back when you\'re done. I am sure Captain O\'Breen will have many uses for them later on.', 0);
INSERT INTO `quest_request_items` VALUES (667, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (668, 1, 0, 0, 0, 'Ahoy, $C. What brings you to the bridge?', 0);
INSERT INTO `quest_request_items` VALUES (669, 1, 0, 0, 0, 'What brings you to Booty Bay, $C?', 0);
INSERT INTO `quest_request_items` VALUES (670, 1, 0, 0, 0, 'So was Seahorn impressed? I bet you his smile reached from Booty Bay to Ratchet.', 0);
INSERT INTO `quest_request_items` VALUES (671, 1, 0, 0, 0, 'Once-cursed blood still runs through my veins, $N. If someone... something is summoning demons, it must be stopped.', 0);
INSERT INTO `quest_request_items` VALUES (672, 1, 0, 0, 0, 'I will create an amulet that will give Gor\'mul some of the strength of the raptors. Perhaps that will awaken some flame within him...', 0);
INSERT INTO `quest_request_items` VALUES (673, 1, 0, 0, 0, 'The burning in my blood... it grows by the day. The $C must be stopped.', 0);
INSERT INTO `quest_request_items` VALUES (674, 1, 0, 0, 0, 'What hope is there when the hand of a coward can slay the mightiest of the mightiest? What hope, I ask you!', 0);
INSERT INTO `quest_request_items` VALUES (675, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (676, 1, 0, 0, 0, 'I have not the time to sharpen my axe, let alone leave the outpost to slay those beasts that would try and slay my kin.$B$BYou do not seem to have the experience of a grunt let alone a full-fledged warrior, what do you want, $N?', 0);
INSERT INTO `quest_request_items` VALUES (677, 1, 0, 0, 0, 'If you have not yet completed my task, then perhaps you are a coward in heart as well as a tyro in war.', 0);
INSERT INTO `quest_request_items` VALUES (678, 1, 0, 0, 0, 'You hesitate. Why? You have shown great strength thus far, $N. Do not fail me now.', 0);
INSERT INTO `quest_request_items` VALUES (679, 1, 0, 0, 0, 'I see your courage finally wanes. It seems my instincts were correct about you: your strength is nothing compared to your bravado.$b$bReturn to me when the beast\'s head has been severed, or return never again.', 0);
INSERT INTO `quest_request_items` VALUES (680, 1, 0, 0, 0, 'Near the Tower of Arathor--that is where you will find Or\'Kalar. His death will stop the attacks on Hammerfall and protect my husband\'s life.$B$BI see in your eyes that you think me weak--even dishonorable--for my silence. Some day you will learn what it is to love as I do. Perhaps then you will understand a different kind of strength and honor.$B$BIn the meantime, do as I ask, and slay Or\'Kalar.', 0);
INSERT INTO `quest_request_items` VALUES (681, 1, 0, 0, 0, '$N, with each passing hour our hold on Stromgarde grows more tenuous. You must make haste or our city will surely fall.', 0);
INSERT INTO `quest_request_items` VALUES (682, 1, 0, 0, 0, 'Have you retrieved any Stromgarde Badges, $N? The Syndicate must learn they cannot profit from our dead.', 0);
INSERT INTO `quest_request_items` VALUES (683, 1, 0, 0, 0, 'So you are $N the $C? News of your contributions to the Alliance has traveled quite far, you know?$B$BOn what business do you come before me today?', 0);
INSERT INTO `quest_request_items` VALUES (684, 1, 0, 0, 0, 'Greetings, $C. You have a report to make?', 0);
INSERT INTO `quest_request_items` VALUES (685, 1, 0, 0, 0, 'Hello. Do you have a report to submit?', 0);
INSERT INTO `quest_request_items` VALUES (686, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (687, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (688, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (689, 1, 0, 0, 0, '$N, $N, $N! Tell me you have enough Alterac Granite for me to begin my masterpiece in honor of Sully Balloo.', 0);
INSERT INTO `quest_request_items` VALUES (690, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (691, 1, 0, 0, 0, 'Have you had any luck so far, $N?$B$B<Kryten makes some notes in his journal as he reads.>$B$BIf my research is correct, the tusks should come from any Witherbark troll. The medicine pouches come from the Witherbark witch doctors, and the strongest of the Witherbark shadow hunters should carry the special knife given to them after they\'ve completed their rites of passage. There\'s no way to tell which shadow hunters will have the knife until you do battle.', 0);
INSERT INTO `quest_request_items` VALUES (692, 1, 0, 0, 0, 'Did you find those fragments?!?! You\'ll need the Scroll of Myzrael if you want to trap her again, before it\'s too late!', 0);
INSERT INTO `quest_request_items` VALUES (693, 1, 0, 0, 0, 'Our goal is the wand, $N. Focus on that for now.', 0);
INSERT INTO `quest_request_items` VALUES (694, 1, 0, 0, 0, '$N, hello again. Have you found an azure agate yet?', 0);
INSERT INTO `quest_request_items` VALUES (695, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (696, 1, 0, 0, 0, 'You do this, an\' I\'m sure Malin\'ll be more than pleased with you.', 0);
INSERT INTO `quest_request_items` VALUES (697, 1, 0, 0, 0, 'Yes? You look vaguely familiar. I do apologize, but have we met? I get so busy I lose track.', 0);
INSERT INTO `quest_request_items` VALUES (698, 1, 0, 0, 0, 'Lok\'tar, $C. Traveling through the swamps isn\'t a risk taken lightly. You\'re brave to test your mettle here.', 0);
INSERT INTO `quest_request_items` VALUES (699, 1, 0, 0, 0, 'Good mead, a warm fire, an army of orcs and an arsenal of weapons... that\'s all we really need out here along the coast. I don\'t regret my position out here safeguarding Stonard, but it would be nice if we could one day get a burrow, or at least a tower.', 0);
INSERT INTO `quest_request_items` VALUES (700, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (701, 1, 0, 0, 0, 'My preparations are made, all I require are the raptor hearts.', 0);
INSERT INTO `quest_request_items` VALUES (702, 1, 0, 0, 0, 'Returned again have you? Indeed there is nothing more I could wish for now than more of Tor\'gan\'s pity.$B$BWhat have you for me this time? Perhaps a piece of brightly colored string? Or a length of rope to end this misery of mine...', 0);
INSERT INTO `quest_request_items` VALUES (703, 1, 0, 0, 0, 'Hello, $N. Did you bring me my wings?', 0);
INSERT INTO `quest_request_items` VALUES (704, 1, 0, 0, 0, 'Did you find those urns, $N? We must find the link between them and the troggs!', 0);
INSERT INTO `quest_request_items` VALUES (705, 1, 0, 0, 0, 'Did you get my pearls?  I\'m almost out of flash bombs!', 0);
INSERT INTO `quest_request_items` VALUES (706, 1, 0, 0, 0, 'How goes the hunt, $C?', 0);
INSERT INTO `quest_request_items` VALUES (707, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (708, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (709, 1, 0, 0, 0, 'Did you find the tablet? It must hold secrets! Secrets to save us!', 0);
INSERT INTO `quest_request_items` VALUES (710, 6, 0, 0, 0, 'This area\'s perfect for-- Could you hold these in place for a moment? Yes, just like that, along the vector normal. Now, what was I... Right. Perfect for testing my latest project. The raw materials, the open space... what more could an intelligent and enlightened practitioner of the arts ask for?', 0);
INSERT INTO `quest_request_items` VALUES (711, 0, 0, 0, 0, 'I\'m most pleased, $N. My spells affected the smaller pieces just as I predicted. If this experiment is as successful as I foresee, then the elementals I\'ll be able to control will put anything summoned prior to this to shame.', 0);
INSERT INTO `quest_request_items` VALUES (712, 1, 0, 0, 0, 'The stone slabs you found were ideal, $N. Lucien will be taking the extra ones back to Kharanos when we\'re done here. After all, they could prove useful again.$B$BFor instance, they\'d be a nice basis for a handy little shelter once I start looking into a multidisciplinary approach to high-yield explosives...', 0);
INSERT INTO `quest_request_items` VALUES (713, 6, 0, 0, 0, 'Have you found the oil I need? It would be so helpful if you were able to find some.', 0);
INSERT INTO `quest_request_items` VALUES (714, 1, 0, 0, 0, 'Yes, yes, yes. Just a moment.$b$b', 0);
INSERT INTO `quest_request_items` VALUES (715, 1, 0, 0, 0, 'He\'s getting closer to finishing. How are things going on your end?', 0);
INSERT INTO `quest_request_items` VALUES (716, 1, 0, 0, 0, 'I wouldn\'t wait too long to get that bracer, Orthanc.$b$bWho knows what\'s going to happen next?', 0);
INSERT INTO `quest_request_items` VALUES (717, 1, 0, 0, 0, 'Strong magics and powers held the drakes\' prison for so long, but we cannot allow any possibility that Blacklash and Hematus may be released.', 0);
INSERT INTO `quest_request_items` VALUES (718, 1, 0, 0, 0, 'The desert\'s a bad place to be hungry, my friend, let me tell you that.$B$BHey... what\'s that over there...', 0);
INSERT INTO `quest_request_items` VALUES (719, 1, 0, 0, 0, 'Not sure what the Shadowforge were lookin\' for, but they definitely had a purpose.', 0);
INSERT INTO `quest_request_items` VALUES (720, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (721, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (722, 1, 0, 0, 0, 'The Shadowforge clan... is dangerous. Be careful. You must find the amulet.', 0);
INSERT INTO `quest_request_items` VALUES (723, 1, 0, 0, 0, 'I\'d say it was a bad day, but this is the Badlands: every day\'s a bad day.', 0);
INSERT INTO `quest_request_items` VALUES (724, 1, 0, 0, 0, 'Ah, yes. Another traveler seeking something from the dwarves.$B$BMa\'am, I\'m truly sorry, but I\'ve no time to answer meaningless questions right now.', 0);
INSERT INTO `quest_request_items` VALUES (725, 1, 0, 0, 0, 'Hmm? Yes, $C.', 0);
INSERT INTO `quest_request_items` VALUES (726, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (727, 1, 0, 0, 0, 'Hello. Welcome to my shop, but watch what you touch.$B$BKnowledge can be deadly.', 0);
INSERT INTO `quest_request_items` VALUES (728, 1, 0, 0, 0, 'Ah, we have an eager $C, I see. Are you here to learn from my collection? Good!$B$BBut be warned: just as knowledge gives power to the strong...it will drive the weak mad.', 0);
INSERT INTO `quest_request_items` VALUES (729, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (730, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (731, 1, 0, 0, 0, 'Is the prospector alive?', 0);
INSERT INTO `quest_request_items` VALUES (732, 1, 0, 0, 0, 'The nomadic band of ogres travels between their camps across the Badlands; heat rising from the dry earth and the swirling winds will make it difficult to track their progress. I have heard that sometimes they travel through Camp Boff. If you are lost, you might try your search there.', 0);
INSERT INTO `quest_request_items` VALUES (733, 1, 0, 0, 0, 'Well, I\'ve made do with what I could, but... it\'s not much. Have you found any more supplies?', 0);
INSERT INTO `quest_request_items` VALUES (734, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (735, 1, 0, 0, 0, 'Do you have the relics for which I asked?', 0);
INSERT INTO `quest_request_items` VALUES (736, 0, 0, 0, 0, 'How goes your mission, $c.', 0);
INSERT INTO `quest_request_items` VALUES (737, 1, 0, 0, 0, 'Ho! You were gone a long time. Did you get the digest?', 0);
INSERT INTO `quest_request_items` VALUES (738, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (739, 1, 0, 0, 0, 'Do you have news of Agmond\'s fate? Did you find him?', 0);
INSERT INTO `quest_request_items` VALUES (741, 1, 0, 0, 0, 'What can I do for you, $R?', 0);
INSERT INTO `quest_request_items` VALUES (742, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (743, 1, 0, 0, 0, 'The Windfuries are deadly foes. Their strength in battle is only rivaled by their desire for fresh meat. ', 0);
INSERT INTO `quest_request_items` VALUES (744, 1, 0, 0, 0, 'This headdress will certainly be a wonderful gift for my brother. ', 0);
INSERT INTO `quest_request_items` VALUES (745, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (746, 1, 0, 0, 0, 'Hello, $n.  Do you have the Broken Tools?  The dwarves\' digging will enrage the kodos of Mulgore.  This defilement must be stopped! ', 0);
INSERT INTO `quest_request_items` VALUES (747, 1, 0, 0, 0, 'Providing meat and feathers for the tribe is the first step in proving yourself as a $C before the Chief.', 0);
INSERT INTO `quest_request_items` VALUES (748, 1, 0, 0, 0, 'Do you have the paws and talons, $N?', 0);
INSERT INTO `quest_request_items` VALUES (749, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (750, 1, 0, 0, 0, 'If you can provide pelts for the tribe I will pass word along to my father, Chief Hawkwind, of your generous deeds.', 0);
INSERT INTO `quest_request_items` VALUES (751, 1, 0, 0, 0, 'Hail, $n. Have you learned anything new about the Venture Co.\'s plans and operations in our homeland? If they plan to exploit our lands as they have others, the Outrunners will be quick to put an end to it. ', 0);
INSERT INTO `quest_request_items` VALUES (752, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (753, 1, 0, 0, 0, 'You look as though you have returned from the plains. Do you have any word from Greatmother Hawkwind?', 0);
INSERT INTO `quest_request_items` VALUES (754, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (755, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (756, 1, 0, 0, 0, '$N, do you have the claws I sent you to gather?  The Thunderhorn Water Well grows more tainted with each passing hour!', 0);
INSERT INTO `quest_request_items` VALUES (757, 21, 0, 0, 0, 'Have you completed the Rite of Strength, $N? I require proof of your valor against the enemy of our tribe, the Bristlebacks.', 0);
INSERT INTO `quest_request_items` VALUES (758, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (759, 1, 0, 0, 0, '$N.  Do you have the teeth I asked for?', 0);
INSERT INTO `quest_request_items` VALUES (760, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (761, 1, 0, 0, 0, 'Have you found the swoops, $n.  Do you have their quills? ', 0);
INSERT INTO `quest_request_items` VALUES (762, 1, 0, 0, 0, 'Time is of the essence, $N. Ragnaros will not wait for us to prepare.', 0);
INSERT INTO `quest_request_items` VALUES (763, 1, 0, 0, 0, 'What brings you to my village, $C?', 0);
INSERT INTO `quest_request_items` VALUES (764, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (765, 1, 0, 0, 0, 'I seethe with anger at the thought of the atrocities the Venture Co. is willing to perpetrate against us in the name of profit. ', 0);
INSERT INTO `quest_request_items` VALUES (766, 1, 0, 0, 0, 'My fever grows worse and I find my mind drifting into delirious nightmares... I should have known that I wouldn\'t be able to handle a beast my grandfather was unable to defeat... Do you have the ingredients for the remedy? I fear if I do not clean the infection soon, it will be the death of me. ', 0);
INSERT INTO `quest_request_items` VALUES (767, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (768, 1, 0, 0, 0, 'Hello again. Have you been hunting? Do you have skins for me?', 0);
INSERT INTO `quest_request_items` VALUES (769, 1, 0, 0, 0, 'Do you have my supplies, $N?', 0);
INSERT INTO `quest_request_items` VALUES (770, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (771, 1, 0, 0, 0, 'Once you have gathered enough well stones from around the water wells and Ambercorn from beneath the trees, I will prepare the Water of the Seers for you.', 0);
INSERT INTO `quest_request_items` VALUES (772, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (773, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (775, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (776, 1, 0, 0, 0, 'Have you tracked down Arra\'chea yet? ', 0);
INSERT INTO `quest_request_items` VALUES (777, 1, 0, 0, 0, '<Without looking up from the shackles, Lotwil holds out a hand and waggles his fingers impatiently.>$B$BThe cog, $N, the cog!', 0);
INSERT INTO `quest_request_items` VALUES (778, 1, 0, 0, 0, 'Not quite the outcome I was expecting. Could you get my shackles back?', 0);
INSERT INTO `quest_request_items` VALUES (779, 1, 0, 0, 0, 'The Seal of the Earth lies here, with three recessed alcoves for the Amethyst Runestone, the Opal Runestone, and the Diamond Runestone.', 0);
INSERT INTO `quest_request_items` VALUES (780, 1, 0, 0, 0, 'The aggression of the Battleboars is increasing. Have you sent them a clear message and brought back some snouts and flanks yet?', 0);
INSERT INTO `quest_request_items` VALUES (781, 1, 0, 0, 0, 'You have a look of concern about you, $N. What news do you bring?', 0);
INSERT INTO `quest_request_items` VALUES (782, 1, 0, 0, 0, 'Tho\'grun\'s betrayal... is there any wonder why the ogres are part of the Horde no longer? I will be glad to see him dead, and the Sign of the Earth returned.$B$BIf you\'ve not dispatched him yet, then waste no time going to Camp Boff.  It is to the southeast of Kargath.', 0);
INSERT INTO `quest_request_items` VALUES (783, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (784, 1, 0, 0, 0, 'You have your orders, $N. The safety of Durotar is in question. Complete the task before you or hang your head in shame.$B$BShow your honor and defeat the humans of Tiragarde Keep.', 0);
INSERT INTO `quest_request_items` VALUES (786, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (787, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (788, 0, 0, 0, 0, 'I hope you haven\'t returned to try and convince me that you have completed your task, $N? No, of course not. I would think better of you.', 0);
INSERT INTO `quest_request_items` VALUES (789, 1, 0, 0, 0, 'The carapace of a scorpid isn\'t so thick that the strength of a determined warrior will be deterred. Strike strongly and without doubt, and the scorpids should prove easy prey.', 0);
INSERT INTO `quest_request_items` VALUES (790, 16, 0, 0, 0, 'Ahhh... my father always said I would never amount to much, and here, lying beneath a tree as life seeps away, I\'m afraid it looks like he was right.$B$BAt least I wish to die knowing that my last enemy in life lays dead.', 0);
INSERT INTO `quest_request_items` VALUES (791, 1, 0, 0, 0, 'I fought proudly alongside the Warchief when these lands were pioneered. The scars of battle mark my skin.$B$BThe honor of the Horde has been upheld with the help of my axe and battlecry during the defeat of Archimonde, when the unholy alliance was made with the humans and elves, wrought from necessity.$B$BBut my position as watchman and provider has given me a new sense of worth.', 0);
INSERT INTO `quest_request_items` VALUES (792, 1, 1, 0, 0, 'To prove yourself against the Burning Blade, you must first defeat its Vile Familiars. Return to me when you have done this.', 0);
INSERT INTO `quest_request_items` VALUES (793, 0, 0, 0, 0, 'There are few enemies more deadly than dragonkind, and there were few dragons that fought as ferociously as Blacklash and Hematus.', 0);
INSERT INTO `quest_request_items` VALUES (794, 2, 0, 0, 0, 'Is your task complete, $n?  Do you have the Burning Blade Medallion? ', 0);
INSERT INTO `quest_request_items` VALUES (795, 1, 0, 0, 0, 'The Seal of the Earth lies here, with three recessed alcoves for the Amethyst Runestone, the Opal Runestone, and the Diamond Runestone.', 0);
INSERT INTO `quest_request_items` VALUES (804, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (805, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (806, 1, 0, 0, 0, 'Did you find Fizzle, $n?  He, and rest of the Burning Blade, must be scoured from our lands! ', 0);
INSERT INTO `quest_request_items` VALUES (808, 1, 0, 0, 0, 'Do you have my brother\'s skull, $N?  Is he finally free?', 0);
INSERT INTO `quest_request_items` VALUES (809, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (812, 1, 0, 0, 0, 'I\'m almost glad I can\'t return to Sen\'jin as I am now. My weakness and stupidity would surely be mocked.', 0);
INSERT INTO `quest_request_items` VALUES (813, 1, 0, 0, 0, 'Remember, no matter what creature you hunt, you would do well to study it and understand its behavior. That knowledge could save your life. ', 0);
INSERT INTO `quest_request_items` VALUES (815, 1, 0, 0, 0, 'Breakfast, lunch, dinner! Who cares which meal it is? It still has to be cooked by someone--namely me! ', 0);
INSERT INTO `quest_request_items` VALUES (816, 1, 0, 0, 0, 'I pray that Kron will return to me, but I\'m almost certain I know his fate already.', 0);
INSERT INTO `quest_request_items` VALUES (817, 1, 0, 0, 0, 'I remember my first tiger hunt, $n. I chose to hunt on the largest of the Echo Isles, and I sat perfectly still in the shadows of its foliage for almost a full day... watching... waiting. My muscles were taut, and I was ready to strike. It was one of my greatest victories when that tiger finally took the bait. ', 0);
INSERT INTO `quest_request_items` VALUES (818, 1, 0, 0, 0, 'Time is the true test of your strength and will. Lose patience or give in to weakness, and your true self will be shown.', 0);
INSERT INTO `quest_request_items` VALUES (819, 1, 0, 0, 0, 'Yes?', 0);
INSERT INTO `quest_request_items` VALUES (821, 1, 0, 0, 0, 'How\'s the search going?', 0);
INSERT INTO `quest_request_items` VALUES (822, 1, 0, 0, 0, 'You working hard at finding those ingredients, $N?', 0);
INSERT INTO `quest_request_items` VALUES (823, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (824, 1, 0, 0, 0, 'Ah, hello there. I spend a great deal of time studying the water - all the elements really - so much so that sometimes I don\'t even notice people around me.$b$bIs there something I can help you with?', 0);
INSERT INTO `quest_request_items` VALUES (825, 1, 0, 0, 0, 'Once we learn how the humans operate their strange machinery, we will stand a greater chance of defeating them in future battles.$B$BWith our new gained knowledge, the Horde only stands to grow in strength.', 0);
INSERT INTO `quest_request_items` VALUES (826, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (827, 1, 0, 0, 0, 'Have you yet entered Skull Rock, $n?  Do you have the Searing Collars? ', 0);
INSERT INTO `quest_request_items` VALUES (828, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (829, 1, 0, 0, 0, 'My most humble greetings, $c.  How might I help my $r brother today? ', 0);
INSERT INTO `quest_request_items` VALUES (830, 1, 0, 0, 0, 'There is a look of concern on your face, $c. What have you there? ', 0);
INSERT INTO `quest_request_items` VALUES (831, 1, 0, 0, 0, 'Can you not see that I am busy? This had better be pressing.... ', 0);
INSERT INTO `quest_request_items` VALUES (832, 1, 0, 0, 0, 'You have something vital to report.  I can sense it behind your eyes. ', 0);
INSERT INTO `quest_request_items` VALUES (833, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (834, 1, 0, 0, 0, 'I\'m great at what I do, don\'t get me wrong, but this is ridiculous! What am I supposed to do, build sand castles? ', 0);
INSERT INTO `quest_request_items` VALUES (835, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (836, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (837, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (838, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (840, 1, 0, 0, 0, 'What do you want, pup? If you\'re not here for recruitment, I don\'t have time for you. ', 0);
INSERT INTO `quest_request_items` VALUES (841, 1, 0, 0, 0, 'Well, have you got the ten water pouches?', 0);
INSERT INTO `quest_request_items` VALUES (842, 1, 0, 0, 0, 'Well well well, what do we have here? Has Kargal deemed me worthy of another recruit? ', 0);
INSERT INTO `quest_request_items` VALUES (843, 1, 0, 0, 0, 'Many innocent tauren lost their lives or were forced off their ancestral birthplace when the dwarves of Bael Modan arrived. My land must be reclaimed!', 0);
INSERT INTO `quest_request_items` VALUES (844, 1, 0, 0, 0, 'Have you collected the plainstrider beaks? ', 0);
INSERT INTO `quest_request_items` VALUES (845, 1, 0, 0, 0, 'How many zhevra have you slain?', 0);
INSERT INTO `quest_request_items` VALUES (846, 1, 0, 0, 0, 'I see you are back, $N.$B$BWhile Khazgorm\'s death might delay the digging in my ancestral lands some, it will by no means bring a total end to the destruction.$B$BThe Keep at Bael Modan is an increasing military threat. Built to defend the dig site, it is now poised for offensive force as well.$B$BIf you have the ingredients I requested, I can fashion a charge that will make the hasty dwarves reconsider their actions here in the Barrens.', 0);
INSERT INTO `quest_request_items` VALUES (847, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (848, 1, 0, 0, 0, 'Do you have the spores, $N? There is a concoction I must send to my associate in Thunder Bluff, which requires the spores...', 0);
INSERT INTO `quest_request_items` VALUES (849, 1, 0, 0, 0, 'Once the dwarven flying machine has been destroyed I will feel the sweet satisfaction of revenge.', 0);
INSERT INTO `quest_request_items` VALUES (850, 1, 0, 0, 0, 'Hello, $N. Do you have Barak\'s Head for me?', 0);
INSERT INTO `quest_request_items` VALUES (851, 1, 0, 0, 0, 'Did you find Verog, $N?', 0);
INSERT INTO `quest_request_items` VALUES (852, 1, 0, 0, 0, 'Is Hezrul defeated, $N?', 0);
INSERT INTO `quest_request_items` VALUES (853, 1, 0, 0, 0, 'You have something from Apothecary Helbrim?', 0);
INSERT INTO `quest_request_items` VALUES (854, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (855, 1, 0, 0, 0, 'How goes your hunting, $N?', 0);
INSERT INTO `quest_request_items` VALUES (857, 5, 0, 0, 0, 'Where is the Tear of the Moons? I need it now! Need I say!', 0);
INSERT INTO `quest_request_items` VALUES (858, 1, 0, 0, 0, 'Quick, we need to get out of here before someone gets suspicious!', 0);
INSERT INTO `quest_request_items` VALUES (860, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (861, 1, 0, 0, 0, 'How goes the hunt, $n?', 0);
INSERT INTO `quest_request_items` VALUES (862, 6, 0, 0, 0, 'Whack enough dig rats yet, $n?', 0);
INSERT INTO `quest_request_items` VALUES (863, 1, 0, 0, 0, 'Can I help you?', 0);
INSERT INTO `quest_request_items` VALUES (864, 1, 0, 0, 0, 'Welcome back. At least, welcome back if you have returned with a sealed testing kit. Otherwise, I will pretend not to notice your utter incompetence and spare my wrath from you until you do as you have been tasked and accomplish my task.', 0);
INSERT INTO `quest_request_items` VALUES (865, 1, 0, 0, 0, 'Did you get the horns, $N? Those things are going to make me a fortune!', 0);
INSERT INTO `quest_request_items` VALUES (866, 1, 0, 0, 0, 'Hello, $N. Did you get those root samples?', 0);
INSERT INTO `quest_request_items` VALUES (867, 1, 0, 0, 0, 'Cut up enough of them yet? Keep slicing and taking trophies. I want 8 Witchwing talons.', 0);
INSERT INTO `quest_request_items` VALUES (868, 1, 0, 0, 0, 'Be careful with the eggs you find, $N. If they break, they be no good to me.', 0);
INSERT INTO `quest_request_items` VALUES (869, 1, 0, 0, 0, 'Do you have those heads, $N?', 0);
INSERT INTO `quest_request_items` VALUES (870, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (871, 1, 0, 0, 0, 'The longer it takes to stop these attacks, the harder it will be to provide supplies for the people of the Crossroads.', 0);
INSERT INTO `quest_request_items` VALUES (872, 1, 0, 0, 0, 'Cut off the head of their leader, and chaos ensues, $N. Learn this lesson well. It will aid you in the future.$B$BThe boars will flounder without direction, and we will be able to take back the Barrens.', 0);
INSERT INTO `quest_request_items` VALUES (873, 1, 0, 0, 0, 'Fear not the waters, $R.', 0);
INSERT INTO `quest_request_items` VALUES (874, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (875, 1, 0, 0, 0, 'Do you have 6 Harpy Lieutenant Rings yet? Justice must be dealt to them for their vicious attacks on the Horde.', 0);
INSERT INTO `quest_request_items` VALUES (876, 1, 0, 0, 0, 'You\'re not getting anything until I see Serena\'s head.', 0);
INSERT INTO `quest_request_items` VALUES (877, 1, 0, 0, 0, 'Have you been to the Stagnant Oasis? Was there a fissure beneath its waters?', 0);
INSERT INTO `quest_request_items` VALUES (878, 1, 0, 0, 0, 'More information <snort> for the Horde when you\'ve killed the Bristleback\'s wise ones, $R. <snort> Not a moment earlier! Mangletooth is no fool.', 0);
INSERT INTO `quest_request_items` VALUES (879, 1, 0, 0, 0, 'How goes your hunt, $R? <snort>$B$BThork thinks he knows the truth about who leads the raids against his people, <snort> but he shall learn how wrong he is if you are successful.$B$BMy death is inescapable, but you have caused great pain to my enemies, so Mangletooth regrets nothing. <snort>', 0);
INSERT INTO `quest_request_items` VALUES (880, 1, 0, 0, 0, 'How goes your collection? Did you get the shells?', 0);
INSERT INTO `quest_request_items` VALUES (881, 1, 0, 0, 0, 'The great cat calls to you, $N.', 0);
INSERT INTO `quest_request_items` VALUES (882, 1, 0, 0, 0, '$N, have you bested Ishamuhale?', 0);
INSERT INTO `quest_request_items` VALUES (883, 1, 0, 0, 0, '$N, when you approached I saw a new power in your stride. Tell me -- has your spirit met with the great Lakota\'mani?', 0);
INSERT INTO `quest_request_items` VALUES (884, 1, 0, 0, 0, '$N, there is a new power behind your eyes! You have met with the mighty Owatanka, have you not?', 0);
INSERT INTO `quest_request_items` VALUES (885, 1, 0, 0, 0, 'There is new resolve within you, $N. A resolve born from pain...$B$BAre you burdened with the death of Washte Pawne?', 0);
INSERT INTO `quest_request_items` VALUES (886, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (887, 1, 0, 0, 0, 'I don\'t even want to think about the profits I\'ve lost from pirate raiding, and now they set up camp on my doorstep? It\'s getting out of hand, Undermine\'s got to do something about it.', 0);
INSERT INTO `quest_request_items` VALUES (888, 1, 0, 0, 0, 'Did you find my things, $N?', 0);
INSERT INTO `quest_request_items` VALUES (889, 1, 0, 0, 0, 'Bring Mangletooth 10 blood shards and I will bless you with great speed. You will run with zhevra and the wind will be jealous of you.$B$BIt will not last long, but it should be enough to help you travel throughout the Barrens.', 0);
INSERT INTO `quest_request_items` VALUES (890, 1, 0, 0, 0, 'Wares to send on the next ship, $N?', 0);
INSERT INTO `quest_request_items` VALUES (891, 1, 0, 0, 0, 'My fleet is in peril with Captain Fairmount and her damned cannoneers blasting away from Northwatch Hold. I want her soldiers to pay as well. Fill my hand with medals from their dead and I will know that vengeance has been given to my fallen privateers.', 0);
INSERT INTO `quest_request_items` VALUES (892, 1, 0, 0, 0, 'So, what did Dizzywig have to say?', 0);
INSERT INTO `quest_request_items` VALUES (893, 1, 0, 0, 0, 'I, too, have doubts that the pathetic quilboars could attain any level of skill in the area of smithing, but I do as the Warchief commands, and I shall learn what I can about the Razormane tribe.$B$BI have had more menial tasks, and I do so willingly if it aids the orc people.', 0);
INSERT INTO `quest_request_items` VALUES (894, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (895, 1, 0, 0, 0, 'What\'s happening? Something I can help you with? Goods to ship, perhaps an engineering job?', 0);
INSERT INTO `quest_request_items` VALUES (896, 1, 0, 0, 0, 'If only we knew which one of the miners had found the emerald, it\'d be a walk in the park...', 0);
INSERT INTO `quest_request_items` VALUES (897, 1, 0, 0, 0, 'You seemed troubled, $N. How go your lessons in the Barrens? Did you find something that disturbs you?', 0);
INSERT INTO `quest_request_items` VALUES (898, 1, 0, 0, 0, 'Yes?', 0);
INSERT INTO `quest_request_items` VALUES (899, 1, 0, 0, 0, 'The quilboar will pay for this, $N. I swear it.', 0);
INSERT INTO `quest_request_items` VALUES (900, 1, 0, 0, 0, 'Blinking lights on the control console indicate that the main control valves have not been closed off.', 0);
INSERT INTO `quest_request_items` VALUES (901, 1, 0, 0, 0, 'The console lights are dimmed and the gauges and dials all read at their zero positions, everything idling.', 0);
INSERT INTO `quest_request_items` VALUES (902, 1, 0, 0, 0, 'Oh, you\'re back, $N! Do you have the samophlange?', 0);
INSERT INTO `quest_request_items` VALUES (903, 1, 0, 0, 0, 'How goes your hunt, $N? Have you found the prowlers?', 0);
INSERT INTO `quest_request_items` VALUES (905, 1, 0, 0, 0, 'Have you been to the nests, $N?', 0);
INSERT INTO `quest_request_items` VALUES (906, 1, 0, 0, 0, 'Yes, what is it?', 0);
INSERT INTO `quest_request_items` VALUES (907, 1, 0, 0, 0, 'Are the thunder lizards defeated, $N?', 0);
INSERT INTO `quest_request_items` VALUES (908, 1, 0, 0, 0, 'Have you been successful in locating the fathom core? Without it we\'ll have no idea what the Twilight\'s Hammer is exactly up to down there.', 0);
INSERT INTO `quest_request_items` VALUES (909, 1, 0, 0, 0, 'Ah, hello again $N. I was just reading the waves the sea, much like I always do. What brings you to the outpost?', 0);
INSERT INTO `quest_request_items` VALUES (910, 1, 0, 0, 0, 'Are we there yet?', 0);
INSERT INTO `quest_request_items` VALUES (911, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (913, 1, 0, 0, 0, 'Is it done? Have you slain the thunderhawk?', 0);
INSERT INTO `quest_request_items` VALUES (914, 1, 0, 0, 0, 'Memories of my nightmares haunt me, $N. Have you defeated the leaders of the fang and acquired their gems?', 0);
INSERT INTO `quest_request_items` VALUES (915, 1, 0, 0, 0, 'I wish they\'d make more flavors of ice cream other than strawberry, but I guess I\'m lucky that strawberry is my favorite!', 0);
INSERT INTO `quest_request_items` VALUES (916, 1, 0, 0, 0, 'Did you gather the venom sacs, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (917, 1, 2, 0, 0, 'Have you been inside the Shadowthread Cave, $n?  Did you find a spider egg? ', 0);
INSERT INTO `quest_request_items` VALUES (918, 1, 0, 0, 0, 'Do you have the seeds?  I am eager to plant them.', 0);
INSERT INTO `quest_request_items` VALUES (919, 1, 0, 0, 0, 'Hello, $N.  Have you found any sprouts near the waters?', 0);
INSERT INTO `quest_request_items` VALUES (920, 0, 1, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (921, 1, 1, 0, 0, 'The moonwells hold the waters of the Well of Eternity, the ancient source of magic that has wrought so many horrors upon our world. The druids take advantage of its properties, and the Sentinels revere the wells as shrines to Elune, but sorcery is forbidden to all. ', 0);
INSERT INTO `quest_request_items` VALUES (922, 1, 0, 0, 0, 'Hello... And how may I help you? ', 0);
INSERT INTO `quest_request_items` VALUES (923, 1, 0, 0, 0, 'Have you been to Wellspring Lake, $n?  Have you been hunting the timberlings there? ', 0);
INSERT INTO `quest_request_items` VALUES (924, 1, 0, 0, 0, 'The Demon Seed still exists. I can sense its power...', 0);
INSERT INTO `quest_request_items` VALUES (925, 1, 0, 0, 0, 'When the orcs were alone and without friends, the tauren welcomed them to a strange land and shared with them without asking anything in return. That\'s honor, $N.', 0);
INSERT INTO `quest_request_items` VALUES (926, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (927, 1, 0, 0, 0, '$n!  You have something for me? ', 0);
INSERT INTO `quest_request_items` VALUES (928, 1, 1, 0, 0, 'Greetings, $c. For what purpose do I owe the pleasure of our meeting? ', 0);
INSERT INTO `quest_request_items` VALUES (929, 1, 1, 0, 0, 'Hello again, $n. Have you completed your task? ', 0);
INSERT INTO `quest_request_items` VALUES (930, 1, 0, 0, 0, '$n, you look like you have something to tell me.  Do you have news concerning the timberlings? ', 0);
INSERT INTO `quest_request_items` VALUES (931, 1, 0, 0, 0, 'You have something for me? ', 0);
INSERT INTO `quest_request_items` VALUES (932, 6, 2, 0, 0, 'Did you kill Lord Melenas yet? It is vital that he be taken care of quickly and quietly, $n. His continued existence is an embarrassment to us all. ', 0);
INSERT INTO `quest_request_items` VALUES (933, 1, 0, 0, 0, 'It is good to see you again, $n. I see you have succeeded in collecting the waters of the moonwells on behalf of Corithras Moonrage. I hope you have learned much along the way. ', 0);
INSERT INTO `quest_request_items` VALUES (934, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (935, 1, 0, 0, 0, 'It is good to see you again. I sense that Tarindrella\'s task went smoothly with you by her side. ', 0);
INSERT INTO `quest_request_items` VALUES (936, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (937, 1, 0, 0, 0, 'Their slashing talons and piercing beaks may prove a difficult match for your own abilities, $n, but I have faith that you will not fail in this task. ', 0);
INSERT INTO `quest_request_items` VALUES (938, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (939, 1, 0, 0, 0, 'What is it, $C? You look concerned.', 0);
INSERT INTO `quest_request_items` VALUES (940, 1, 0, 0, 0, 'Hmm... You come with the spirit of the forest strongly within you, $c. What business do you have with the Arch Druid of the Kaldorei? ', 0);
INSERT INTO `quest_request_items` VALUES (941, 1, 0, 0, 0, 'This planter is filled with soil, specially prepared by Denalan. ', 0);
INSERT INTO `quest_request_items` VALUES (942, 1, 0, 0, 0, 'What ya got there, friend?', 0);
INSERT INTO `quest_request_items` VALUES (943, 1, 0, 0, 0, 'With the Stone of Relu I will be able to release the hidden secrets of my fossil as well as Remtravel\'s fossil from Darkshore, $N.', 0);
INSERT INTO `quest_request_items` VALUES (944, 1, 0, 0, 0, 'The Master\'s Glaive, $N.$B$BGo there, then speak with me again.', 0);
INSERT INTO `quest_request_items` VALUES (945, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (947, 1, 0, 0, 0, 'Do you have my mushrooms, $N? Have you been to the cave?', 0);
INSERT INTO `quest_request_items` VALUES (948, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (949, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (950, 1, 0, 0, 0, '$N. You return.', 0);
INSERT INTO `quest_request_items` VALUES (951, 1, 0, 0, 0, '$N. Has your rooting through the Ruins of Mathystra been fruitful?', 0);
INSERT INTO `quest_request_items` VALUES (952, 1, 0, 0, 0, 'Ah. $C. How may Onu assist you?', 0);
INSERT INTO `quest_request_items` VALUES (953, 1, 0, 0, 0, 'When you have studied the tablets and learned of Ameth\'Aran\'s fall, I will take the knowledge on to Auberdine, and inform the Circle of Ancients.', 0);
INSERT INTO `quest_request_items` VALUES (954, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (955, 1, 0, 0, 0, 'Once I have the earrings, I will cast the spell to search for the whereabouts of the seal that binds me. For centuries I have thought on the freedom destroying the seal would bring to me... Perhaps those centuries have taken a toll upon my mind that I might never recover...', 0);
INSERT INTO `quest_request_items` VALUES (956, 1, 0, 0, 0, 'The pillars of this shrine are as the bars of a prison to me, $N. No strength I still possess might break them, and no magic I wield might destroy them...$B$BFor a thousand years and more I have stared at them, wondering if at long last I outlived even the stone, would I be free? Or would it be invisible bars that held me then...', 0);
INSERT INTO `quest_request_items` VALUES (957, 1, 0, 0, 0, 'In truth, $N, I am afraid... Afraid that your coming--all of this--is merely a figment of a deranged mind. Can you know the torture that this is? I... Please, you must go quickly.', 0);
INSERT INTO `quest_request_items` VALUES (958, 1, 0, 0, 0, 'If only the tools of their undoing could have been destroyed in the cataclysm that destroyed our world... Nonetheless, we must do what we can to ensure that the horrors of our past are not repeated in the future.', 0);
INSERT INTO `quest_request_items` VALUES (959, 1, 0, 0, 0, 'The dockmaster has been on my case ever since Mad Magglish made off with that 99-year-old port. I guess that bottle was intended as a gift for Gazlowe from none other than Baron Revilgaz himself.$B$BIf you\'re brave enough and patient enough to seek out Mad Magglish and get that port back, I\'ll see to it you get a nice reward.', 0);
INSERT INTO `quest_request_items` VALUES (960, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (961, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (962, 1, 0, 0, 0, 'I am eager to see if you can gather enough Serpentbloom from the Wailing Caverns. I\'ve sent many to do my bidding but none have returned.', 0);
INSERT INTO `quest_request_items` VALUES (963, 1, 0, 0, 0, 'With a great sorrow in my heart, I followed the Shan\'do Stormrage into hibernation, and took my sorrow to my dreams, sleeping for the passing of thousands of years.', 0);
INSERT INTO `quest_request_items` VALUES (964, 1, 0, 0, 0, 'Kill many and kill often, $C - we\'ll need a decent supply of suitable skeletal fragments to make up the outer layer of the key. They don\'t call it a Skeleton Key for nothing, you know.', 0);
INSERT INTO `quest_request_items` VALUES (965, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (966, 1, 0, 0, 0, 'Have you found any more of their scrolls? I should be able to piece together a larger picture of the cult if you can find them.', 0);
INSERT INTO `quest_request_items` VALUES (967, 1, 0, 0, 0, 'You have some business with me, $C?', 0);
INSERT INTO `quest_request_items` VALUES (968, 1, 0, 0, 0, 'Hello, $Gsir:madam;.$B$BMay I interest you in one of my tomes?', 0);
INSERT INTO `quest_request_items` VALUES (969, 1, 0, 0, 0, 'Bring back da shards, and I be tellin\' you more!', 0);
INSERT INTO `quest_request_items` VALUES (970, 6, 0, 0, 0, 'Have you acquired that soul gem?', 0);
INSERT INTO `quest_request_items` VALUES (971, 1, 0, 0, 0, 'The journey to Ashenvale is long, and your task is not easy. But if you get me the manuscript, $N...then your reward will be great.', 0);
INSERT INTO `quest_request_items` VALUES (973, 6, 0, 0, 0, 'You look a bit shaken up, $n. Are you well?', 0);
INSERT INTO `quest_request_items` VALUES (974, 1, 0, 0, 0, 'I\'d go there myself, but... I\'m a little scared of the fire elementals there!', 0);
INSERT INTO `quest_request_items` VALUES (975, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (976, 1, 0, 0, 0, 'The Sentinels have a great need for supplies to reinforce themselves in Darkshore.', 0);
INSERT INTO `quest_request_items` VALUES (977, 1, 0, 0, 0, 'I\'ve just about finished attaching the fur, $N. Please, hurry back with those horns!', 0);
INSERT INTO `quest_request_items` VALUES (978, 1, 0, 0, 0, 'Where could these powers have originated from? I think we are on the right track to find the answer, $N.', 0);
INSERT INTO `quest_request_items` VALUES (979, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (980, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (981, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (982, 1, 0, 0, 0, 'The captains of those ships were good night elves, and they deserve a better fate than they were given. Perhaps tending to their personal effects will be the best way to put their spirits to rest.', 0);
INSERT INTO `quest_request_items` VALUES (983, 1, 0, 0, 0, 'Buzzbox 827 sits with an eerie silence. A single flashing light indicates that it needs 6 Crawler Legs to be placed in its holding box.', 0);
INSERT INTO `quest_request_items` VALUES (984, 1, 0, 0, 0, 'How goes your search, $N?', 0);
INSERT INTO `quest_request_items` VALUES (985, 1, 0, 0, 0, 'Do not stay your hand from what must be done, child. I know how repulsive the idea of killing the creatures of the forest must be, but in this case it is necessary. No cure has been discovered for the corruption let loose upon the forest, and we must do what we can to halt its progress until one is found.', 0);
INSERT INTO `quest_request_items` VALUES (986, 1, 0, 0, 0, 'I can\'t in good conscience permit you to seek Volcor until I\'ve crafted that cloak for you.', 0);
INSERT INTO `quest_request_items` VALUES (990, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (991, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (992, 6, 0, 0, 0, 'Welcome back, Junior Surveyor $n!  Have you completed your assignment yet?', 0);
INSERT INTO `quest_request_items` VALUES (993, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (994, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (995, 1, 0, 0, 0, 'Yes, $n?', 0);
INSERT INTO `quest_request_items` VALUES (996, 0, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a windblossom plant.  The berries that hang from the plant appear rotten and poisonous.  It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (997, 6, 1, 0, 0, 'You have something for me? ', 0);
INSERT INTO `quest_request_items` VALUES (998, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a windblossom plant. The berries that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (1000, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1001, 1, 0, 0, 0, 'The machine\'s hatch is open and it seems to wait expectantly for 3 Thresher Eyes to be placed inside.', 0);
INSERT INTO `quest_request_items` VALUES (1002, 1, 0, 0, 0, 'Though you have yet to place the 6 Moonstalker Fangs inside, you believe you hear the sounds of static and incoherent gnome ramblings coming from within. Could someone else have fixed the machine already?', 0);
INSERT INTO `quest_request_items` VALUES (1003, 1, 0, 0, 0, 'You hear singing coming from Buzzbox 525.$b$b\"Though crawler wine\'s shweet, and thresher ale fine, and moonstalker moonshine ish grand. There\'s nothing sho dear, as a thistle bear beer, and shoon I shall have shome on hand!\"$b$bThe hatch is open and awaits the 4 grizzled scalps as you hear the song repeated over and over.', 0);
INSERT INTO `quest_request_items` VALUES (1004, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1007, 1, 0, 0, 0, 'Have you found the statuette, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1008, 1, 0, 0, 0, 'We cannot allow the naga to invade our coasts, $N.  It is vital that you go to the Zoram Strand and complete your mission.', 0);
INSERT INTO `quest_request_items` VALUES (1009, 1, 0, 0, 0, 'It is said that the Ring of Zoram is the key to any lock within the city. Do you have it, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1010, 1, 0, 0, 0, 'Have you gathered the Bathran\'s Hair, $N?  The child\'s health grows weaker by the hour...', 0);
INSERT INTO `quest_request_items` VALUES (1011, 1, 0, 0, 0, 'Did you find the camp, $N? Do you have a bottle of disease?', 0);
INSERT INTO `quest_request_items` VALUES (1012, 1, 0, 0, 0, 'The anguish of the Dor\'danil druids still haunt my dreams, $N. You must destroy their leaders!', 0);
INSERT INTO `quest_request_items` VALUES (1013, 1, 0, 0, 0, 'Did you find the book, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1014, 1, 0, 0, 0, 'With Arugal\'s death we stand to increase the Dark Lady\'s stronghold on Lordaeron.', 0);
INSERT INTO `quest_request_items` VALUES (1015, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1016, 1, 0, 0, 0, 'Since you must destroy the bracers to kill the elementals, it will probably be difficult to find the specific ones that contain the information the divining scroll needs. You can trade bracers with others in order to obtain the ones you need, or perhaps you have the divined paper already?', 0);
INSERT INTO `quest_request_items` VALUES (1017, 1, 0, 0, 0, 'Is it done? Is Sarilus Foulborne dead?', 0);
INSERT INTO `quest_request_items` VALUES (1018, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1019, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1020, 1, 0, 0, 0, 'I must apologize, for I have no time to speak.  My child, Relara, is deathly ill!', 0);
INSERT INTO `quest_request_items` VALUES (1021, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1022, 1, 0, 0, 0, 'The tome of the shrine is a mysterious object. It is not a book in the traditional sense. The leaves of the tome were blessed by Mel\'Thandris herself, and records events of import in its pages.$B$BIt is hard for me to explain. If you go to the shrine, you will understand.', 0);
INSERT INTO `quest_request_items` VALUES (1023, 2, 0, 0, 0, 'Ah, welcome back, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1024, 1, 0, 0, 0, 'Hello. How are you?', 0);
INSERT INTO `quest_request_items` VALUES (1025, 1, 0, 0, 0, 'The furbolg were not always our enemy, $N. But times change, and it is no longer a time of peace here in these dark woods.', 0);
INSERT INTO `quest_request_items` VALUES (1026, 1, 0, 0, 0, 'It upsets me so that the treants have become corrupt. I wish I could do more to help them.', 0);
INSERT INTO `quest_request_items` VALUES (1027, 1, 0, 0, 0, 'Did you find the final piece of the rod, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1028, 1, 0, 0, 0, 'You can sense a subtle yet powerful force within the shrine and surrounding trees.$B$BYou begin placing the rod within the shrine and a soft thrumming noise emits from around you as the shrine begins to glow...', 0);
INSERT INTO `quest_request_items` VALUES (1029, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1030, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1031, 1, 0, 0, 0, 'Have you found them? What did Anilia say? Where is she?', 0);
INSERT INTO `quest_request_items` VALUES (1032, 1, 0, 0, 0, 'Please, help me avenge Anilia\'s death.', 0);
INSERT INTO `quest_request_items` VALUES (1033, 1, 0, 0, 0, '$N, did you find Iris Lake? Do you have the Tear?', 0);
INSERT INTO `quest_request_items` VALUES (1034, 1, 0, 0, 0, 'Do you yet have the Stardust, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1035, 1, 0, 0, 0, 'Did you face the Shadethicket Oracle, $N? If so, then please hand me the fallen moonstone. Relara has strength left for only a few more breaths!', 0);
INSERT INTO `quest_request_items` VALUES (1036, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1037, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1038, 1, 0, 0, 0, 'What\'d you find out?', 0);
INSERT INTO `quest_request_items` VALUES (1039, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1040, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1041, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1042, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1043, 1, 0, 0, 0, 'The woods are perilous for the unprepared. Keep your weapons close at hand and your wits even closer, or your next journey into the haunted forest may be your last.', 0);
INSERT INTO `quest_request_items` VALUES (1044, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1045, 1, 0, 0, 0, 'Have you slain Ran yet, my friend?$B$BEven the Night elves do not truly deserve his wrath. His hatred burns even brighter than my own, but his mind is no longer his own. He is a threat to all the natural creatures of this forest.', 0);
INSERT INTO `quest_request_items` VALUES (1046, 1, 0, 0, 0, 'The Sentinels do what they can here in Ashenvale, but it\'s thanks to $rs like you that we have gained the ground we have.', 0);
INSERT INTO `quest_request_items` VALUES (1047, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1048, 1, 0, 0, 0, 'Perhaps I was not explicit in my orders, $c. I want High Inquisitor Whitemane killed once and for all. And while you\'re at it, take out her top brass as well.$B$BKill that zealot, Scarlet Commander Mograine. Lay waste to Herod, the Scarlet Champion. And slaughter Houndmaster Loksey and his filthy mutts too.$B$BNow begone!', 0);
INSERT INTO `quest_request_items` VALUES (1049, 1, 0, 0, 0, 'Cairne is a brave and noble leader and I would trust him with my own life. But it is others that I do not trust in this political climate.$b$bOnce I have a chance to gather all the knowledge available I can provide sound council to the Chieftain.$b$bHave you had a chance to travel to Tirisfal Glades? To the Scarlet Monastery? The Compendium of the Fallen is just one piece in this complicated puzzle...', 0);
INSERT INTO `quest_request_items` VALUES (1050, 1, 0, 0, 0, 'The Monastery was a seminary for Paladins-in-training. Once a stronghold of the Light, it fell into the hands of the crazed zealots of the Scarlet Crusade.$b$bThe Crusade believed their goal a noble one: to purify the land of the undead plague. But insanity tainted their plight and now they stand enemies to all.$b$bBring Mythology of the Titans to me so I can study it and house it here in Ironforge.$b$bThe corrupt halls of the Monastery are no place for such a historical treasure.', 0);
INSERT INTO `quest_request_items` VALUES (1051, 1, 0, 0, 0, 'What do you want, stranger?', 0);
INSERT INTO `quest_request_items` VALUES (1052, 6, 0, 0, 0, 'Who goes there? What do you want from me?', 0);
INSERT INTO `quest_request_items` VALUES (1053, 1, 5, 0, 0, 'The corruption in the Monastery will not end until the highest ranking officials have been removed.$b$bIn the name of the Light, slay High Inquisitor Whitemane, Scarlet Commander Mograine,  Herod, the Scarlet Champion and Houndmaster Loksey. Once they have fallen, perhaps the true cause can be rekindled. Until then, anyone who crosses the path of the Crusade lies in peril.$b$bVenture forth from Southshore and make it so!', 0);
INSERT INTO `quest_request_items` VALUES (1054, 1, 2, 0, 0, 'The furbolgs\' corruption has caused Ashenvale to become a fraction of its former glory.', 0);
INSERT INTO `quest_request_items` VALUES (1055, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1056, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1057, 1, 0, 0, 0, 'There is much work to be done before the Charred Vale can be restored to the lush forest it once was.$B$BClear the area of those foul menaces, $N! Only then can we begin to reclaim what belongs to nature.', 0);
INSERT INTO `quest_request_items` VALUES (1058, 1, 0, 0, 0, 'Look at our poor little elf friends. All caged up with no forest to frolic in!$b$bNow were you able to find me some sap? How about the whiskers from the twilight runners? Don\'t suppose you have that fey dragon scale on you?$b$bAnd eyes! I\'ll need so many eyes! You just can\'t mix up a fierce forest magic brew without a good helping of eyes!', 0);
INSERT INTO `quest_request_items` VALUES (1059, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1060, 1, 0, 0, 0, 'You seem a shady character. You have something for me to see?', 0);
INSERT INTO `quest_request_items` VALUES (1061, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1062, 1, 0, 0, 0, 'The Greatwood Vale lies to the northwest, $N. Go. Strike fear into those who would pillage this land!', 0);
INSERT INTO `quest_request_items` VALUES (1063, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1064, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1065, 1, 0, 0, 0, 'Ah, are you here with my new test subjects?', 0);
INSERT INTO `quest_request_items` VALUES (1066, 1, 0, 0, 0, 'Did you find the Syndicate Shadow Mages, and collect from them the bl', 0);
INSERT INTO `quest_request_items` VALUES (1067, 1, 0, 0, 0, 'You have returned, $N. Do you bring aid from Apothecary Lydon?', 0);
INSERT INTO `quest_request_items` VALUES (1068, 1, 0, 0, 0, 'The tree spirits wail at the loss of their brethren, $N. You must destroy the shredders XT:4 and XT:9, or I fear Stonetalon will never be healed.', 0);
INSERT INTO `quest_request_items` VALUES (1069, 1, 0, 0, 0, 'Did you get the eggs, $N? I already made a shipping deal with Wharfmaster Dizzywig!', 0);
INSERT INTO `quest_request_items` VALUES (1070, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1071, 1, 0, 0, 0, 'How goes the battle on your end, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1072, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1073, 1, 0, 0, 0, 'I can\'t make any Nitromirglyceronium if I don\'t have the potions... they\'re vital to its creation.', 0);
INSERT INTO `quest_request_items` VALUES (1074, 1, 0, 0, 0, 'Ah, goodie goodie, you\'re back.', 0);
INSERT INTO `quest_request_items` VALUES (1075, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1076, 1, 0, 0, 0, 'Hello, $N. Have you found the component I need?', 0);
INSERT INTO `quest_request_items` VALUES (1077, 1, 0, 0, 0, 'Haha! you\'re back! Do you have it? Do you have the spell?', 0);
INSERT INTO `quest_request_items` VALUES (1078, 1, 2, 0, 0, 'Hello again, $N.$B$BHave you already returned from the Vale in Stonetalon with those scales?', 0);
INSERT INTO `quest_request_items` VALUES (1079, 1, 0, 0, 0, 'Did you get the plans, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1080, 1, 0, 0, 0, 'How\'d it go, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1081, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1082, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1083, 1, 0, 0, 0, 'The first time I saw the Charred Vale I almost wept, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1084, 1, 0, 0, 0, 'I have a feeling Gaxim will find a use for the shrapnel regardless of how the Venture Co. has used it in the past.', 0);
INSERT INTO `quest_request_items` VALUES (1085, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1086, 1, 0, 0, 0, 'You must find the Venture Company airport if it exists, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1087, 1, 0, 0, 0, 'Here, channeling magic is like drawing water from a well with a bucket full of holes.', 0);
INSERT INTO `quest_request_items` VALUES (1088, 1, 0, 0, 0, 'When my master bade me to the peak of Stonetalon, I expected that all I would need was to lay waste to the night elves that crawled the sacred ruins of our ancient temple of Azshara, their touch despoiling its sanctity... but Ordanus had slipped my grasp.', 0);
INSERT INTO `quest_request_items` VALUES (1089, 1, 0, 0, 0, 'Three keyholes are carved into the stone.', 0);
INSERT INTO `quest_request_items` VALUES (1090, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1091, 1, 0, 0, 0, 'Yes, $N? What can I do for you?', 0);
INSERT INTO `quest_request_items` VALUES (1092, 1, 0, 0, 0, 'Something I can help you with?', 0);
INSERT INTO `quest_request_items` VALUES (1093, 1, 0, 0, 0, 'Did you find those plans? I\'m eager to impress the new boss. Hopefully, once he\'s convinced of my loyalty--well, as much as he can be convinced... goblin\'s honor, you know?--he\'ll feel comfortable making use of my rather impressive genius.', 0);
INSERT INTO `quest_request_items` VALUES (1094, 1, 0, 0, 0, 'Hello there! How can I help you?', 0);
INSERT INTO `quest_request_items` VALUES (1095, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1096, 1, 0, 0, 0, 'Sputtervalve will want some sort of proof that Gerenzo\'s dead. I think his mechanical arm will probably do.', 0);
INSERT INTO `quest_request_items` VALUES (1097, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1098, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1100, 1, 0, 0, 0, 'From your look of concern, I can tell that something is amiss....', 0);
INSERT INTO `quest_request_items` VALUES (1101, 1, 0, 0, 0, 'So long as Charlga Razorflank is mustering a force in Razorfen Kraul, these lands are in great danger.', 0);
INSERT INTO `quest_request_items` VALUES (1102, 1, 0, 0, 0, 'Once I know the foul beasts of Razorfen Kraul have been driven from their foul lair, I will be able to rest in peace, knowing that revenge has been served.$b$bHave you the driven the quilboar from the Kraul? Do you bring to me good news in the form of Razorflank\'s heart?', 0);
INSERT INTO `quest_request_items` VALUES (1103, 1, 0, 0, 0, 'Ya have the sapta, $G brotha:sista;?$B$BI know another that had trouble after defeating da corrupt water spirit--seems he waited too long and he came out of the spirit world too quick fer his taste. Hate to see dat happen to another, so I\'ll just wait here fer a bit to make sure no one else be needin\' me help.', 0);
INSERT INTO `quest_request_items` VALUES (1104, 1, 0, 0, 0, 'Hi hi hi! Did you get that venom??', 0);
INSERT INTO `quest_request_items` VALUES (1105, 1, 0, 0, 0, 'My brother is making progress with his new fuel design, and that has me worried. I need to start work on a tortoise shell fuel tank as soon as possible!', 0);
INSERT INTO `quest_request_items` VALUES (1106, 1, 0, 0, 0, 'Well, you found me. Good for you.$b$bAre you here about that axe I made for Gath\'Ilzogg? Or are you here to reclaim Duchess Pamay\'s honor?$b$bActually, I don\'t care which it is. If you\'re here to fight, then let\'s get it over with...', 0);
INSERT INTO `quest_request_items` VALUES (1107, 0, 0, 0, 0, 'Do you have the tail fins?  If I can\'t protect our car from its own speed, then it won\'t last long in these races.', 0);
INSERT INTO `quest_request_items` VALUES (1108, 1, 0, 0, 0, 'Did you find any indurium flakes, $N. I have my forge heated up and ready to test them.', 0);
INSERT INTO `quest_request_items` VALUES (1109, 1, 0, 0, 0, 'Ah, I see you have returned. Were you able to procure any Kraul Guano?', 0);
INSERT INTO `quest_request_items` VALUES (1110, 1, 0, 0, 0, '$N, have you been out into the Flats? Did you bring back that load of parts I wanted?', 0);
INSERT INTO `quest_request_items` VALUES (1111, 1, 0, 0, 0, 'Speak up! Tell me, are you dropping off or picking up?', 0);
INSERT INTO `quest_request_items` VALUES (1112, 1, 0, 0, 0, 'Did you make it to Ratchet and get those parts?', 0);
INSERT INTO `quest_request_items` VALUES (1113, 1, 0, 0, 0, 'Have you returned from the Scarlet Monastery? I\'ll need many hearts for this delightful experiment!$b$bNo doubt, Varimathras and the Dark Lady will be pleased to be rid of the Scarlet Scum as well...', 0);
INSERT INTO `quest_request_items` VALUES (1114, 1, 0, 0, 0, 'You have something for me? That\'s great! let\'s see it!', 0);
INSERT INTO `quest_request_items` VALUES (1115, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1116, 1, 0, 0, 0, 'Back so soon? Do you have my dream dust?', 0);
INSERT INTO `quest_request_items` VALUES (1117, 1, 0, 0, 0, 'Did you get anything on Nazz Steamboil? Anything he might want to keep a secret??', 0);
INSERT INTO `quest_request_items` VALUES (1118, 1, 0, 0, 0, 'Hello hello. And what brings a noble $R such as you down to Booty Bay?', 0);
INSERT INTO `quest_request_items` VALUES (1119, 1, 0, 0, 0, 'Hello, $N. Was Fizzlebub able to help us?', 0);
INSERT INTO `quest_request_items` VALUES (1120, 1, 0, 0, 0, 'Hi! You have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (1121, 1, 0, 0, 0, 'What are you looking at?', 0);
INSERT INTO `quest_request_items` VALUES (1122, 1, 0, 0, 0, 'Hello $N. How\'d that stout work out? It\'s strong stuff, isn\'t it?', 0);
INSERT INTO `quest_request_items` VALUES (1123, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1124, 1, 0, 0, 0, 'This is a dangerous land to be so casual, $C. What brings you to the wastes of Silithus?', 0);
INSERT INTO `quest_request_items` VALUES (1125, 1, 1, 0, 0, 'Alliance or Horde, it doesn\'t matter - no being deserves to be trapped on this world as a tortured spirit.  The freeing of these souls will make things right, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1126, 1, 0, 0, 0, 'Well, did it work? You\'re still in one piece, which is good news. Did you find anything?', 0);
INSERT INTO `quest_request_items` VALUES (1127, 1, 0, 0, 0, 'Do you have those Zanzil mixtures yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1130, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1131, 1, 0, 0, 0, 'Have you defeated the foul Steelsnap, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1132, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1133, 1, 2, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1134, 1, 0, 0, 0, 'Do you have the pridewing venom sacs, $N? We cannot allow the orcs to use the beasts\' poisons against us!', 0);
INSERT INTO `quest_request_items` VALUES (1135, 1, 0, 0, 0, 'Did you find Highperch, $N? Any luck with the wyverns there?', 0);
INSERT INTO `quest_request_items` VALUES (1136, 1, 0, 0, 0, 'Have you been to the Alterac Mountains, $N? Did you face the elusive Frostmaw?', 0);
INSERT INTO `quest_request_items` VALUES (1137, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1138, 1, 0, 0, 0, '...lemon crab, whipper root crab, and Ironforge surprise crab.  That\'s about it.$B$BOh, hello there $N.  Do you have them fine crab chunks I was telling you about?', 0);
INSERT INTO `quest_request_items` VALUES (1139, 1, 0, 0, 0, 'Hammertoe\'s quest must be actualized, $N. I owe him that much.$B$BYour return to Uldaman is imperative not only to that goal, but also to the safety of all dwarven kind. With the tablet in the hands of the Dark Irons who knows how powerful their army of golems would become.', 0);
INSERT INTO `quest_request_items` VALUES (1140, 1, 1, 0, 0, 'I heard whisper once that the satyrs\' history is somehow related to that of the night elves, but I have found my esteemed hosts reticent to speak of the matter.', 0);
INSERT INTO `quest_request_items` VALUES (1141, 1, 0, 0, 0, 'There\'s plenty of good dishes you use Darkshore groupers for.  They\'re good to eat, but I think it\'s more fun catching them.$B$BYou caught any Darkshore groupers yet?', 0);
INSERT INTO `quest_request_items` VALUES (1142, 1, 0, 0, 0, 'What brings you to my home, $R?', 0);
INSERT INTO `quest_request_items` VALUES (1143, 1, 0, 0, 0, 'Athrikus Narassin is an ancient and powerful warlock. Perhaps we should wait for Delgren\'s assistance, but he obviously had much faith in you to send you alone.', 0);
INSERT INTO `quest_request_items` VALUES (1144, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1145, 1, 0, 0, 0, 'I envy you, $C. You have the look of someone who\'s been outside the walls of Orgrimmar for a while.$B$BI myself would travel in the name of the Warchief if Thrall didn\'t have need of my skills here in the city. But he leads us well, and I trust his judgement - I remain here for as long as he needs me.', 0);
INSERT INTO `quest_request_items` VALUES (1146, 1, 0, 0, 0, 'War brings my group and I to the Shimmering Flats, $C. What brings you here?', 0);
INSERT INTO `quest_request_items` VALUES (1147, 1, 0, 0, 0, 'With the amount of travelers heading out to the Flats for those races, I\'m sure we can convince enough adventure seekers to help push back those insects. My party and I won\'t be able to leave until we do.', 0);
INSERT INTO `quest_request_items` VALUES (1148, 1, 0, 0, 0, 'Ah, it been a long time since you\'ve come to see me, $N. What can I do for you today? You be looking like you\'ve seen the face of battle recently. Good... good for the Horde and good for you. The more battle you\'ve seen, the more helpful you\'ll be; stronger, too.', 0);
INSERT INTO `quest_request_items` VALUES (1149, 1, 0, 0, 0, 'Faith. It is far more important than some realize.$B$BIt does not matter what you believe sometimes. It is just important that you believe in something.', 0);
INSERT INTO `quest_request_items` VALUES (1150, 1, 0, 0, 0, 'You must be prepared spiritually, physically and mentally for the challenges that lie ahead of you.$b$bToo often do we rush forward before we are ready. I consider it my duty to the youth, no matter which tribe they belong to, to prepare them for the dangers they may face after they leave the sanctity of their home.', 0);
INSERT INTO `quest_request_items` VALUES (1151, 1, 0, 0, 0, 'Rok\'Alim is also called the Pounder by the centaur tribes in Thousand Needles because of the thundering his fists make as he pummels the creatures brave, or stupid, enough to stand in his path.', 0);
INSERT INTO `quest_request_items` VALUES (1152, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1153, 1, 0, 0, 0, 'I saw the travelers again - the ones that would not sell me a sample of the ore. I spit at them for not helping the warchief.$B$BMay they die in battle like cowards and not like warriors as should be the right of all people who ally themselves with the Horde.', 0);
INSERT INTO `quest_request_items` VALUES (1154, 1, 0, 0, 0, 'Bring me the book after you\'ve studied it. I will not ask you your question until after you have given me the book.', 0);
INSERT INTO `quest_request_items` VALUES (1159, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1160, 1, 0, 0, 0, 'I hope you made the Scarlet Crusade suffer some before stealing the book from them.$b$bMy views of their kind are not unwarranted. The Crusade may have been followers of the Light at one time, but now, they seek to destroy any creatures that have not sided with their religion. They believe all undead, Forsaken or otherwise, must be cleansed, and those traveling in their lands must either be insane, or subject to the undead\'s powerful magics. Idiots. Idiots and fools; all of them.', 0);
INSERT INTO `quest_request_items` VALUES (1164, 5, 0, 0, 0, 'Kill them all and bring me their heads!', 0);
INSERT INTO `quest_request_items` VALUES (1166, 0, 0, 0, 0, 'Me thirsty for grog. Me miss snuff too. Where is strongbox? You go get for Overlord Mok\'Morokk.$b$bGo find south in old home. Me too busy leading ogres to get.', 0);
INSERT INTO `quest_request_items` VALUES (1167, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1168, 1, 0, 0, 0, 'Mok\'Morokk tell all ogres to stay and keep this place safe. Me think ogres need to kill black dragon army and get old home back.$b$bYou help ogres get home back. Help ogres get revenge.', 0);
INSERT INTO `quest_request_items` VALUES (1169, 0, 0, 0, 0, 'With the hearts and tongues of scorched offspring of the black dragon army, I can decipher what wretched beast introduced her spawn into our home. Perhaps with a greater knowledge of our aggressors, we can seek to destroy them once and for all and reclaim Stonemaul Village from ruin.$b$bOf course, convincing Mok\'Morokk to move his lethargic, fat mass out of this muck hole is going to be an epic quest in and of itself...', 0);
INSERT INTO `quest_request_items` VALUES (1170, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1171, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1172, 1, 0, 0, 0, 'You must hurry to the Dragonmurk, $n. With Onyxia\'s eggs riddled around the Wyrmbog, we face overwhelming numbers unless something is done quickly.$b$bDestroy her eggs! Don\'t let the black dragon plague spread across our homeland!', 0);
INSERT INTO `quest_request_items` VALUES (1173, 1, 0, 0, 0, 'I thought you were going to attempt to drive Mok\'Morokk out of the village. Instead you have come to me to chat?', 0);
INSERT INTO `quest_request_items` VALUES (1175, 1, 0, 0, 0, 'It\'s bad enough having to clear out the wreckage of the racers without having to pick them out of burnt animal parts.', 0);
INSERT INTO `quest_request_items` VALUES (1176, 6, 0, 0, 0, 'Do you have those bones for me? I was just about to start working on lightening the steering rig, but I don\'t want to open her up without all the parts I need.', 0);
INSERT INTO `quest_request_items` VALUES (1177, 0, 0, 0, 0, 'Gimme food or me eat you.', 0);
INSERT INTO `quest_request_items` VALUES (1178, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1179, 1, 0, 0, 0, 'Watch where you\'re stepping!  Watch watch watch!!  This is delicate stuff you see here, and if we\'re to win then it must all work perfectly!', 0);
INSERT INTO `quest_request_items` VALUES (1180, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1181, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1182, 1, 0, 0, 0, 'Much as I hate to admit it, that gnome team they have out there is pretty good. Our boys need every edge they can get.', 0);
INSERT INTO `quest_request_items` VALUES (1183, 1, 0, 0, 0, '$N! Did you manage to track down the fuel regulator?', 0);
INSERT INTO `quest_request_items` VALUES (1184, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1185, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1186, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1187, 6, 0, 0, 0, 'How\'m I supposed to show my face around the track without a little extra kick to get me going? It\'s a travesty, I tell you.', 0);
INSERT INTO `quest_request_items` VALUES (1188, 1, 0, 0, 0, 'As I\'m sure you know, the Gizmorium can service all of your tinkering needs! How can I help you?', 0);
INSERT INTO `quest_request_items` VALUES (1189, 1, 0, 0, 0, 'Can you believe Pozzik put a bucket of sand on the racer? How am I supposed to hit my maximum speed with a bucket of sand under the seat?', 0);
INSERT INTO `quest_request_items` VALUES (1190, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1191, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1192, 1, 0, 0, 0, 'I\'d like to integrate indurium into different parts of our racers, but I need large amounts of raw indurium to create these parts.$B$BYou can find indurium ore in the Uldaman excavation in the Badlands, across the sea in Khaz Modan.$B$BThe gnomes are getting their own supply of it, so it\'s important we get our own to keep pace with them.', 0);
INSERT INTO `quest_request_items` VALUES (1193, 1, 0, 0, 0, 'A large, broken trap lies before you. From the looks of it, the ogres have tried to repair the trap but to no avail. A hastily written note lies next to the trap, and strangely enough it details exactly what is needed to repair it: a thorium widget and some frost oil. Were the trap repaired, an ogre passing near it might get trapped, and could be avoided.$b$bClearly, it would seem fortuitous that very few ogres know how to read.$b$bClearly.', 0);
INSERT INTO `quest_request_items` VALUES (1194, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1195, 1, 0, 0, 0, 'Once we have the filled phial, we can send it along to my associate, Rau, in the Thousand Needles. He was the one who requested the phial of water, so he\'ll better know how we can make use of it.', 0);
INSERT INTO `quest_request_items` VALUES (1196, 1, 0, 0, 0, 'I don\'t suppose you\'ve been sent by Zangen, hm?', 0);
INSERT INTO `quest_request_items` VALUES (1197, 1, 0, 0, 0, 'I am eager to put my hands upon the Cloven Hoof. Have you taken it yet?', 0);
INSERT INTO `quest_request_items` VALUES (1198, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1199, 1, 0, 0, 0, 'Blackfathom Deeps was once an ancient night elf temple. It once housed a most powerful moonwell. Who knows what evil brews there now at the hands of the Twilight\'s Hammer.$B$BHave you made any progress in ridding their presence?', 0);
INSERT INTO `quest_request_items` VALUES (1200, 1, 0, 0, 0, 'Time is a precious commodity, $C.$B$BMy role here in Darnassus is to ensure that the Argent Dawn thrives and that the evil forces encroaching upon Kalimdor are thwarted.$B$BState your business quickly or be on your way.', 0);
INSERT INTO `quest_request_items` VALUES (1201, 1, 0, 0, 0, 'Did you find the infiltrators, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1202, 0, 0, 0, 0, 'Did you find the documents, $N?  They hold information vital to the stability of the Alliance and, hence, vital to the security of the Horde.', 0);
INSERT INTO `quest_request_items` VALUES (1203, 1, 0, 0, 0, 'You have my blade??', 0);
INSERT INTO `quest_request_items` VALUES (1204, 1, 0, 0, 0, 'Did you get the forked tongues?', 0);
INSERT INTO `quest_request_items` VALUES (1205, 0, 0, 0, 0, 'Do you have the tooth of Deadmire, $N?  Have you ended the creature\'s suffering?', 0);
INSERT INTO `quest_request_items` VALUES (1206, 1, 0, 0, 0, 'Where are those eyes?', 0);
INSERT INTO `quest_request_items` VALUES (1218, 6, 0, 0, 0, 'Spice.  We could all use some spice in our life.  You agree?', 0);
INSERT INTO `quest_request_items` VALUES (1219, 1, 0, 0, 0, 'Do you have a report to make?', 0);
INSERT INTO `quest_request_items` VALUES (1220, 1, 0, 0, 0, 'You have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (1221, 1, 0, 0, 0, 'Do you have the tubers, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1222, 1, 0, 0, 0, 'Have you seen Mr. Ignatz? I sent him into the swamp some time ago and he hasn\'t returned!', 0);
INSERT INTO `quest_request_items` VALUES (1238, 1, 0, 0, 0, 'You have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (1239, 1, 0, 0, 0, 'You have another matter to report, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1240, 1, 0, 0, 0, 'There is an angry spirit about you, $gbrother:sister;. What brings you to Kin\'weelay?', 0);
INSERT INTO `quest_request_items` VALUES (1241, 1, 0, 0, 0, 'Hmph, you better have good reason to interrupt a man and his fishin\'. I don\'t take kindly to peddlers, let alone beggars.', 0);
INSERT INTO `quest_request_items` VALUES (1242, 1, 0, 0, 0, 'Hello, $N. Is there something I can do for you? Perhaps you\'d like to try some of our special Trias cheddar? Or a block of Darnassian bleu?', 0);
INSERT INTO `quest_request_items` VALUES (1243, 1, 0, 0, 0, 'Not too safe to be traveling about in the woods, $N. Be careful, and if you see anything suspicious or dangerous, contact the Watchers immediately. Don\'t try and take anything on yourself. We\'re not responsible for anything terrible that might happen to you.$B$BBut we both know you\'re gonna ignore me and fight whatever comes out of the darkness anyway, don\'t we? Haha, yeah, you adventurer types... all the same.', 0);
INSERT INTO `quest_request_items` VALUES (1244, 1, 0, 0, 0, 'Be careful out there, $N. I know Trias was the one to send you here, but that doesn\'t mean there isn\'t anything lurking out in the woods that couldn\'t cause you some trouble... especially with you investigating the Defias.', 0);
INSERT INTO `quest_request_items` VALUES (1245, 1, 0, 0, 0, 'I see you\'re back, and in one piece. We both know you\'re not here for cheese, so let\'s cut out the pleasantries. Was Backus any help, or have you even left for Duskwood yet?', 0);
INSERT INTO `quest_request_items` VALUES (1246, 14, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1247, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1248, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1249, 1, 0, 0, 0, 'Did he slip away? He looked a little shady the way he was watching us.', 0);
INSERT INTO `quest_request_items` VALUES (1250, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1251, 6, 0, 0, 0, 'What\'s that you have there, $n? Evidence from the remains of the Shady Rest Inn?', 0);
INSERT INTO `quest_request_items` VALUES (1252, 1, 0, 0, 0, 'Have you found anything of interest at the Shady Rest Inn?', 0);
INSERT INTO `quest_request_items` VALUES (1253, 1, 0, 0, 0, 'Have you found evidence from the site of the Shady Rest Inn?', 0);
INSERT INTO `quest_request_items` VALUES (1258, 1, 0, 0, 0, 'My research with the Mudrock tongues is progressing nicely. I trust your crab hunt goes well?', 0);
INSERT INTO `quest_request_items` VALUES (1259, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1260, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1261, 1, 0, 0, 0, '$N, did you discover Marg\'s fate?', 0);
INSERT INTO `quest_request_items` VALUES (1262, 1, 0, 0, 0, 'You traveled from Brackenwall Village in Dustwallow? How fares Nazeer, and how fare his efforts in the marsh?', 0);
INSERT INTO `quest_request_items` VALUES (1264, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1265, 1, 0, 0, 0, 'Yes, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1266, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1267, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1268, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1269, 6, 0, 0, 0, 'Have you found any leads on what happened at the Shady Rest Inn?', 0);
INSERT INTO `quest_request_items` VALUES (1270, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1271, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1273, 1, 0, 0, 0, 'Did you find Reethe?', 0);
INSERT INTO `quest_request_items` VALUES (1274, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1275, 1, 0, 0, 0, 'Once I have enough samples to study, my true work can begin. With the corrupted brain stems of both the satyr and naga of Blackfathom Deeps I can try to draw a correlation between the mutations.$B$BPerhaps with that gained knowledge we can prevent the blood elves from delving deeper into deformity and evil.', 0);
INSERT INTO `quest_request_items` VALUES (1276, 3, 0, 0, 0, 'Hello there, $c. Something I can help you with?', 0);
INSERT INTO `quest_request_items` VALUES (1282, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1284, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1285, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1286, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1287, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1288, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1289, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1301, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1302, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1318, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1319, 1, 0, 0, 0, 'Something for me to look at?', 0);
INSERT INTO `quest_request_items` VALUES (1320, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1321, 0, 0, 0, 0, 'Something for me, $c?', 0);
INSERT INTO `quest_request_items` VALUES (1322, 0, 0, 0, 0, 'Did you get them sacs from the spiders?', 0);
INSERT INTO `quest_request_items` VALUES (1323, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1324, 1, 0, 0, 0, 'Hello again, $N. I hope you don\'t mind the assistance, but we couldn\'t have Hendel escaping, or worse, wind up dead.', 0);
INSERT INTO `quest_request_items` VALUES (1338, 1, 0, 0, 0, 'A letter from the dwarven lands? I wonder who would call from so far to the north...$B$BPlease, let me see the order.', 0);
INSERT INTO `quest_request_items` VALUES (1339, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1358, 1, 0, 0, 0, 'You have a package for me?', 0);
INSERT INTO `quest_request_items` VALUES (1359, 1, 0, 0, 0, 'You have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (1360, 1, 0, 0, 0, 'Well now, we\'re you able to get slap around those troggs long enough to get into my chest and nab my treasure?', 0);
INSERT INTO `quest_request_items` VALUES (1361, 1, 0, 0, 0, 'I note that your task is unfinished, $N. Shall I inform Sharlindra of your ineptitude?', 0);
INSERT INTO `quest_request_items` VALUES (1362, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1363, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1364, 1, 0, 0, 0, 'What brings you to Nethergarde Keep, $R?', 0);
INSERT INTO `quest_request_items` VALUES (1365, 1, 0, 0, 0, '$N, have you defeated Khan Dez\'hepah?', 0);
INSERT INTO `quest_request_items` VALUES (1366, 1, 0, 0, 0, 'How is your collection of ears, $N? Large?', 0);
INSERT INTO `quest_request_items` VALUES (1367, 1, 0, 0, 0, 'Leave! The Magram do not speak with the weak. We kill them!$B$BIf you want to speak with me, then show me you are strong. Return after you slay many Gelkis.', 0);
INSERT INTO `quest_request_items` VALUES (1368, 1, 0, 0, 0, 'Your two feet step on Gelkis earth. You are not welcome here!$B$BProve you seek friendship with the Gelkis. Kill Magram centaur. Return when the ground is wet with Magram blood.', 0);
INSERT INTO `quest_request_items` VALUES (1369, 1, 0, 0, 0, 'If you are not our enemy, then you will do what I ask!', 0);
INSERT INTO `quest_request_items` VALUES (1370, 1, 0, 0, 0, 'Return after you further prove your worth to the Gelkis!', 0);
INSERT INTO `quest_request_items` VALUES (1371, 1, 0, 0, 0, 'If you are not our enemy, then you will do what I ask!', 0);
INSERT INTO `quest_request_items` VALUES (1372, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1373, 0, 0, 0, 0, 'Show me you are a friend of the Gelkis, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1374, 1, 0, 0, 0, 'Show me you are a friend of the Gelkis, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1375, 1, 0, 0, 0, 'Do tasks for the Magram, and I will help you.', 0);
INSERT INTO `quest_request_items` VALUES (1380, 1, 0, 0, 0, 'Is Khan Hratha dead? Do you have the key fragment?', 0);
INSERT INTO `quest_request_items` VALUES (1381, 1, 0, 0, 0, 'Do what I ask.  Prove to me that you are an ally of the Magram!', 0);
INSERT INTO `quest_request_items` VALUES (1382, 1, 0, 0, 0, 'Be gone! The Gelkis do not want you here. Leave now!!$B$BReturn after killing many Magram, and then I will speak with you.', 0);
INSERT INTO `quest_request_items` VALUES (1383, 1, 0, 0, 0, 'That Infiltrator in Stonard will surely.... open up... after he drinks my special serum. Haha!$b$bThe ingredients required are by no means easy to procure. Shadow Panthers are common in the Swamp but collecting enough hearts for our purpose can be daunting. And the Mire Lord can be such a fussy beast.$b$b', 0);
INSERT INTO `quest_request_items` VALUES (1384, 1, 0, 0, 0, 'You have the charms? You showed the Kolkar they are weak?', 0);
INSERT INTO `quest_request_items` VALUES (1385, 1, 0, 0, 0, 'You will go now, or the Magram will crush you! To be our friend, you must kill Gelkis.', 0);
INSERT INTO `quest_request_items` VALUES (1386, 1, 0, 0, 0, 'Are you afraid of the Kolkar? Why do you not kill them? Maybe you forgot how to kill. Hurry and kill Kolkar before they are dead!', 0);
INSERT INTO `quest_request_items` VALUES (1387, 1, 0, 0, 0, 'Do you have a report, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1388, 1, 0, 0, 0, 'I hope you have proven yourself of use to our dear friend, Apothecary Faustin.', 0);
INSERT INTO `quest_request_items` VALUES (1389, 1, 0, 0, 0, 'Do you have the crystals?', 0);
INSERT INTO `quest_request_items` VALUES (1390, 1, 0, 0, 0, 'NULL', 0);
INSERT INTO `quest_request_items` VALUES (1391, 1, 0, 0, 0, 'Please have mercy on me! I have information that goes beyond alliance boundaries. While I am no sympathizer of the Horde, there is political treachery going on that must be revealed!', 0);
INSERT INTO `quest_request_items` VALUES (1392, 0, 0, 0, 0, 'Greetings.  And welcome to the Harborage.', 0);
INSERT INTO `quest_request_items` VALUES (1393, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1394, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1395, 1, 0, 0, 0, 'Hello! Don\'t mind all the commotion, it\'s just business as usual at Nethergarde Keep.$B$BYou have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (1396, 1, 0, 0, 0, 'The swamp creatures press close, $N. Please, you must defend the camp!', 0);
INSERT INTO `quest_request_items` VALUES (1398, 1, 0, 0, 0, 'Did you find any driftwood, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1418, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1419, 0, 0, 0, 0, 'Do you have the jawbones?', 0);
INSERT INTO `quest_request_items` VALUES (1420, 1, 0, 0, 0, 'You returned. You have a report?', 0);
INSERT INTO `quest_request_items` VALUES (1421, 1, 0, 0, 0, 'Do you have the wizard\'s reagents, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1422, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1423, 1, 0, 0, 0, 'You have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (1424, 1, 0, 0, 0, 'No one knows what dark practices went on inside The Temple of Atal\'Hakkar. But we do know that great and powerful forces of magic were used.$b$bWe must learn as much as we can about such magic. Perhaps the spells of the Atal\'ai will prove of use to the Horde.$b$bOnce you have gathered enough Atal\'ai artifacts from around the Pool of Tears, I can begin to understand what the trolls were hoping to accomplish and what went so horribly wrong.', 0);
INSERT INTO `quest_request_items` VALUES (1425, 1, 0, 0, 0, 'You have business with me?', 0);
INSERT INTO `quest_request_items` VALUES (1426, 1, 0, 0, 0, 'I am patient. Patient and everlasting like an old kank stone from Draenor. The fish men shall not make it past our borders--not while I still stand. If we had an army at our disposal I would cleanse this world and all others of their presence. I feel my hatred seethe just speaking about them.', 0);
INSERT INTO `quest_request_items` VALUES (1427, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1428, 1, 0, 0, 0, 'Not until the sea and all her children are silenced will I be pleased... especially those disgusting fish men.', 0);
INSERT INTO `quest_request_items` VALUES (1429, 1, 0, 0, 0, 'You are brave to come here. Brave or foolish...', 0);
INSERT INTO `quest_request_items` VALUES (1430, 0, 0, 0, 0, 'I have a cask of wine waiting for your success, $N. It\'s only right I taste the goods before I have it shipped back to my customers.', 0);
INSERT INTO `quest_request_items` VALUES (1431, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1432, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1433, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1434, 1, 0, 0, 0, 'I was warned by a tauren companion that the satyr are not all they appear to be. He believes there is something more to them, that their evil is a twisting of their true nature. But I have not seen such things.$B$BI see only the ruthless slaughter of the weak and the corruption of those who seek dark power.$B$BI will continue in my duty of annihilating them until the Warchief directs me otherwise. Until then, I take no pity on them.', 0);
INSERT INTO `quest_request_items` VALUES (1435, 1, 0, 0, 0, 'I have tried to make the magics as simple as possible. Drawing the spirit of your victim out of its injured form should be child\'s play. Do not rely on the gem\'s power to slay your foe completely. You must only activate the gem when they are close to death, or it will be useless.', 0);
INSERT INTO `quest_request_items` VALUES (1436, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1437, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1438, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1439, 1, 0, 0, 0, 'I fear Tyranis will attempt to learn the Burning Blade\'s secrets and count himself among their kind if they allow it - he has always adored the power magic brings to those who are seduced by it.$B$BI\'m not sure I could endure returning home to my family with news of Tyranis\' spirit flirting with such dangers. It\'s a terrible enough crime among my kind to pursue such things, but to become that which we attempt to protect ourselves from, well, that\'s apprehensible.', 0);
INSERT INTO `quest_request_items` VALUES (1440, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1442, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1444, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1445, 1, 0, 0, 0, 'If the Atal\'ai fetishes hold the power to summon Hakkar and fulfill Jammal\'an\'s prophecy they must be seized. Such powers must be understood by the Horde!', 0);
INSERT INTO `quest_request_items` VALUES (1446, 1, 0, 0, 0, 'Once Jammal\'an has been removed, I stand a chance of returning to my people.$b$bWith Jammal\'an as their spiritual leader, the Atal\'ai face certain destruction.', 0);
INSERT INTO `quest_request_items` VALUES (1447, 11, 0, 0, 0, 'I didn\'t mean anything by the comment \'bout you being a stupid $C. We\'re friends, right? No hard feelings?', 0);
INSERT INTO `quest_request_items` VALUES (1448, 1, 0, 0, 0, 'I have traveled the world from the jungles of Azeroth to the snowy peaks of Khaz Modan.$B$BNever before have I asked for help in my adventures. But my old bones are tired.$B$BNothing would leave me feeling more satisfied than knowing that I completed my final quest for the Explorers\' League$B$BIf you\'d be so kind as to help me search for the Temple of Atal\'Hakkar, $C, I\'d greatly appreciate it.$B$BScour the Swamp of Sorrows and report back with your findings!', 0);
INSERT INTO `quest_request_items` VALUES (1449, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1450, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1451, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1452, 1, 0, 0, 0, 'Ya ever had a Rhapsody Malt? One of my finest brews, if I do say so myself. Hiccup!$B$BBut if I\'m gonna relive the horrors of that fateful flight over... hiccup... the swamp, well I\'m gonna need me something a wee bit stronger. Hiccup!$B$BDon\'t suppose you found me those gizzards and livers I need to add that extra kick to my Kalimdor Kocktail?$B$BHiccup!', 0);
INSERT INTO `quest_request_items` VALUES (1453, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1454, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1455, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1456, 1, 0, 0, 0, 'No offense to whoever Nijel is, but this camp ain\'t the most comfortable place I\'ve spent a night, if you know what I mean, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1457, 1, 0, 0, 0, 'Business is booming, $N, and I don\'t have a lot of time for questions. If you\'ve got business with the Reclaimers, then let\'s hear it. If not, I\'m gonna have to ask you to talk to one of me underlings - they\'re adept enough at taking care of things \'round here.', 0);
INSERT INTO `quest_request_items` VALUES (1458, 1, 0, 0, 0, 'Despicable creatures, the satyr. Story says they\'re somehow tied to the night elves, but I\'m not so sure I believe it.$B$BI think they get that on account of that one elf that brought them into the war few years back. World\'s never been the same since. Lot more dangerous, and a lot scarier.', 0);
INSERT INTO `quest_request_items` VALUES (1459, 1, 0, 0, 0, 'Sorry I couldn\'t tell you where to find the kodo or the scorpashi. I\'m not terribly familiar with the area, and I haven\'t had time to explore.', 0);
INSERT INTO `quest_request_items` VALUES (1462, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1463, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1464, 1, 0, 0, 0, 'Speak to Telf Joolam for another Fire Sapta.', 0);
INSERT INTO `quest_request_items` VALUES (1465, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1466, 1, 0, 0, 0, 'I didn\'t even realize these demon things were in Desolace. Last I read, centaur pretty much owned the land after the night elves picked up and left years ago.$B$BI wonder why they took up here, and how.', 0);
INSERT INTO `quest_request_items` VALUES (1467, 1, 0, 0, 0, 'Well met, $N. Business is booming, the sounds of anvils being struck rings throughout Ironforge, the bellows blow the fires hot, and me wife\'s making me a pie for dessert after tonight\'s dinner. Could life be any grander?', 0);
INSERT INTO `quest_request_items` VALUES (1468, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1469, 1, 0, 0, 0, 'At long last you have returned, $N. It has been quite some time since we last spoke. I thought perhaps you had forgotten about my quest.$B$BDid you locate that wily gryphon rider? Did he have anything to report?', 0);
INSERT INTO `quest_request_items` VALUES (1470, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1471, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1472, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1473, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1474, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1475, 1, 0, 0, 0, 'As dusk slowly descends upon my career I turn to you, $N, to help me in my final quest for the Explorers\' League. If my old bones could muster the strength to brave the Swamp of Sorrows and the sunken temple I would be fighting right alongside you.$B$BPride makes it hard for me to ask for your help in collecting the Atal\'ai Tablets. But old age forces the necessity.$B$BPlease help me, $N. I want to retire from the Explorers\' League having completed their final bidding.', 0);
INSERT INTO `quest_request_items` VALUES (1476, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1477, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1478, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1479, 1, 0, 0, 0, 'Are we there yet?', 0);
INSERT INTO `quest_request_items` VALUES (1480, 1, 0, 0, 0, 'The Burning Blade begin to realize how weak they truly are. Their magics are pathetic, their strength feeble.$B$BTheir only power comes from those they serve, and not from any understanding of true power and knowledge.', 0);
INSERT INTO `quest_request_items` VALUES (1481, 1, 0, 0, 0, 'Do not bring me an incorrect scalp, $c. Using the incorrect reagents could cause our deaths. The demon lord may have contingency spells on his person to slay those who would scry upon him.$B$BFate has already dealt me enough pain.', 0);
INSERT INTO `quest_request_items` VALUES (1482, 1, 0, 0, 0, 'I am ready for the oracle crystal, $c. Finding and destroying this Lord Azrethoc would garner a great deal of favor with the Warchief for both of us. We would do well to work together and to do so swiftly so we may further our own ends and curry favor with the Warchief. ', 0);
INSERT INTO `quest_request_items` VALUES (1483, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1484, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1485, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1486, 1, 0, 0, 0, 'I am very interested in examining the hides from the deviate creatures who have infested these caves. Have you had any luck in collecting some, $C?', 0);
INSERT INTO `quest_request_items` VALUES (1487, 1, 0, 0, 0, '$N, we, the Disciples of Naralex, need your help. Our numbers are dwindling with our master trapped in his twisted nightmare. We have not the forces necessary to deal with the corrupt creatures which now haunt these caverns.$b$bI beg of you, enter the caves and wage war on the deviate creatures!', 0);
INSERT INTO `quest_request_items` VALUES (1488, 1, 0, 0, 0, 'Glory to the Horde, and death to our enemies, $N!$B$BThe demons in Desolace pose a greater threat than ever before. My hope of returning to the Warchief dwindles as more and more of the foul creatures seem to appear.$B$BI sometimes wish it was only the centaur we had to deal with.', 0);
INSERT INTO `quest_request_items` VALUES (1489, 1, 0, 0, 0, 'Your masters are fools to send you here, for I will never again be a Scourge slave!', 0);
INSERT INTO `quest_request_items` VALUES (1490, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1491, 1, 0, 0, 0, 'Where is my wailing essence?', 0);
INSERT INTO `quest_request_items` VALUES (1492, 1, 0, 0, 0, 'You seek passage on the next ship, or have some item you wish to send aboard it?', 0);
INSERT INTO `quest_request_items` VALUES (1498, 1, 0, 0, 0, 'Do you have the scales, $N? Unless you can withstand the attacks of the thunder lizards, you will not benefit from my instruction.', 0);
INSERT INTO `quest_request_items` VALUES (1499, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1501, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1502, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1503, 1, 0, 0, 0, 'Do you have my steel bars?', 0);
INSERT INTO `quest_request_items` VALUES (1504, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1505, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1506, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1507, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1508, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1509, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1510, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1511, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1512, 1, 0, 0, 0, 'You have returned. Are you ready to battle a succubus?', 0);
INSERT INTO `quest_request_items` VALUES (1513, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1514, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a windblossom plant. The berries that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (1515, 1, 0, 0, 0, 'Urrrghhhh...', 0);
INSERT INTO `quest_request_items` VALUES (1516, 1, 0, 0, 0, 'Patience is earth\'s greatest virtue. The earth witnesses the cycle of all things: the mountains becoming deserts; rivers becoming canyons. The earth is the most stubborn and wise of all the elements and it does not tolerate impatience.$B$BThe earth beckons you now because a time of conflict draws near. When you return to me successful, then you shall be that much closer to being made whole.$B$BOthers will be envious of your wisdom and hate you for their ignorance.', 0);
INSERT INTO `quest_request_items` VALUES (1518, 1, 0, 0, 0, 'I wish to be the first to welcome you fully to the first of four paths that will forever lead you in your destiny.$B$BIf you have the stone the earth gave to you, I will give you the totem it promised.$B$BIf not, then be gone with you until you have found your way.', 0);
INSERT INTO `quest_request_items` VALUES (1519, 1, 0, 0, 0, 'The earth is patient, and will wait for you until you are ready because she knows in time all things erode and are reborn. It is the cycle of things. Mountains become deserts. Rivers become canyons. The earth is the most stubborn and wise of all the elements.$B$BYou must learn patience and stamina above all things. The earth calls for you now because she feels you are ready. Consider this your rebirth if you succeed. You will never be able to go back to ignorance afterwards.', 0);
INSERT INTO `quest_request_items` VALUES (1520, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1521, 1, 0, 0, 0, 'Greetings, $N. You would not return to me if you had not accomplished your task. May I be the first to welcome you fully to the first path of four that will forever rule your travels.$B$BIf you have the stone the earth gave to you, I will give you the totem it promised. If not, then I pity you. There is much pride to be had when you\'ve fully dedicated yourself to the elements.', 0);
INSERT INTO `quest_request_items` VALUES (1522, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1523, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1524, 1, 0, 0, 0, 'Greetin\'s, $N. You\'ve found yerself at the Shrine of the Dormant Flame. Only those knowledgeable enough in the shamanistic arts will ever learn the secrets of this place and the power it holds. I\'m sorry you made the trip all this way, only to be turned back now--the journey up here is far from safe after all--but I am the keeper of the shrine, and I cannot allow just anyone to wander around here.', 0);
INSERT INTO `quest_request_items` VALUES (1525, 1, 0, 0, 0, 'I have enough ingredients for a sapta of fire if you can find the reagent pouch and some fire tar. The Burning Blade fanatics carry the proper components for most of their spells in those pouches, and usually have enough of the items I need that we will not have to search much farther for anything else.$B$BThe saptas are always made from ingredients that are closely tied to their respective elements. It makes our work easier because of the warlocks\' ties to fire.', 0);
INSERT INTO `quest_request_items` VALUES (1526, 1, 0, 0, 0, 'The brazier stands about a third your height, and looks normal, save for the inscriptions along its smooth metal rails. The metal shows no signs of wear from the weather, and the bowl seated at the top of it feels cool to the touch.', 0);
INSERT INTO `quest_request_items` VALUES (1527, 1, 0, 0, 0, 'Yes, $N? What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (1528, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1529, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1530, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1531, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1532, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1534, 1, 0, 0, 0, 'Do you have the water yet, $N? Tales say the ruins were protected by large creatures of nature that do not care for visitors, but those could be myths to scare off the enemies of the night elves.$B$BRegardless, be careful.', 0);
INSERT INTO `quest_request_items` VALUES (1535, 1, 0, 0, 0, 'I am just about prepared to send you on your other tasks. Have you filled the skin yet?$B$BI know how protective the quilboar can be. Even such a small water source is a vast hoard of wealth to them. They have great feasts when even the slightest rain comes to the Barrens. Water is sacred to their kind because it is so scarce. Do you understand?', 0);
INSERT INTO `quest_request_items` VALUES (1536, 1, 0, 0, 0, 'The well remaining pure within the town reminds me of stories told to me when I was younger, $N. Even in times of great pain and sorrow one can find a sliver of hope, a small symbol to rally around. The orc people see Thrall this way. He survived against great odds and rose up to lead our people through his strength and example.$B$BI\'m not sure any orc has suffered as much as he has, but at the same time, I\'m not sure any orc is as strong as he is either.', 0);
INSERT INTO `quest_request_items` VALUES (1558, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1559, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1560, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1578, 1, 0, 0, 0, 'I have no time to chat. Do you have business with me?', 0);
INSERT INTO `quest_request_items` VALUES (1579, 1, 0, 0, 0, 'Did you find my gaffer jacks, $N? Without my gaffer jacks I can\'t tune my stintle pegs!', 0);
INSERT INTO `quest_request_items` VALUES (1580, 1, 0, 0, 0, 'Did you find any electropellers? I\'ll need them if I\'m to continue my research on duck decoys...', 0);
INSERT INTO `quest_request_items` VALUES (1581, 1, 0, 0, 0, 'Hello, $N. Do you have the elixirs to trade?', 0);
INSERT INTO `quest_request_items` VALUES (1582, 1, 0, 0, 0, 'Greetings, $N.', 0);
INSERT INTO `quest_request_items` VALUES (1598, 11, 0, 0, 0, 'It was too conspicuous for me to steal the book myself. What luck one of their own patsies did the dirty work for me.', 0);
INSERT INTO `quest_request_items` VALUES (1599, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1618, 1, 0, 0, 0, 'I hope you\'re here with good news from Ironforge. Because I\'m at my wit\'s end!', 0);
INSERT INTO `quest_request_items` VALUES (1638, 1, 0, 0, 0, NULL, 0);
