INSERT INTO `quest_request_items` VALUES (1655, 1, 0, 0, 0, 'So, any luck yet? Haha, those ogres didn\'t get the best of ya yet, did they? ', 0);
INSERT INTO `quest_request_items` VALUES (1656, 1, 0, 0, 0, 'Yes, young one? What can Kauth do for you?$B$BThe journey here from the Mesa can be a tremendous burden for some, but a welcome sight for others. Which is it for you, I wonder?', 0);
INSERT INTO `quest_request_items` VALUES (1657, 1, 0, 0, 0, 'Have you delivered our \"gift\" to the people of Southshore?$B$B<Darkcaller Yanka laughs wickedly.>', 0);
INSERT INTO `quest_request_items` VALUES (1658, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1661, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1665, 1, 0, 0, 0, 'I saw your fight with Bartleby. Nicely done! Did you get his mug?', 0);
INSERT INTO `quest_request_items` VALUES (1666, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1667, 1, 0, 0, 0, 'Do you have my badge? I don\'t want to think of the mischief Dead-tooth Jack could cause with it.', 0);
INSERT INTO `quest_request_items` VALUES (1678, 1, 0, 0, 0, 'Have you been to Vejrek\'s hut, $N? Is that $R stink I smell on you?', 0);
INSERT INTO `quest_request_items` VALUES (1679, 1, 0, 0, 0, 'Did you make the switch?', 0);
INSERT INTO `quest_request_items` VALUES (1680, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1681, 1, 0, 0, 0, 'Have you entered Ironband\'s Compound? Did you find the umbral ore?', 0);
INSERT INTO `quest_request_items` VALUES (1682, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1683, 1, 0, 0, 0, 'Do you have the horn, $N? Is our moonwell free of the fiend Vorlus?', 0);
INSERT INTO `quest_request_items` VALUES (1684, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1685, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1686, 1, 0, 0, 0, 'Have you defeated the Shade of Elura, $N? And do you have the lost elunite ore?', 0);
INSERT INTO `quest_request_items` VALUES (1687, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1688, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1689, 1, 1, 0, 0, 'I cannot show you how to control a voidwalker until you have overtaken one.', 0);
INSERT INTO `quest_request_items` VALUES (1690, 1, 0, 0, 0, 'Back so soon? I hope you were able to bring some goblin-style justice to those Wastewander Bandits and Thieves like I asked you to!', 0);
INSERT INTO `quest_request_items` VALUES (1691, 1, 0, 0, 0, 'Well, were you able to take out those nomads like I asked? The Gadgetzan Water Company is developing plans based on your success here! Don\'t let us down, now...', 0);
INSERT INTO `quest_request_items` VALUES (1692, 1, 0, 0, 0, 'Greetings, young $C. How might my skills serve you?', 0);
INSERT INTO `quest_request_items` VALUES (1693, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1698, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1699, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1700, 1, 0, 0, 0, 'Hello, and well met. How might I be of service to you?', 0);
INSERT INTO `quest_request_items` VALUES (1701, 1, 0, 0, 0, 'How goes the scavenger hunt, $N? Do you have the materials?', 0);
INSERT INTO `quest_request_items` VALUES (1702, 1, 0, 0, 0, 'Hello! Dry times, don\'t you think?', 0);
INSERT INTO `quest_request_items` VALUES (1703, 1, 0, 0, 0, 'I bid you greetings, $C.', 0);
INSERT INTO `quest_request_items` VALUES (1704, 1, 0, 0, 0, 'Good day, or morning or evening. I can\'t tell from way down here. So do you have business for me?', 0);
INSERT INTO `quest_request_items` VALUES (1705, 1, 0, 0, 0, '$N, do you have the burning blood and rock? I\'ll need them to complete the armor.', 0);
INSERT INTO `quest_request_items` VALUES (1706, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1707, 1, 0, 0, 0, 'Got the five Wastewander water pouches we need?  If you do, then the Gadgetzan Water Company Care Package, Model 103-XB, will be yours!', 0);
INSERT INTO `quest_request_items` VALUES (1708, 1, 0, 0, 0, 'Hello hello, $N! Do you have the searing coral? I can\'t wait to get to work!', 0);
INSERT INTO `quest_request_items` VALUES (1709, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1710, 1, 0, 0, 0, 'Do you have the shells, $N? They are quite strong, and can be rendered into a lacquer I will use to coat the links of my new mail armor.', 0);
INSERT INTO `quest_request_items` VALUES (1711, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1712, 1, 0, 0, 0, 'Do you have the items, $N? Gathering them is the proof I need that you have the strength to face Cyclonian.', 0);
INSERT INTO `quest_request_items` VALUES (1713, 1, 0, 0, 0, '$N, I must have the whirlwind heart!', 0);
INSERT INTO `quest_request_items` VALUES (1714, 1, 0, 0, 0, 'The cauldron bubbles. Its vapors beckon...', 0);
INSERT INTO `quest_request_items` VALUES (1715, 1, 0, 0, 0, '', 0);
