INSERT INTO `quest_request_items` VALUES (1738, 6, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1739, 11, 11, 0, 0, 'Sometimes I wonder if Surena was not a succubus in disguise, sent to warp and twist my mind... Ha! I give her too much credit, I think.', 0);
INSERT INTO `quest_request_items` VALUES (1740, 1, 0, 0, 0, 'It took me many years to collect the pieces of the orb of Zargain, but it has served me well, as I am sure the orb of Soran\'ruk will serve you.', 0);
