INSERT INTO `quest_request_items` VALUES (1824, 1, 0, 0, 0, 'Do you have the antennae? If so then give them to me quickly, for twitching antennae do not twitch forever...', 0);
INSERT INTO `quest_request_items` VALUES (1825, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1838, 1, 0, 0, 0, 'Do you have the items on my scroll, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1839, 1, 0, 0, 0, NULL, 0);
