INSERT INTO `quest_request_items` VALUES (1842, 1, 0, 0, 0, 'Do you have the hooves, $N? The magic within them is strong.', 0);
INSERT INTO `quest_request_items` VALUES (1843, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1844, 1, 0, 0, 0, 'Do you have the horn? Is the matriarch free of pain?', 0);
INSERT INTO `quest_request_items` VALUES (1845, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1846, 1, 0, 0, 0, 'I\'m waiting for those shinbones, $N. They\'ll make a nice frame for your leg guards.', 0);
INSERT INTO `quest_request_items` VALUES (1847, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1848, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1858, 1, 0, 0, 0, 'Is it not vexing to have the subject of your desire within your grasp, but to have no way of getting to it?', 0);
INSERT INTO `quest_request_items` VALUES (1859, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1860, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (1861, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1878, 5, 0, 0, 0, 'Back again, $n?  If you have five more Wastewander water pouches, then I have a care package with your name on it!', 0);
INSERT INTO `quest_request_items` VALUES (1879, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1880, 1, 0, 0, 0, '', 0);
