INSERT INTO `quest_request_items` VALUES (1882, 1, 0, 0, 0, 'Do you have the snapdragons? That breed of flower is highly receptive to magic energies, and studying the snapdragons so close to the Plaguelands can tell us if the plague has entered Tirisfal Glades.', 0);
INSERT INTO `quest_request_items` VALUES (1883, 1, 0, 0, 0, '', 0);
