INSERT INTO `quest_request_items` VALUES (1899, 1, 0, 0, 0, 'Success, $N?', 0);
INSERT INTO `quest_request_items` VALUES (1918, 1, 0, 0, 0, 'Yeah, what do you need?', 0);
