INSERT INTO `quest_request_items` VALUES (1944, 1, 0, 0, 0, 'I am pleased you have returned with your skin intact, $N. Do you have the water sample? I am eager to study its properties.', 0);
INSERT INTO `quest_request_items` VALUES (1945, 1, 0, 0, 0, 'Greetings, $N. Deino said you would come, and would bring the laughing sisters\' hair. Do you have it?', 0);
