INSERT INTO `quest_request_items` VALUES (1960, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1961, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1962, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (1963, 1, 0, 0, 0, 'It is a fool who believes a charge with axe drawn is more dangerous than a knife in the dark.', 0);
INSERT INTO `quest_request_items` VALUES (1978, 1, 0, 0, 0, 'Yes?', 0);
INSERT INTO `quest_request_items` VALUES (1998, 1, 0, 0, 0, 'I have placed the utmost faith in you to perform this service for Lord Varimathras.', 0);
INSERT INTO `quest_request_items` VALUES (1999, 1, 0, 0, 0, 'Have you located the documents, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2019, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (2038, 1, 0, 0, 0, '$N! Where are my things?!', 0);
INSERT INTO `quest_request_items` VALUES (2039, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2040, 1, 0, 0, 0, 'Have you found the Gnoam Sprecklesprocket, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2041, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2078, 1, 0, 0, 0, 'Where be me first mate, $N? Shackles n\' sharks fer ye soon if ye don\'t hurry!', 0);
INSERT INTO `quest_request_items` VALUES (2098, 1, 0, 0, 0, 'Have ye found me broke down key, landlubber?', 0);
INSERT INTO `quest_request_items` VALUES (2118, 1, 0, 0, 0, 'Have you brought me the sick animal, $N?$B$BShould you fail to spring the trap, do not fret - Tharnariun\'s Hope is eternal. If you require another trap, abandon your task and report back to me.', 0);
INSERT INTO `quest_request_items` VALUES (2138, 1, 0, 0, 0, 'Is your task complete?', 0);
INSERT INTO `quest_request_items` VALUES (2139, 1, 0, 0, 0, 'With the infected Den Mother slain, the population of Rabid Thistle Bears entering our land is lessened. Waste no time, $N.', 0);
INSERT INTO `quest_request_items` VALUES (2158, 2, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2159, 6, 1, 0, 0, 'How might I be of service to you, young one?  Are you here to rest in the inn?  Do you require a hearthstone? ', 0);
INSERT INTO `quest_request_items` VALUES (2160, 1, 0, 0, 0, 'Hi there! Come in, take a seat by the fire and warm yourself with a flagon of ale. ', 0);
INSERT INTO `quest_request_items` VALUES (2161, 1, 0, 0, 0, 'Welcome to Razor Hill! ', 0);
INSERT INTO `quest_request_items` VALUES (2178, 1, 0, 0, 0, 'The pot is empty and I\'m hungry! What\'s taking you so long?', 0);
INSERT INTO `quest_request_items` VALUES (2198, 1, 0, 0, 0, 'You\'ve got the wrong gnome, pal! I was never there! You can\'t prove anything!$B$BWait a second... who are you? What the... where did you find this necklace at?', 0);
INSERT INTO `quest_request_items` VALUES (2199, 1, 0, 0, 0, 'Have you got the five silver bars I asked for?  I will share my sad tale of woe with you concerning the necklace you now possess... but only after I get those bars!  Please, help a gnome out, won\'t ya?', 0);
INSERT INTO `quest_request_items` VALUES (2200, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2201, 1, 0, 0, 0, 'Talvash\'s image comes into focus from the waters of the scrying bowl.$b$b\"Wow, you\'re still alive! Did you manage to find the gems? Are you truly the savior of my reputation I have hoped for? Please tell me you didn\'t waste a charge on the phial just to chat; those things are NOT cheap, and I\'m already in dire financial strai', 0);
INSERT INTO `quest_request_items` VALUES (2202, 1, 0, 0, 0, 'Have you obtained the magenta fungus caps I need for my alchemical work? No caps - no reward!', 0);
INSERT INTO `quest_request_items` VALUES (2203, 1, 0, 0, 0, 'Have you used the vessels to get me the scorched guardian dragon blood I need?  Yes, I know it is a dangerous task... but the recipe for my restorative brew awaits your success.  Risk and reward, my friend... risk and reward...', 0);
INSERT INTO `quest_request_items` VALUES (2204, 1, 0, 0, 0, 'You didn\'t even stop to tidy yourself up after leaving Uldaman, did you.  You just came straight here, lingering dungeon odors be damned.  Well, let\'s hope this visit is merely an odiferous one, and not a useless one to boot.$B$BDo you have the power source for the necklace?', 0);
INSERT INTO `quest_request_items` VALUES (2205, 1, 0, 0, 0, 'Can I help you, $C?', 0);
INSERT INTO `quest_request_items` VALUES (2206, 1, 0, 0, 0, 'Your mortality wanes with every moment you waste loitering in the barracks, $C.', 0);
INSERT INTO `quest_request_items` VALUES (2218, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2238, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2239, 1, 0, 0, 0, 'Did ye enjoy the stench of leper gnome? I only ask because ye got a crazy smile on yer face.$B$BWhat news do ye bring from Onin?', 0);
INSERT INTO `quest_request_items` VALUES (2240, 1, 0, 0, 0, 'Do you have something to report?', 0);
INSERT INTO `quest_request_items` VALUES (2241, 1, 0, 0, 0, 'Oh, isn\'t this wonderful. You\'ve brought flowers for your own funeral.', 0);
INSERT INTO `quest_request_items` VALUES (2242, 1, 0, 0, 0, 'Have you anything to report from Sethir the Ancient, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2258, 1, 0, 0, 0, 'Have you gotten the things I need yet? You won\'t get paid unless you bring me those reagents.', 0);
INSERT INTO `quest_request_items` VALUES (2259, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2260, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2278, 1, 0, 0, 0, 'The voice of the stone watcher seems to resonate within your very inner being:$b$b\"You must first satisfy the data assimilation prerequisite of Discs of Norgannon; once you fulfill this requirement, you will then be permitted to obtain a portable version of the stored data. Please be sure you have fully explored the information within this repository first.\"', 0);
INSERT INTO `quest_request_items` VALUES (2279, 1, 0, 0, 0, 'Yes, may I help you with something?  I assure you I am a very busy right now.  If it is grave importance to the Explorers\' League, however, then I am all ears!', 0);
INSERT INTO `quest_request_items` VALUES (2280, 1, 0, 0, 0, 'What is that you have there? What did you learn from the discs?', 0);
INSERT INTO `quest_request_items` VALUES (2281, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2282, 1, 0, 0, 0, 'Did I forget to mention the orcs?$B$BI hear they have been nosing around up by the mill.', 0);
INSERT INTO `quest_request_items` VALUES (2283, 1, 0, 0, 0, 'Well, do you have the necklace?  You won\'t see a copper from us if you don\'t have that necklace!', 0);
INSERT INTO `quest_request_items` VALUES (2284, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2298, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2299, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2300, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2318, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2338, 1, 0, 0, 0, 'You\'ve thought about it, yes? You\'re a smart $C if you take this deal - you and I will get what we both want, and Droffers and Son Salvage will think they\'re getting what they want.', 0);
INSERT INTO `quest_request_items` VALUES (2339, 1, 0, 0, 0, 'You\'ve got another trip into the depths of Uldaman in store for yourself if you don\'t have the gems and a power source capable of channeling magical power back into the necklace.$B$BYou\'ll be getting the gems back to deliver to the goons in Orgrimmar; I will be keeping the power source, since it will be the thing that will make the necklace work in the first place...', 0);
INSERT INTO `quest_request_items` VALUES (2340, 1, 0, 0, 0, 'Well, look who it is! Took your sweet time getting here, I see. Let\'s hope this isn\'t a waste of my time! You\'ll not get paid unless you have everything I asked for. And trust me on this - we\'ll be double and triple checking everything!', 0);
INSERT INTO `quest_request_items` VALUES (2341, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2342, 20, 0, 0, 0, 'The sweeping never ends... these bats are prolific in their mockery of me and my broom.  Please tell me you\'ve reclaimed my family\'s treasure!  I\'ve offered you my silver - is that not enough?!', 0);
INSERT INTO `quest_request_items` VALUES (2358, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2359, 1, 0, 0, 0, 'Any news from Agent Kearnen?', 0);
INSERT INTO `quest_request_items` VALUES (2360, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2361, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2378, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2379, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2380, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2381, 1, 0, 0, 0, 'Well, at least you still have all of your body parts. Did you find the treasure?$b$b', 0);
INSERT INTO `quest_request_items` VALUES (2382, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2383, 6, 0, 0, 0, 'What\'s that you have there? A parchment? You\'re not a scholar, I hope...', 0);
INSERT INTO `quest_request_items` VALUES (2398, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2399, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2418, 6, 0, 0, 0, 'Do you have the power stones, $N?  I have a robotic rodent that needs a power supply...', 0);
INSERT INTO `quest_request_items` VALUES (2438, 6, 4, 0, 0, 'Please move swiftly. I can only hope that my emerald dreamcatcher has been unharmed by the furbolg. Have you recovered it yet, $n? ', 0);
INSERT INTO `quest_request_items` VALUES (2439, 1, 0, 0, 0, 'Welcome to the Vault of Ironforge, $N.  What may I do for you today?', 0);
INSERT INTO `quest_request_items` VALUES (2440, 1, 0, 0, 0, 'Greetings, $C! Are you here for alchemy training, or perhaps something else?', 0);
INSERT INTO `quest_request_items` VALUES (2458, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2459, 6, 2, 0, 0, 'Ferocitas and the Gnarlpine mystics must return what is mine.  Please retrieve the emerald so that I may repair my emerald dreamcatcher. ', 0);
INSERT INTO `quest_request_items` VALUES (2460, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2478, 1, 0, 0, 0, 'What have you to report, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2479, 1, 0, 0, 0, 'What\'s this???', 0);
INSERT INTO `quest_request_items` VALUES (2480, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2498, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2499, 1, 0, 0, 0, 'Have you located Oakenscowl yet, $r? ', 0);
INSERT INTO `quest_request_items` VALUES (2500, 1, 0, 0, 0, 'Have you gotten the things I need yet?  You won\'t get paid unless you bring me those reagents.', 0);
INSERT INTO `quest_request_items` VALUES (2501, 1, 0, 0, 0, 'Have you used the vessels to get me the scorched guardian dragon blood I need?  Yes, I know it is a dangerous task... but the recipe for my restorative brew awaits your success.  Risk and reward, my friend... risk and reward...', 0);
INSERT INTO `quest_request_items` VALUES (2518, 1, 0, 0, 0, 'I regret the task that I have asked you to carry out; but Lady Sathrah is beyond hope. It is our hope to offer the sacrifice of the spinnerets to Elune. With this sacrifice, Elune will bless Sathrah so that she might be reborn, and at peace. ', 0);
INSERT INTO `quest_request_items` VALUES (2519, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2520, 1, 0, 0, 0, 'Have you placed the sacrifice at the fountain, $n?', 0);
INSERT INTO `quest_request_items` VALUES (2521, 1, 0, 0, 0, 'I have dedicated my life to the search of flawless draenethyst spheres. A lifetime, tau', 0);
INSERT INTO `quest_request_items` VALUES (2522, 1, 0, 0, 0, 'Have you found another flawless draenethyst sphere?', 0);
INSERT INTO `quest_request_items` VALUES (2523, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant. A pungent, unhealthy odor emanates from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (2541, 1, 0, 0, 0, 'If I can examine the charm, I may be able to figure out how to break the enchantment. Have you found one? ', 0);
INSERT INTO `quest_request_items` VALUES (2561, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2581, 1, 0, 0, 0, 'You smell foul, $N. Have you been traipsing in sulfur fields? And where are my components?!', 0);
INSERT INTO `quest_request_items` VALUES (2582, 1, 0, 0, 0, 'Do you have the beast organs?', 0);
INSERT INTO `quest_request_items` VALUES (2583, 1, 0, 0, 0, 'Where are the organs, $N!?', 0);
INSERT INTO `quest_request_items` VALUES (2584, 1, 0, 0, 0, 'Where are the organs, $N!?', 0);
INSERT INTO `quest_request_items` VALUES (2585, 1, 0, 0, 0, 'Where are the organs, $N!?$b$b', 0);
INSERT INTO `quest_request_items` VALUES (2586, 1, 0, 0, 0, 'Where are the organs, $N!?', 0);
INSERT INTO `quest_request_items` VALUES (2601, 1, 0, 0, 0, 'Have you returned with the requested organs?', 0);
INSERT INTO `quest_request_items` VALUES (2602, 1, 0, 0, 0, 'Have you returned with the requested organs?', 0);
INSERT INTO `quest_request_items` VALUES (2603, 1, 0, 0, 0, 'Do not waste my time, $N. We have nothing to discuss, unless you have recovered the items I have requested.', 0);
INSERT INTO `quest_request_items` VALUES (2604, 1, 0, 0, 0, 'Do not waste my time, $N. We have nothing to discuss, unless you have recovered the items I have requested.', 0);
INSERT INTO `quest_request_items` VALUES (2605, 1, 0, 0, 0, 'Please, tell me you found the dew collectors?', 0);
INSERT INTO `quest_request_items` VALUES (2606, 1, 0, 0, 0, 'So old Marin\'s up to it again, eh? What\'s this concoction made from?', 0);
INSERT INTO `quest_request_items` VALUES (2607, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2608, 1, 0, 0, 0, 'When you\'re ready for the examination, /lay down on the ground and I\'ll begin the phlebotomy.', 0);
INSERT INTO `quest_request_items` VALUES (2609, 1, 0, 0, 0, 'If you want the \'itis\' cured, you\'re going to have to try harder than that, $n. Where are the reagents for the cure?', 0);
INSERT INTO `quest_request_items` VALUES (2621, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2622, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2623, 1, 0, 0, 0, 'Awaiting orders.', 0);
INSERT INTO `quest_request_items` VALUES (2641, 1, 0, 0, 0, 'Under the waters of that lake -- it\'s the only place where the Violet Tragan can be found.  Hope you\'re good at holding your breath!', 0);
INSERT INTO `quest_request_items` VALUES (2661, 1, 0, 0, 0, 'Oh, $N, you\'re finally back.  What have you brought?', 0);
INSERT INTO `quest_request_items` VALUES (2662, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2681, 1, 0, 0, 0, 'It is no easy task, $N. Do not give up!', 0);
INSERT INTO `quest_request_items` VALUES (2701, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2702, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2721, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2741, 1, 0, 0, 0, 'The Super Egg-O-Matic is the latest of Curgle Cranklehop\'s inventions. It is quite an impressive piece of machinery.$B$BThe Super Egg-O-Matic sputters wildly as you approach the control panel.', 0);
INSERT INTO `quest_request_items` VALUES (2742, 1, 0, 0, 0, 'Rin\'ji is scared!', 0);
INSERT INTO `quest_request_items` VALUES (2743, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2744, 1, 0, 0, 0, 'What are you doing here?', 0);
INSERT INTO `quest_request_items` VALUES (2745, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2746, 1, 0, 0, 0, 'I\'ve been watching Lescovar for a couple weeks now. Trias has never trusted him, but we didn\'t suspect he was involved in anything to do with the Defias Brotherhood. We were following leads that tied him to the Twilight\'s Hammer. Either way, he\'s become more dangerous than this city can deal with, and that\'s where we come in.$b$bGet me those items and we can put my plan into effect.', 0);
INSERT INTO `quest_request_items` VALUES (2747, 1, 0, 0, 0, 'I have seen very few eggs retrieved from Feralas in extraordinary condition. These are eggs of the rarest sort...', 0);
INSERT INTO `quest_request_items` VALUES (2748, 1, 0, 0, 0, 'A fine egg is one that will, in ideal conditions, hatch free of the evil effects of the Gordunni ogres\' incantations.', 0);
INSERT INTO `quest_request_items` VALUES (2749, 1, 0, 0, 0, 'Ordinary hippogryph eggs hatch about half the time. We do our best to nurture them and with a little luck, they will hatch.', 0);
INSERT INTO `quest_request_items` VALUES (2750, 1, 0, 0, 0, 'These are the eggs that cannot be saved -- they will never hatch.', 0);
INSERT INTO `quest_request_items` VALUES (2751, 1, 0, 0, 0, 'Bronze, $N! More bronze!!', 0);
INSERT INTO `quest_request_items` VALUES (2752, 1, 0, 0, 0, 'Show me your dedication, $R.', 0);
INSERT INTO `quest_request_items` VALUES (2753, 1, 0, 0, 0, 'Their skulls will crack under the pressure of your boots!', 0);
INSERT INTO `quest_request_items` VALUES (2754, 1, 0, 0, 0, 'Show the iron who is in charge, $N!', 0);
INSERT INTO `quest_request_items` VALUES (2755, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2756, 1, 0, 0, 0, 'Aturk, like time, waits for no one! Hurry up fool!', 0);
INSERT INTO `quest_request_items` VALUES (2757, 1, 0, 0, 0, 'A rare breed your kind be, matey. Let me see that insignia.', 0);
INSERT INTO `quest_request_items` VALUES (2758, 1, 0, 0, 0, 'Could you be the next Galvan protege?', 0);
INSERT INTO `quest_request_items` VALUES (2759, 1, 0, 0, 0, 'A rare breed your kind be, matey. Let me see that insignia.', 0);
INSERT INTO `quest_request_items` VALUES (2760, 1, 0, 0, 0, 'Hail! Come closer; show Galvan what you have.', 0);
INSERT INTO `quest_request_items` VALUES (2761, 1, 0, 0, 0, 'After such mining, your muscles bulge and your body aches!', 0);
INSERT INTO `quest_request_items` VALUES (2762, 1, 0, 0, 0, 'After such mining, your muscles bulge and your body aches!', 0);
INSERT INTO `quest_request_items` VALUES (2763, 1, 0, 0, 0, 'After such mining, your muscles bulge and your body aches!', 0);
INSERT INTO `quest_request_items` VALUES (2764, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2765, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2766, 1, 0, 0, 0, 'You appear to have uncovered the wreckage of... a robotic chicken? The voice from within the egg crackles to life again:$b$b\"Yes, excellent work! This is indeed my homing robot, though my sensors indicate that it needs a jump start before it can fly back to Booty Bay for repairs. Go ahead and place the beacon inside the rover - the beacon will take care of the rest!\"', 0);
INSERT INTO `quest_request_items` VALUES (2767, 1, 0, 0, 0, 'Yes, I\'m Oglethorpe Obnoticus, master inventor at your service! Now, is there something I could assist you with?', 0);
INSERT INTO `quest_request_items` VALUES (2768, 6, 0, 0, 0, 'Did you find Sergeant Bly?  Did you get my divino-matic rod?', 0);
INSERT INTO `quest_request_items` VALUES (2769, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2770, 0, 0, 0, 0, 'Do you have the scale?  I can\'t wait to try different ways to harness its energy!', 0);
INSERT INTO `quest_request_items` VALUES (2771, 1, 0, 0, 0, 'Have you completed the crafting of the items, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2772, 1, 0, 0, 0, 'Have you completed the crafting of the items, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2773, 1, 0, 0, 0, 'Have you completed the crafting of the items, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2781, 1, 0, 0, 0, 'Yes $c, I am an official of the Gadgetzan Water Company.  What can I assist you with?', 0);
INSERT INTO `quest_request_items` VALUES (2782, 1, 0, 0, 0, 'Well, now, what is this?', 0);
INSERT INTO `quest_request_items` VALUES (2783, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2784, 1, 0, 0, 0, 'Listen to what I have to say.', 0);
INSERT INTO `quest_request_items` VALUES (2801, 1, 0, 0, 0, 'Listen to what I have to say, $N.', 0);
INSERT INTO `quest_request_items` VALUES (2821, 1, 0, 0, 0, 'A stack of ten thick yeti hides will net you a choice of one of my crafted items.  Because I care about quality, I am able to ensure you\'ll get a good item!$B$BIf you can\'t seem to find yetis, I know where some might be.  Try looking just inland of the Forgotten Coast, around Feral Scar Vale.', 0);
INSERT INTO `quest_request_items` VALUES (2822, 1, 0, 0, 0, 'Were you able to get a stack of ten thick yeti hides? My leather goods are second to none, and I\'ll share a sampling with you should you have the hides.$b$bIf you can\'t seem to find yetis, I know where some might be. Try looking west of here, just inland of the Forgotten Coast around the Feral Scar Vale.', 0);
INSERT INTO `quest_request_items` VALUES (2841, 1, 0, 0, 0, 'I don\'t see any blueprints. Did you hide them somewhere on your body or are you just standing around here to irritate me?$b$b', 0);
INSERT INTO `quest_request_items` VALUES (2842, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2843, 1, 0, 0, 0, 'It\'s ready!', 0);
INSERT INTO `quest_request_items` VALUES (2844, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2845, 1, 0, 0, 0, 'I was gettin\' worried \'bout ya! Thank you so much for bringin\' Shay home, $N.', 0);
INSERT INTO `quest_request_items` VALUES (2846, 6, 0, 0, 0, 'Do you have the tiara, $N?  Has Velratha learned the price of crossing me?', 0);
INSERT INTO `quest_request_items` VALUES (2847, 1, 0, 0, 0, 'Like I said, you\'ll be working for me while you learn about Wild Leather armor. Because wildvines are both potent and chaotic, it yields a random but strong benefit to the already strong armor you will be making. This knowledge, however, was not easy for me to come by.$B$BThe initial cost to begin this process is ten pieces of thick leather.$B$BOnce that is done, we\'ll get to the work you need to do in order to obtain the patterns.', 0);
INSERT INTO `quest_request_items` VALUES (2848, 1, 0, 0, 0, 'Do you have the six thick armor kits and the wildvine I require?$B$BDon\'t think of making armor kits as monotonous work; the steady fashioning method you develop as you ply your trade on these kits helps develop your skills for the intricate work needed to make Wild Leather armor.$B$BSee - there\'s a real reason behind what you\'re making for me...', 0);
INSERT INTO `quest_request_items` VALUES (2849, 1, 0, 0, 0, 'Do you have the two Turtle Scale breastplates and gloves I ordered? Also, don\'t forget the wildvine!$B$BEven with the earliest patterns, we learn that the fundamentals of shape translate well into more difficult garments. Though different items, the shape of the Turtle Scale breastplates prepares you for the detailing needed to make a Wild Leather vest.$B$BAnd the gloves... well, they\'re just for my own benefit. Remember, you\'re working for me!', 0);
INSERT INTO `quest_request_items` VALUES (2850, 1, 0, 0, 0, 'I need those tunics and headbands made, and I also need that piece of wildvine before I will share with you the knowledge of Wild Leather helmets.$B$BHead gear is highly coveted amongst adventurers, whether it be a disarmingly simple headband or a full-covering helmet. The fundamentals of creating valued head gear remain constant, no matter what the cosmetic appearance of the gear is.', 0);
INSERT INTO `quest_request_items` VALUES (2851, 1, 0, 0, 0, 'The order on the pants, boots, and wildvines needs to be filled before you get the pattern, $N. Are you finished?$B$BFrom the earliest pair of boots we learn how to make, we start to understand that a quality boot needs to ride a razor\'s edge between comfort and function. With both, we are able to create items that allow the wearer to ignore fatigue that would cripple those wearing lower quality goods.', 0);
INSERT INTO `quest_request_items` VALUES (2852, 1, 0, 0, 0, 'Do you have the Turtle Scale bracers and helms ready? Don\'t forget the two wildvines I need!$B$BBy now, you\'re starting to realize the potential power that lies in Wild Leather armor. An armor that has no boundaries in application is nearly invaluable to a leatherworker. The limits are only in the quantities of resources to make the items - not the quality of the finished products!', 0);
INSERT INTO `quest_request_items` VALUES (2853, 1, 0, 0, 0, 'Greetings, $R... from your countenance I can tell you are a leatherworker as am I. Have you come to draw from my skills, or perhaps you have other business with me?', 0);
INSERT INTO `quest_request_items` VALUES (2854, 1, 0, 0, 0, 'We must be clear; you shall be apprenticed to me while you learn the art of Wild Leather armor. Because wildvines are both potent and chaotic, it yields a random but strong benefit to the already strong armor you will be making. This knowledge, however, was not easy for me to acquire.$b$bThe initial cost to begin this process is ten pieces of thick leather.$b$bOnce that is done, we\'ll get to the work you need to do in order to obtain the patterns.', 0);
INSERT INTO `quest_request_items` VALUES (2855, 1, 0, 0, 0, 'Do you have the six thick armor kits and the wildvine I require?$b$bThink of making armor kits as a lesson in steady and reliable crafting; the consistent fashioning method you develop as you ply your trade on these kits helps develop your skills for the intricate work needed to make Wild Leather armors.$b$bEvery lesson has a purpose, $N. It is important to embrace each one accordingly.', 0);
INSERT INTO `quest_request_items` VALUES (2856, 1, 0, 0, 0, 'Do you have the two Turtle Scale breastplates and gloves? Also, don\'t forget the wildvine!$b$bEven with the earliest patterns, we learn that the fundamentals of shape translate well into more difficult garments. Though different items, the shape of the Turtle Scale breastplates prepares you for the detailing needed to make a Wild Leather vest.$b$bAs you progress through your lessons, the skills I teach will become as art.', 0);
INSERT INTO `quest_request_items` VALUES (2857, 1, 0, 0, 0, 'I need those tunics and headbands made, and I also need that piece of wildvine before I will share with you the knowledge of Wild Leather helmets.$b$bHead gear is highly coveted amongst adventurers, whether it be a disarmingly simple headband or a full-covering helmet. The fundamentals of creating valued head gear remain constant, no matter what the cosmetic appearance of the gear is.', 0);
INSERT INTO `quest_request_items` VALUES (2858, 1, 0, 0, 0, 'The pants, boots, and wildvines need to be delivered to me before you learn the pattern, $N. Have you done as I asked?$b$bFrom the earliest pair of boots we learn how to make, we start to understand that a quality boot needs to ride a razor\'s edge between comfort and function. With both, we are able to create items that allow the wearer to ignore fatigue that would cripple those wearing lower quality goods.', 0);
INSERT INTO `quest_request_items` VALUES (2859, 1, 0, 0, 0, 'Do you have the Turtle Scale bracers and helms ready? Don\'t forget the two wildvines I require.$b$bBy now, you\'re starting to realize the potential power that lies in Wild Leather armor. An armor that has no boundaries in application is nearly invaluable to a leatherworker. The limits are only in the quantities of resources to make the items - not the quality of the finished products!', 0);
INSERT INTO `quest_request_items` VALUES (2860, 1, 0, 0, 0, 'Greetings, $r... from your countenance I can tell you are a leatherworker as am I. Have you come to draw from my skills, or perhaps you have other business with me?', 0);
INSERT INTO `quest_request_items` VALUES (2861, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2862, 1, 0, 0, 0, 'We drive them back, and yet they still attack! Someone or something must be driving them into a frenzy... oh, you have returned, eh $N? Do you have the manes I require for the bounty to be met?', 0);
INSERT INTO `quest_request_items` VALUES (2863, 1, 0, 0, 0, 'Time is running out, $N! If you\'re not here to report that you\'ve taken out the Alphas, then you\'re wasting time!', 0);
INSERT INTO `quest_request_items` VALUES (2864, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2865, 1, 0, 0, 0, 'Do you have the shells?  My cousin in Booty Bay is waiting for a load of them, and he\'s getting impatient!', 0);
INSERT INTO `quest_request_items` VALUES (2866, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2867, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2869, 1, 0, 0, 0, '$N, if you\'re here to verify the task given to you, then excellent - it is ten Hatecrest scales I seek.  If you are here for chit-chat, then I am currently unavailable for such trivialities.$B$BKnow this - we night elves are not warmongers.  Our race is dedicated to the preservation of peace and harmony.  This does not mean, however, that we will not proactively protect our own interests.  This is my duty to General Feathermoon, and to the stronghold.', 0);
INSERT INTO `quest_request_items` VALUES (2870, 1, 0, 0, 0, 'Bringing down Lord Shalzaru would certainly set their plans back weeks, if not months.  On top of that, the relic he uncovered is of definite interest to us.$B$BHave you performed the mission given to you, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2871, 1, 0, 0, 0, 'Yes, may I assist you?$B$BHold on, you\'re the $C that has been helping General Feathermoon and Latro out with the naga threat, yes?  I\'m Vestia, Latro\'s - erm, rather, Latronicus\' wife.  It is a pleasure to meet you!$B$BI\'m sorry, you\'re here on business, of course.  Do you have something for me - from him, perchance?', 0);
INSERT INTO `quest_request_items` VALUES (2872, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2873, 1, 0, 0, 0, 'Did you find my shipment of rum, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2874, 1, 0, 0, 0, 'Did Stoley cough up my booze?', 0);
INSERT INTO `quest_request_items` VALUES (2875, 1, 0, 0, 0, 'You look a little dazed.  Have you been reading our legal documents?', 0);
INSERT INTO `quest_request_items` VALUES (2876, 1, 0, 0, 0, 'You look out of breath.  You have something to tell me?', 0);
INSERT INTO `quest_request_items` VALUES (2877, 1, 5, 0, 0, 'Make no effort to negotiate the mission at hand, $r!  If the gods had wanted those oozes killed, they would have miracled it done by now, wouldn\'t they?!', 0);
INSERT INTO `quest_request_items` VALUES (2878, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant. A pungent, unhealthy odor emanates from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (2879, 1, 0, 0, 0, 'The Equinex Monolith stands silently among the ruins. What could it be holding?', 0);
INSERT INTO `quest_request_items` VALUES (2880, 5, 0, 0, 0, 'I want five of those tribal necklaces the trolls carry on them.  If you need it spelled out further, then killing one of them stands you a good chance of getting one!$B$BProve your worth to the Wildhammers!', 0);
INSERT INTO `quest_request_items` VALUES (2881, 1, 0, 0, 0, 'I want five of those tribal necklaces the trolls carry on them. If you need it spelled out further, then killing one of them stands you a good chance of getting one!$B$BProve your worth to the Wildhammers!', 0);
INSERT INTO `quest_request_items` VALUES (2882, 1, 0, 0, 0, 'This chest is locked!', 0);
INSERT INTO `quest_request_items` VALUES (2902, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2903, 1, 0, 0, 0, 'Welcome back $N - were you able to find some tangible evidence as to the plans of the gnolls?', 0);
INSERT INTO `quest_request_items` VALUES (2904, 1, 0, 0, 0, 'Eh? Kernobee is alive??', 0);
INSERT INTO `quest_request_items` VALUES (2922, 1, 0, 0, 0, 'Did you find Techbot?  Did you retrieve its memory core??', 0);
INSERT INTO `quest_request_items` VALUES (2923, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2924, 1, 0, 0, 0, 'Do you have the essential artificials?', 0);
INSERT INTO `quest_request_items` VALUES (2925, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2926, 1, 0, 0, 0, 'Can\'t you see we\'re trying to cure an entire species of gnomes here??! We need more of the green glow!', 0);
INSERT INTO `quest_request_items` VALUES (2927, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2928, 1, 0, 0, 0, 'If this were a race, you would have lost by now.', 0);
INSERT INTO `quest_request_items` VALUES (2929, 1, 0, 0, 0, 'Is the task complete? Did he beg for lenience? For mercy??', 0);
INSERT INTO `quest_request_items` VALUES (2930, 1, 0, 0, 0, 'Do you have the prismatic punch card??', 0);
INSERT INTO `quest_request_items` VALUES (2931, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2932, 1, 0, 0, 0, 'You have not completed my task, $N.', 0);
INSERT INTO `quest_request_items` VALUES (2933, 1, 0, 0, 0, 'Hello, gentle $C. The day has been long and not a single experiment successful...I hope you bring good news to me.', 0);
INSERT INTO `quest_request_items` VALUES (2934, 0, 0, 0, 0, 'Do you have the undamaged venom sac, $N?  I yearn to run experiments with its fresh venom, and have ordered a collection of small, terribly cute animals on which to test it!', 0);
INSERT INTO `quest_request_items` VALUES (2935, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2936, 1, 0, 0, 0, 'Do you know the spider god\'s name?', 0);
INSERT INTO `quest_request_items` VALUES (2937, 1, 0, 0, 0, 'Did you get the venom?', 0);
INSERT INTO `quest_request_items` VALUES (2938, 1, 0, 0, 0, 'Word was sent of your coming, $N. You have a parcel for me?', 0);
INSERT INTO `quest_request_items` VALUES (2939, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2940, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2941, 1, 0, 0, 0, 'A letter -- for me?', 0);
INSERT INTO `quest_request_items` VALUES (2942, 1, 0, 0, 0, 'I am glad you have returned, $N. I am eager to hear of your findings.', 0);
INSERT INTO `quest_request_items` VALUES (2943, 1, 0, 0, 0, 'Hello, $N. Have you been to Darnassus?', 0);
INSERT INTO `quest_request_items` VALUES (2944, 1, 0, 0, 0, 'So, you have finally returned, $N. And you\'ve brought the contraption that Curgle built for me -- perfect.', 0);
INSERT INTO `quest_request_items` VALUES (2945, 1, 0, 0, 0, 'The gnomish contraption before you bears a plaque calling it \"The Sparklematic 5200\".  The gist of the machine, from reading the instructions below the plaque, is to scrub away dirt that an item might have.  The machine has a coin slot, accepting three silver coins to start the process once the item is placed inside it.$B$BIt would seem as though the grime-encrusted ring you found earlier is just the thing to try in this machine!', 0);
INSERT INTO `quest_request_items` VALUES (2946, 1, 0, 0, 0, 'This familiar looking pedestal sticks out of the hot sand. Perhaps there is something to its presence here...', 0);
INSERT INTO `quest_request_items` VALUES (2947, 1, 0, 0, 0, 'Hey, easy there partner - I\'m a very important businessman!  I am sure that the courier is just simply late with the delivery of the rent... wait... you\'re not my landlord.$B$BWell, of course you aren\'t - silly me!  You\'ve come to me seeking the finest jeweler in all of Ironforge, one who does NOT make CURSED items!  Yes!$B$BUm... what do you need?', 0);
INSERT INTO `quest_request_items` VALUES (2948, 1, 0, 0, 0, 'Do you have the materials I need?  I wouldn\'t ask you for them if I wasn\'t down on my luck...', 0);
INSERT INTO `quest_request_items` VALUES (2949, 1, 0, 0, 0, 'You\'d think that we would find a way on our own to outdo those filthy little gnomes.  I would even wager that they stole that rig from us to begin with!  Bah, those greasy, grimy... erm, yes?  You need something?', 0);
INSERT INTO `quest_request_items` VALUES (2950, 1, 0, 0, 0, 'Do you have the materials I need?  I can\'t improve on this design without everything I asked for.', 0);
INSERT INTO `quest_request_items` VALUES (2951, 1, 0, 0, 0, 'It would seem that the device needs some sort of grime-encrusted object to clean and three silver coins to get the contraption working. So long as both are present, the Sparklematic 5200 should work...', 0);
INSERT INTO `quest_request_items` VALUES (2952, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2953, 1, 0, 0, 0, 'The Sparklematic 5200 is empty, awaiting a grime-encrusted object to clean and three silver coins to start!', 0);
INSERT INTO `quest_request_items` VALUES (2954, 1, 0, 0, 0, 'The purpose of the stone watcher must be learned before continuing on...', 0);
INSERT INTO `quest_request_items` VALUES (2962, 1, 0, 0, 0, 'Hrm, you\'re not glowing. That\'s a good sign.', 0);
INSERT INTO `quest_request_items` VALUES (2963, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2964, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2965, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2966, 1, 0, 0, 0, 'This familiar looking pedestal sticks out of the hot sand.  Perhaps there is something to its presence here...', 0);
INSERT INTO `quest_request_items` VALUES (2967, 1, 0, 0, 0, 'Welcome back $N.  Were you able to use the discs to your advantage, or was it for naught?', 0);
INSERT INTO `quest_request_items` VALUES (2968, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2969, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2970, 1, 0, 0, 0, 'Kindal needs time to prepare, but our kills already number in the dozens. The Grimtotem clan is more than aware of our presence in the area, and they seek us out like vipers.$B$BThey\'ll do everything in their power to take our heads from our bodies. You should be alert... they\'ll be coming for you too now that you\'ve interfered.', 0);
INSERT INTO `quest_request_items` VALUES (2972, 1, 0, 0, 0, 'Hello, child. It pleases us to have more powerful adventurers here in the temple. If you have the time, will you share a tale or two with the younger adventurers? I know many of them would benefit from your wisdom.$B$BI\'m sorry, look how rude of me. You\'ve come to the Temple seeking our aid, and I impose on you. Please, forgive me. Tell me what the servants of the Light can do for you.', 0);
INSERT INTO `quest_request_items` VALUES (2973, 1, 0, 0, 0, 'The sprite darters can be dangerous critters when provoked. Be careful when dealing with them, $C. And be even more careful of any night elves in the area. The pestering fools tend to hold up in the forests also.$b$bWhen you\'ve gotten enough of the wings, let me know, I\'ll be sure to reward you well!', 0);
INSERT INTO `quest_request_items` VALUES (2974, 1, 0, 0, 0, 'Take my words seriously, $C, the Grimtotem clan is evil. If you\'ve found their whereabouts, then it\'s up to you to return and strike the first blow against their clan... before they can come into our own lands and raze our own villages, or pilfer our lands.', 0);
INSERT INTO `quest_request_items` VALUES (2975, 1, 0, 0, 0, 'Move swiftly, $N. Or is the task I requested too difficult?', 0);
INSERT INTO `quest_request_items` VALUES (2976, 1, 0, 0, 0, 'Be quick, $C, I have much to complete today.', 0);
INSERT INTO `quest_request_items` VALUES (2977, 1, 0, 0, 0, 'Welcome back $N.  Were you able to use the discs to your advantage, or did it end up being a wild goose chase?', 0);
INSERT INTO `quest_request_items` VALUES (2978, 1, 0, 0, 0, 'What is this?', 0);
INSERT INTO `quest_request_items` VALUES (2979, 1, 0, 0, 0, 'We must discover more about why the Gordunni are here, $N.', 0);
INSERT INTO `quest_request_items` VALUES (2980, 1, 0, 0, 0, 'Have you found the ruins, $N?', 0);
INSERT INTO `quest_request_items` VALUES (2981, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2982, 1, 0, 0, 0, 'Be watchful around the Gordunni, $N. Their magic seems to wreak havoc on the very land they stand on.', 0);
INSERT INTO `quest_request_items` VALUES (2983, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2984, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2985, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2987, 1, 0, 0, 0, 'Get on up there and start digging!$b$bI\'ve got places to go and people to see -- time is money!', 0);
INSERT INTO `quest_request_items` VALUES (2988, 1, 0, 0, 0, 'Have you searched the cages, $N? We must find Sharpbeak!', 0);
INSERT INTO `quest_request_items` VALUES (2989, 1, 0, 0, 0, 'Hurry, $N!  If the Vilebranch trolls have Sharpbeak, then who knows what they might be doing with him!', 0);
INSERT INTO `quest_request_items` VALUES (2990, 1, 0, 0, 0, '$N, you come bearing a gift?', 0);
INSERT INTO `quest_request_items` VALUES (2991, 1, 0, 0, 0, 'Do you have Nekrum\'s Medallion, $N?  There are powers hidden within it that I am eager to discover.', 0);
INSERT INTO `quest_request_items` VALUES (2992, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2993, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2994, 1, 0, 0, 0, 'Save Sharpbeak!', 0);
INSERT INTO `quest_request_items` VALUES (2995, 1, 6, 0, 0, 'Keeping the Highvale elves isolated is the key. Have you found the lodge?', 0);
INSERT INTO `quest_request_items` VALUES (2996, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (2997, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2998, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (2999, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3000, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3001, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3002, 1, 0, 0, 0, 'What have you brought me, $R?', 0);
INSERT INTO `quest_request_items` VALUES (3022, 1, 0, 0, 0, 'Another shipment from Curgle, I assume?', 0);
INSERT INTO `quest_request_items` VALUES (3042, 1, 0, 0, 0, 'Did you bring me the temper, $N?', 0);
INSERT INTO `quest_request_items` VALUES (3062, 1, 0, 0, 0, 'The hate that Edana spreads across the land must be stopped.', 0);
INSERT INTO `quest_request_items` VALUES (3063, 1, 0, 0, 0, 'The wings of the Northspring harpies are black as the night; do not take your eyes off of them, lest they disappear into darkness.', 0);
INSERT INTO `quest_request_items` VALUES (3065, 2, 0, 0, 0, 'Another $R to bolster the ranks. Good enough for me.$b$bYou\'ll probably have a hard time hefting a good weapon like an axe, but a spear\'s just as good as anything else.$b$bWelcome to the Valley of Trials.', 0);
INSERT INTO `quest_request_items` VALUES (3082, 2, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3083, 2, 5, 0, 0, 'Welcome to the Valley of Trials, Rangrang. You wouldn\'t be here if you hadn\'t gotten my tablet, so I will get to the point.$B$BI am Rwag and I am responsible for training the rogues, thieves, and cutpurses here in the Valley. I\'m the one the Hand will turn to if you\'re not ready for what\'s to come. But don\'t worry, the Hand won\'t be controlling everything you do, but it would be wise to work with them if they have need of your talents.', 0);
INSERT INTO `quest_request_items` VALUES (3084, 2, 0, 0, 0, 'Ah, welcome, $N. I\'m pleased you have arrived. My days have become long and even busy what with so many students to teach, but the coming of one of your ilk brings me a great sense of accomplishment--I remember the days when I was taught by one of your shamans.', 0);
INSERT INTO `quest_request_items` VALUES (3085, 2, 0, 0, 0, 'So ya made it... good good! Da spirits tol\' me you be comin\' to see Ken\'jai soon enough. Let me be one o\' da first to welcome ya to da Valley of Trials. Dis place not be your home fer long, but while it is, why dontcha make da best o\' it. ', 0);
INSERT INTO `quest_request_items` VALUES (3086, 2, 0, 0, 0, 'Ya look to please Mai\'ah already, $n. Dat be good. You give Mai\'ah respect, and Mai\'ah maybe give you respect back. But enough o\' dat, you be here to learn \'bout magic, not hear Mai\'ah talk. There be only one ting Mai\'ah can no teach you \'bout magic, $n, and dat\'s how to stop da corruptin\'. ', 0);
INSERT INTO `quest_request_items` VALUES (3087, 2, 0, 0, 0, 'Many come to me with the desire to be a $c, but few follow through.  It\'s easy to underestimate our job.  Being a $c is far more than just aiming and shooting. ', 0);
INSERT INTO `quest_request_items` VALUES (3088, 2, 5, 0, 0, 'Shhh, not so loud. I don\'t trust Nartok over there. Anyone that has to hide deeper in a cave than I do shouldn\'t be trifled with.$b$bI trust you had no problem finding your way around?', 0);
INSERT INTO `quest_request_items` VALUES (3089, 2, 0, 0, 0, 'So, you\'ve arrived. I was beginning to wonder when you would show yourself. I sent the parchment some time ago--I wasn\'t sure if it had arrived.$B$BBut enough chatter... you\'re here because you have been chosen, chosen to lead the spiritual lives of our people.', 0);
INSERT INTO `quest_request_items` VALUES (3090, 1, 0, 0, 0, 'Finally, you\'ve arrived... and discretely also. Good. Our world is full of fools, $n. Even the mighty Thrall has greater flaws than most can see. He turns his back on the power needed to make this land ours completely! We\'re not the same people who were manipulated and used by creatures from the Nether. We are our own people. We are proud... and we are strong. ', 0);
INSERT INTO `quest_request_items` VALUES (3091, 1, 0, 0, 0, 'Ah, at last, you\'ve arrived, $c. I did not lie in my note, $N. We are a special breed also, not unlike the druids or shamans of our tribe. You are just as important. We are the ones called upon to defend our borders, to hunt the centaur, and to go to war.', 0);
INSERT INTO `quest_request_items` VALUES (3092, 1, 0, 0, 0, 'Welcome to Camp Narache, $n. I hear good things about you. Your bloodline is strong, and many of the elders consider you skilled already. But that we will test. The plains of Mulgore will be your home for sometime--you should do your best to learn it very well. One day you will travel to unfamiliar lands to master greater skills. You must be ready. ', 0);
INSERT INTO `quest_request_items` VALUES (3093, 1, 0, 0, 0, 'As quickly as water falls from the sky, here you are before me. I am pleased by your haste. It means you realize both the importance of our meeting and you being here. I am no leader, but I do understand the elements, and I can speak to the spirits of our people. I will teach you to do the same.', 0);
INSERT INTO `quest_request_items` VALUES (3094, 1, 0, 0, 0, 'You have arrived. This is good. Our ancestors\' spirits have become restless throughout Mulgore and beyond, but I cannot tell why. It will forever be your duty to learn to listen to nature\'s spirits, and act as their avatar. Be mindful of that.', 0);
INSERT INTO `quest_request_items` VALUES (3095, 1, 0, 0, 0, 'Ah, so you\'ve arrived. Good. I overheard that a few others were able to escape \"death\" and were heading into town. Perhaps that resilence will pay off in the future also.$B$BYou may thank Sylvanas for your freedom... freedom of mind and body. Though you still remain tortured by the plague and its effects, you are now free to come and go as you see fit.', 0);
INSERT INTO `quest_request_items` VALUES (3096, 1, 0, 0, 0, 'So you\'ve made it? Good, we\'ll have need of more rogues as time goes on. The Shadowstalkers will probably wind up finding you when they think the time\'s right, so don\'t go and slip up or do anything you might regret. They need talented agents... not pickpockets and fools.', 0);
INSERT INTO `quest_request_items` VALUES (3097, 1, 0, 0, 0, 'Ah, so between fire, plague, rioting, and much worse, one more of the \"faithful\" comes to my door. Well, let me bid you welcome, $c. And allow me a moment to explain a thing or two before you decide it\'s time for you to seek whatever drives you forward: the Holy Light no longer concerns you, the spirits of your forefathers are fairy tales, and creatures from the Nether don\'t want you. Do you understand me so far? ', 0);
INSERT INTO `quest_request_items` VALUES (3098, 1, 0, 0, 0, 'I knew you would come to me, $n. Not because you do not have the will to follow your own path, but because we are kindred spirits. We both have felt pain. We have both suffered. And now we want the power to take back what we know is ours: this land, our lives, our destinies. But there is much for you to learn still. ', 0);
INSERT INTO `quest_request_items` VALUES (3099, 1, 0, 0, 0, 'I bid you welcome, brother. I knew you would come. It was only a matter of time. What I said interested you, didn\'t it? I hit a chord... something inside you knew what I claimed was truth. Good. Know this though: I am no traitor to Sylvanas. If anything, she would appreciate my claims considering it was her own beliefs that has put the Forsaken in the position it is now. ', 0);
INSERT INTO `quest_request_items` VALUES (3100, 2, 0, 0, 0, 'Ah, you got my letter, $N... good.$B$BThere\'s been an influx of warriors in Elwynn recently - which is good for Stormwind, but bad for the kobolds and Defias in the area.', 0);
INSERT INTO `quest_request_items` VALUES (3101, 4, 0, 0, 0, 'Finally! We meet face to face, brother to brother. I welcome you to Northshire. This will be your home for a short time while you learn the ins and outs of how things are done, but know that Stormwind is not far off, and sooner or later, your path will take you there. But until then, be patient... Knight of the Silver Hand. ', 0);
INSERT INTO `quest_request_items` VALUES (3102, 2, 0, 0, 0, 'You made it here in one piece, and it doesn\'t look like too many people saw you. Good enough for me. I don\'t like to have much attention drawn to me back here... nice and quiet. I\'m sure you can understand.$b$bHave any trouble yet? I\'m glad to hear not. That\'ll change soon enough.', 0);
INSERT INTO `quest_request_items` VALUES (3103, 2, 0, 0, 0, 'Ah, at last you\'ve come. I knew you would find your way to me. The Holy Light shines upon you, and the path you\'ve chosen. These times are harsh--the Burning Legion still has a presence upon Azeroth, the entirety of Kalimdor seeks new ways to defend itself from its own tribulations, and it is up to you to aid as many as you can. ', 0);
INSERT INTO `quest_request_items` VALUES (3104, 6, 0, 0, 0, 'Hello, $n. I am Khelden. Is there something I can do for you? ', 0);
INSERT INTO `quest_request_items` VALUES (3105, 1, 0, 0, 0, 'Ah, so you\'ve arrived, and not a moment too soon, $n. Some of the guards were over here a moment ago and were giving me curious looks... pathetic mundanes. ', 0);
INSERT INTO `quest_request_items` VALUES (3106, 6, 0, 0, 0, 'Blast it\'s cold today, aint it? It\'s like the snow never goes away, $N.$b$bYou\'ve probably noticed already, but there are gnomes now living in our city. That\'s because they went and got themselves blown out of their own home. Don\'t go spreadin\' this \'round, but I can hardly blame them--I think I woulda resorted to explosives too if Ironforge were infested with Dark Irons or the like.', 0);
INSERT INTO `quest_request_items` VALUES (3107, 1, 0, 0, 0, 'So, you\'ve made it! And not a second too soon. There\'s much to be done in Coldridge Valley and beyond. I\'m gonna need your help as much as you\'re gonna need mine! You\'re a Knight of the Silver Hand now, be ready to play the part. ', 0);
INSERT INTO `quest_request_items` VALUES (3108, 4, 0, 0, 0, 'Ya made it! Good to hear! Betcha didn\'t have to track me to find the place either. Haha! ', 0);
INSERT INTO `quest_request_items` VALUES (3109, 2, 0, 0, 0, 'You made it! Great!$B$BWe\'ve got an influx of activity lately, so I\'m glad to count another of the Ironforge clan among our numbers. Too many of us are lookin\' to the arcane, and divine for my own tastes. Nothin\' against them and their beliefs, but there\'s nothing like a cold blade in your hand and a shadow to keep you from the light, know what I mean?', 0);
INSERT INTO `quest_request_items` VALUES (3110, 6, 0, 0, 0, 'Ach! Ya made it, $n! Wonderful! I was gonna say, I was about to lose faith that ye\'d arrive at all... get it, lose faith? It\'s a joke, lad... aww, nevermind. Ya didn\'t come here for me bad jokes anyway. ', 0);
INSERT INTO `quest_request_items` VALUES (3111, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (3112, 2, 0, 0, 0, 'Ah, well, another memorandum from a $R on a mission... isn\'t this quaint.$B$BNo, no, I ain\'t teasin\' ya, little one. Gotta respect your tenacity, that much is fer sure. I\'d be just as peeved if Ironforge was taken by Dark Iron dwarves, so don\'t be thinkin\' I don\'t feel for your plight...', 0);
INSERT INTO `quest_request_items` VALUES (3113, 1, 0, 0, 0, 'Glad to see you got my note and came over. Sorry about pretendin\' it was a memorandum from your higher-ups... no offense intended. I just knew the two of us, along with others of our kind, gotta stick together.$B$BNot many think it\'s the best thing in the world to have your kind and my kind holed up in the same city, but I think we can work things out just fine. What do you think?', 0);
INSERT INTO `quest_request_items` VALUES (3114, 11, 0, 0, 0, 'Yeah, what\'s that, $r? Speak up, if you don\'t mind. I don\'t hear so good after a few ales. ', 0);
INSERT INTO `quest_request_items` VALUES (3115, 1, 0, 0, 0, 'Wonderful! You obviously got my rune. Ignore the fools around you, $n. The Holy Light?! The sword and shield?! These aren\'t paths for ones as open minded as us. ', 0);
INSERT INTO `quest_request_items` VALUES (3116, 1, 0, 0, 0, 'You made it. I\'m so glad.$b$bMuch has happened over the last few years, $N: the creation of Teldrassil, the corruption of many of the forest creatures here and abroad, discovery of lands we thought lost to us like Feralas... so much, in so little time. But those are just some of the reasons we are here, the most important being to protect our kind from further evil.', 0);
INSERT INTO `quest_request_items` VALUES (3117, 2, 0, 0, 0, 'You\'ve arrived, and none too soon, $n. Welcome to Shadowglen. I trust my sigil found you in good spirits and health? As I said previously, I am here to train you as a $c; to tame beasts to aid you in battle; to use a bow with unerring accuracy; to respect the lands which we call home and also the lands beyond. ', 0);
INSERT INTO `quest_request_items` VALUES (3118, 2, 1, 0, 0, 'Hello, Ferlis. I\'m glad you found me. I was thinking that perhaps you got lost on the way here.$b$bNothing really new has happened in Shadowglen since I sent you my sigil, but I\'ll leave all the information gathering to you. Speak to the rest of the people around Aldrassil if you\'d like.', 0);
INSERT INTO `quest_request_items` VALUES (3119, 1, 0, 0, 0, 'It pleases me to see you\'ve arrived so quickly, $n. Welcome. As you\'ve probably heard, all of Teldrassil is stirring with the comings and goings of travelers. Even members of the Alliance have been allowed access onto Teldrassil\'s boughs in order to meet with other Kaldorei who prepare for the adventures ahead. ', 0);
INSERT INTO `quest_request_items` VALUES (3120, 1, 0, 0, 0, 'Ah, young $c. I see you\'re eager to continue your studies. Good. I wonder, have you spent much time in the Emerald Dream already? Perhaps you\'re not prepared for that yet... In time, I\'m sure. But until then, we should discuss other matters. ', 0);
INSERT INTO `quest_request_items` VALUES (3121, 1, 0, 0, 0, 'Yes?', 0);
INSERT INTO `quest_request_items` VALUES (3122, 1, 0, 0, 0, 'Have you spoken to Neeru?', 0);
INSERT INTO `quest_request_items` VALUES (3123, 1, 0, 0, 0, 'Were you able to capture the wildkin?$b$bIf you succeed, we will be ready to shrink and capture the muisek of creatures of Feralas.', 0);
INSERT INTO `quest_request_items` VALUES (3124, 1, 0, 0, 0, 'Were you able to capture the hippogryphs?', 0);
INSERT INTO `quest_request_items` VALUES (3125, 1, 0, 0, 0, 'Were you able to capture the muisek of the faerie dragons?', 0);
INSERT INTO `quest_request_items` VALUES (3126, 1, 0, 0, 0, 'Were you able to capture the wandering forest walkers?', 0);
INSERT INTO `quest_request_items` VALUES (3127, 1, 0, 0, 0, 'Were you able to capture the mountain giants?', 0);
INSERT INTO `quest_request_items` VALUES (3128, 1, 0, 0, 0, 'Were you able to collect the materials I need?', 0);
INSERT INTO `quest_request_items` VALUES (3129, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3130, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3141, 1, 0, 0, 0, 'Do not interrupt me, $r.', 0);
INSERT INTO `quest_request_items` VALUES (3161, 1, 0, 0, 0, 'Are you having any trouble?$B$BYou can find Gahz\'ridian just about anywhere in Tanaris, $N, so keep looking!', 0);
INSERT INTO `quest_request_items` VALUES (3181, 1, 0, 0, 0, 'No, I will not open the gate.', 0);
INSERT INTO `quest_request_items` VALUES (3182, 1, 0, 0, 0, 'Why hello there young lady. Would you like a tour of the museum?', 0);
INSERT INTO `quest_request_items` VALUES (3201, 1, 0, 0, 0, 'I don\'t believe it.', 0);
INSERT INTO `quest_request_items` VALUES (3221, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3261, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3281, 1, 0, 0, 0, 'Do you have the silver?', 0);
INSERT INTO `quest_request_items` VALUES (3301, 1, 0, 0, 0, 'I can smell the dust of the Barrens on you, $C. You have traveled far.', 0);
INSERT INTO `quest_request_items` VALUES (3321, 1, 0, 0, 0, 'Today we finalize our celebration of your commitment to the Order.', 0);
INSERT INTO `quest_request_items` VALUES (3341, 1, 0, 0, 0, 'This matter is of utmost importance, $N. We must stop any attempt by the Scourge to bolster their ranks.', 0);
INSERT INTO `quest_request_items` VALUES (3361, 0, 0, 0, 0, 'Once I get my tools, I\'m outta here. ', 0);
INSERT INTO `quest_request_items` VALUES (3362, 1, 0, 0, 0, 'I\'d like to take a closer look at that cactus in the valley... So leave some of it in one piece, will ya?', 0);
INSERT INTO `quest_request_items` VALUES (3363, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant. A pungent, unhealthy odor emanates from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (3364, 6, 4, 0, 0, 'Aye, I\'m Durnan Furcutter.  You have something for me? ', 0);
INSERT INTO `quest_request_items` VALUES (3365, 1, 7, 0, 0, 'I trust the scalding mornbrew got to Durnan on time!  Did you remember to bring me back my mug? ', 0);
INSERT INTO `quest_request_items` VALUES (3366, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (3367, 1, 0, 0, 0, 'I\'m not going to make it...', 0);
INSERT INTO `quest_request_items` VALUES (3368, 1, 0, 0, 0, '<Thorius sobs.>', 0);
INSERT INTO `quest_request_items` VALUES (3369, 1, 0, 0, 0, 'May I help you with something?', 0);
INSERT INTO `quest_request_items` VALUES (3370, 1, 0, 0, 0, 'May I help you with something?', 0);
INSERT INTO `quest_request_items` VALUES (3371, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3372, 1, 0, 0, 0, 'The altar is empty.', 0);
INSERT INTO `quest_request_items` VALUES (3373, 1, 0, 0, 0, 'As you near the essence font that Eranikus told you of, his voice once again touches your mind.$B$B\"Yes mortal, this essence font will redeem what untainted element of my psyche remains imbued in this gem.  Place the gem inside the font, and let the magic of the Green Dragonflight cleanse the corruption and taint from my being.  Only then will I find true release, and only then will the Dragonflight be able to reassert their stewardship over the Atal\'ai.\"', 0);
INSERT INTO `quest_request_items` VALUES (3374, 1, 0, 0, 0, 'Here we are $N, at yet another crossroads. The time has come to make another choice. What choice do you make, mortal?', 0);
INSERT INTO `quest_request_items` VALUES (3375, 1, 0, 0, 0, 'To make another phial I need a mana potion, a piece of coal, and some sweet nectar.$B$BThat, and a whole lotta patience apparently.', 0);
INSERT INTO `quest_request_items` VALUES (3376, 1, 0, 0, 0, 'Sharptusk will trouble us no more once you have brought me proof of his death.  It is his head that I seek, $N.$B$BWe tauren live for the hunt, and there is no greater hunt than against one that is cunning enough to perhaps hunt us back.  If you are successful in this task, young one, you will start to learn what I mean.', 0);
INSERT INTO `quest_request_items` VALUES (3377, 1, 0, 0, 0, 'Allow me to finish my story.', 0);
INSERT INTO `quest_request_items` VALUES (3378, 1, 0, 0, 0, 'What brings you to the Temple of the Moon, $N?', 0);
INSERT INTO `quest_request_items` VALUES (3379, 1, 0, 0, 0, 'What information do you have?', 0);
INSERT INTO `quest_request_items` VALUES (3380, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3381, 1, 0, 0, 0, 'I remain here at my master\'s bidding. I\'ve been given leave to ask any price I wish for transportation up to his tower. For now, I ask for only the two feathers from each traveler so I can continue to make my signature arrows.$b$bIf you\'re not careful, I\'ll up the price. How does half a dozen gold sound?$b$bYeah, I thought as much. Just mind yourself and I\'ll keep the price where it is.', 0);
INSERT INTO `quest_request_items` VALUES (3382, 1, 0, 0, 0, 'Have you met with Andron yet? He rarely leaves Undercity, so I don\'t think it\'d be too hard to find him.', 0);
INSERT INTO `quest_request_items` VALUES (3385, 1, 0, 0, 0, 'The Trade Master still lives?', 0);
INSERT INTO `quest_request_items` VALUES (3402, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3421, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3441, 1, 0, 0, 0, 'Allow me to finish mo... $r.', 0);
INSERT INTO `quest_request_items` VALUES (3442, 1, 0, 0, 0, 'Have you collected the materials?', 0);
INSERT INTO `quest_request_items` VALUES (3443, 1, 0, 0, 0, 'Eight, $N. I need eight!	', 0);
INSERT INTO `quest_request_items` VALUES (3444, 1, 0, 0, 0, 'Ratchet is not far from here, $N. The journey shouldn\'t take long.', 0);
INSERT INTO `quest_request_items` VALUES (3445, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3446, 1, 0, 0, 0, 'Upon examining the statue, you notice a depression in its side, just the size of the token that Marvon gave you...', 0);
INSERT INTO `quest_request_items` VALUES (3447, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3448, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3449, 4, 0, 0, 0, 'Well, well, well, glad to see you made it out here, $N. Did you get the rubbings for Tymor?$B$BAs dangerous as this place is, there hasn\'t been too much action along the coast. That might be on account of the naga swimming underwater, but that\'s not my problem... I patrol the skies.', 0);
INSERT INTO `quest_request_items` VALUES (3450, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3451, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3452, 0, 0, 0, 0, 'Without a suitable source of arcane energy, the torch of retribution cannot be completed.', 0);
INSERT INTO `quest_request_items` VALUES (3453, 1, 0, 0, 0, 'Do not interrupt the channeling process.', 0);
INSERT INTO `quest_request_items` VALUES (3454, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3461, 6, 0, 0, 0, 'You\'re back! Excellent. Do you have my drawing kit also?', 0);
INSERT INTO `quest_request_items` VALUES (3462, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3463, 1, 0, 0, 0, 'Are you lost, $N?', 0);
INSERT INTO `quest_request_items` VALUES (3481, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3482, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3483, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (3501, 1, 0, 0, 0, 'Have you had any luck in your exploration?', 0);
INSERT INTO `quest_request_items` VALUES (3502, 1, 0, 0, 0, 'Well? Draenethyst? Remember?$B$B<Kum\'isha clenches his fist and knocks on your head.>$B$BIs anybody home?', 0);
INSERT INTO `quest_request_items` VALUES (3503, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3504, 1, 0, 0, 0, 'Ah, Belgrom wizened up and finally sent someone not in his ranks to aid us, did he?$b$bThis camp used to be a dozen warriors strong, $N, but now they\'re all dead. That $C, Rimtori, has slain them all. She played Belgrom like a lute... seduced him even. It\'s none of my business, but between you and I, she is quite the temptress. That\'s probably why I\'m still out here helping Belgrom--I probably would have done the same thing.', 0);
INSERT INTO `quest_request_items` VALUES (3505, 1, 0, 0, 0, 'The title of the book is emblazoned on the black leather cover in gold leaf--Kaldorei Tome of Summoning. As you open the pages you can see that the book is very old but in superb condition.$b$bYou assume the text is of some ancient language... perhaps Kaldorei?$b$bYour instincts tell you that you should return here once you\'ve finished doling out retribution on the blood elves for their betrayal.', 0);
INSERT INTO `quest_request_items` VALUES (3506, 1, 0, 0, 0, 'How goes your slaughter of the blood elf traitors, $N? Have you made any progress?$b$bI hope you are the one strong enough to bring that dog to her knees! She deserves nothing but a painful death for all that she has done!', 0);
INSERT INTO `quest_request_items` VALUES (3507, 1, 0, 0, 0, 'I remember you, $C. I asked you to go to Azshara to destroy that wench that betrayed me! That seems like many moons ago. Don\'t tell me that Ag\'tor and the others are dead also!', 0);
INSERT INTO `quest_request_items` VALUES (3508, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3509, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3510, 1, 0, 0, 0, '<Lord Arkkoroc bends down to inspect you.>$b$bWhere are they?', 0);
INSERT INTO `quest_request_items` VALUES (3511, 1, 0, 0, 0, 'You return! Astounding, $R. Did you discover the true name?$b$b', 0);
INSERT INTO `quest_request_items` VALUES (3512, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3513, 1, 0, 0, 0, 'Whaddya got?', 0);
INSERT INTO `quest_request_items` VALUES (3514, 1, 0, 0, 0, 'We cannot allow the Alliance on our land, $N. Make this known.', 0);
INSERT INTO `quest_request_items` VALUES (3517, 1, 0, 0, 0, 'The tablets I\'m having you gather should bring in a pretty copper or two to the right parties. I\'ll tell you who we need to deliver them to after you\'ve found them. But I\'m no fool... you\'ll get your share after I have proof that they\'ve been delivered.$b$bSo get to it--we don\'t have all day. I might have to find someone else to help me.', 0);
INSERT INTO `quest_request_items` VALUES (3518, 1, 0, 0, 0, 'Yes, $N. What can I do for you? I have many matters I must attend to, so please, be quick.', 0);
INSERT INTO `quest_request_items` VALUES (3520, 0, 0, 0, 0, 'Have you collected the essence of the screecher spirits, $N?', 0);
INSERT INTO `quest_request_items` VALUES (3521, 0, 2, 0, 0, 'Please, collect the ingredients, $n. Iverron needs our help. ', 0);
INSERT INTO `quest_request_items` VALUES (3522, 0, 0, 0, 0, 'Oh... $n, I\'m so glad you have returned. ', 0);
INSERT INTO `quest_request_items` VALUES (3523, 1, 0, 0, 0, 'I\'m not one for politics; I care not if your affiliations are for either Horde or Alliance.  I am more interested in squelching direct and dire threats to all the races... and we have quite a large one in here.$B$BIf you\'re willing to be a true hero for all people, then hand me the oathstone I have given you as a sign of commitment.  I\'m... not from around these parts; an oathstone is important to people of my kind as a bond of agreement.', 0);
INSERT INTO `quest_request_items` VALUES (3524, 1, 0, 0, 0, 'It is only recently that these creatures started landing on the coast of Darkshore in such alarming numbers. I can\'t help but think that this is an ill omen of some sort. Recovering a sample of that creature\'s bones to the south would help us in Darnassus assess this situation!', 0);
INSERT INTO `quest_request_items` VALUES (3525, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3526, 1, 0, 0, 0, 'I can smell fresh recruits much like I can an excellent blasting powder - from a mile away. Have you come seeking to learn about the mastery of the explosion?', 0);
INSERT INTO `quest_request_items` VALUES (3527, 1, 0, 0, 0, 'Do you have the tablets of the Prophecy of Mosh\'aru, $N?$b$bWhen I gain the tablets, I will study them, and learn how to contain the essence of Hakkar!', 0);
INSERT INTO `quest_request_items` VALUES (3528, 1, 0, 0, 0, 'Have you defeated the avatar of Hakkar, $N? Has his essence yet empowered the egg I gave you?', 0);
INSERT INTO `quest_request_items` VALUES (3541, 1, 0, 0, 0, 'Yes, what you be needin\', $gdad:mon? I got many tings to be takin\' care of today, and you not be on me agenda as one of them. Pester me, and I make sure that changes.', 0);
INSERT INTO `quest_request_items` VALUES (3542, 1, 0, 0, 0, 'Well... ... isn\'t this a surprise? An adventurererere... !$b$bWhat c\'n I do for you... ?', 0);
INSERT INTO `quest_request_items` VALUES (3561, 1, 0, 0, 0, 'What can help you with, $N?', 0);
INSERT INTO `quest_request_items` VALUES (3562, 1, 0, 0, 0, 'Well, what did Magatha say? The old crone... I bet she was less than polite.', 0);
INSERT INTO `quest_request_items` VALUES (3563, 1, 0, 0, 0, 'Have you spoken to Jes\'rimon yet?$B$BHe\'s a boar among trolls, but his information is usually accurate and his jobs well paying.$B$BIf you can stand his attitude then you stand to make some good coin from his business endeavors.', 0);
INSERT INTO `quest_request_items` VALUES (3564, 1, 0, 0, 0, 'Have you met with Andron yet? He rarely leaves Undercity, so I don\'t think it\'d be too hard to find him.', 0);
INSERT INTO `quest_request_items` VALUES (3565, 1, 0, 0, 0, 'Well, what did Xylem have to say? He didn\'t do anything to you, did he? Cast a spell on you? Con you into doing work for him?', 0);
INSERT INTO `quest_request_items` VALUES (3566, 1, 0, 0, 0, 'I don\'t believe you! Show me proof!', 0);
INSERT INTO `quest_request_items` VALUES (3567, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3568, 6, 0, 0, 0, 'You know where this is leading, don\'t you, $N? There\'s no way she can survive... look at her. The best thing for her now is to aid us in finding a cure for the plague. This water she drank might have a clue that helps us figure out how. She\'s going to die anyway--she might as well die doing something noble for our people before she does. Don\'t you agree?', 0);
INSERT INTO `quest_request_items` VALUES (3569, 1, 0, 0, 0, 'I\'ve come to Undercity because I heard their alchemists have been studying long and hard on how to find a cure for their own illness. It was suggested that perhaps they could help me too.$B$BAlthough this place makes me feel far from welcome, I had no choice--the sickness that found me is tearing me up inside and I needed their help immediately.', 0);
INSERT INTO `quest_request_items` VALUES (3570, 1, 0, 0, 0, 'You know where this is leading, don\'t you, $N? There\'s no way she can survive... look at her. The best thing for her now is to aid us in finding a cure for the plague. This water she drank might have a clue that helps us figure out how. She\'s going to die anyway--she might as well die doing something noble for our people before she does. Don\'t you agree?', 0);
INSERT INTO `quest_request_items` VALUES (3601, 14, 0, 0, 0, 'Those stinkin\' Blood elves. I tell ya, if I was as strong as you are, I\'d go down there and teach them a thing or two myself! But I\'ll have to settle with payin\' you to take care of \'em for me.', 0);
INSERT INTO `quest_request_items` VALUES (3602, 1, 0, 0, 0, 'Evil does not sleep, fool. You will have time for rest when you are finally dead. Now, bring me those crystals.', 0);
INSERT INTO `quest_request_items` VALUES (3621, 1, 0, 0, 0, 'Loramus, eh? It has been many years since I have heard that name.', 0);
INSERT INTO `quest_request_items` VALUES (3625, 1, 0, 0, 0, 'To interrupt the forging process could result in an imperfect weapon. Be patient, $n.', 0);
INSERT INTO `quest_request_items` VALUES (3626, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3627, 1, 0, 0, 0, 'The three shall form the one, the one shall light the way.', 0);
INSERT INTO `quest_request_items` VALUES (3628, 1, 0, 0, 0, 'There is nothing left to fear.$b$b', 0);
INSERT INTO `quest_request_items` VALUES (3629, 1, 0, 0, 0, 'I can smell fresh recruits much like I can an excellent blasting powder - from a mile away. Have you come seeking to learn about the mastery of the explosion?', 0);
INSERT INTO `quest_request_items` VALUES (3630, 1, 0, 0, 0, 'Yes, yes, what needs of yours might I address today? Clearly, I have the time to do such since all I do is stand here while our beloved city lies in a cloud of irradiated death.', 0);
INSERT INTO `quest_request_items` VALUES (3631, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3632, 1, 0, 0, 0, 'Yes, yes, what needs of yours might I address today? Clearly, I have the time to do such since all I do is stand here while our beloved city lies in a cloud of irradiated death.', 0);
INSERT INTO `quest_request_items` VALUES (3633, 1, 0, 0, 0, 'I can smell fresh recruits much like I can an excellent blasting powder - from a mile away. Have you come seeking to learn about the mastery of the explosion?', 0);
INSERT INTO `quest_request_items` VALUES (3634, 1, 0, 0, 0, 'Yes, yes, what needs of yours might I address today? Clearly, I have the time to do such since all I do is stand here while our beloved city lies in a cloud of irradiated death.', 0);
INSERT INTO `quest_request_items` VALUES (3635, 1, 0, 0, 0, 'Hello there! If you\'ve come about a homing robot that may have smashed through a wall of your domicile, then I will refer you to my barrister in advance. Otherwise, what can I do for you today?', 0);
INSERT INTO `quest_request_items` VALUES (3636, 1, 0, 0, 0, 'Amnennar must be eradicated. Go, swiftly.', 0);
INSERT INTO `quest_request_items` VALUES (3637, 1, 0, 0, 0, 'Hello there! If you\'ve come about a homing robot that may have smashed through a wall of your domicile, then I will refer you to my barrister in advance. Otherwise, what can I do for you today?', 0);
INSERT INTO `quest_request_items` VALUES (3638, 1, 0, 0, 0, 'If you\'ve signed the document and are ready to hand it to me, then that is that. You\'ve been told that this is a one way trip. If you\'re ready, then hop on board!', 0);
INSERT INTO `quest_request_items` VALUES (3639, 1, 0, 0, 0, 'Once I receive your crafted engineering items for my review, I will hand you a genuine Goblin Engineer Membership Card! So long as the card is valid, you will have unlimited access to any goblin engineer trainer anywhere in the world.', 0);
INSERT INTO `quest_request_items` VALUES (3640, 1, 0, 0, 0, 'If you\'ve signed the document and are ready to hand it to me, then that is that.$B$BThe secrets I will share with you are of such a magnitude that the signing of the Pledge of Secrecy is absolutely critical. I signed one, as did my brother and sister gnome engineers. You will be joining quite the auspicious fold, Engineer $N!', 0);
INSERT INTO `quest_request_items` VALUES (3641, 1, 0, 0, 0, 'Once I receive your crafted engineering items for my review, I will hand you a genuine Gnome Engineer Membership Card! So long as the card is valid, you will have unlimited access to any gnome engineer trainer anywhere in the world.', 0);
INSERT INTO `quest_request_items` VALUES (3642, 1, 0, 0, 0, 'If you\'ve signed the document and are ready to hand it to me, then that is that.$B$BWhile I may vehemently disagree with Gnomeregan - especially that fool Tinkmaster Overspark - politically, the Pledge of Secrecy transcends everything else! You must agree to commit a single path and stay true to that path throughout your life.', 0);
INSERT INTO `quest_request_items` VALUES (3643, 1, 0, 0, 0, 'Once I receive your crafted engineering items for my review, I will hand you a genuine Gnome Engineer Membership Card! So long as the card is valid, you will have unlimited access to any gnome engineer trainer anywhere in the world.', 0);
INSERT INTO `quest_request_items` VALUES (3644, 1, 0, 0, 0, 'In order to renew your membership card, you will need to pay the renewal fee of two gold pieces.', 0);
INSERT INTO `quest_request_items` VALUES (3645, 1, 0, 0, 0, 'In order to renew your membership card, you will need to pay the renewal fee of two gold pieces.', 0);
INSERT INTO `quest_request_items` VALUES (3646, 1, 0, 0, 0, 'In order to renew your membership card, you will need to pay the renewal fee of two gold pieces.', 0);
INSERT INTO `quest_request_items` VALUES (3647, 1, 0, 0, 0, 'In order to renew your membership card, you will need to pay the renewal fee of two gold pieces.', 0);
INSERT INTO `quest_request_items` VALUES (3661, 0, 0, 0, 0, 'Try to avoid them if you can, $N. The Wildkin may misread your interest as an intent to do them harm...', 0);
INSERT INTO `quest_request_items` VALUES (3681, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3701, 1, 0, 0, 0, 'Do you bring new information?', 0);
INSERT INTO `quest_request_items` VALUES (3702, 1, 0, 0, 0, 'Allow me to finish telling you the story of Thaurissan.', 0);
INSERT INTO `quest_request_items` VALUES (3721, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3741, 1, 0, 0, 0, 'Hi. I miss my necklace. My daddy got it for me. Daddy says that there are monsters in the lake. Did you beat up any monsters?', 0);
INSERT INTO `quest_request_items` VALUES (3761, 1, 0, 0, 0, 'At ease, Private. If you\'re here to unload soil from Un\'Goro - outstanding then! Otherwise, disappear.', 0);
INSERT INTO `quest_request_items` VALUES (3762, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3763, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3764, 1, 0, 0, 0, 'Ah yes, the dirt. The Arch Druid wants twenty loads per adventurer, and twenty loads he shall get. Let those who conspire against us fall to the wayside!', 0);
INSERT INTO `quest_request_items` VALUES (3765, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3781, 1, 0, 0, 0, 'Peace and serenity be yours, friend. You are here on business from the Arch Druid himself, yes?', 0);
INSERT INTO `quest_request_items` VALUES (3782, 1, 0, 0, 0, 'Peace and serenity be yours, friend. You are here on business from the Arch Druid himself, yes?', 0);
INSERT INTO `quest_request_items` VALUES (3783, 1, 0, 0, 0, 'I\'ve got lots to get started on here. Please get me those furs as soon as you can!', 0);
INSERT INTO `quest_request_items` VALUES (3784, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3785, 1, 0, 0, 0, 'Yes $N, have you grown some morrowgrain for the Arch Druid\'s important research? The mysterious properties of Un\'Goro Crater become clearer with each passing day, thanks to the help you are giving us.', 0);
INSERT INTO `quest_request_items` VALUES (3786, 6, 0, 0, 0, 'Yes $N, have you grown some morrowgrain for the Arch Druid\'s important research?  The mysterious properties of Un\'Goro Crater become clearer with each passing day, thanks to the help you are giving us.', 0);
INSERT INTO `quest_request_items` VALUES (3787, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3788, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3789, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3790, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3791, 1, 0, 0, 0, 'I\'m looking for ten morrowgrain - that should be enough to at least get my research started.  I\'ll no doubt burn through a lot of those going down wrong paths, but such is the nature of research.', 0);
INSERT INTO `quest_request_items` VALUES (3792, 1, 0, 0, 0, 'Hello again, $N. My research is progressing fairly well, but if you have five more Morrowgrain I\'d be happy to take them off your hands. Well... happy is a figurative term in this case; the more I am around them, the more uncomfortable I feel. Still, my research demands I buckle down and get through this.', 0);
INSERT INTO `quest_request_items` VALUES (3801, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3802, 0, 0, 0, 0, 'The statue looms ominously above you.', 0);
INSERT INTO `quest_request_items` VALUES (3803, 1, 0, 0, 0, 'The Arch Druid is always looking for additional morrowgrain for the Cenarion Circle\'s continued research. We take them in increments of ten, and award you with a cache of goods you should find useful. When you have ten, let me know and I will reward you accordingly.', 0);
INSERT INTO `quest_request_items` VALUES (3804, 1, 0, 0, 0, 'The Arch Druid is always looking for more morrowgrain for the Cenarion Circle\'s research project on Un\'Goro Crater. We take them in increments of ten, and award you with a cache of goods you should find useful. When you have ten, let me know and I will award you accordingly.', 0);
INSERT INTO `quest_request_items` VALUES (3821, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3822, 1, 0, 0, 0, 'Did you find Sha\'ni? Is she ok?', 0);
INSERT INTO `quest_request_items` VALUES (3823, 1, 0, 0, 0, 'There is not nearly enough blood on your uniform, soldier!', 0);
INSERT INTO `quest_request_items` VALUES (3824, 1, 0, 0, 0, 'Oh glorious day! Have you returned with the head?', 0);
INSERT INTO `quest_request_items` VALUES (3825, 1, 0, 0, 0, 'So? Did you paint any pictures of the event?', 0);
INSERT INTO `quest_request_items` VALUES (3841, 1, 0, 0, 0, 'Why hello, $C.$B$BDon\'t let my location fool you, I\'m really not here for the races... as entertaining as they may be.$B$BI\'m actually here in Thousand Needles investigating all I can to find out how salvageable the land is. It has become my crusade of sorts to revitalize and replenish the area with new, fertile soil. Perhaps I\'ll find there\'s a water source nearby.$B$BTell me you haven\'t noticed how odd the transition between Feralas and Thousand Needles is. Strange magic was afoot when that happened.', 0);
INSERT INTO `quest_request_items` VALUES (3842, 1, 0, 0, 0, 'The longer I stay here, the more tempted I am to partake in these races, $N. Truly boggling...$B$BHave you found the elixirs yet? Once I can tell if the egg is going to be healthy or not, I\'ll return it to you to hold onto until it\'s prepared to hatch.$B$BLet me know.', 0);
INSERT INTO `quest_request_items` VALUES (3843, 1, 0, 0, 0, 'Greetin\'s, $N. How can I be of service to ya?', 0);
INSERT INTO `quest_request_items` VALUES (3844, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3845, 1, 0, 0, 0, 'Hi there. I\'ve seen you before... Haven\'t I?', 0);
INSERT INTO `quest_request_items` VALUES (3861, 1, 0, 0, 0, 'The chicken stares at you with dark, cold eyes. It waits for you hungrily.$B$B\"BACAAAW!$B$BCluck...cluck...cluck.\"', 0);
INSERT INTO `quest_request_items` VALUES (3881, 1, 0, 0, 0, 'If we\'re going to have any chance of getting out of here alive, we\'ll need our big crate of foodstuffs.  Also, getting at least some of our research equipment back would be a blessing in a sea of misery.', 0);
INSERT INTO `quest_request_items` VALUES (3882, 1, 0, 0, 0, 'Think whatever you want of me, but they\'re not going to care if the bones they get to research are from ones from ancient stegodons and diemetradons or the ones that almost devoured us wholesale when we were trying to set up our camps.  I\'ll just be happy if we get out of here alive...', 0);
INSERT INTO `quest_request_items` VALUES (3883, 6, 0, 0, 0, 'Do you have the sample of the Gorishi hive for me to study, $N?', 0);
INSERT INTO `quest_request_items` VALUES (3884, 3, 0, 0, 0, 'Hello there!  I and my companions are happy to see some living beings here other than overgrown savage beasts!  What brings you into the Un\'Goro Crater?', 0);
INSERT INTO `quest_request_items` VALUES (3901, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3902, 1, 0, 0, 0, 'Have you managed to scavenge up some useful items for us?  There is no shame in reusing that which has been tossed aside.  No one is going to give us any handouts - we Forsaken will fend for ourselves!', 0);
INSERT INTO `quest_request_items` VALUES (3903, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3904, 1, 0, 0, 0, 'Do you have my harvest, $N?', 0);
INSERT INTO `quest_request_items` VALUES (3905, 1, 0, 0, 0, 'You look to be in fine spirits! Come! Have a seat, and have a drink!', 0);
INSERT INTO `quest_request_items` VALUES (3906, 1, 0, 0, 0, 'The elements are still in disarray, $N.', 0);
INSERT INTO `quest_request_items` VALUES (3907, 1, 0, 0, 0, 'The flames will soon overtake these lands. Make haste, $N!$b$b', 0);
INSERT INTO `quest_request_items` VALUES (3908, 1, 0, 0, 0, 'My, my... So Linken did finally get around to sending me his sword.', 0);
INSERT INTO `quest_request_items` VALUES (3909, 1, 0, 0, 0, 'Back already?', 0);
INSERT INTO `quest_request_items` VALUES (3911, 1, 0, 0, 0, 'Show them to me!', 0);
INSERT INTO `quest_request_items` VALUES (3912, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (3913, 1, 0, 0, 0, 'This must be the gravestone that Gaeriyan mentioned...', 0);
INSERT INTO `quest_request_items` VALUES (3914, 1, 0, 0, 0, 'Oh! I remember you! You are... No, don\'t tell me!', 0);
INSERT INTO `quest_request_items` VALUES (3921, 1, 0, 0, 0, 'I\'m very busy with my work, $C. Unless you have something for me, it\'d be best if you moved along...', 0);
INSERT INTO `quest_request_items` VALUES (3922, 1, 0, 0, 0, 'Do you have the nugget slugs, $N? I\'ve been eyeing this Samophlange and I can\'t wait to tinker with it.', 0);
INSERT INTO `quest_request_items` VALUES (3923, 1, 0, 0, 0, 'Mind your head! I don\'t want it to get in the way of my work!', 0);
INSERT INTO `quest_request_items` VALUES (3924, 1, 0, 0, 0, 'Do you have the manual?', 0);
INSERT INTO `quest_request_items` VALUES (3941, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3942, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3961, 1, 0, 0, 0, 'Hi, again, $N!', 0);
INSERT INTO `quest_request_items` VALUES (3962, 1, 0, 0, 0, 'Blazerunner is almost invincible behind the aura he has created by using the Golden Flame. Only you have the power to remove it with the Silver Totem of Aquementas.', 0);
INSERT INTO `quest_request_items` VALUES (3981, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (3982, 1, 0, 0, 0, 'Defend yourself, fool!', 0);
INSERT INTO `quest_request_items` VALUES (4001, 1, 0, 0, 0, 'What brings you to these hallowed grounds?', 0);
INSERT INTO `quest_request_items` VALUES (4002, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4003, 1, 0, 0, 0, '<Princess Moira cowers in fear.>', 0);
INSERT INTO `quest_request_items` VALUES (4004, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4005, 1, 0, 0, 0, 'So you\'re back, eh? Hmm... Let me take a look at that, $N.', 0);
INSERT INTO `quest_request_items` VALUES (4021, 1, 0, 0, 0, 'Do you have the banner?', 0);
INSERT INTO `quest_request_items` VALUES (4022, 1, 0, 0, 0, '<Cyrus\'s eyes form two blazing spheres.>', 0);
INSERT INTO `quest_request_items` VALUES (4023, 1, 0, 0, 0, '<Cyrus\'s eyes form two blazing spheres.>', 0);
INSERT INTO `quest_request_items` VALUES (4024, 6, 0, 0, 0, 'Has the giant been felled?', 0);
INSERT INTO `quest_request_items` VALUES (4041, 1, 0, 0, 0, 'Bring me an Evoroot, and sure, I can make ya that Videre Elixir.$B$BI know all kinds of things about herbs and alchemy... Why, let me tell you the story about the time I transmuted gold from the cheese I was going to eat for lunch... hey... Where are you going?', 0);
INSERT INTO `quest_request_items` VALUES (4061, 1, 0, 0, 0, 'Do not take this task lightly, $N!', 0);
INSERT INTO `quest_request_items` VALUES (4062, 1, 0, 0, 0, 'What have you got there, $R?', 0);
INSERT INTO `quest_request_items` VALUES (4063, 1, 0, 0, 0, 'Was it him? Was he really alive?', 0);
INSERT INTO `quest_request_items` VALUES (4081, 1, 6, 0, 0, 'What is it, $r? Can\'t you see I have a platoon to command?$B$B', 0);
INSERT INTO `quest_request_items` VALUES (4082, 1, 0, 0, 0, 'You again? I have to hand it to you, $N, you are tenacious.', 0);
INSERT INTO `quest_request_items` VALUES (4083, 1, 0, 0, 0, 'The gems make no sound as they fall into depths of the chalice... ', 0);
INSERT INTO `quest_request_items` VALUES (4084, 1, 0, 0, 0, 'I can tell you more of the power of which you required to defeat Blazerunner, but first, you need to gather the things I require.', 0);
INSERT INTO `quest_request_items` VALUES (4101, 1, 0, 0, 0, 'I know Felwood suffers, $N - I suffer along with it!  I must remain steadfast in my conviction; were the knowledge I possess to fall into the wrong hands, it would spell disaster for all of Felwood.$B$BBring to me the blood amber drawn from the slain Warpwood elementals, and I will trust you enough to help me enact a means to fight the corruption.', 0);
INSERT INTO `quest_request_items` VALUES (4102, 1, 0, 0, 0, 'I know Felwood suffers, $N - I suffer along with it!  I must remain steadfast in my conviction; were the knowledge I possess to fall into the wrong hands, it would spell disaster for all of Felwood.$B$BBring to me the blood amber drawn from the slain Warpwood elementals, and I will trust you enough to help me enact a means to fight the corruption.', 0);
INSERT INTO `quest_request_items` VALUES (4103, 1, 0, 0, 0, 'Possessing a Cenarion Beacon allows one to sea a corrupted soul shard on those tainted beasts that are put down for the greater good. I grind shards into a usable reagent that goes into making Cenarion plant salve. We will use that salve to turn corrupted plants into healthy ones again.$b$bIn exchange for these shards, I will give you some Cenarion plant salves I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (4104, 1, 0, 0, 0, 'If you possess a Cenarion beacon while mining in Felwood, you will be able to see tainted vitriol that corrupts a vein of raw metal. I know how to purify that vitriol and turn it into a reagent that goes into making Cenarion plant salve. You will then use that salve on plants you find in the wild that need saving.$b$bIf you have collected any tainted vitriol, I\'ll give you some Cenarion plant salve I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (4105, 1, 0, 0, 0, 'A Cenarion beacon allows a seasoned herbalist to spot insidious fel creep - a malfeasant product of Felwood\'s corruption. My work here has taught me the knowledge of purifying fel creep into a cleansing reagent... used in what we now refer to as Cenarion plant salve.$b$bWhen you gather herbs in Felwood, you should encounter the fel creep so long as you have the beacon. In exchange for what you bring to me, I will give you pre-made Cenarion plant salve.', 0);
INSERT INTO `quest_request_items` VALUES (4106, 1, 0, 0, 0, 'A Cenarion beacon will allow a well-trained skinner to spot patches of tainted skin from bounty gathered in Felwood. I convert these seemingly useless patches into a thick paste that serves as a quickening agent for Cenarion plant salve. When you skin your kills here in Felwood, be sure to have a beacon on you!$b$bWhen you collect tainted patches, bring them to me and I will give you some Cenarion plant salves that I have already made.', 0);
INSERT INTO `quest_request_items` VALUES (4107, 1, 0, 0, 0, 'The power of a disenchanted magical item is felt by the essence it creates. I\'ve devised a way to turn raw essence used by enchanters into a suitable reagent for creating Cenarion plant salve. You don\'t need a Cenarion beacon for this; any suitably disenchanted item that yields lesser nether essences will work.$b$bI just need a single lesser nether essence; in exchange, I will give you Cenarion plant salves. The essence is extremely potent - a little definitely goes a long way!', 0);
INSERT INTO `quest_request_items` VALUES (4108, 1, 0, 0, 0, 'Possessing a Cenarion Beacon allows one to sea a corrupted soul shard on those tainted beasts that are put down for the greater good. I grind shards into a usable reagent that goes into making Cenarion plant salve. We will use that salve to turn corrupted plants into healthy ones again.$b$bIn exchange for these shards, I will give you some Cenarion plant salves I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (4109, 1, 0, 0, 0, 'If you possess a Cenarion beacon while mining in Felwood, you will be able to see tainted vitriol that corrupts a vein of raw metal. I know how to purify that vitriol and turn it into a reagent that goes into making Cenarion plant salve. You will then use that salve on plants you find in the wild that need saving.$b$bIf you have collected any tainted vitriol, I\'ll give you some Cenarion plant salve I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (4110, 1, 0, 0, 0, 'A Cenarion beacon allows a seasoned herbalist to spot insidious fel creep - a malfeasant product of Felwood\'s corruption. My work here has taught me the knowledge of purifying fel creep into a cleansing reagent... used in what we now refer to as Cenarion plant salve.$b$bWhen you gather herbs in Felwood, you should encounter the fel creep so long as you have the beacon. In exchange for what you bring to me, I will give you pre-made Cenarion plant salve.', 0);
INSERT INTO `quest_request_items` VALUES (4111, 1, 0, 0, 0, 'A Cenarion beacon will allow a well-trained skinner to spot patches of tainted skin from bounty gathered in Felwood. I convert these seemingly useless patches into a thick paste that serves as a quickening agent for Cenarion plant salve. When you skin your kills here in Felwood, be sure to have a beacon on you!$b$bWhen you collect tainted patches, bring them to me and I will give you some Cenarion plant salves that I have already made.', 0);
INSERT INTO `quest_request_items` VALUES (4112, 1, 0, 0, 0, 'The power of a disenchanted magical item is felt by the essence it creates. I\'ve devised a way to turn raw essence used by enchanters into a suitable reagent for creating Cenarion plant salve. You don\'t need a Cenarion beacon for this; any suitably disenchanted item that yields lesser nether essences will work.$b$bI just need a single lesser nether essence; in exchange, I will give you Cenarion plant salves. The essence is extremely potent - a little definitely goes a long way!', 0);
INSERT INTO `quest_request_items` VALUES (4113, 0, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant.  A pungent, unhealthy odor emanates from the plant.  It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4114, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant. A pungent, unhealthy odor emanates from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4115, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a windblossom plant. The berries that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4116, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant. A pungent, unhealthy odor emanates from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4117, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a whipper root plant. The visible roots of the plant appear tough and leathery, and a slimy film hangs from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4118, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant. A pungent, unhealthy odor emanates from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4119, 0, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a night dragon plant.  The fruits that hang from the plant appear rotten and poisonous.  It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4120, 1, 0, 0, 0, 'Everything touched by the fel emanates a strange green glow... I sense it is evil, but at the same time, very powerful.', 0);
INSERT INTO `quest_request_items` VALUES (4121, 1, 0, 0, 0, 'I will take this traitorous filth, $N.', 0);
INSERT INTO `quest_request_items` VALUES (4122, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4123, 0, 0, 0, 0, 'Do you have the Heart of the Mountain?  To me, its value is without limit.', 0);
INSERT INTO `quest_request_items` VALUES (4124, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4125, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4126, 1, 0, 0, 0, 'Do you have the recipe, $N? I can\'t stand the idea of those Dark Iron dwarves drinking my family\'s drink!', 0);
INSERT INTO `quest_request_items` VALUES (4127, 1, 0, 0, 0, 'Ah, welcome back $N.  I hope that you were able to uncover some clue as to Raschal\'s ultimate fate, as tragic as that may be.', 0);
INSERT INTO `quest_request_items` VALUES (4128, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4129, 1, 0, 0, 0, 'Ginro sent you, eh?$B$BMy psychometric readings are fairly draining on the psyche... but so are my losses at Kalimdor Hold \'Em.  They call me \"King of the Bad Beats\" here in the Stronghold.  Unlucky at cards... lucky at mastering the secrets of nature, I guess.$B$BAnyway, of course I\'ll do it.  This may be just the breakthrough we need to uncover Raschal\'s fate.  If you would hand me the knife, we can get started.', 0);
INSERT INTO `quest_request_items` VALUES (4130, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4131, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4132, 1, 0, 0, 0, 'Has the Butcher of Blackrock been disposed of?', 0);
INSERT INTO `quest_request_items` VALUES (4133, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4134, 6, 0, 0, 0, 'Do you have the recipe for the Thunderbrew Lager, $N?', 0);
INSERT INTO `quest_request_items` VALUES (4135, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4136, 0, 0, 0, 0, 'Do you have Ribbly?  Or, at least a part of him?', 0);
INSERT INTO `quest_request_items` VALUES (4141, 11, 0, 0, 0, 'Larion\'s got something coming, that\'s for sure!', 0);
INSERT INTO `quest_request_items` VALUES (4142, 1, 0, 0, 0, 'I live out here in the forest... Peaceful.$B$BWell, at least I thought it would be. I get more visitors out here than I ever did when I lived in Ironforge!', 0);
INSERT INTO `quest_request_items` VALUES (4143, 1, 0, 0, 0, 'Larion\'s still not speaking to me! He sure knows how to hold a grudge.', 0);
INSERT INTO `quest_request_items` VALUES (4144, 1, 0, 0, 0, 'Here\'s the plan, $n: Go out and collect some bloodpetal sprouts -- you know, the plants that haven\'t fully sprouted yet, and bring them here. Then I\'ll see what the Atal\'ai haze can do.$B$BYou may think I\'m vengeful... Actually, you\'d be right about that! $B$BTruth is, I know the way out of here, but until Larion will admit that I\'m right, I\'m staying right here!$B$BSo off with you, find those bloodpetal sprouts and let\'s have some fun!', 0);
INSERT INTO `quest_request_items` VALUES (4145, 1, 5, 0, 0, 'Muigin needs to apologize first before I\'ll talk to him again!', 0);
INSERT INTO `quest_request_items` VALUES (4146, 1, 0, 0, 0, 'This is exhausting, $N. Those things just won\'t leave me alone!', 0);
INSERT INTO `quest_request_items` VALUES (4147, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4148, 1, 0, 0, 0, 'For the zapper to work, it needs a sample of the target creature. Head out into the crater and collect a Bloodpetal sprout. Then I can calibrate it to work on Muigin\'s little friends...$b$bIf he weren\'t so stubborn, we could be on our way home, already... But until then, I\'ll just have to show him that his little prank doesn\'t bother me at all!', 0);
INSERT INTO `quest_request_items` VALUES (4161, 0, 0, 0, 0, 'Remember the balance, $N. I wish you to develop an understanding and a strong empathy for the living forests.', 0);
INSERT INTO `quest_request_items` VALUES (4181, 1, 0, 0, 0, 'I can smell fresh recruits much like I can an excellent blasting powder - from a mile away. Have you come seeking to learn about the mastery of the explosion?', 0);
INSERT INTO `quest_request_items` VALUES (4182, 1, 0, 0, 0, 'How goes the dragon hunt?', 0);
INSERT INTO `quest_request_items` VALUES (4183, 1, 0, 0, 0, 'Greetings, $N. Have we met before? You look vaguely familiar.', 0);
INSERT INTO `quest_request_items` VALUES (4184, 1, 0, 0, 0, 'What brings you to Stormwind Keep?', 0);
INSERT INTO `quest_request_items` VALUES (4185, 1, 0, 0, 0, '<Bolvar watches you intently.>', 0);
INSERT INTO `quest_request_items` VALUES (4186, 1, 0, 0, 0, 'Any news from Bolvar?', 0);
INSERT INTO `quest_request_items` VALUES (4201, 1, 0, 0, 0, 'Do you have the ingredients?  The hole in my heart threatens to consume me!', 0);
INSERT INTO `quest_request_items` VALUES (4221, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a windblossom plant. The berries that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
