INSERT INTO `quest_request_items` VALUES (4244, 0, 0, 0, 0, 'The panel in which the mithril casing goes is still closed shut. The rest of A-Me 01 remains inert.', 0);
INSERT INTO `quest_request_items` VALUES (4245, 1, 0, 0, 0, 'Have you been able to help A-Me? That mithril casing you mentioned being destroyed was a good guess at what was wrong. I\'m sure if you replace that, she\'ll reactivate and be able to come home.', 0);
INSERT INTO `quest_request_items` VALUES (4261, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4262, 1, 0, 0, 0, '<Jalinda appears to be staring at your head.>', 0);
INSERT INTO `quest_request_items` VALUES (4263, 1, 0, 0, 0, 'Is the fiend dead??', 0);
INSERT INTO `quest_request_items` VALUES (4264, 1, 0, 0, 0, '<Marshal Windsor eyes the note in your hand.>$B$BWhat do you have there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (4265, 1, 0, 0, 0, 'You have something to report, $n?', 0);
INSERT INTO `quest_request_items` VALUES (4266, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4267, 1, 0, 0, 0, 'Welcome to this blessed temple, friend.  Your arrival here from Feathermoon Stronghold has been foretold to me.  Do you have the report Shandris Feathermoon asked you to bring?', 0);
INSERT INTO `quest_request_items` VALUES (4281, 1, 0, 0, 0, 'Welcome to Thalanaar, $C. Do you need assistance of some sort?', 0);
INSERT INTO `quest_request_items` VALUES (4282, 1, 0, 0, 0, 'Soon this grand subterfuge will be over.', 0);
INSERT INTO `quest_request_items` VALUES (4283, 1, 0, 0, 0, '<Oralius is talking into a rather large, severed ogre ear.>$B$BBurning Steppes to control, come in control.', 0);
INSERT INTO `quest_request_items` VALUES (4284, 5, 0, 0, 0, 'I just know I\'m onto something here, $N!', 0);
INSERT INTO `quest_request_items` VALUES (4285, 1, 0, 0, 0, 'Have you visited the pylon, $N?', 0);
INSERT INTO `quest_request_items` VALUES (4286, 1, 0, 0, 0, 'I can\'t be bothered right now, $N. Me and Winky got a meeting to attend.', 0);
INSERT INTO `quest_request_items` VALUES (4287, 1, 0, 0, 0, 'Have you visited the pylon, $N?', 0);
INSERT INTO `quest_request_items` VALUES (4288, 1, 0, 0, 0, 'Have you visited the pylon, $N?', 0);
INSERT INTO `quest_request_items` VALUES (4289, 2, 0, 0, 0, 'Have the creatures here bested you already, $N?$B$BDo not be dissuaded so easily. Tracking and defeating the apes of Un\'Goro is no simple task, even for a great hunter.', 0);
INSERT INTO `quest_request_items` VALUES (4290, 1, 0, 0, 0, 'Do not take my words lightly, $N. If you truly wish to face this creature, then you must be careful... and smart. It will take a great deal of strength and insight to draw out Lar\'korwi and defeat him.', 0);
INSERT INTO `quest_request_items` VALUES (4291, 1, 0, 0, 0, 'Be careful, $N. Getting close to any of nest of eggs surely will provoke the mothers... even if you\'ve already secured a gland from one. The mothers can be just as deadly as Lar\'korwi himself when they fight to protect their young. But, if you are successful, then we shall have a definitive way of bringing Lar\'korwi out from hiding.', 0);
INSERT INTO `quest_request_items` VALUES (4292, 1, 0, 0, 0, 'Do not let fear overpower you, $N. Fear is the great betrayer... you must remain strong!$B$BTake the meat, place it in the small valley, and then use the gland on it. Only then will death come for you.', 0);
INSERT INTO `quest_request_items` VALUES (4293, 1, 0, 0, 0, 'I will need at least five corrupted samples for our control group, $N. Continue to gather Felwood slime samples until you\'re able to give me that which we\'ll need. The Lady Sylvanas decrees it...', 0);
INSERT INTO `quest_request_items` VALUES (4294, 6, 0, 0, 0, 'Yes, $N? How goes your search?', 0);
INSERT INTO `quest_request_items` VALUES (4295, 5, 0, 0, 0, 'Oh, ale!  I would kill for some Dark Iron ale!!  Quick, I\'m getting sober!  I know this because sobriety blurs my vision... and it\'s making you look like the $r I slew last week!', 0);
INSERT INTO `quest_request_items` VALUES (4296, 1, 0, 0, 0, 'Do you have the writings of the Seven, $N?  Have you learned the secrets from their tablet?', 0);
INSERT INTO `quest_request_items` VALUES (4297, 1, 0, 0, 0, 'Find that meat yet, $N? Your little egg here\'s just about ready to hatch. If he don\'t have a good enough first meal, then he might not make it past his first week, and I\'d hate for that to happen.$B$BCan\'t much lie to ya, $N. I\'m jealous of you gettin\' this egg to begin with. Don\'t make me regret helpin\' ya out like this.', 0);
INSERT INTO `quest_request_items` VALUES (4298, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4300, 6, 0, 0, 0, 'Me clients are not so patient, $N. Have you gotten any of the claws yet?', 0);
INSERT INTO `quest_request_items` VALUES (4301, 1, 0, 0, 0, 'U\'cha... the beast was magnificent. Huge and red, with teeth the size of daggers. His arms as thick as tree trunks, and as fast as any mountain lion I have ever laid eyes upon. You should consider yourself lucky to find such a test of bravery--my people would go generations without seeing such a creature.', 0);
INSERT INTO `quest_request_items` VALUES (4321, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4322, 1, 0, 0, 0, 'You look exhausted, $n. Perhaps you should have a seat by the fire and relax.', 0);
INSERT INTO `quest_request_items` VALUES (4324, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4341, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4342, 1, 0, 0, 0, 'Allow me to finish telling my story.', 0);
INSERT INTO `quest_request_items` VALUES (4343, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a windblossom plant. The berries that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
