INSERT INTO `quest_request_items` VALUES (4381, 1, 0, 0, 0, 'The Pylon table allows you to combine green power crystals with yellow power crystals.$B$BAccording to J.D.\'s manual, this combination can be used to heal yourself or your allies.', 0);
INSERT INTO `quest_request_items` VALUES (4382, 1, 0, 0, 0, 'The Pylon table allows you to combine green power crystals with blue power crystals.$B$BAccording to J.D.\'s manual, this combination can be used to increase your spirit.', 0);
INSERT INTO `quest_request_items` VALUES (4383, 1, 0, 0, 0, 'The Pylon table allows you to combine green power crystals with red power crystals.$B$BAccording to J.D.\'s manual, this combination can be used to strengthen the protection you have against physical damage.', 0);
INSERT INTO `quest_request_items` VALUES (4384, 1, 0, 0, 0, 'The Pylon table allows you to combine red power crystals with blue power crystals.$B$BAccording to J.D.\'s manual, this combination can be used to weaken an enemy\'s defenses.', 0);
INSERT INTO `quest_request_items` VALUES (4385, 1, 0, 0, 0, 'The Pylon table allows you to combine red power crystals with yellow power crystals.$B$BAccording to J.D.\'s manual, this combination can be used to create a large explosion that can inflict damage on your enemies.', 0);
INSERT INTO `quest_request_items` VALUES (4386, 1, 0, 0, 0, 'The Pylon table allows you to combine blue power crystals with yellow power crystals.$B$BAccording to J.D.\'s manual, this combination can be used to create a shield that does damage to enemies.', 0);
INSERT INTO `quest_request_items` VALUES (4401, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant. A pungent, unhealthy odor emanates from the plant. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4402, 6, 0, 0, 0, 'Have you finished collecting cactus apples? ', 0);
