INSERT INTO `quest_request_items` VALUES (4448, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a Night Dragon plant. The fruits that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4449, 1, 0, 0, 0, 'I ain\'t got all day! Get me those pieces of silk cloth! I mean geologists. Get those geologists! They deserve to feel my, well... your wrath.', 0);
INSERT INTO `quest_request_items` VALUES (4450, 1, 0, 0, 0, 'Yes, yes? What can I do for you, $R? I\'m awfully busy and have many patrons requesting my services. Perhaps you can speed things up. I don\'t mean to be rude, but I just don\'t have the time if I\'m to catch up on all my work.', 0);
INSERT INTO `quest_request_items` VALUES (4451, 1, 0, 0, 0, '*cough*$b$bWho is it? Can\'t ya see I\'m busy?', 0);
