INSERT INTO `quest_request_items` VALUES (4462, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a Night Dragon plant. The fruits that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4463, 1, 0, 0, 0, 'Present the components, mortal.$B$BI will also require payment in the form of thirty gold pieces for this creation.', 0);
