INSERT INTO `quest_request_items` VALUES (4465, 0, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a songflower plant.  A pungent, unhealthy odor emanates from the plant.  It desperately needs some sort of attention if it is to be turned back to normal.', 0);
