INSERT INTO `quest_request_items` VALUES (4467, 1, 0, 0, 0, 'You have found a sickly, corrupted version of what appears to be a windblossom plant. The berries that hang from the plant appear rotten and poisonous. It desperately needs some sort of attention if it is to be turned back to normal.', 0);
INSERT INTO `quest_request_items` VALUES (4481, 1, 0, 0, 0, 'There is a price to pay for all things in this world. The price for the specific item that you seek is thirty gold pieces.$B$BNaturally, I shall retain the majority of the components which you collected. But worry not, you shall have your trinket.', 0);
INSERT INTO `quest_request_items` VALUES (4482, 1, 0, 0, 0, 'Thirty gold, $R. Thirty gold and the required components.', 0);
INSERT INTO `quest_request_items` VALUES (4483, 1, 0, 0, 0, 'If it is resilience you desire, thirty gold I require.', 0);
INSERT INTO `quest_request_items` VALUES (4484, 1, 0, 0, 0, 'Do not waste my time, $R. Give me what I require. Thirty gold and the components.', 0);
INSERT INTO `quest_request_items` VALUES (4485, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4486, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4487, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4488, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4489, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4490, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4491, 1, 0, 0, 0, 'I\'ve been so worried about Ringo...', 0);
INSERT INTO `quest_request_items` VALUES (4492, 1, 0, 0, 0, 'Wha... What?', 0);
INSERT INTO `quest_request_items` VALUES (4493, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4494, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4496, 1, 0, 0, 0, 'Finding a suitable scent gland might take a bit - the gland can\'t be damaged, but the process of getting one certainly doesn\'t lend itself to it. As for the soil, I\'d assume it should be easy enough to find.$b$bAnyway, do you have the items I need to make the lure?', 0);
INSERT INTO `quest_request_items` VALUES (4501, 1, 0, 0, 0, 'To tell you the truth, I really wasn\'t that worried about the strange creatures... Until the day that I saw it written on the side of a large stone.$B$BBEWARE OF PTERRORDAX$B$BWho could have written it? I don\'t know, but it\'s too creepy to just ignore!', 0);
INSERT INTO `quest_request_items` VALUES (4502, 6, 0, 0, 0, 'Is it true that the volcano in Un\'Goro is active? I\'m sure I could learn a lot with some ash from the volcano, $N.', 0);
INSERT INTO `quest_request_items` VALUES (4503, 1, 0, 0, 0, 'Every great vehicle needs a name... I was thinking I\'d call it... Pwned!', 0);
INSERT INTO `quest_request_items` VALUES (4504, 4, 0, 0, 0, 'Tran\'rek\'s done it again -- this super sticky glue will be all the rage!', 0);
INSERT INTO `quest_request_items` VALUES (4505, 1, 0, 0, 0, 'This is of utmost importance. Be on your way, now.', 0);
INSERT INTO `quest_request_items` VALUES (4506, 1, 0, 0, 0, 'Don\'t tell me that you can\'t go back there! Get going!', 0);
INSERT INTO `quest_request_items` VALUES (4507, 1, 0, 0, 0, 'Acquiring the queen\'s brain for our research is absolutely imperative.  From what we have learned, we believe that these silithid are quite possibly being controlled by a malign intelligence.  I shudder to think what could control something as insidious as the silithid, $N.', 0);
INSERT INTO `quest_request_items` VALUES (4508, 1, 0, 0, 0, 'They are fools, $N!  They cannot even think to look around them for a greater threat; their irrational hatred of the Horde will be the end of us all.  I do not know how much more proof I can give them of the silithid threat short of dropping them in one of the hives so they can see for themselves!$B$BI\'m sorry, you bring news for my attention?', 0);
INSERT INTO `quest_request_items` VALUES (4509, 1, 0, 0, 0, 'They are fools, $N!  They cannot even think to look around them for a greater threat; their irrational hatred of the Alliance will be our undoing.  I do not know how much more proof I can give them of the silithid threat short of dropping them in one of the hives so they can see for themselves!$B$BI\'m sorry, you bring news for my attention?', 0);
INSERT INTO `quest_request_items` VALUES (4510, 1, 0, 0, 0, 'Elune\'adore, $C.  What may I do for you today?', 0);
INSERT INTO `quest_request_items` VALUES (4511, 1, 0, 0, 0, 'Zug zug!  What may I help you with today, $C?', 0);
INSERT INTO `quest_request_items` VALUES (4512, 1, 0, 0, 0, 'Some of the experiments I\'ve done are fascinating. I think with a little more work, I\'ll be able to figure out the nature of these creatures and how they play into how life developed on Azeroth... if they even have anything to do with it to begin with.$B$BOne of my biggest theories that isn\'t well liked is the idea that oozes and slimes are tied to the creation of this planet... almost like they\'re a secretion of it.$B$BBut I can\'t prove or disprove it until I get more samples.', 0);
INSERT INTO `quest_request_items` VALUES (4513, 1, 0, 0, 0, 'So many things to consider. But what does it mean? And how does it affect the lives of the people of Azeroth?', 0);
INSERT INTO `quest_request_items` VALUES (4521, 1, 0, 0, 0, 'Report back to me after you have completed the task I gave you.', 0);
INSERT INTO `quest_request_items` VALUES (4542, 1, 0, 0, 0, 'What do you want, $C? An urgent message - for me?$b', 0);
INSERT INTO `quest_request_items` VALUES (4561, 1, 0, 0, 0, 'You take a sample of slime from Un\'Goro Crater and place some of it into the various tubes and beakers on the table. As things begin to boil and spurt, the slime changes colors. When the process slows down and the liquids calm, you see a small petri dish with your purified Un\'Goro slime samples in it along with some other remnants.', 0);
INSERT INTO `quest_request_items` VALUES (4581, 1, 0, 0, 0, 'Do you have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (4601, 1, 0, 0, 0, 'It would seem that the device needs some sort of grime-encrusted object to clean and three silver coins to get the contraption working. So long as both are present, the Sparklematic 5200 should work...', 0);
INSERT INTO `quest_request_items` VALUES (4602, 1, 0, 0, 0, 'Insert a Grime-Encrusted Item into the Sparklematic 5200, and be sure to have three silver coins to start the machine.', 0);
INSERT INTO `quest_request_items` VALUES (4603, 1, 0, 0, 0, 'The Sparklematic 5200 is empty, awaiting a grime-encrusted object to clean and three silver coins to start!', 0);
INSERT INTO `quest_request_items` VALUES (4604, 1, 0, 0, 0, 'The Sparklematic 5200 is empty, awaiting a grime-encrusted object to clean and three silver coins to start!', 0);
INSERT INTO `quest_request_items` VALUES (4605, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4606, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4621, 1, 0, 0, 0, 'Yer back already, ya blasted tar! Haves ye done as I\'ve ordered? Fail us, and ye will be walkin\' the plank.$B$BArrrrr...', 0);
INSERT INTO `quest_request_items` VALUES (4641, 6, 0, 0, 0, 'The carapace of a scorpid isn\'t so thick that the strength of a determined warrior will be deterred. Strike strongly and without doubt, and the scorpids should prove easy prey.', 0);
INSERT INTO `quest_request_items` VALUES (4642, 1, 0, 0, 0, 'How goes the experiment, $N? I will continue to study the samples you\'ve recovered for me--I am starting to see why Lady Sylvanas is so interested in these creatures. If they are truly part of the Old Gods, then who knows how it can be used to our benefit.', 0);
INSERT INTO `quest_request_items` VALUES (4661, 1, 0, 0, 0, 'You take a sample of slime from Felwood and place some of it into the various tubes and beakers on the table. As things begin to boil and spurt, the slime changes colors. When the process slows down and the liquids calm, you see a small petri dish with your altered Felwood slime samples in it along with some other remnants.', 0);
INSERT INTO `quest_request_items` VALUES (4681, 1, 0, 0, 0, 'Once you have investigated the creature\'s remains in the water to the west of here, I should be able to file a proper report with the Temple of the Moon in Darnassus. Perhaps then we will be closer to discovering the reason why these unfortunate creatures choose to end their lives beached on the coast of Darkshore.', 0);
INSERT INTO `quest_request_items` VALUES (4701, 1, 0, 0, 0, 'Have you discovered and dealt with the source of the worg menace?', 0);
INSERT INTO `quest_request_items` VALUES (4721, 1, 0, 0, 0, 'You know your orders, $N.', 0);
INSERT INTO `quest_request_items` VALUES (4722, 1, 0, 0, 0, 'Hello $N - do you have any discoveries of creatures that have washed ashore to report on?', 0);
INSERT INTO `quest_request_items` VALUES (4723, 1, 0, 0, 0, 'Hello again, $N! Are you here to report on another discovery?', 0);
INSERT INTO `quest_request_items` VALUES (4724, 1, 1, 0, 0, 'With the pack mistress slain, we can begin to thin out the worg sentries of the Spire and eventually make some headway into the city.', 0);
INSERT INTO `quest_request_items` VALUES (4725, 1, 0, 0, 0, 'It is a pleasure to see you again, $N. We are making great strives in uncovering the mystery of why majestic sea creatures beach themselves on the Darkshore coastline, but with every question answered, two more are raised it seems.$b$bAre you here to offer us more aid in our research?', 0);
INSERT INTO `quest_request_items` VALUES (4726, 1, 0, 0, 0, 'Do you have the broodling essence, $N?  I can\'t wait to study it.$B$BAnd besides that... my patron is not the type of person you want to disappoint.', 0);
INSERT INTO `quest_request_items` VALUES (4727, 1, 0, 0, 0, 'Hello again, $N! Are you here to report on another discovery?', 0);
INSERT INTO `quest_request_items` VALUES (4728, 1, 0, 0, 0, 'Greetings once again, $N!  What brings you back to Auberdine?  Are you here to report on another discovery, perhaps?', 0);
INSERT INTO `quest_request_items` VALUES (4729, 1, 0, 0, 0, '<Kibler is busy arguing with Toucan Stan.>', 0);
INSERT INTO `quest_request_items` VALUES (4730, 1, 0, 0, 0, 'Hello again, $N!  Are you here to report on another discovery?', 0);
INSERT INTO `quest_request_items` VALUES (4731, 1, 0, 0, 0, 'Hello again, $N.  The work you have done on behalf of the Temple of the Moon has been outstanding.  Are we to be blessed with more of your effort on our behalf?', 0);
INSERT INTO `quest_request_items` VALUES (4732, 1, 0, 0, 0, 'Greetings once again $N - do you have any more discoveries to report to the Temple of the Moon?', 0);
INSERT INTO `quest_request_items` VALUES (4733, 1, 0, 0, 0, 'Thanks be to Elune - I am glad to see you again, dear $N.  The Temple of the Moon\'s work on the strange beaching phenomena continues here in Darkshore.  Might you have anything additional to offer us?', 0);
INSERT INTO `quest_request_items` VALUES (4734, 1, 0, 0, 0, '$N, did you test the eggscilloscope?', 0);
INSERT INTO `quest_request_items` VALUES (4735, 6, 0, 0, 0, 'Do you have the eggs, $N?  My patron heard you were collecting them for me, and is very eager to get his hands on them!', 0);
INSERT INTO `quest_request_items` VALUES (4736, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4737, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (4738, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4739, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4740, 1, 0, 0, 0, 'Greetings $c - what may the Sentinels assist you with today? Perhaps you are here to inquire about the bounty on Murkdeep?', 0);
INSERT INTO `quest_request_items` VALUES (4741, 1, 0, 0, 0, 'Don\'t tell me that you\'re too scared! Get going!', 0);
INSERT INTO `quest_request_items` VALUES (4742, 1, 0, 0, 0, 'Courage and patience above all else, $N!', 0);
INSERT INTO `quest_request_items` VALUES (4743, 1, 0, 0, 0, 'Waste no time, $N. Nefarian works feverishly to unleash his evil upon our world.', 0);
INSERT INTO `quest_request_items` VALUES (4761, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4762, 1, 0, 0, 0, 'The pollution of the Cliffspring River is but the start of an alarming trend here in Darkshore.  The sample you provide will help us formalize a plan... a plan of attack, I am starting to suspect.', 0);
INSERT INTO `quest_request_items` VALUES (4763, 1, 0, 0, 0, 'The Talisman of Corruption is a sinister device that only serves to pervert the balance of nature. When you obtain this item from whatever satyr is tormenting the furbolgs and bring it to me for disposal, we will have won a great victory this day!', 0);
INSERT INTO `quest_request_items` VALUES (4764, 1, 0, 0, 0, 'Do you have the clasp, $N? My patron will pay very handsomely for it.', 0);
INSERT INTO `quest_request_items` VALUES (4765, 1, 0, 0, 0, 'I was told a messenger would come. One with a gift from Blackrock Spire.$B$BAre you he?', 0);
INSERT INTO `quest_request_items` VALUES (4766, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4767, 1, 0, 0, 0, '$N, have you retrieved the wyvern eggs that I seek? I\'m really anxious to start my wind rider training!', 0);
INSERT INTO `quest_request_items` VALUES (4768, 6, 0, 0, 0, 'Have you found the Tablet, $N?  I yearn to delve into its secrets.', 0);
INSERT INTO `quest_request_items` VALUES (4769, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4770, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4771, 1, 0, 0, 0, 'Remember, $N - we must be tolerant yet rigid in our beliefs!', 0);
INSERT INTO `quest_request_items` VALUES (4781, 2, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4782, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4783, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4784, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4785, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4786, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4787, 1, 0, 0, 0, 'Do you have the ancient egg? I sense great forces stirring, and I fear that time grows short.', 0);
INSERT INTO `quest_request_items` VALUES (4788, 1, 0, 0, 0, 'Have you been to the spire, $N? Do you have the fifth and sixth tables?', 0);
INSERT INTO `quest_request_items` VALUES (4801, 1, 0, 0, 0, 'In Winterspring, you will fight great cats called frostsabers. These beasts possess incredible speed an\' cunning. If you wish ta gain the speed a\' da frostsaber, bring me da E\'ko you find from dem.$B$BRememba, you must have the Cache of Mau\'ari in your inventory if you want ta hunt for E\'ko.', 0);
INSERT INTO `quest_request_items` VALUES (4802, 1, 0, 0, 0, 'In Winterspring, you will fight misguided creatures known as da Winterfall furbolg. Through the wishes of their leader, dey have gained incredible strength. If you wish ta gain the power a\' da Winterfall, bring me da E\'ko you find from dem.$B$BRememba, you must have the Cache of Mau\'ari in your inventory if you want ta hunt for E\'ko.', 0);
INSERT INTO `quest_request_items` VALUES (4803, 1, 0, 0, 0, 'In Winterspring, you will find large bears wit extremely thick hides. These Shardtooth bears gain much protection from what dey can withstand. If you wish ta gain the resistance against fire, bring me da E\'ko you find from da Shardtooth.$B$BRememba, you must have the Cache of Mau\'ari in your inventory if you want ta hunt for E\'ko.$B$B', 0);
INSERT INTO `quest_request_items` VALUES (4804, 1, 0, 0, 0, 'In Winterspring, you will fight great flying creatures called da Chillwind. These beasts possess da power ta wield frost magics. If you wish ta gain resistance ta frost, bring me da E\'ko you find from da Chillwind.$B$BRememba, you must have the Cache of Mau\'ari in your inventory if you want ta hunt for E\'ko.$B$B', 0);
INSERT INTO `quest_request_items` VALUES (4805, 1, 0, 0, 0, 'In Winterspring, you will fight great creatures called da ice thistle yeti. These beasts move slowly, but dey are able to evade many blows from da protection their thick fur provides dem. If you wish ta gain da ability to dodge attacks, bring me da E\'ko you find from dem.$B$BRememba, you must have the Cache of Mau\'ari in your inventory if you want ta hunt for E\'ko.$B$B', 0);
INSERT INTO `quest_request_items` VALUES (4806, 1, 0, 0, 0, 'In Winterspring, you have fought da large ice giants called frostmaul. Sheer power and force is at their disposal. If you wish ta gain da force of da frostmaul, bring me da E\'ko you find from dem.$B$BRememba, you must have the Cache of Mau\'ari in your inventory if you want ta hunt for E\'ko.', 0);
INSERT INTO `quest_request_items` VALUES (4807, 1, 0, 0, 0, 'In Winterspring, you will fight creatures of might dat seem to possess an innate magic ability. These wildkin can use strong magics. If you wish ta gain an increase in your intellect bring me da E\'ko you find from any a\' da owlbeasts you find der.$B$BRememba, you must have the Cache of Mau\'ari in your inventory if you want ta hunt for E\'ko.$B$B', 0);
INSERT INTO `quest_request_items` VALUES (4808, 1, 0, 0, 0, 'It\'s cold up here! I hope you brought me a blanket!', 0);
INSERT INTO `quest_request_items` VALUES (4809, 1, 0, 0, 0, 'Do you have the chillwind horns, $N?', 0);
INSERT INTO `quest_request_items` VALUES (4810, 1, 0, 0, 0, '$N! Did you talk to Felnok? Did you bring the components I need?', 0);
INSERT INTO `quest_request_items` VALUES (4811, 1, 0, 0, 0, 'What do you have to report on that red crystal? Does it even really exist?', 0);
INSERT INTO `quest_request_items` VALUES (4812, 1, 0, 0, 0, 'The crystal looks very alien against the wooded scenery of Darkshore. You think you hear a very slight humming coming from deep within it.', 0);
INSERT INTO `quest_request_items` VALUES (4813, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4821, 1, 0, 0, 0, 'I must know more about this mysterious egg, who knows what will hatch from it.', 0);
INSERT INTO `quest_request_items` VALUES (4822, 6, 0, 0, 0, 'I wish they\'d make more flavors of ice cream other than strawberry, but I guess I\'m lucky that strawberry is my favorite!', 0);
INSERT INTO `quest_request_items` VALUES (4841, 1, 0, 0, 0, 'Come now $N, I know you haven\'t killed your share yet. Hunt them down, and I shall give you a reward for my gratitude.', 0);
INSERT INTO `quest_request_items` VALUES (4842, 1, 0, 0, 0, 'The water in the springs seems to have some very odd properties... I am still unsure of what it means...', 0);
INSERT INTO `quest_request_items` VALUES (4861, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4862, 1, 0, 0, 0, 'Are those spider eggs in your pack or are you just happy to see me?', 0);
INSERT INTO `quest_request_items` VALUES (4863, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4864, 1, 0, 0, 0, 'Aye... Tell me the news.', 0);
INSERT INTO `quest_request_items` VALUES (4865, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4866, 1, 35, 0, 0, '<Ragged John pinches you.>', 0);
INSERT INTO `quest_request_items` VALUES (4867, 1, 0, 0, 0, 'Ah! Do you have my mojo?', 0);
INSERT INTO `quest_request_items` VALUES (4881, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4882, 1, 0, 0, 0, 'Reporting for another assignment?', 0);
INSERT INTO `quest_request_items` VALUES (4883, 1, 0, 0, 0, 'How may I help you, $N?', 0);
INSERT INTO `quest_request_items` VALUES (4901, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4902, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4903, 1, 0, 0, 0, '<Warlord Goretooth salutes.>', 0);
INSERT INTO `quest_request_items` VALUES (4904, 1, 0, 0, 0, 'Thalia Amberhide:', 0);
INSERT INTO `quest_request_items` VALUES (4906, 1, 0, 0, 0, 'Please, put and end to the suffering of Felwood\'s creatures.', 0);
INSERT INTO `quest_request_items` VALUES (4907, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4921, 1, 0, 0, 0, 'Have you found any sign of her at all? The pain in my chest tells me that the worst has happened, but I have hope you will find her safe and sound.', 0);
INSERT INTO `quest_request_items` VALUES (4941, 1, 0, 0, 0, 'Can you not see that I must not be interrupted?', 0);
INSERT INTO `quest_request_items` VALUES (4961, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4962, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4963, 6, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4964, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4965, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4966, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4967, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4968, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (4969, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4970, 1, 0, 0, 0, 'Discipline and determination are your goals. I may ask you to do a simple task many times; you must perform to the best of your ability each time.', 0);
INSERT INTO `quest_request_items` VALUES (4971, 1, 1, 0, 0, 'Temporal parasites are a common malady present wherever the flow of time has been tampered with.  I sense that many are present, and this is disturbing.$B$BRooting out whatever ones you can find will help me be able to take a better hold on the deteriorating temporal situation here.  I will be able to sense when this has been achieved.', 0);
INSERT INTO `quest_request_items` VALUES (4972, 1, 0, 0, 0, 'The time trinkets I seek are simple devices.  They are watches mainly, and their hands are trapped forever when the plague first ravaged Andorhal.$B$BTime is never ending, and the watches you bring to me will invariably find themselves counted out back to their homes... that is, so long as the disturbances continue here.', 0);
INSERT INTO `quest_request_items` VALUES (4973, 1, 0, 0, 0, 'The watches of Andorhal, much like the large clock on the ruins of the town hall, all are frozen in time at three o\'clock.  This was when the full effects of the plague first spread out over the city, choking the life out of it.$B$BAs much as we all may regret what happened that day, it has shaped the flow of time as you mortals perceive it.  The bronze dragonflight must persevere in protecting the timeline!', 0);
INSERT INTO `quest_request_items` VALUES (4974, 1, 0, 0, 0, '<Thrall grunts.>', 0);
INSERT INTO `quest_request_items` VALUES (4975, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4976, 6, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4981, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (4982, 1, 0, 0, 0, 'Any luck?', 0);
INSERT INTO `quest_request_items` VALUES (4983, 1, 0, 0, 0, 'Where\'s the goblin???', 0);
INSERT INTO `quest_request_items` VALUES (4984, 1, 0, 0, 0, 'The wolves that are infected with the plague must be put down, $N.  The disease they carry cannot be cured.  I tried... I tried until I succumbed to the plague myself.', 0);
INSERT INTO `quest_request_items` VALUES (4985, 1, 0, 0, 0, 'I hear your footsteps, $N.  My vision has faded from me, but I still am able to sense things around me.  Have you ended the misery of the disease-ridden grizzlies?', 0);
INSERT INTO `quest_request_items` VALUES (4986, 0, 0, 0, 0, 'On behalf of the Cenarion Circle, I bid you welcome to this enclave, $c.  What business do you have with us?', 0);
INSERT INTO `quest_request_items` VALUES (4987, 1, 0, 0, 0, 'On behalf of the Cenarion Circle, I bid you welcome to this enclave, $C. What business do you have with us?', 0);
INSERT INTO `quest_request_items` VALUES (5001, 1, 0, 0, 0, 'Any luck?', 0);
INSERT INTO `quest_request_items` VALUES (5002, 1, 0, 0, 0, 'Ah, $N. It has been a long time.', 0);
INSERT INTO `quest_request_items` VALUES (5021, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5022, 2, 0, 0, 0, 'Welcome to the office of the Stormwind census.  If you are in need of information on our populace, then I can assist you.', 0);
INSERT INTO `quest_request_items` VALUES (5023, 1, 0, 0, 0, 'Are you here to seek the assistance of the Undercity census, or just to ask me if someone you knew is dead? I get asked that a lot.', 0);
INSERT INTO `quest_request_items` VALUES (5041, 1, 0, 0, 0, 'How goes your search for the supplies, $N? I trust the quilboar fall under your strength easily.', 0);
INSERT INTO `quest_request_items` VALUES (5042, 0, 0, 0, 0, 'I will need 4 blood shards if you wish Agamaggan\'s strength, $r.$B$BYour foes will cower before your strength were you to be given this blessing. <snort>$B$BThe Razormane\'s greatest warriors are infused with such power!', 0);
INSERT INTO `quest_request_items` VALUES (5043, 0, 0, 0, 0, 'My tribes greatest scouts are said to be unrivaled in their accuracy, and no rogue <snort> could measure up to their quickness in battle.$B$BBring me 4 blood shards and I will make you even more agile than any quilboar born.', 0);
INSERT INTO `quest_request_items` VALUES (5044, 0, 0, 0, 0, 'The shaman and geomancers of the quilboar tribes <snort> call upon the strength of Agamaggan to help them in battle and in their rituals, $r.$B$BIf you too wish the added power of Agamaggan\'s blessing with your spells, then bring me 4 blood shards and Mangletooth will aid you. <snort>', 0);
INSERT INTO `quest_request_items` VALUES (5045, 0, 0, 0, 0, 'Warriors of all types <snort> have need of a strong spirit. It drives you to greater feats when all hope has been lost. This is not unknown to the <snort> Razormane. We are a spiritual tribe--we are more proud of our connection to Agamaggan than our prowess <snort> in battle.$B$BBring me 4 blood shards and I will bless your spirit for battle. <snort>', 0);
INSERT INTO `quest_request_items` VALUES (5046, 0, 0, 0, 0, 'All those who <snort> enter battle have need of protection. Their bones must be strong. Their skin tough. <snort> My tribe knows this as well, and to add to the natural protection our quills and hide give us, <snort> we often call upon Agamaggan to protect us from harm before we go to war.$B$BBring me 4 blood shards <snort> and I will grant you the same protection.', 0);
INSERT INTO `quest_request_items` VALUES (5047, 1, 0, 0, 0, 'Yea?', 0);
INSERT INTO `quest_request_items` VALUES (5048, 25, 0, 0, 0, 'I would tell you to get off my lawn, but as you can see I don\'t have one.', 0);
INSERT INTO `quest_request_items` VALUES (5049, 1, 0, 0, 0, 'Every time someone steps on a cockroach, I cry. Please don\'t make me cry.', 0);
INSERT INTO `quest_request_items` VALUES (5050, 0, 0, 0, 0, 'John, sweetheart... is that you?  I\'m so cold all the sudden...', 0);
INSERT INTO `quest_request_items` VALUES (5051, 0, 0, 0, 0, 'John, don\'t let the ghouls get you... don\'t let the ghouls get me... nasty ghouls... our charm will keep us safe.', 0);
INSERT INTO `quest_request_items` VALUES (5052, 1, 0, 0, 0, 'Our tribes flock to the thorny areas throughout the Barrens <snort> because they are holy places, but none as holy as Razorfen. Agamaggan\'s body makes up the entirety of the Razorfen, <snort> but the Downs are especially protected because the entrance is made from his great maw! <snort> It will swallow whole those not loyal to him, and spit out their bodies after he\'s chewed them up! <snort>$B$BAgamaggan has left his body behind to protect us, and he gives of his spirit so we may protect him. <snort>', 0);
INSERT INTO `quest_request_items` VALUES (5054, 1, 0, 0, 0, 'Go now, $c. Seek out Ursius.', 0);
INSERT INTO `quest_request_items` VALUES (5055, 1, 0, 0, 0, 'Brumeran calls out to you, $N.', 0);
INSERT INTO `quest_request_items` VALUES (5056, 1, 0, 0, 0, 'Shy-Rotam is bold and unforgiving; she will defend her kind with fervent enthusiasm.', 0);
INSERT INTO `quest_request_items` VALUES (5057, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5058, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5059, 0, 0, 0, 0, 'The door to the outhouse has begun to splinter at the edges of the frame as though it has been repeatedly and incessantly tried to be forced open.  It is currently locked up tight from the outside of the outhouse.$B$BAs you rattle the door, you hear a guttural moaning come from inside!  Whatever is inside there, it certainly does not sound friendly.', 0);
INSERT INTO `quest_request_items` VALUES (5060, 0, 0, 0, 0, 'An extremely sturdy cabinet stands before you, securely fastened shut by a built-in lock.  The front of the cabinet is deeply scratched and marked.  This could be surmised as being from numerous and violent failed attempts to reveal whatever secrets the cabinet currently obfuscates from view.$B$BIf you are going to open this cabinet, you will need to find the key.', 0);
INSERT INTO `quest_request_items` VALUES (5061, 1, 0, 0, 0, 'Your return to Darnassus is not without heralding, though I will need proof of your lessons learned in Moonglade before I will teach you your aquatic form.$B$BDo you have the Pendant of the Sea Lion?', 0);
INSERT INTO `quest_request_items` VALUES (5062, 1, 0, 0, 0, 'So, Motega Firemain sends word of Arikara...well now that is grave news.$b$b$b$bArikara is a deadly creature born only to seek vengeance against those who have committed heinous acts.$b$b', 0);
INSERT INTO `quest_request_items` VALUES (5063, 1, 0, 0, 0, 'Unless you\'ve got everything I need, you\'re wasting my time.', 0);
INSERT INTO `quest_request_items` VALUES (5064, 1, 0, 0, 0, 'Have you discovered what the Grimtotem are up to?', 0);
INSERT INTO `quest_request_items` VALUES (5065, 6, 0, 0, 0, 'Do you have the tablets?  I fear their texts will reveal a great threat to our world.', 0);
INSERT INTO `quest_request_items` VALUES (5066, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5067, 1, 0, 0, 0, 'Unless you\'ve got everything I need, you\'re wasting my time.', 0);
INSERT INTO `quest_request_items` VALUES (5068, 1, 0, 0, 0, 'Unless you\'ve got everything I need, you\'re wasting my time.', 0);
INSERT INTO `quest_request_items` VALUES (5081, 1, 0, 0, 0, 'Status?', 0);
INSERT INTO `quest_request_items` VALUES (5082, 1, 0, 0, 0, 'I appreciate your help!', 0);
INSERT INTO `quest_request_items` VALUES (5083, 0, 0, 0, 0, 'What is that you have found?', 0);
INSERT INTO `quest_request_items` VALUES (5084, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5085, 1, 0, 0, 0, 'I hope you found something, $N. The Winterfall are becoming increasingly aggressive!', 0);
INSERT INTO `quest_request_items` VALUES (5086, 1, 0, 0, 0, 'I think we are beginning to uncover what is happening here, $N.', 0);
INSERT INTO `quest_request_items` VALUES (5087, 1, 0, 0, 0, 'We\'ll see what happens when the Winterfall don\'t get their firewater!', 0);
INSERT INTO `quest_request_items` VALUES (5088, 1, 0, 0, 0, 'Have you slain the vicious serpent Arikara, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5089, 1, 0, 0, 0, 'What have you got there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5090, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5091, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5092, 1, 25, 0, 0, 'I want you to prepare for the worst, $N - dig deep.  The task in front of us will not be easy.  As we rally our forces here to eventually strike out against the Scourge, you will be part of our advance effort that takes the fight to them!  Your assigned mission in Sorrow Hill will begin our path to victory!', 0);
INSERT INTO `quest_request_items` VALUES (5093, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5094, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5095, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5096, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5097, 1, 1, 0, 0, 'Once the towers are marked, they\'ll become top priority targets for our attack on Andorhal. I suspect that once we neutralize the towers, the main threat of Andorhal will emerge. From that point on, we\'ll have a straight-up fight for control of the city!$B$Byou\'re back to report success, yes? Don\'t forget the beacon torch as well; we must maintain control of our materiel.', 0);
INSERT INTO `quest_request_items` VALUES (5098, 1, 0, 0, 0, 'Once the towers are marked, they\'ll become top priority targets for our attack on Andorhal. I suspect that once we neutralize the towers, the main threat of Andorhal will emerge. From that point on, we\'ll have a straight-up fight for control of the city!$b$bYou\'re back to report success, yes? Don\'t forget the beacon torch as well; we must maintain control of our materiel.', 0);
INSERT INTO `quest_request_items` VALUES (5102, 1, 0, 0, 0, 'Is it done?', 0);
INSERT INTO `quest_request_items` VALUES (5103, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5121, 1, 0, 0, 0, 'Maybe you will find out more in Winterfall Village, $N.', 0);
INSERT INTO `quest_request_items` VALUES (5122, 1, 0, 0, 0, 'The power of this chapel gives me the strength to resist the corruption in my heart.  If I leave it, I will become a death knight.   But there is a medallion, the medallion of faith, that will give me the strength I need to leave.$B$BPlease, $N, retrieve the medallion.  It is guarded by Malor the Zealous, a crazed member of the Scarlet Crusade who resides deep in the Scarlet Bastion in western Stratholme.', 0);
INSERT INTO `quest_request_items` VALUES (5123, 1, 0, 0, 0, 'Now, what\'s this, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5124, 1, 0, 0, 0, 'Time is money, $N and I don\'t have much of either.', 0);
INSERT INTO `quest_request_items` VALUES (5125, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5126, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5127, 1, 0, 0, 0, 'Tempt not...', 0);
INSERT INTO `quest_request_items` VALUES (5128, 1, 0, 0, 0, 'The Emerald Circle is friendly to all, $R. What can I do for you?', 0);
INSERT INTO `quest_request_items` VALUES (5141, 1, 0, 0, 0, 'If you\'re ready to commit to a permanent decision by becoming a dragonscale leatherworker, then I\'m ready to take you on as a student. Just bring to me the things I asked for, and we\'ll begin your education.', 0);
INSERT INTO `quest_request_items` VALUES (5142, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5143, 1, 0, 0, 0, 'Nature is a force that must be appeased before you hope to learn how to bend its will into your leather garments. Bring me your offering to this force, and I will make sure you are heard.', 0);
INSERT INTO `quest_request_items` VALUES (5144, 1, 0, 0, 0, 'Making this kind of leather-based armor requires patience and dedication. Once you have cast your lot with the elements, there is no turning your back on them. Bring me proof of your worthiness, and we\'ll get started.', 0);
INSERT INTO `quest_request_items` VALUES (5145, 1, 0, 0, 0, 'If you\'re ready to commit to a permanent decision by becoming a dragonscale leatherworker, then I\'m ready to take you on as a student. Just bring to me the things I asked for, and we\'ll begin your education.', 0);
INSERT INTO `quest_request_items` VALUES (5146, 1, 0, 0, 0, 'Making this kind of leather-based armor requires patience and dedication. Once you have cast your lot with the elements, there is no turning your back on them. Bring me proof of your worthiness, and we\'ll get started.', 0);
INSERT INTO `quest_request_items` VALUES (5147, 1, 0, 0, 0, 'Have you any news of that murderous Arnak Grimtotem?', 0);
INSERT INTO `quest_request_items` VALUES (5148, 1, 0, 0, 0, 'Nature is a force that must be appeased before you hope to learn how to bend its will into your leather garments. Bring me your offering to this force, and I will make sure you are heard.', 0);
INSERT INTO `quest_request_items` VALUES (5149, 0, 0, 0, 0, 'Did you find my doll?', 0);
INSERT INTO `quest_request_items` VALUES (5150, 0, 0, 0, 0, 'Dadanga looks up at you as you approach her. She seems to be hoping for something...$B$BShe\'s probably hungry!$B$BThere\'s got to be something growing in the crater that would be just the perfect snack for a large herbivore. Dadanga\'s a big girl; whatever you bring her, there would need to be a lot of it!', 0);
INSERT INTO `quest_request_items` VALUES (5151, 1, 0, 0, 0, 'Do you have my hypercapacitor?', 0);
INSERT INTO `quest_request_items` VALUES (5152, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5153, 6, 0, 0, 0, 'There is something timely about your visit.  You\'re not from the future, are you?', 0);
INSERT INTO `quest_request_items` VALUES (5154, 6, 0, 0, 0, 'Did you find the book, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5155, 1, 0, 0, 0, 'How goes your fight, $N? I know the shedding of blood as proof of honor can be disgusting to some, but you must understand that it serves two goals: you make my task easier by hurting their numbers, and we gain a respect for each other that will only make us stronger in times to come.$B$BI hope you understand.', 0);
INSERT INTO `quest_request_items` VALUES (5156, 1, 0, 0, 0, 'I hope your search goes well, $N. I haven\'t started heading that far north, but I will admit, the thought of crossing the path of an infernal at any point scares me just a little. The creatures are brainless, but still quite intimidating.', 0);
INSERT INTO `quest_request_items` VALUES (5157, 1, 0, 0, 0, 'Once we have the waters from the Moon Well, we will purify it and use it to extinguish the braziers of protection within Shadow Hold. That should allow me ample time to see into the chambers even deeper and discern who actually leads this... cult.$b$bI pray the Earthmother is with us.', 0);
INSERT INTO `quest_request_items` VALUES (5158, 1, 0, 0, 0, 'I sense you are not just a simple traveler looking for the path to Ratchet. Come, sit and rest at our camp. Speak to me when you\'re ready.', 0);
INSERT INTO `quest_request_items` VALUES (5159, 1, 0, 0, 0, 'Ah, I see you\'ve returned, $N. Good. Did you find Islen in the Barrens? Or do we have to find another way to accomplish our goals?', 0);
INSERT INTO `quest_request_items` VALUES (5160, 1, 0, 0, 0, 'It is good to see you, $N.', 0);
INSERT INTO `quest_request_items` VALUES (5161, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5162, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5163, 1, 0, 0, 0, 'I can\'t wait to hear how my friends react!$B$BThey\'ll never expect it!', 0);
INSERT INTO `quest_request_items` VALUES (5164, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5165, 1, 0, 0, 0, 'The braziers must be extinguished if we are to have any hope of being prepared for a much greater battle. Going in to the dragon\'s lair without any knowledge is a fool\'s errand. And this is much worse than a dragon. The Shadow Council are solely responsible for a great number of crimes and atrocities. We\'ll have to work quickly if we\'re to stop them.', 0);
INSERT INTO `quest_request_items` VALUES (5166, 1, 0, 0, 0, 'You have chosen wisely, $R.', 0);
INSERT INTO `quest_request_items` VALUES (5167, 1, 0, 0, 0, 'Such an item has never been crafted!', 0);
INSERT INTO `quest_request_items` VALUES (5168, 0, 0, 0, 0, 'Do you have the relics, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5181, 0, 0, 0, 0, 'Did you find the skull and the sword, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5201, 1, 0, 0, 0, 'The furbolgs seem to suffer from such paranoia...', 0);
INSERT INTO `quest_request_items` VALUES (5202, 1, 0, 0, 0, 'I begin to wonder if I\'ll ever escape this cage.$b$bIt\'s only a matter of time before they sacrifice me to whatever demons they worship. The monsters!', 0);
INSERT INTO `quest_request_items` VALUES (5203, 1, 0, 0, 0, 'You look winded, $n. Are you all right, or is something wrong?', 0);
INSERT INTO `quest_request_items` VALUES (5204, 1, 0, 0, 0, 'You inspect the body, and there is no doubt that these are the remains of the Knight of the Silver Hand, Trey Lightforge. For a moment you think of Arko\'narin and question if anyone in your life meant as much to you as this man meant to the Night elf captive you recently helped escape Shadow Hold.$B$BAfter taking another moment to gather your thoughts, you know that you cannot take the paladin\'s remains back to Jessir without killing his torturer first.', 0);
INSERT INTO `quest_request_items` VALUES (5206, 6, 0, 0, 0, 'Do you have the skulls?  Chromie said they will be critical for her spell, and that spell will give us the chance to save Darrowshire.', 0);
INSERT INTO `quest_request_items` VALUES (5210, 0, 0, 0, 0, 'You\'ve come from the west?  How fare the rest of Lordaeron?  I know that Andorhal is lost, but has the Scourge yet reached fair Tirisfal?', 0);
INSERT INTO `quest_request_items` VALUES (5211, 1, 0, 0, 0, 'The poor defenders of Darrowshire cry out to me in my dreams, $N. You must free them!', 0);
INSERT INTO `quest_request_items` VALUES (5212, 1, 0, 0, 0, 'Some say I worry too much - to them I say, \'You don\'t worry enough!\'', 0);
INSERT INTO `quest_request_items` VALUES (5213, 1, 0, 0, 0, 'We are on the verge of discovering what this new active plague agent may be!', 0);
INSERT INTO `quest_request_items` VALUES (5214, 1, 0, 0, 0, 'I can\'t take it, $N! You gotta help me! I\'m dying!', 0);
INSERT INTO `quest_request_items` VALUES (5215, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5216, 0, 0, 0, 0, 'An access panel to the cauldron remains securely fastened.  In order to open it, you will need to find the key.\n', 0);
INSERT INTO `quest_request_items` VALUES (5217, 3, 0, 0, 0, 'Welcome back to the relative safety of Chillwind Camp, $N.  What progress on the cauldrons do you have to report?', 0);
INSERT INTO `quest_request_items` VALUES (5218, 0, 0, 0, 0, 'The Scourge\'s plague cauldron stands before you, spewing vast amounts of toxins into the air.  A small, non-descript access panel lies in the base of the cauldron\'s vast platform.$B$BHaving already defeated the cauldron lord and acquired its key, you are free to add the appropriate reagents to the cauldron to make a counter agent to the plague.', 0);
INSERT INTO `quest_request_items` VALUES (5219, 0, 0, 0, 0, 'An access panel to the cauldron remains securely fastened.  In order to open it, you will need to find the key.', 0);
INSERT INTO `quest_request_items` VALUES (5220, 1, 0, 0, 0, 'We know that each cauldron employs a different mix of reagents to generate its plague-inducing toxin; likewise, we know that we will need to develop a counter agent that is unique for each cauldron.  Your sample from Dalson\'s Tears will be the key to figure out that cauldron\'s distinct reagent requirement. ', 0);
INSERT INTO `quest_request_items` VALUES (5221, 1, 0, 0, 0, 'The Scourge\'s plague cauldron stands before you, spewing vast amounts of toxins into the air.  A small, non-descript access panel lies in the base of the cauldron\'s vast platform.$B$BHaving already defeated the cauldron lord and acquired its key, you are free to add the appropriate reagents to the cauldron to make a counter agent to the plague.', 0);
INSERT INTO `quest_request_items` VALUES (5222, 0, 0, 0, 0, 'An access panel to the cauldron remains securely fastened.  In order to open it, you will need to find the key.', 0);
INSERT INTO `quest_request_items` VALUES (5223, 1, 0, 0, 0, 'Once we successfully analyze the sample drawn from the Writhing Haunt\'s cauldron, it will provide us with a third avenue to deliver a devastating counter agent onto the Scourge!', 0);
INSERT INTO `quest_request_items` VALUES (5224, 0, 0, 0, 0, 'The Scourge\'s plague cauldron stands before you, spewing vast amounts of toxins into the air.  A small, non-descript access panel lies in the base of the cauldron\'s vast platform.$B$BHaving already defeated the cauldron lord and acquired its key, you are free to add the appropriate reagents to the cauldron to make a counter agent to the plague.', 0);
INSERT INTO `quest_request_items` VALUES (5225, 0, 0, 0, 0, 'An access panel to the cauldron remains securely fastened.  In order to open it, you will need to find the key.', 0);
INSERT INTO `quest_request_items` VALUES (5226, 1, 0, 0, 0, 'Gahrron\'s Withering houses the last cauldron here in the east that we need access to.  Once we have a sample of the plague it spews forth, we will be able to introduce our reagents into the environment through four separate vessels!  The Scourge will be hard pressed to keep us out of all four, even with the power of Kel\'Thuzad behind them.', 0);
INSERT INTO `quest_request_items` VALUES (5227, 1, 0, 0, 0, 'The Scourge\'s plague cauldron stands before you, spewing vast amounts of toxins into the air.  A small, non-descript access panel lies in the base of the cauldron\'s vast platform.$B$BHaving already defeated the cauldron lord and acquired its key, you are free to add the appropriate reagents to the cauldron to make a counter agent to the plague.', 0);
INSERT INTO `quest_request_items` VALUES (5228, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5229, 1, 0, 0, 0, 'An access panel to the cauldron remains securely fastened.  In order to open it, you will need to find the key. ', 0);
INSERT INTO `quest_request_items` VALUES (5230, 1, 0, 0, 0, 'Welcome back to the relative safety of the Bulwark, $N. What progress on the cauldrons do you have to report?', 0);
INSERT INTO `quest_request_items` VALUES (5231, 1, 0, 0, 0, 'An access panel to the cauldron remains securely fastened. In order to open it, you will need to find the key.', 0);
INSERT INTO `quest_request_items` VALUES (5232, 1, 0, 0, 0, 'We know that each cauldron employs a different mix of reagents to generate its plague-inducing toxin; likewise, we know that we will need to develop a counter agent that is unique for each cauldron. Your sample from Dalson\'s Tears will be the key to figure out that cauldron\'s distinct reagent requirement.', 0);
INSERT INTO `quest_request_items` VALUES (5233, 1, 0, 0, 0, 'An access panel to the cauldron remains securely fastened.  In order to open it, you will need to find the key. ', 0);
INSERT INTO `quest_request_items` VALUES (5234, 1, 0, 0, 0, 'Once we successfully analysis the sample drawn from the Writhing Haunt\'s cauldron, it will provide us with a third avenue to deliver a devastating counter agent against the Scourge!', 0);
INSERT INTO `quest_request_items` VALUES (5235, 1, 0, 0, 0, 'An access panel to the cauldron remains securely fastened. In order to open it, you will need to find the key.', 0);
INSERT INTO `quest_request_items` VALUES (5236, 1, 0, 0, 0, 'Gahrron\'s Withering houses the last cauldron that we need to acquire access to here in the west. Once we have a sample of the plague from that cauldron, we will be able to introduce our reagents into the environment through four separate vessels! The Scourge will be hard pressed to keep us out of all four, even with the power of Kel\'Thuzad behind them.', 0);
INSERT INTO `quest_request_items` VALUES (5237, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5238, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5241, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5242, 1, 0, 0, 0, 'Without Fel\'dan, the Shadow Council will hopefully lose focus and start infighting. They will struggle with one another for control and hoard assets for future plans. That will be an opportune time to devastate them and their demon slaves.', 0);
INSERT INTO `quest_request_items` VALUES (5243, 1, 0, 0, 0, 'Be wary, not all supply crates will have survived the destruction of the city. The Scourge dare not touch the water but surely the holy water will not prevent vermin infestations.$b$b', 0);
INSERT INTO `quest_request_items` VALUES (5244, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5245, 1, 0, 0, 0, 'Why have you come here?', 0);
INSERT INTO `quest_request_items` VALUES (5246, 1, 0, 0, 0, 'It is only in the pages of the sacred writings that I will be able to discern whether or not I can help you...', 0);
INSERT INTO `quest_request_items` VALUES (5247, 1, 0, 0, 0, 'The relic must be placed in the hands of only the most trustworthy. It can not be stolen again...', 0);
INSERT INTO `quest_request_items` VALUES (5248, 1, 0, 0, 0, 'Currrrrsed... Forevvvverrrr...', 0);
INSERT INTO `quest_request_items` VALUES (5249, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5250, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5251, 1, 0, 0, 0, 'Remember, $N - we must be tolerant yet rigid in our beliefs!', 0);
INSERT INTO `quest_request_items` VALUES (5252, 1, 0, 0, 0, 'It has been some time since you left, $N. How have you fared?', 0);
INSERT INTO `quest_request_items` VALUES (5253, 1, 0, 0, 0, 'Yes, $R?', 0);
INSERT INTO `quest_request_items` VALUES (5261, 6, 6, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5262, 1, 0, 0, 0, 'What have you got there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5263, 1, 0, 0, 0, 'The Baron has slain more people than you have most likely seen in your lifetime.', 0);
INSERT INTO `quest_request_items` VALUES (5264, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5265, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (5281, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5282, 1, 0, 0, 0, 'Compassion is what separates us from the animals, $N. Remember that...', 0);
INSERT INTO `quest_request_items` VALUES (5283, 1, 0, 0, 0, 'Ah, ain\'t nothing like a good forge tan. Ye can tell who\'s got the really good tans by their apron lines.', 0);
INSERT INTO `quest_request_items` VALUES (5284, 1, 0, 0, 0, '<Ironus is busy stacking gold coins into neat little piles.>', 0);
INSERT INTO `quest_request_items` VALUES (5301, 1, 0, 0, 0, 'I will pound the steel until the breath itself has been taken from me.', 0);
INSERT INTO `quest_request_items` VALUES (5302, 1, 0, 0, 0, 'For the glory of the Horde!', 0);
INSERT INTO `quest_request_items` VALUES (5305, 1, 0, 0, 0, 'His apron! Where is it?', 0);
INSERT INTO `quest_request_items` VALUES (5306, 1, 0, 0, 0, 'Legend states that one use of Vosh\'gajin\'s snakestone will keep an axe razor sharp for a 1000 years!', 0);
INSERT INTO `quest_request_items` VALUES (5307, 1, 0, 0, 0, 'Have you forgotten what it is that you were tasked with, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5321, 1, 0, 0, 0, 'Has Kerlonian arrived?', 0);
INSERT INTO `quest_request_items` VALUES (5341, 25, 0, 0, 0, 'Bow your head in my presence, $r. I am a noble, after all, and you are a copperless peasant.', 0);
INSERT INTO `quest_request_items` VALUES (5342, 1, 0, 0, 0, 'Secure my fortune and share in the spoils.', 0);
INSERT INTO `quest_request_items` VALUES (5343, 1, 0, 0, 0, 'Bow your head in my presence, $R. I am a noble, after all, and you are a copperless peasant.', 0);
INSERT INTO `quest_request_items` VALUES (5344, 1, 0, 0, 0, 'You do want payment, do you not?', 0);
INSERT INTO `quest_request_items` VALUES (5361, 1, 0, 0, 0, 'What news have you, $C! Ah - a message from my brother you say? Well then, hand over the report!', 0);
INSERT INTO `quest_request_items` VALUES (5381, 1, 0, 0, 0, '$n, do you have the Demon Box?', 0);
INSERT INTO `quest_request_items` VALUES (5382, 1, 0, 0, 0, 'The Butcher must be stopped!', 0);
INSERT INTO `quest_request_items` VALUES (5384, 1, 0, 0, 0, 'Be wary, Kirtonos is a seasoned fighter.', 0);
INSERT INTO `quest_request_items` VALUES (5385, 1, 0, 0, 0, 'How did things go in Jaedenar, $N?', 0);
INSERT INTO `quest_request_items` VALUES (5386, 1, 0, 0, 0, 'My hoof tingles and my mouth starts to water when I think of fried Bloodbelly fish... You have any on you?', 0);
INSERT INTO `quest_request_items` VALUES (5401, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5402, 1, 0, 0, 0, 'A Minion\'s Scourgestone is the insignia of the Scourge rank and file.  These are sometimes found on the weaker of their troops positioned in the Plaguelands, though the term \"weaker\" is certainly to be considered in context.  The Scourge, no matter where they are, should never be underestimated.$B$BThe Argent Dawn currently offers a valor token in exchange for twenty of these insignia - an exchange I\'m happy to do, provided you have earned enough scourgestones!', 0);
INSERT INTO `quest_request_items` VALUES (5403, 1, 0, 0, 0, 'An Invader\'s Scourgestone is the insignia of the Scourge\'s elite troops.  These are sometimes found on the stronger of the troops positioned in the Plaguelands.  Slaying such a creature is indeed a challenge, but one that should be relished with a commission to vanquish evil.$B$BThe Argent Dawn currently offers a valor token in exchange for ten of these insignia.  Bring them to me here, and I will make sure you receive your just reward.', 0);
INSERT INTO `quest_request_items` VALUES (5404, 1, 0, 0, 0, 'A Corruptor\'s Scourgestone is the insignia of the Scourge\'s overlords.  A powerful being that holds a position of authority over the Scourge will always possess one.  To slay such a malevolent creature would surely advance the cause of the Argent Dawn, and all good causes!$B$BOn behalf of the Argent Dawn, I will give you a valor token in exchange for just a single one these insignia.  Use caution in acquiring one, $N - such powerful beings are not to be trifled with.', 0);
INSERT INTO `quest_request_items` VALUES (5405, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5406, 1, 0, 0, 0, 'A Corruptor\'s Scourgestone is the insignia of the Scourge\'s overlords.  A powerful being that holds a position of authority over the Scourge will always possess one.  To slay such a malevolent creature would surely advance the cause of the Argent Dawn, and all good causes!$B$BOn behalf of the Argent Dawn, I will give you a valor token in exchange for just a single one these insignia.  Use caution in acquiring one, $N - such powerful beings are not to be trifled with.', 0);
INSERT INTO `quest_request_items` VALUES (5407, 1, 0, 0, 0, 'An Invader\'s Scourgestone is the insignia of the Scourge\'s elite troops.  These are sometimes found on the stronger of the troops positioned in the Plaguelands.  Slaying such a creature is indeed a challenge, but one that should be relished with a commission to vanquish evil.$B$BThe Argent Dawn currently offers a valor token in exchange for ten of these insignia.  Bring them to me here, and I will make sure you receive your just reward.', 0);
INSERT INTO `quest_request_items` VALUES (5408, 1, 0, 0, 0, 'A Minion\'s Scourgestone is the insignia of the Scourge rank and file.  These are sometimes found on the weaker of their troops positioned in the Plaguelands, though the term \"weaker\" is certainly to be considered in context.  The Scourge, no matter where they are, should never be underestimated.$B$BThe Argent Dawn currently offers a valor token in exchange for twenty of these insignia - an exchange I\'m happy to do, provided you have earned enough scourgestones!', 0);
INSERT INTO `quest_request_items` VALUES (5421, 1, 0, 0, 0, 'I\'ll reward anyone who makes my life a bit easier... I enjoy doing as little as possible, mon!$B$BBelow the docks here in Shadowprey Village, I\'ve many shellfish traps.  If you\'re kind enough to do my work and collect me my shellfish, then I\'ll reward you with something you want... get my drift mon?  For every five shellfish you bring me I will give you a fine Bloodbelly fish!', 0);
INSERT INTO `quest_request_items` VALUES (5441, 5, 1, 0, 0, 'No good lazy... Eh?  Do you have my blackjack?  Did you catch any peons sleeping on the job?! ', 0);
INSERT INTO `quest_request_items` VALUES (5461, 1, 0, 0, 0, 'A keepsake of remembrance is a rare find, $N.', 0);
INSERT INTO `quest_request_items` VALUES (5462, 1, 0, 0, 0, 'Do not ask questions of which you do not want answers.', 0);
INSERT INTO `quest_request_items` VALUES (5463, 1, 0, 0, 0, 'The area around Menethil\'s Gift is exceptionally cold.', 0);
INSERT INTO `quest_request_items` VALUES (5464, 1, 0, 0, 0, '<Leonid shudders.>', 0);
INSERT INTO `quest_request_items` VALUES (5465, 1, 0, 0, 0, 'Have you done the impossible?', 0);
INSERT INTO `quest_request_items` VALUES (5466, 1, 0, 0, 0, 'You carry the burden of ten thousand restless souls, $N.', 0);
INSERT INTO `quest_request_items` VALUES (5481, 1, 0, 0, 0, 'Where\'s that useless abomination? Either you have what I need or you\'d best get out there and find it. ', 0);
INSERT INTO `quest_request_items` VALUES (5482, 1, 0, 0, 0, 'This had better be good. I trust you have all of the doom weed that I require? ', 0);
INSERT INTO `quest_request_items` VALUES (5501, 1, 0, 0, 0, 'Do you have the bones?  The caravan will be here any moment.  I need just ten more kodo bones to reach a career high.  A career high, I tell you!', 0);
INSERT INTO `quest_request_items` VALUES (5502, 1, 0, 0, 0, 'It is a pleasure to see you again, $N.  Have you attended to the duties you\'ve volunteered for during Children\'s Week?', 0);
INSERT INTO `quest_request_items` VALUES (5503, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5504, 1, 0, 0, 0, 'Ah, noble $C! Have you brought the valor tokens requested of you? Once you hand them to me, I will make our various mantles available to you for purchase.', 0);
INSERT INTO `quest_request_items` VALUES (5505, 1, 0, 0, 0, 'Well, here you are, $n - the completed Skeleton Key. I am certain as I can be that this key will allow you within the confines of the Scholomance. There\'s only one way to be absolutely sure it works, though. Waste no time in trying it out, I say.', 0);
INSERT INTO `quest_request_items` VALUES (5507, 1, 0, 0, 0, 'Ah, noble $C! Have you brought the valor tokens requested of you? Once you hand them to me, I will make our various mantles available to you for purchase.', 0);
INSERT INTO `quest_request_items` VALUES (5508, 1, 0, 0, 0, 'A Corruptor\'s Scourgestone is the insignia of the Scourge\'s overlords.  A powerful being that holds a position of authority over the Scourge will always possess one.  To slay such a malevolent creature would surely advance the cause of the Argent Dawn, and all good causes!$B$BOn behalf of the Argent Dawn, I will give you a valor token in exchange for just a single one of these insignia.  Use caution in acquiring one, $N - such powerful beings are not to be trifled with.', 0);
INSERT INTO `quest_request_items` VALUES (5509, 1, 0, 0, 0, 'An Invader\'s Scourgestone is the insignia of the Scourge\'s elite troops.  These are sometimes found on the stronger of the troops positioned in the Plaguelands.  Slaying such a creature is indeed a challenge, but one that should be relished with a commission to vanquish evil.$B$BThe Argent Dawn currently offers a valor token in exchange for ten of these insignia.  Bring them to me here, and I will make sure you receive your just reward.', 0);
INSERT INTO `quest_request_items` VALUES (5510, 1, 0, 0, 0, 'A Minion\'s Scourgestone is the insignia of the Scourge rank and file.  These are sometimes found on the weaker of their troops positioned in the Plaguelands, though the term \"weaker\" is certainly to be considered in context.  The Scourge, no matter where they are, should never be underestimated.$B$BThe Argent Dawn currently offers a valor token in exchange for twenty of these insignia - an exchange I\'m happy to do, provided you have earned enough scourgestones!', 0);
INSERT INTO `quest_request_items` VALUES (5511, 1, 0, 0, 0, 'Well, here you are, $n - the completed Skeleton Key. I am certain as I can be that this key will allow you within the confines of the Scholomance. There\'s only one way to be absolutely sure it works, though. Waste no time in trying it out, I say.', 0);
INSERT INTO `quest_request_items` VALUES (5513, 1, 0, 0, 0, 'Ah, noble $C! Have you brought the valor tokens requested of you? Once you hand them to me, I will make our various mantles available to you for purchase.', 0);
INSERT INTO `quest_request_items` VALUES (5514, 1, 0, 0, 0, 'Yeah, I know who you are, and I know why you\'re here. Dithers sent word to me before you arrived. Let\'s cut to deal at hand, now shall we?$b$bI\'ve got a mold you can use for the skeleton key, but it will cost you - fifteen gold, up front, no negotiation. I\'ll pack the skeletal fragments into the mold for you, and I\'ll also teach you on how to forge the stem of the key without any knowledge of blacksmithing... all free of charge no less.$b$bWho says mercenaries don\'t offer competitive deals!', 0);
INSERT INTO `quest_request_items` VALUES (5515, 0, 0, 0, 0, '<Eva fades in and out of focus.>', 0);
INSERT INTO `quest_request_items` VALUES (5517, 1, 0, 0, 0, 'Salutations, mighty priest! Have you brought the valor tokens I asked of you? Once you hand them to me, I will issue you your own Chromatic Mantle of the Dawn.', 0);
INSERT INTO `quest_request_items` VALUES (5518, 1, 0, 0, 0, 'The Ogre Tannin is probably the toughest thing to find for what I need to make the suit - I think they have some upstairs?  It\'s hard to tell, since this ball and chain doesn\'t make movement that easy to do...$B$BAnyway, bring me the things I need, and I\'ll whip you up an ogre suit that will fool Captain Kromcrush into thinking you\'re one of his men.', 0);
INSERT INTO `quest_request_items` VALUES (5519, 1, 0, 0, 0, 'Need another suit, do ya? Well, I\'m not going anywhere soon it seems - bring me the same things I asked for from before, and I\'ll make you another ogre suit.', 0);
INSERT INTO `quest_request_items` VALUES (5521, 1, 0, 0, 0, 'Salutations, mighty $C! Have you brought the valor tokens I asked of you? Once you hand them to me, I will issue you your own Chromatic Mantle of the Dawn.', 0);
INSERT INTO `quest_request_items` VALUES (5522, 1, 0, 0, 0, 'You are the one up to mischief in Blackrock Spire, yes? Do you have what I asked for?', 0);
INSERT INTO `quest_request_items` VALUES (5524, 1, 0, 0, 0, 'Salutations, mighty $C! Have you brought the valor tokens I asked of you? Once you hand them to me, I will issue you your own Chromatic Mantle of the Dawn.', 0);
INSERT INTO `quest_request_items` VALUES (5525, 1, 0, 0, 0, 'It\'s called the Gordok Shackle Key - well, that\'s what these \"tons o\' fun\" keep calling it. I think any of the ogres might have it, but I\'m not sure if any specific ones do. Maybe the guards have a better chance of having one...$B$BWhat am I talking about - you have it already, don\'t you?! Is that it there??!', 0);
INSERT INTO `quest_request_items` VALUES (5526, 1, 0, 0, 0, 'With the Sealed Reliquary of Purity in our possession, it will be possible not only to remove a corrupting threat from the world but also to study it under our judicious watch. Perhaps we can even devise new means to combat the taint of corruption that ever threatens Azeroth.$b$bI know Milli would have had it no other way...', 0);
INSERT INTO `quest_request_items` VALUES (5527, 1, 0, 0, 0, 'A Reliquary of Purity is an artifact unto itself.  Few were ever made, and almost all of them were thought to have been lost over time.$B$BI admit I have known about the one in Southwind for a little while now.  Honestly, with the rising turmoil in Silithus, I thought to keep our secrets just that - a secret.  To poke and prod would only cause suspicions of our enemies to rise.$B$BAlas, the time for complacency is at an end, especially with the situation in Eldre\'Thalas. ', 0);
INSERT INTO `quest_request_items` VALUES (5528, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5529, 1, 5, 0, 0, 'Get to the Scholomance, $N.  Take out those plagued hatchlings before they grow!', 0);
INSERT INTO `quest_request_items` VALUES (5531, 1, 0, 0, 0, 'Hello, $N! I heard you were here with some dragon eggs? Well, let\'s see them!', 0);
INSERT INTO `quest_request_items` VALUES (5533, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5534, 1, 0, 0, 0, 'Well, $N? Where is the rune? You are a good employee, right? You\'re here to help?$b$bDon\'t make me think twice about paying you what we agreed upon. What? Oh, we didn\'t agree on anything? Oh, great... then take your time--just know that it\'ll be a lot less if you take a long time.', 0);
INSERT INTO `quest_request_items` VALUES (5535, 1, 6, 0, 0, 'How goes your search for the Highborne spirits, $c?$B$BMany events have caused all the races of Azeroth great suffering, but for some reason, these spirits seem to be a plague for all people. Perhaps it is there continued desire for any arcane magic--such desire is a harbinger of the Burning Legion, and we know what that can lead to.', 0);
INSERT INTO `quest_request_items` VALUES (5536, 1, 1, 0, 0, 'How goes your battle against the satyr, $c?$B$BAre they as strong as you thought? Stronger? Or perhaps they were nothing to your own might.', 0);
INSERT INTO `quest_request_items` VALUES (5537, 1, 0, 0, 0, 'As morbid as it sounds, we\'ll need a decent supply of suitable skeletal fragments to make up the outer layer of the key.  They don\'t call it a Skeleton Key for nothing, you know.', 0);
INSERT INTO `quest_request_items` VALUES (5538, 1, 0, 0, 0, 'Yeah, I know who you are, and I know why you\'re here. Dithers sent word to me before you arrived. Let\'s cut to deal at hand, now shall we?$b$bI\'ve got a mold you can use for the skeleton key, but it will cost you - fifteen gold, up front, no negotiation. I\'ll pack the skeletal fragments into the mold for you, and I\'ll also teach you on how to forge the stem of the key without any knowledge of blacksmithing... all free of charge no less.$b$bWho says mercenaries don\'t offer competitive deals!', 0);
INSERT INTO `quest_request_items` VALUES (5541, 1, 0, 0, 0, 'I hope you\'re not here for ammo, because I\'m almost out! ', 0);
INSERT INTO `quest_request_items` VALUES (5542, 1, 5, 0, 0, 'Do not pity the demon dogs, $r. They are abominations!', 0);
INSERT INTO `quest_request_items` VALUES (5543, 1, 1, 0, 0, 'Do not underestimate the winged vermin, $r. The Plague has given them supernatural abilities.', 0);
INSERT INTO `quest_request_items` VALUES (5544, 1, 0, 0, 0, 'You will grow to tolerate the taste, $r.', 0);
INSERT INTO `quest_request_items` VALUES (5545, 0, 0, 0, 0, 'That deadline isn\'t getting any further away, $c. Please hurry and collect those bundles of wood. ', 0);
INSERT INTO `quest_request_items` VALUES (5561, 1, 0, 0, 0, 'The caravan will be here shortly; do you have the five new tamed kodos I was asking for?', 0);
INSERT INTO `quest_request_items` VALUES (5581, 1, 0, 0, 0, 'Have you banished the demon portals at Mannoroc Coven?', 0);
INSERT INTO `quest_request_items` VALUES (5582, 1, 0, 0, 0, '$N, do you have something to show me?', 0);
INSERT INTO `quest_request_items` VALUES (5601, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5621, 1, 0, 0, 0, 'Our spells of Fortify are very powerful, Delor. They allow our companions to take further injury from all types of attacks and survive in situations where they would normally fall. But this is nothing when compared to our abilities to heal. There are no greater healers than a priest--do well to remember that. Your power alone can turn the tides of battle easily.', 0);
