INSERT INTO `quest_request_items` VALUES (5713, 1, 0, 0, 0, 'Have you seen of Sentinel Aynasha on the road? She left on an important mission but she has not yet returned.', 0);
INSERT INTO `quest_request_items` VALUES (5721, 1, 0, 0, 0, 'I think I heard ghosts outside. They whisper scary things to me...', 0);
INSERT INTO `quest_request_items` VALUES (5722, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5723, 1, 6, 0, 0, 'How goes your search for the Chasm? And the troggs?$B$BThe threat cannot be allowed to persist--it will only injure our orc brethren if it continues.', 0);
INSERT INTO `quest_request_items` VALUES (5724, 1, 0, 0, 0, 'Were you able to find anything, $N? Any clues as to why one of her clansman had to die needlessly would be helpful.', 0);
INSERT INTO `quest_request_items` VALUES (5725, 1, 0, 0, 0, 'There are a hundred other tasks awaiting my attention, $C. Do you have the books?', 0);
INSERT INTO `quest_request_items` VALUES (5726, 1, 0, 0, 0, 'Do you have the insignia yet, $N?$b$bIt will be a vital tool in you infiltrating what I believe is the greatest threat to the Horde and us finally finding peace in our new home.$b$bYou will learn how intricate a web men and orcs alike can weave when they are motivated by greed and power. The hidden agendas, the corruption, all of it will become clear. You will find yourself in the midst of a war you never knew existed.', 0);
INSERT INTO `quest_request_items` VALUES (5727, 1, 0, 0, 0, 'Well, $c? Does he believe our ploy, or are things worse than I had first estimated?$b$bProving valuable to Neeru will make our infiltration of the Shadow Council much easier. He will have plenty of information that we can use to route out those who would destroy all we have built in Durotar.', 0);
INSERT INTO `quest_request_items` VALUES (5728, 1, 0, 0, 0, 'Have you found them yet, $N? The leaders of the Searing Blade.$b$bI knew the Shadow Council sought to take Orgrimmar and all of the Horde from me, but I hadn\'t realized how quickly they were able to infiltrate the city. So many arms this beast has... we can cut them off until exhaustion sets in, but we will be no further than when we started. I will have to have my spies double their efforts.', 0);
INSERT INTO `quest_request_items` VALUES (5729, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5730, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5741, 1, 0, 0, 0, 'Do you have the Sceptre of Light?$B$B', 0);
INSERT INTO `quest_request_items` VALUES (5742, 1, 0, 0, 0, 'Please, friend; sit and hear my tale.', 0);
INSERT INTO `quest_request_items` VALUES (5761, 1, 0, 0, 0, 'Have you killed the beast? He surely must be the leader of the Searing Blade in Ragefire Chasm.', 0);
INSERT INTO `quest_request_items` VALUES (5762, 1, 0, 0, 0, 'Is that desert dust on your collar?$b$bHm... if my nose tells true, I\'d say it\'s not desert dust, it\'s desert salt!  Been to the Shimmering Flats, have you?', 0);
INSERT INTO `quest_request_items` VALUES (5763, 1, 0, 0, 0, 'Sit, $C. Soon enough you\'ll strike back into the jungle.', 0);
INSERT INTO `quest_request_items` VALUES (5781, 5, 0, 0, 0, 'He must be redeemed.', 0);
INSERT INTO `quest_request_items` VALUES (5801, 1, 0, 0, 0, 'Do you have the stem of the skeletal key finished? I\'m truly sorry you had to bear the brunt of the fee to purchase the mold, but we must all do our part to counter the Scourge. Once you hand me the unfinished key, you\'ll be ready for the final item needed to complete its construction.$b$bIt won\'t be easy at all, but the work you\'ve done to date in preparing for an assault on Andorhal will now start to pay for itself. You\'ll see.', 0);
INSERT INTO `quest_request_items` VALUES (5802, 1, 0, 0, 0, 'Do you have the stem of the skeletal key finished? I\'m truly sorry you had to bear the brunt of the fee to purchase the mold, but we must all do our part to counter the Scourge. Once you hand me the unfinished key, you\'ll be ready for the final item needed to complete its construction.$b$bIt won\'t be easy at all, but the work you\'ve done to date in preparing for an assault on Andorhal will now start to pay for itself. You\'ll see.', 0);
INSERT INTO `quest_request_items` VALUES (5803, 1, 0, 0, 0, 'You\'ve come this far $N - only the destruction of the physical form of Araj the Summoner will provide us with the means to finish the key. Get Araj\'s scarab, by hook or by crook, and bring it to me - I will fuse it on as the head of the key.', 0);
INSERT INTO `quest_request_items` VALUES (5804, 1, 0, 0, 0, 'You\'ve come this far $N - only the destruction of the physical form of Araj the Summoner will provide us with the means to finish the key. Get Araj\'s scarab, by hook or by crook, and bring it to me - I will fuse it on as the head of the key.', 0);
INSERT INTO `quest_request_items` VALUES (5805, 1, 0, 0, 0, 'Greetings! It is a pleasure to meet you!$B$BI see you have a special voucher. Give it to me and I will offer you something in exchange.', 0);
INSERT INTO `quest_request_items` VALUES (5821, 1, 0, 0, 0, 'Why do I find myself waiting for that blasted caravan?$b$b<Smeed looks enlightened.>$b$bOh yeah, they pay the bills. Have you seen them?', 0);
INSERT INTO `quest_request_items` VALUES (5841, 1, 0, 0, 0, 'Hello!  It is a pleasure to meet you! I see you have a special voucher.  Give it to me and I will offer you something in exchange. ', 0);
INSERT INTO `quest_request_items` VALUES (5842, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5843, 1, 0, 0, 0, 'Hello!  It is a pleasure to meet you! I see you have a special voucher.  Give it to me and I will offer you something in exchange. ', 0);
INSERT INTO `quest_request_items` VALUES (5844, 1, 0, 0, 0, 'Greetings! It is a pleasure to meet you!$B$BI see you have a special voucher. Give it to me and I will offer you something in exchange.', 0);
INSERT INTO `quest_request_items` VALUES (5845, 1, 0, 0, 0, 'My faith will guide you, $N. The Light knows no bounds.', 0);
INSERT INTO `quest_request_items` VALUES (5846, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5847, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5848, 6, 0, 0, 0, 'The painting, $N. Do you have the painting?', 0);
INSERT INTO `quest_request_items` VALUES (5861, 1, 0, 0, 0, 'I knew this day would come.', 0);
INSERT INTO `quest_request_items` VALUES (5862, 1, 0, 0, 0, 'Are you the reinforcements from Tyr\'s Hand?', 0);
INSERT INTO `quest_request_items` VALUES (5863, 1, 1, 0, 0, 'I\'m so worried! Please be careful!', 0);
INSERT INTO `quest_request_items` VALUES (5881, 1, 0, 0, 0, 'You have news from Maggran Earthbinder?', 0);
INSERT INTO `quest_request_items` VALUES (5882, 1, 0, 0, 0, 'Possessing a Cenarion Beacon allows one to sea a corrupted soul shard on those tainted beasts that are put down for the greater good. I grind shards into a usable reagent that goes into making Cenarion plant salve. We will use that salve to turn corrupted plants into healthy ones again.$b$bIn exchange for these shards, I will give you some Cenarion plant salves I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (5883, 1, 0, 0, 0, 'If you possess a Cenarion beacon while mining in Felwood, you will be able to see tainted vitriol that corrupts a vein of raw metal. I know how to purify that vitriol and turn it into a reagent that goes into making Cenarion plant salve. You will then use that salve on plants you find in the wild that need saving.$b$bIf you have collected any tainted vitriol, I\'ll give you some Cenarion plant salve I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (5884, 1, 0, 0, 0, 'A Cenarion beacon allows a seasoned herbalist to spot insidious fel creep - a malfeasant product of Felwood\'s corruption. My work here has taught me the knowledge of purifying fel creep into a cleansing reagent... used in what we now refer to as Cenarion plant salve.$b$bWhen you gather herbs in Felwood, you should encounter the fel creep so long as you have the beacon. In exchange for what you bring to me, I will give you pre-made Cenarion plant salve.', 0);
INSERT INTO `quest_request_items` VALUES (5885, 1, 0, 0, 0, 'A Cenarion beacon will allow a well-trained skinner to spot patches of tainted skin from bounty gathered in Felwood. I convert these seemingly useless patches into a thick paste that serves as a quickening agent for Cenarion plant salve. When you skin your kills here in Felwood, be sure to have a beacon on you!$b$bWhen you collect tainted patches, bring them to me and I will give you some Cenarion plant salves that I have already made.', 0);
INSERT INTO `quest_request_items` VALUES (5886, 1, 0, 0, 0, 'The power of a disenchanted magical item is felt by the essence it creates. I\'ve devised a way to turn raw essence used by enchanters into a suitable reagent for creating Cenarion plant salve. You don\'t need a Cenarion beacon for this; any suitably disenchanted item that yields lesser nether essences will work.$b$bI just need a single lesser nether essence; in exchange, I will give you Cenarion plant salves. The essence is extremely potent - a little definitely goes a long way! ', 0);
INSERT INTO `quest_request_items` VALUES (5887, 1, 0, 0, 0, 'Possessing a Cenarion beacon allows one to see a corrupted soul shard on those tainted beasts that are put down for the greater good.  I grind shards into a usable reagent that goes into making Cenarion plant salve.  We will use that salve to turn corrupted plants into healthy ones again.$B$BIn exchange for these shards, I will give you some Cenarion plant salves I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (5888, 1, 0, 0, 0, 'If you possess a Cenarion beacon while mining in Felwood, you will be able to see tainted vitriol that corrupts a vein of raw metal.  I know how to purify that vitriol and turn it into a reagent that goes into making Cenarion plant salve.  You will then use that salve on plants you find in the wild that need saving.$B$BIf you have collected any tainted vitriol, I\'ll give you some Cenarion plant salve I have already prepared.', 0);
INSERT INTO `quest_request_items` VALUES (5889, 1, 0, 0, 0, 'A Cenarion beacon allows a seasoned herbalist to spot insidious fel creep - a malfeasant product of Felwood\'s corruption. My work here has taught me the knowledge of purifying fel creep into a cleansing reagent... used in what we now refer to as Cenarion plant salve.$b$bWhen you gather herbs in Felwood, you should encounter the fel creep so long as you have the beacon. In exchange for what you bring to me, I will give you pre-made Cenarion plant salve.', 0);
INSERT INTO `quest_request_items` VALUES (5890, 1, 0, 0, 0, 'A Cenarion beacon will allow a well-trained skinner to spot patches of tainted skin from bounty gathered in Felwood. I convert these seemingly useless patches into a thick paste that serves as a quickening agent for Cenarion plant salve. When you skin your kills here in Felwood, be sure to have a beacon on you!$b$bWhen you collect tainted patches, bring them to me and I will give you some Cenarion plant salves that I have already made.', 0);
INSERT INTO `quest_request_items` VALUES (5891, 1, 0, 0, 0, 'The power of a disenchanted magical item is felt by the essence it creates.  I\'ve devised a way to turn raw essence used by enchanters into a suitable reagent for creating Cenarion plant salve.  You don\'t need a Cenarion beacon for this; any suitably disenchanted item that yields lesser nether essences will work.$B$BI just need a single lesser nether essence; in exchange, I will give you Cenarion plant salves.  The essence is extremely potent - a little definitely goes a long way!', 0);
INSERT INTO `quest_request_items` VALUES (5892, 1, 0, 0, 0, 'Do you have the supplies, $N? We can never have enough!', 0);
INSERT INTO `quest_request_items` VALUES (5893, 1, 0, 0, 0, 'Have you been to the Coldtooth mine, $N? Do you have the supplies I asked for?', 0);
INSERT INTO `quest_request_items` VALUES (5901, 1, 0, 0, 0, 'Do you have the termites yet, $N? I am sure it is obvious to a smart $C like yourself.$B$BOnce we have enough of them, we\'ll make sure no one can use the lumber mill ever again!', 0);
INSERT INTO `quest_request_items` VALUES (5902, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5903, 6, 0, 0, 0, 'Did you find the termite mounds, $N? I\'ve heard they are all over Plaguewood.', 0);
