INSERT INTO `quest_request_items` VALUES (5941, 6, 0, 0, 0, 'I have been in contact with your friend Carlin.  He feels great pain for the doom of his village, but he speaks very highly of you and knows that you can set things right.$B$BOh, but I\'m drifting from the subject at hand... $N, do you have the relics I asked for?', 0);
INSERT INTO `quest_request_items` VALUES (5942, 0, 0, 0, 0, 'This chest is old and covered in grime.', 0);
INSERT INTO `quest_request_items` VALUES (5943, 1, 0, 0, 0, 'You know, if that caravan were to ever disappear I would be ruined! You\'re not the bearer of bad news about the caravan, are you?$b$b<Smeed wipes his brow.>$b$bThank the goddess of greed!', 0);
INSERT INTO `quest_request_items` VALUES (5944, 1, 0, 0, 0, '<Tirion regains his composure.>', 0);
INSERT INTO `quest_request_items` VALUES (5961, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (5981, 1, 0, 0, 0, 'You must continue to prove yourself, $N.', 0);
INSERT INTO `quest_request_items` VALUES (6001, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6002, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6004, 1, 6, 0, 0, 'How is it going, $N? Are they stronger than you thought? I hope not. If I\'m going to follow through here, then it\'s going to require a heck of a lot more strength than what I\'ve already asked you to do.', 0);
INSERT INTO `quest_request_items` VALUES (6021, 5, 0, 0, 0, 'Did you find the hideout, $N?  Did you take care of Zaeldarr?', 0);
INSERT INTO `quest_request_items` VALUES (6022, 1, 0, 0, 0, 'Are you crying? If this is too \'tedious\' for you, \'hero,\' I recommend that you head back to the Dark Lady and inform her of the horrible mistreatment you received at my farmstead.$b$bNow get out of my sight!', 0);
INSERT INTO `quest_request_items` VALUES (6023, 1, 0, 0, 0, 'Have you found them yet, $N? With the two of them taken care of, I can proceed to enter Hearthglen to take a closer look at their setup. I can\'t do it without your help. Please, find Radley and Durgen for me.', 0);
INSERT INTO `quest_request_items` VALUES (6024, 0, 0, 0, 0, 'This chest buried here is securely locked.', 0);
INSERT INTO `quest_request_items` VALUES (6025, 1, 0, 0, 0, 'It\'s a dangerous task, $n. I envy your courage.', 0);
INSERT INTO `quest_request_items` VALUES (6026, 1, 0, 0, 0, 'Trust ol\' Smokey, $r. The reward will be worth it. These Argent Dawn folk don\'t mess around when it comes to payment.\n', 0);
INSERT INTO `quest_request_items` VALUES (6027, 1, 0, 0, 0, 'Ah, $N! It\'s good to see you again. Do you have the Book of the Ancients?$b$b', 0);
INSERT INTO `quest_request_items` VALUES (6028, 1, 0, 0, 0, 'Greetings, $N. On behalf of the Argent Dawn, I offer you safety and shelter while you are here at Chillwind Camp. I might also have some work for you...', 0);
INSERT INTO `quest_request_items` VALUES (6029, 1, 0, 0, 0, 'Greetings, $C.  On behalf of the Argent Dawn, I offer you safety and shelter while you are here at Bulwark.  I might also offer you the chance to fight for a cause that\'s worth fighting for!', 0);
INSERT INTO `quest_request_items` VALUES (6030, 1, 0, 0, 0, 'May the Light guide you in these troubling times, $C. What brings you here to this beacon of hope in the middle of darkness and despair?', 0);
INSERT INTO `quest_request_items` VALUES (6031, 0, 0, 0, 0, 'Do you have the runecloth?  My people are eager for more items of runecloth!', 0);
INSERT INTO `quest_request_items` VALUES (6032, 1, 0, 0, 0, 'Have you brought the mooncloth, $N?', 0);
INSERT INTO `quest_request_items` VALUES (6041, 1, 0, 0, 0, 'I got supplies left over to make a few more sticks of the special compound. Just let ol\' Smokey know if you need more.', 0);
INSERT INTO `quest_request_items` VALUES (6042, 1, 0, 0, 0, 'It could have been worse. I could have had you collecting bat guano.$B$B<Nathanos stares at you in contemplation.>$B$BHrm... Hey! Wait a minute. Where are you going?', 0);
