INSERT INTO `quest_request_items` VALUES (6086, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6087, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6088, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6089, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6101, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6102, 1, 0, 0, 0, 'I am proud of your accomplishments, $N. Have you finished the last task I gave you?', 0);
INSERT INTO `quest_request_items` VALUES (6103, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6121, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6122, 1, 0, 0, 0, 'You\'re the one that the Cenarion Circle in Moonglade sent? That\'s wonderful! We\'ve quite the crisis our hands here regarding the poor deer, and we\'re happy for all the help we can get.$B$BDo you have the sample of water that Dendrite Starblaze said you\'d have? He notified me that you\'d draw one so we could work on a cure together...', 0);
INSERT INTO `quest_request_items` VALUES (6123, 1, 0, 0, 0, 'Have you got the reagents I need to make the salve? The deer aren\'t getting any better on their own, so we better hurry to help them out!', 0);
INSERT INTO `quest_request_items` VALUES (6124, 1, 0, 0, 0, 'Have you completed what was asked of you by Alanndarian Nightsong of Auberdine? Your work is not complete unless it is.', 0);
INSERT INTO `quest_request_items` VALUES (6125, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6126, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6127, 1, 0, 0, 0, 'You are the one that the Cenarion Circle in Moonglade sent, yes? This is most fortuitous for us! We are stymied in our effort to bring balance to the sickly gazelles that wander the northern Barrens; we\'re happy for all the help we can get.$B$BDo you have the sample of water that Dendrite Starblaze said you\'d have? He notified me that you\'d draw one so we could work on a cure together...', 0);
INSERT INTO `quest_request_items` VALUES (6128, 1, 0, 0, 0, 'Have you got the reagents I need to make the salve? The gazelle aren\'t getting any better on their own, so we better not tarry in our effort to save them!', 0);
INSERT INTO `quest_request_items` VALUES (6129, 1, 0, 0, 0, 'Have you completed what was asked of you by Tonga Runetotem at the Crossroads? Your work is not complete unless it is.', 0);
INSERT INTO `quest_request_items` VALUES (6130, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6131, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6132, 1, 0, 0, 0, 'Have you seen my sister Melizza? She\'s always on the go, which gets her into trouble all the time.', 0);
INSERT INTO `quest_request_items` VALUES (6133, 1, 0, 0, 0, 'Do not leave me waiting, $C.', 0);
INSERT INTO `quest_request_items` VALUES (6134, 6, 0, 0, 0, 'Where\'s my ghost-o-plasm, $N?', 0);
INSERT INTO `quest_request_items` VALUES (6135, 1, 0, 0, 0, 'I would not recommend that you take on this challenge alone, $c.', 0);
INSERT INTO `quest_request_items` VALUES (6136, 1, 6, 0, 0, 'Have I told you lately that I hate you?', 0);
INSERT INTO `quest_request_items` VALUES (6141, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6142, 1, 0, 0, 0, 'I can\'t wait to go fishing with some fresh soft-shelled clam meat; did you bring me the 10 pieces of it I need?', 0);
INSERT INTO `quest_request_items` VALUES (6143, 1, 0, 0, 0, 'I still hear their voices crying for help when the naga unleashed their chaos over us. If I didn\'t have this bad knee, I\'d go and help you kill those blasted naga!$B$BYou can usually guarantee to find them deep in the coral reefs below the surface... lurking... scheming...', 0);
INSERT INTO `quest_request_items` VALUES (6144, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6145, 1, 0, 0, 0, 'Succeed now and you will have almost earned my respect, $C.', 0);
INSERT INTO `quest_request_items` VALUES (6146, 1, 0, 0, 0, 'This is unacceptable, soldier!', 0);
INSERT INTO `quest_request_items` VALUES (6147, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6148, 1, 0, 0, 0, 'What is your status, $N?', 0);
INSERT INTO `quest_request_items` VALUES (6161, 1, 0, 0, 0, 'This chest is securely locked.', 0);
INSERT INTO `quest_request_items` VALUES (6162, 1, 0, 0, 0, 'Do you have the beasts head yet, $N? It will pay for its crimes. I don\'t care if it\'s corrupt or just angry for living in such a dismal forest. No furbolg will live for long committing such crimes against my family!', 0);
INSERT INTO `quest_request_items` VALUES (6163, 1, 0, 0, 0, 'After Sylvanas freed me, I hunted the beast across these wastes for months. It fled to the safety of Stratholme. The bastard...', 0);
INSERT INTO `quest_request_items` VALUES (6164, 0, 0, 0, 0, 'Do you have my receipt book?  I can\'t wait to get back to business!', 0);
INSERT INTO `quest_request_items` VALUES (6181, 1, 0, 0, 0, 'You look like you\'re in a hurry. Well, then you came to the right place!', 0);
INSERT INTO `quest_request_items` VALUES (6182, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6183, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6184, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6185, 6, 0, 0, 0, 'An... Any luck??', 0);
INSERT INTO `quest_request_items` VALUES (6186, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6187, 1, 0, 0, 0, '<Highlord Bolvar Fordragon is lost in thought.>', 0);
INSERT INTO `quest_request_items` VALUES (6221, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6241, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6261, 1, 0, 0, 0, 'Is that sweat on your brow, lad? You\'ve been running too much. Next time, take a gryphon!', 0);
INSERT INTO `quest_request_items` VALUES (6281, 1, 0, 0, 0, 'You\'ve been traveling, eh? Have you been anywhere interesting?', 0);
INSERT INTO `quest_request_items` VALUES (6282, 1, 0, 0, 0, 'Do not be weary of Charred Vale; many evil creatures reside in those hills. Stay strong $N, and you shall prevail over this threat to our people. Go now and strike hard - our children shall never know of the evil of what was.', 0);
INSERT INTO `quest_request_items` VALUES (6283, 1, 0, 0, 0, 'Bloodfury Ripper is a nasty creature! You will have success finding her along the western hill line in the Charred Vale.$b$bThe bloodfuries will be helpless with out... surely we can vanquish them forever!', 0);
INSERT INTO `quest_request_items` VALUES (6284, 1, 0, 0, 0, 'Besseleth is a ruthless predator... I fear for those that travel Webwinder Path at night. It\'s then that she and her children prey upon innocent travelers. I myself fell prey to her two-foot fang of death, but luckily I was able to fend her off and get to safety. I would give anything to see that monster destroyed.', 0);
INSERT INTO `quest_request_items` VALUES (6285, 1, 0, 0, 0, 'You\'re back from Stormwind? Did Osric send the armor?', 0);
INSERT INTO `quest_request_items` VALUES (6301, 1, 0, 0, 0, 'The continuous destruction caused by war and those that seek a profit from lumber pains me deeply. The least I can do is perform the cycle of rebirth and sow the Gaea seeds to replenish the lands with a new forest. Do you have the required Gaea seeds, $C?', 0);
INSERT INTO `quest_request_items` VALUES (6321, 1, 0, 0, 0, 'You appear to be on official business... ', 0);
INSERT INTO `quest_request_items` VALUES (6322, 1, 0, 0, 0, 'If you must travel a long distance, then a bat is your best option. ', 0);
INSERT INTO `quest_request_items` VALUES (6323, 1, 0, 0, 0, 'I keep my weapons in top condition.  They are cleaned and ready for use. ', 0);
INSERT INTO `quest_request_items` VALUES (6324, 1, 0, 0, 0, '$n, you return.  Do you have our supplies from the Undercity? ', 0);
INSERT INTO `quest_request_items` VALUES (6341, 1, 0, 0, 0, 'How may I help you? ', 0);
INSERT INTO `quest_request_items` VALUES (6342, 1, 0, 0, 0, 'Are you ready to return to Dolanaar? ', 0);
INSERT INTO `quest_request_items` VALUES (6343, 1, 0, 0, 0, '$n, you\'re back from Darnassus? ', 0);
INSERT INTO `quest_request_items` VALUES (6344, 1, 0, 0, 0, 'How can I help you? ', 0);
INSERT INTO `quest_request_items` VALUES (6361, 1, 0, 0, 0, 'Are you here for a wind rider?  You have something to transport? ', 0);
INSERT INTO `quest_request_items` VALUES (6362, 1, 0, 0, 0, 'There is dust on your shoulders that must be from Mulgore.  You have spoken with my friend Varg? ', 0);
INSERT INTO `quest_request_items` VALUES (6363, 1, 0, 0, 0, 'Greetings, $c.  What can I do for you?', 0);
INSERT INTO `quest_request_items` VALUES (6364, 1, 0, 0, 0, '$N, you are back from Thunder Bluff?  Did you deliver the hides to Ahanu?', 0);
INSERT INTO `quest_request_items` VALUES (6365, 1, 0, 0, 0, 'You need to get somewhere fast?  Then you\'re talking to the right orc! ', 0);
INSERT INTO `quest_request_items` VALUES (6381, 1, 0, 0, 0, 'These seeds you plant are strong, resisting corruption, and making a foothold for other life. They will grow and grow, first preventing corruption and healing the scarred land, and then one day, restoring Stonetalon to a lush forest, once again.$b$bHave you planted all of the Gaea seeds?', 0);
INSERT INTO `quest_request_items` VALUES (6382, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6383, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6384, 1, 0, 0, 0, 'Something smells good!  You don\'t have raw meat on you, do you? ', 0);
INSERT INTO `quest_request_items` VALUES (6385, 1, 0, 0, 0, 'Do you need one of my wind riders? ', 0);
INSERT INTO `quest_request_items` VALUES (6386, 1, 0, 0, 0, 'Have you returned from Orgrimmar?  Did Gryshka like the meat I sent her? ', 0);
INSERT INTO `quest_request_items` VALUES (6387, 1, 0, 0, 0, 'Have you had your fill of Kharanos so soon?  Are you ready to leave for another city? ', 0);
INSERT INTO `quest_request_items` VALUES (6388, 1, 0, 0, 0, 'You look like you have somewhere to go.  Need one of my gryphons? ', 0);
INSERT INTO `quest_request_items` VALUES (6389, 6, 0, 0, 0, 'Have you done it, $N? Have you released the termites? The Light help us if the Scarlet Crusade were able to hold onto both the mill and Hearthglen. They should have neither. They\'re just capitalizing on the victims of the last war and should be put down like rabid animals!', 0);
INSERT INTO `quest_request_items` VALUES (6390, 1, 0, 0, 0, 'Have you done it, $N? Have you released the termites in the lumber mill?$B$BIt was bad enough that my family lost their jobs and lives, but then to see the place where my childhood was spent taken over by those disgusting so-called holy men... pfah!!', 0);
INSERT INTO `quest_request_items` VALUES (6391, 1, 0, 0, 0, 'What can I do for you, sir? ', 0);
INSERT INTO `quest_request_items` VALUES (6392, 1, 0, 0, 0, 'Ah, $n.  Have you returned from Ironforge? ', 0);
INSERT INTO `quest_request_items` VALUES (6393, 1, 0, 0, 0, 'The Tribunal of the Tides grows impatient. They seek to end this war that has raged across all dimensions for eons. My brethren are anxious to hear news of the glorious victory over the hated fire elementals. Have you the Incendrites that I require?', 0);
INSERT INTO `quest_request_items` VALUES (6394, 1, 0, 0, 0, 'Have you entered the Burning Blade Coven, $n?  Did you find my pick? ', 0);
INSERT INTO `quest_request_items` VALUES (6395, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6401, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6402, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6403, 1, 0, 0, 0, 'I... I... I was powerless.', 0);
INSERT INTO `quest_request_items` VALUES (6421, 1, 0, 0, 0, 'What news have you discovered from Boulderslide Ravine? I recall some legend that deals with Resonite... I just cannot place my hoof on it. Perhaps knowing what lies at the bottom of the cave will illuminate their devious intentions.', 0);
INSERT INTO `quest_request_items` VALUES (6441, 1, 0, 0, 0, 'I hope you can be quick about getting those horns, $N. I\'m heading back to Ratchet soon!', 0);
INSERT INTO `quest_request_items` VALUES (6442, 0, 0, 0, 0, 'The naga increase in numbers, $n. Please complete this task for me.', 0);
INSERT INTO `quest_request_items` VALUES (6461, 1, 0, 0, 0, 'Hey mon, have you slain the hairy blood feeders? I fear none here in Stonetalon but I don\'t go walking around here at night... if you know what I mean mon!$b$bAs long as I stay off there dinner plate then all is well.$b$bGood luck to you, $C!', 0);
INSERT INTO `quest_request_items` VALUES (6462, 14, 0, 0, 0, 'Did you find the charms, $N?  Every moment the furbolgs possess those sacred items, my blood boils with rage!', 0);
INSERT INTO `quest_request_items` VALUES (6481, 1, 0, 0, 0, 'I fear if we do not dispose of this threat immediately, all of Stonetalon will be lost. The might of an Earthen can not be matched by any means. When awakened, Goggeroc will be weak from his long slumber, this will be the opportunity that you must take advantage of... go now $N!', 0);
INSERT INTO `quest_request_items` VALUES (6482, 1, 0, 0, 0, 'Have you seen my brother Ruul? He walked into the forest days ago and has not returned...', 0);
INSERT INTO `quest_request_items` VALUES (6501, 1, 0, 0, 0, 'I sense an aura of evil radiating from you, $R. What could you hold that emits such an aura?', 0);
INSERT INTO `quest_request_items` VALUES (6502, 1, 0, 0, 0, 'The flow of time does not stop or slow, $R. While my life is eternal, yours is not. Waste not the time that you have...', 0);
INSERT INTO `quest_request_items` VALUES (6503, 1, 0, 0, 0, 'I await reports of your outrunner kills, $N.', 0);
INSERT INTO `quest_request_items` VALUES (6504, 0, 0, 0, 0, 'I hope you find the pages soon, $N! I really need to get back to work!', 0);
INSERT INTO `quest_request_items` VALUES (6521, 1, 0, 0, 0, 'Have you found the Ambassador, $N? Is he dead?$B$BWe cannot afford to allow the Scourge to take a foothold on Kalimdor. They are enough of a threat to our own borders to have to deal with them on two fronts.$B$BThe only optimistic sign from the events you\'ve told me about is that the crone seemed uncorrupted. She must know deep in her spirit that the Scourge may bring great power, but that the Barrens would not truly be hers if she were to agree to their deal.', 0);
INSERT INTO `quest_request_items` VALUES (6522, 1, 0, 0, 0, 'What business is it you wish to speak of, $N? You must feel it is important if you continue to pester me.', 0);
INSERT INTO `quest_request_items` VALUES (6523, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6541, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6542, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6543, 0, 0, 0, 0, 'Hurry, $N. They must receive their reports; it is urgent.', 0);
INSERT INTO `quest_request_items` VALUES (6544, 1, 0, 0, 0, 'Torek was sent on a mission against Silverwing Outpost. Was the attack successful?', 0);
INSERT INTO `quest_request_items` VALUES (6545, 1, 0, 0, 0, 'So you\'re here with my orders? Always good to see a new recruit with an exuberant nature and a strong will.$B$BYou\'d best learn fast if you expect to keep up here. The threat of the naga grows, $N. I have observed and have taken up defenses against several attacks on this outpost since I arrived here.$B$BBut if you\'d like to pitch in with that effort, speak with one of the others here at the outpost.', 0);
INSERT INTO `quest_request_items` VALUES (6546, 1, 0, 0, 0, 'Much danger lies along this path, $N. You\'d do best to remember this while traveling in these lands. The threat of the alliance is quite near.$B$BWe are faced by enemies on all fronts. The satyr are a formidable and prevalent force in eastern Ashenvale. I have also discovered that the naga have taken over a large area of the land of Azshara.$B$BIt\'s good to see that we are still bolstering our numbers -- be ready for what lies ahead, $N.', 0);
INSERT INTO `quest_request_items` VALUES (6547, 1, 0, 0, 0, 'Keep an eye out, $R. The elves are often hiding in the shadows...$B$BWe must always be watching. We have worked very hard to claim this land, and the elves are looking for a chance to take it from us.$B$BI assume you have my next orders from Kadrak?', 0);
INSERT INTO `quest_request_items` VALUES (6548, 1, 0, 0, 0, 'Have you killed them yet?', 0);
INSERT INTO `quest_request_items` VALUES (6561, 1, 0, 0, 0, 'May the Earthmother be with you, $N.$B$BPeace between the earth and all her people should be our goal. She has a grand plan for nature, and we all have a role to play in that plan.', 0);
INSERT INTO `quest_request_items` VALUES (6562, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6563, 6, 0, 0, 0, 'How goes your search for the crystals, $N? Have you witnessed the naga harvesting them? I pray to my ancestors we find the reason they are collecting such things.', 0);
INSERT INTO `quest_request_items` VALUES (6564, 1, 0, 0, 0, 'Yes, $N? What is it you need? There is still much I must learn about the crystals the naga are gathering.', 0);
INSERT INTO `quest_request_items` VALUES (6565, 1, 0, 0, 0, 'Have you found him yet, $N? Lorgus must be stopped!', 0);
INSERT INTO `quest_request_items` VALUES (6566, 1, 0, 0, 0, 'Patience, $N. Pay attention!', 0);
INSERT INTO `quest_request_items` VALUES (6567, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6568, 1, 0, 0, 0, 'It is not often I see one of the Horde in these parts of Lordaeron. What is it that you have for Myranda?', 0);
INSERT INTO `quest_request_items` VALUES (6569, 11, 0, 0, 0, 'The eyes of that which we wish to mimic are the most important ingredient of any illusion, $N.$B$B<Myranda points to a bag almost overflowing with eyeballs labeled \'Scarlet Crusade.\'>$B$B<Myranda laughs.>', 0);
INSERT INTO `quest_request_items` VALUES (6570, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6571, 1, 0, 0, 0, 'I hope you can come through with the supplies!', 0);
INSERT INTO `quest_request_items` VALUES (6581, 1, 0, 0, 0, 'Direct from Ratchet, the Warsong saw blades! Yep, I have them right here.$B$B..But what sort of payment do you have for me? You can\'t just take them, you know! My time isn\'t cheap!$B$BWhat I really need is a good gun to carry with me on my travels. A girl\'s gotta protect herself, you know? There\'s a gun I really like that I\'m sure an engineer would have no problem making.$B$BSo, if you bring me a deadly blunderbuss, I\'ll give you the saw blade shipment. Do we have a deal?', 0);
INSERT INTO `quest_request_items` VALUES (6582, 1, 0, 0, 0, '<Emberstrife hisses.>', 0);
INSERT INTO `quest_request_items` VALUES (6583, 1, 0, 0, 0, 'Do not return here until you have bathed in the blood of our enemies and drank in their suffering.', 0);
INSERT INTO `quest_request_items` VALUES (6584, 1, 0, 0, 0, 'Ironically, whelp, time is of the essencccce.', 0);
INSERT INTO `quest_request_items` VALUES (6585, 1, 0, 0, 0, 'Changesss... I sense them taking place in you, whelp. Pass this test and only ceremony remains.', 0);
INSERT INTO `quest_request_items` VALUES (6601, 1, 0, 0, 0, 'Do not panic, $N!', 0);
INSERT INTO `quest_request_items` VALUES (6602, 1, 0, 0, 0, 'I don\'t think I need to tell you that Drakkisath is not to be taken lightly.$B$BI let the thousands dead by his hand do the talking.', 0);
INSERT INTO `quest_request_items` VALUES (6603, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6604, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6605, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6606, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6607, 1, 0, 0, 0, 'Anything bitin\' today?', 0);
INSERT INTO `quest_request_items` VALUES (6608, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6609, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6610, 1, 0, 0, 0, 'My cravings are going to be the end of me! Hurry, $N - before I dip into my own supply.', 0);
INSERT INTO `quest_request_items` VALUES (6611, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6612, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6621, 1, 0, 0, 0, 'Did you defeat Chief Murgut, $N? Did you retrieve his Foulweald Totem?', 0);
INSERT INTO `quest_request_items` VALUES (6622, 1, 0, 0, 0, 'Miraculous work, doctor. Simply miraculous.', 0);
INSERT INTO `quest_request_items` VALUES (6623, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6624, 1, 0, 0, 0, 'Miraculous work, doctor. Simply miraculous.', 0);
INSERT INTO `quest_request_items` VALUES (6625, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6626, 1, 0, 0, 0, 'How goes the hunt, $N? Seeing just this small sample of this diplomat\'s power here removes any doubt I had that the Scourge are one of the greatest threats this world has ever seen.', 0);
INSERT INTO `quest_request_items` VALUES (6627, 1, 0, 0, 0, 'Life is full of questions, $C. You will never be able to answer all of them, but with some time and study, perhaps you will become a little more knowledgeable.', 0);
INSERT INTO `quest_request_items` VALUES (6628, 1, 0, 0, 0, 'There is only one rule I feel you must know if you wish to survive in this world: the more you know, the more you\'ll see.$b$bIf you study, if you observe, then you will begin to see things in the world that no other $r will see.', 0);
INSERT INTO `quest_request_items` VALUES (6629, 1, 0, 0, 0, 'Have you killed Grundig Darkcloud and his personal band of Brutes?', 0);
INSERT INTO `quest_request_items` VALUES (6641, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6642, 1, 0, 0, 0, 'Dark Iron, while plentiful in the Depths, is still a valued commodity amongst the Brotherhood. The sacred arms and armaments of Ragnaros favor Dark Iron.$B$BFor every 10 pieces of Dark Iron Ore you offer, favor amongst the Brotherhood you will gain.', 0);
INSERT INTO `quest_request_items` VALUES (6643, 1, 0, 0, 0, 'Woe unto those that tempt fate inside the Molten Core. Death comes swiftly - the punishment dealt without mercy.$B$BMany of the Brotherhood have been lost in their search for Fiery Cores.$B$BOffer 1 Fiery Core and you shall be granted favor amongst the Brotherhood.', 0);
INSERT INTO `quest_request_items` VALUES (6644, 1, 0, 0, 0, 'The Thorium Brotherhood sympathizes with your plight, $r. This is why Lokthos has been empowered to bargain.$B$BOffer 1 Lava Core and you shall be granted favor amongst the Brotherhood.', 0);
INSERT INTO `quest_request_items` VALUES (6645, 1, 0, 0, 0, 'Many of the sacred recipes require the skin from Ragnaros\' chosen pets.$B$BOffer 2 Core Leather, skinned from the smoldering corpses of the Core Hounds of the Molten Core and you shall be granted favor amongst the Brotherhood.', 0);
INSERT INTO `quest_request_items` VALUES (6646, 1, 0, 0, 0, 'The tears of the Fire Lord are a rare find indeed.$B$BOffer 1 Blood of the Mountain and you shall be granted favor amongst the Brotherhood. \n', 0);
INSERT INTO `quest_request_items` VALUES (6661, 1, 0, 0, 0, 'Yarrr... Swabby, what be takin\' ye so long?', 0);
INSERT INTO `quest_request_items` VALUES (6662, 1, 0, 0, 0, '$b$bAlive and kicking... and just in time!', 0);
INSERT INTO `quest_request_items` VALUES (6681, 1, 0, 0, 0, 'Did you meet Milton?<Fahrad laughs.>', 0);
INSERT INTO `quest_request_items` VALUES (6701, 1, 0, 0, 0, 'We have been entrenched in a battle with the Syndicate for years. What they lack in skill they make up for in numbers. It\'s impossible to kill them off fast enough to have any noticeable impact on their population!$B$BWe\'ve found that the best way to deal with their size is to pilfer their emblems. Once an emblem is stolen the shamed member is \'dealt\' with internally.$B$BPick their pockets clean and turn the emblems in to me or one of the other guards.$B$BStart at Durnholde, south of here.', 0);
INSERT INTO `quest_request_items` VALUES (6721, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6722, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6741, 1, 0, 0, 0, 'I need more armor scraps, $N! Do you have any?', 0);
INSERT INTO `quest_request_items` VALUES (6761, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6762, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6781, 1, 0, 0, 0, '$N, we need more armor scraps to supply our troops!', 0);
INSERT INTO `quest_request_items` VALUES (6801, 1, 0, 0, 0, 'I come from Thunder Bluff, $r. Cairne himself has seen to it that I assist the Frostwolf Clan in these dire times.$b$bBut let us not waste any more time. You must strike down our enemies and bring to me their blood. Once enough blood has been gathered, the ritual of summoning may begin.$b$bVictory will be assured when the elemental lord is loosed upon the Stormpike army.', 0);
INSERT INTO `quest_request_items` VALUES (6804, 0, 0, 0, 0, 'Do you have the bracers?', 0);
INSERT INTO `quest_request_items` VALUES (6805, 1, 0, 0, 0, 'Cowardice is not a thing we hold in regard, $c.  Go to Silithus and prove your bravery.', 0);
INSERT INTO `quest_request_items` VALUES (6821, 1, 0, 0, 0, 'Do you have the Eye, $C?  Do you have the strength to enter Blackrock Spire?', 0);
INSERT INTO `quest_request_items` VALUES (6822, 1, 0, 0, 0, 'Your success in the Molten Core awaits, $N.', 0);
INSERT INTO `quest_request_items` VALUES (6823, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6824, 1, 0, 0, 0, 'Have you defeated Lucifron and the others, $N?  Do you have the hands of the enemy?', 0);
INSERT INTO `quest_request_items` VALUES (6825, 1, 0, 0, 0, 'We must prepare the new fleet of War Riders, $r! My riders are set to make a strike on the central battlefield; but first, I must wet their appetites - preparing them for the assault.$b$bI need enough Stormpike Soldier Flesh to feed a fleet! Hundreds of pounds! Surely you can handle that, yes? Get going!', 0);
INSERT INTO `quest_request_items` VALUES (6826, 1, 0, 0, 0, 'You\'ve worked hard, $n, but we have only just begun!$b$bMy War Riders must taste in the flesh of their targets. This will ensure a surgical strike against our enemies!$b$bMy fleet is the second most powerful in our air command. Thusly, they will strike at the more powerful of our adversaries. For this, then, they need the flesh of the Stormpike Lieutenants.$b$bMake haste, soldier!', 0);
INSERT INTO `quest_request_items` VALUES (6827, 1, 0, 0, 0, 'I was locked up in a dwarven hellhole for days. You better believe I want revenge!$b$bWe must plan carefully.$b$bFirst, my war riders need targets to gun for - high priority targets. I\'m going to need to feed them the flesh of Stormpike Commanders. Unfortunately, those little buggers are entrenched deep behind enemy lines! You\'ve definitely got your work cut out for you.', 0);
INSERT INTO `quest_request_items` VALUES (6844, 1, 0, 0, 0, 'Why, hello there! Hrmm...$b$bLet me be a little honest with you, friend... you smell a bit ripe. Whiffy, one might say. Now I\'m not making a personal assailment of your being. I\'m just saying... in the future, you may want to freshen up a little after coming in from the field. It will make those first impressions a little more positively impressionable!$b$bAnyhoo... what can I do for you?', 0);
INSERT INTO `quest_request_items` VALUES (6845, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6846, 1, 0, 0, 0, 'My troops are supplied and ready to assault.  We just need orders from Noreg Stormpike and I\'ll send them into the fray!', 0);
INSERT INTO `quest_request_items` VALUES (6847, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6848, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6861, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6862, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6881, 1, 0, 0, 0, 'The Frostwolf Clan is protected by a taint of elemental energy. Their shaman meddle in powers that will surely destroy us all if left unchecked.$b$bThe damage has grown too great for the Circle to control! Ivus must be called to our aid.$b$bThe Frostwolf soldiers carry elemental charms called storm crystals. We can use the charms to conjure Ivus. Venture forth and claim the crystals, $n!', 0);
INSERT INTO `quest_request_items` VALUES (6901, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (6921, 6, 0, 0, 0, 'Have you been successful in locating the fathom core?  Without it we\'ll have no idea what the Twilight\'s Hammer is exactly up to down there.', 0);
INSERT INTO `quest_request_items` VALUES (6922, 1, 0, 0, 0, 'Ah, hello again $N.  I was just reading the waves the sea, much like I always do.  What brings you to the outpost?', 0);
INSERT INTO `quest_request_items` VALUES (6941, 1, 0, 0, 0, 'The elite Frostwolf units that guard the lines must be dealt with, soldier! I\'m tasking you with thinning out that herd of savages. Return to me with medals from their lieutenants and legionnaires. When I feel that enough of the riff-raff has been dealt with, I\'ll deploy the air strike.', 0);
INSERT INTO `quest_request_items` VALUES (6942, 1, 0, 0, 0, 'My gryphons are poised to strike at the front lines but cannot make the attack until the lines are thinned out.$b$bThe Frostwolf warriors charged with holding the front lines wear medals of service proudly upon their chests. Rip those medals off their rotten corpses and bring them back here.$b$bOnce the front line is sufficiently thinned out, I will make the call to air! Death from above!', 0);
INSERT INTO `quest_request_items` VALUES (6943, 1, 0, 0, 0, 'Their spirits are low, soldier. After our last failed air strike against the Horde, they refuse to fly! It is up to you to bolster their morale.$B$BReturn to the battlefield and strike at the heart of the Frostwolf\'s command. Take down their commanders and guardians. Return to me with as many of their medals as you can stuff in your pack! I promise you, when my gryphons see the bounty and smell the blood of our enemies, they will fly again! Go now!', 0);
INSERT INTO `quest_request_items` VALUES (6961, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6962, 1, 0, 0, 0, 'All this talk of treats has given me a hankering for some myself.  Mmmm... gingerbread cookies and milk...', 0);
INSERT INTO `quest_request_items` VALUES (6963, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6964, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6981, 1, 0, 0, 0, 'Hello, $R. What can I do for you?', 0);
INSERT INTO `quest_request_items` VALUES (6982, 1, 0, 0, 0, 'Have you been to the Coldtooth mine, $N? Do you have the supplies I asked for?', 0);
INSERT INTO `quest_request_items` VALUES (6983, 5, 0, 0, 0, '$N - our Feast of Winter Veil will be ruined without those treats to restock!  Graccu himself will miss out on sharing his delicious meat pies with all the good boys and girls this season...', 0);
INSERT INTO `quest_request_items` VALUES (6984, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (6985, 1, 0, 0, 0, 'Did you enter the Irondeep mine, $N? Did you raid its supplies?', 0);
INSERT INTO `quest_request_items` VALUES (7001, 1, 0, 0, 0, 'Without your help, the Frostwolf Wolf Riders would not have mounts to ride into battle. You do us a great service!', 0);
INSERT INTO `quest_request_items` VALUES (7002, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7003, 6, 0, 0, 0, 'Miniaturization residue, I assure you, is a valuable commodity when it comes to engineering!  Well, it is valuable in that it helps me make sure the zapper won\'t do something as disappointing as explode on the user.$B$BOh, I mean for the zappers other than the one I gave you.  Absolutely!', 0);
INSERT INTO `quest_request_items` VALUES (7021, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7022, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7023, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7024, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7025, 1, 0, 0, 0, 'All this talk of treats has given me a hankering for some myself.  Mmmm... gingerbread cookies and milk...', 0);
INSERT INTO `quest_request_items` VALUES (7026, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7027, 1, 0, 0, 0, 'Without your help, the Stormpike Ram Riders would not have mounts to ride into battle. You do us a great service!', 0);
INSERT INTO `quest_request_items` VALUES (7028, 25, 0, 0, 0, 'Don\'t ask questions!$B$BYou have my request.', 0);
INSERT INTO `quest_request_items` VALUES (7029, 1, 0, 0, 0, 'If you are able to heal the plant, it will again begin to grow. We must do what we can, $N...', 0);
INSERT INTO `quest_request_items` VALUES (7041, 1, 0, 0, 0, 'If you are able to heal the plant, it will again begin to grow. We must do what we can, $N...', 0);
INSERT INTO `quest_request_items` VALUES (7042, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7043, 1, 0, 0, 0, '$N - our Feast of Winter Veil will be ruined without those treats to restock!  Graccu himself will miss out on sharing his delicious meat pies with all the good boys and girls this season...', 0);
INSERT INTO `quest_request_items` VALUES (7044, 1, 0, 0, 0, 'I have awoken from a nightmare that seemed it would never end...', 0);
INSERT INTO `quest_request_items` VALUES (7045, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7046, 1, 0, 0, 0, 'If you wish to restart the ritual, please abandon our first attempt and then speak to me again.', 0);
INSERT INTO `quest_request_items` VALUES (7061, 1, 0, 0, 0, 'I bid you welcome to Mulgore and our humble community of Thunder Bluff, friend.  I always take an interest in those who choose to take an interest in the kingdom, its people, and its lore.  Is this why you are standing before me?', 0);
INSERT INTO `quest_request_items` VALUES (7062, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7063, 1, 0, 0, 0, 'I bid you welcome to the Kingdom of Ironforge, friend.  I always take an interest in those who choose to take an interest in the kingdom, its people, and its lore.  Is this why you are standing before me?', 0);
INSERT INTO `quest_request_items` VALUES (7064, 1, 0, 0, 0, 'I would prefer to fight this battle on our own, but we are left with no other options--we need those more powerful, and the races of Azeroth have proven without a doubt they can overcome such things when they work together. So it is to you we turn for help.$B$BI only hope it is enough.$B$BZaetar, brother to Remulos, brought many pains to this world, and ultimately it caused his own death. I just hope I have not caused more death by asking you to aid us.', 0);
INSERT INTO `quest_request_items` VALUES (7065, 1, 0, 0, 0, 'I feel the weight of imposing my plea on the mortal races, but we are left with no other options. The races of Azeroth have proven without a doubt they can overcome such things when they work together, so it is to them I ask for help.$B$BI only hope it is enough.$B$BZaetar, brother to Remulos, brought many pains to this world, and ultimately it caused his own death. There is a lesson there to all of us if we are wise enough to see it.', 0);
INSERT INTO `quest_request_items` VALUES (7066, 1, 0, 0, 0, 'You have the scent of corruption on you, $N... much like many adventurers these days. But something about you is different. Is there something you\'ve come to speak to me about? You have an aura about you that seems familiar, but I cannot place it.$B$BPlease, I implore you, tell me why you\'ve sought an audience with me.', 0);
INSERT INTO `quest_request_items` VALUES (7067, 0, 0, 0, 0, 'What did you decide, $N? Can you help me? Will you set foot on holy ground to help me forge one great centaur tribe!?', 0);
INSERT INTO `quest_request_items` VALUES (7068, 0, 0, 0, 0, 'You find the crystals yet? Rituals of power, spells of great strength - those shadowshards maybe very helpful in all kind of arcane magics.', 0);
INSERT INTO `quest_request_items` VALUES (7070, 1, 0, 0, 0, 'Have you made the trip yet? I realize it\'d be quite dangerous, but if you were successful, it would very much be worth it.', 0);
INSERT INTO `quest_request_items` VALUES (7081, 1, 0, 0, 0, '$N, you have not yet assaulted a graveyard. Return to me when this task is complete!', 0);
INSERT INTO `quest_request_items` VALUES (7082, 1, 0, 0, 0, 'Attack a graveyard held by the Alliance!', 0);
INSERT INTO `quest_request_items` VALUES (7101, 1, 0, 0, 0, 'You haven\'t yet assaulted a bunker, $N! Are you waiting for others to claim your glory?', 0);
INSERT INTO `quest_request_items` VALUES (7102, 1, 0, 0, 0, 'You haven\'t yet assaulted a tower, $N! What are you waiting for?', 0);
INSERT INTO `quest_request_items` VALUES (7121, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7122, 1, 0, 0, 0, 'You haven\'t captured the mine yet, $N!$B$BAfter we control a mine, it will be much easier to gather minerals and supplies from it.', 0);
INSERT INTO `quest_request_items` VALUES (7123, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7124, 1, 0, 0, 0, 'You haven\'t yet captured a mine, $N! Find one that we do not control and defeat it\'s leader! ', 0);
INSERT INTO `quest_request_items` VALUES (7141, 1, 6, 0, 0, 'Go, $N.  Go to Alterac Valley and defeat the orc general!', 0);
INSERT INTO `quest_request_items` VALUES (7142, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7161, 1, 0, 0, 0, 'Wake up! Wake up, $N! This is not a dream. You really are entrenched in the midst of a raging battle!', 0);
INSERT INTO `quest_request_items` VALUES (7162, 1, 0, 0, 0, 'Beware the harpies of the region, $C. They\'ll not think twice to rip out your throat!', 0);
INSERT INTO `quest_request_items` VALUES (7163, 1, 0, 0, 0, '', 0);
