INSERT INTO `quest_request_items` VALUES (7201, 1, 0, 0, 0, 'Show them to me!', 0);
INSERT INTO `quest_request_items` VALUES (7202, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7223, 1, 0, 0, 0, 'Did you bring any armor scraps, $N?', 0);
INSERT INTO `quest_request_items` VALUES (7224, 1, 0, 0, 0, 'How goes the hunting, $N. Do you have any armor scraps for me?', 0);
INSERT INTO `quest_request_items` VALUES (7241, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7261, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7281, 1, 0, 0, 0, 'How it must pain him to remain as one of the living while his beloved brother has ascended to perfection.', 0);
INSERT INTO `quest_request_items` VALUES (7282, 1, 0, 0, 0, 'It is with heavy heart that I give such an order, soldier.', 0);
INSERT INTO `quest_request_items` VALUES (7301, 1, 0, 0, 0, 'Anything I would care to hear?', 0);
INSERT INTO `quest_request_items` VALUES (7302, 1, 0, 0, 0, 'Status of the hunt, soldier?', 0);
INSERT INTO `quest_request_items` VALUES (7321, 6, 0, 0, 0, 'Any luck finding the ingredients?  I\'ll tell you, the alliance maggots are far too numerous in this area now... In my opinion, they have come far too close already...', 0);
INSERT INTO `quest_request_items` VALUES (7341, 6, 0, 0, 0, 'Greetings, $r. I am Kolark, Bounty Hunter from Thunderbluff. Much of the world I have traveled and much I have seen.$B$BMy journeys across the South Seas led to the discovery of these wonderous thorium headed arrows. Alas, I have an endless supply of the arrows but have exhausted my supply of shells. Bah, no self respecting Tauren would ever be caught dead using a flimsy bow. The arrows are useless!$B$BI will offer a trade: An even exchange of thorium shells for my thorium headed arrows. Deal?', 0);
INSERT INTO `quest_request_items` VALUES (7342, 1, 0, 0, 0, 'Can you believe this rubbish?! The last shipment of ammunition from Kharanos was botched! All we have for ammo now are these flimsy, good for nothing arrows! What in the world am I going to do with 500,000 thorium headed arrows?$b$bI\'ll tell you what, kid. If you can bring me thorium shells, I\'ll trade you thorium headed arrows - straight up! Deal?', 0);
INSERT INTO `quest_request_items` VALUES (7361, 1, 0, 0, 0, 'They seek to exterminate us? It is they who shall be exterminated.', 0);
INSERT INTO `quest_request_items` VALUES (7362, 1, 0, 0, 0, 'I don\'t care where the hair comes from, $R.', 0);
INSERT INTO `quest_request_items` VALUES (7363, 1, 0, 0, 0, 'Yes, it is true. My brother is a human. Shameful... A stain upon my nearly immaculate record.', 0);
INSERT INTO `quest_request_items` VALUES (7364, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7365, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7366, 1, 0, 0, 0, 'Benedictus! I am but a speck in the shadow of his grandeur. Praise him!', 0);
INSERT INTO `quest_request_items` VALUES (7367, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7368, 1, 0, 0, 0, NULL, 0);
