INSERT INTO `quest_request_items` VALUES (7429, 1, 0, 0, 0, 'It\'s called the Gordok Shackle Key - well, that\'s what these \"tons o\' fun\" keep calling it. I think any of the ogres might have it, but I\'m not sure if any specific ones do. Maybe the guards have a better chance of having one...$b$bWhat am I talking about - you have it already, don\'t you?! Is that it there??!', 0);
INSERT INTO `quest_request_items` VALUES (7441, 1, 0, 0, 0, 'I regret nothing, stranger. The Queen has long since passed. The works of the Shen\'Dralar have been marred by the madness of Prince Tortheldrin. I seek only freedom... Escape...', 0);
INSERT INTO `quest_request_items` VALUES (7461, 1, 0, 0, 0, 'Be wary, adventurer. The Prince is... persuasive.', 0);
INSERT INTO `quest_request_items` VALUES (7462, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7463, 1, 0, 0, 0, 'Yes? Do I know you?', 0);
INSERT INTO `quest_request_items` VALUES (7481, 1, 0, 0, 0, 'My associate, the night elf scholar, Runethorn, is recruiting her allies for this task.', 0);
INSERT INTO `quest_request_items` VALUES (7482, 1, 0, 0, 0, 'My associate, the night elf scholar, Runethorn, is recruiting her allies for this task.', 0);
INSERT INTO `quest_request_items` VALUES (7483, 1, 0, 0, 0, 'What is it? I have much cataloguing to do!', 0);
INSERT INTO `quest_request_items` VALUES (7484, 1, 0, 0, 0, 'You again? What could you possibly want now?', 0);
INSERT INTO `quest_request_items` VALUES (7485, 1, 0, 0, 0, 'My patience prevents your suffering.', 0);
INSERT INTO `quest_request_items` VALUES (7486, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (7487, 1, 0, 0, 0, 'You must attune your soul with the Molten Core before access is granted.', 0);
INSERT INTO `quest_request_items` VALUES (7488, 1, 0, 0, 0, 'Do you have the web, $N?  Its concentrated magical energy must be dissipated!', 0);
INSERT INTO `quest_request_items` VALUES (7489, 6, 0, 0, 0, '$N, do you have Lethtendris\'s Web?', 0);
INSERT INTO `quest_request_items` VALUES (7490, 1, 0, 0, 0, '<Thrall\'s stoic demeanor changes for a split second when he sees the enormous head of Onyxia. The mighty Doomhammer was nearly unsheathed.>', 0);
INSERT INTO `quest_request_items` VALUES (7491, 1, 0, 0, 0, '', 0);
