INSERT INTO `quest_request_items` VALUES (7507, 1, 0, 0, 0, 'Ah, one of our greatest compilations. This one has been missing for ages.', 0);
INSERT INTO `quest_request_items` VALUES (7508, 1, 0, 0, 0, 'Excellent, let us begin...', 0);
INSERT INTO `quest_request_items` VALUES (7509, 1, 0, 0, 0, 'Perhaps one day, another will wield the prismatic blade.', 0);
