INSERT INTO `quest_request_items` VALUES (7563, 1, 0, 0, 0, 'Have you seen the raging owl beasts, $N? The magic of those creatures is strong, and it concentrates in the blood that flows through their torturted forms.', 0);
INSERT INTO `quest_request_items` VALUES (7564, 1, 0, 0, 0, '', 0);
