INSERT INTO `quest_request_items` VALUES (7602, 1, 0, 0, 0, 'Don\'t tell anyone this but Niby is daft.', 0);
INSERT INTO `quest_request_items` VALUES (7603, 1, 0, 0, 0, 'Did you get lost?', 0);
INSERT INTO `quest_request_items` VALUES (7604, 1, 0, 0, 0, 'Do we have a deal?', 0);
