INSERT INTO `quest_request_items` VALUES (7702, 0, 0, 0, 0, 'Don\'t let the crazy goggles fool you, $N. I\'m the smart one here.', 0);
INSERT INTO `quest_request_items` VALUES (7703, 1, 0, 0, 0, 'Hah, you no find it, do you boss? Maybe old timey story a bad story... hard to believe that creepy elf can steal from Gordok king!', 0);
