INSERT INTO `quest_request_items` VALUES (7721, 6, 0, 0, 0, 'While I could bore you with the technical details of the utility behind elemental cores, I will instead tempt you to completion of this important task by offering valuable coin and prizes for doing so.  Yon verily, are you finished?', 0);
INSERT INTO `quest_request_items` VALUES (7722, 1, 0, 0, 0, 'Did you find the plans?', 0);
