INSERT INTO `quest_request_items` VALUES (7724, 1, 0, 0, 0, 'Was he right? Does it come out their rumps?', 0);
INSERT INTO `quest_request_items` VALUES (7725, 6, 0, 0, 0, 'Ah, the fruits of research and utilization in the form of sweet, sweet residue.  Well, that is to say, I don\'t taste it or anything when I study it.$B$BMuch.', 0);
INSERT INTO `quest_request_items` VALUES (7726, 6, 0, 0, 0, 'Have you managed to find the elemental cores I need?', 0);
INSERT INTO `quest_request_items` VALUES (7727, 1, 0, 0, 0, '<Hansel is busily rubbing his bunions.>$B$BDon\'t just stand there, grab some oil and a luffa and get to scrubbin\' these bunions.$B$BYe don\'t have a luffa? Well then! Perhaps it\'s time I sent you out to find a luffa?$B$BHey, where are ye goin\'?', 0);
INSERT INTO `quest_request_items` VALUES (7728, 1, 0, 0, 0, 'If you\'re here for the reward, you\'re gonna have to give me the stolen goods.', 0);
