INSERT INTO `quest_request_items` VALUES (7730, 1, 0, 0, 0, 'How goes the hunt, $N?  Are you here to report your success?', 0);
INSERT INTO `quest_request_items` VALUES (7731, 1, 0, 0, 0, 'Have you managed to bring down Stinglasher yet?', 0);
INSERT INTO `quest_request_items` VALUES (7732, 1, 0, 0, 0, 'Greetings friend... you look as though you are on urgent business.  Is there something I can help you with?', 0);
INSERT INTO `quest_request_items` VALUES (7733, 1, 0, 0, 0, 'If these Rage Scar yeti hides are anything like the quality displayed by their Feral Scar counterparts, they could very well be as resilient as thorium!$B$BImagine that!', 0);
INSERT INTO `quest_request_items` VALUES (7734, 5, 0, 0, 0, 'If these Rage Scar yeti hides are anything like the quality displayed by their Feral Scar counterparts, they could very well be as resilient as thorium!$B$BImagine that!', 0);
INSERT INTO `quest_request_items` VALUES (7735, 1, 0, 0, 0, 'What\'s this, $N - you\'ve got something special for me?', 0);
INSERT INTO `quest_request_items` VALUES (7736, 1, 0, 0, 0, 'Let\'s not waste more of my precious time with jibber jabber, $r. It\'s time to focus on replenishing our dwindling fiery flux supply.$B$BWhat I\'m gonna need from you is the following:$B$B*Incendosaur scales.$B$B*Kingsblood.$B$B*Coal.$B$BI\'ll take all that you can offer!$B$BAnd you\'ll do it fast if you wanna get in good with the Brotherhood.', 0);
INSERT INTO `quest_request_items` VALUES (7737, 1, 0, 0, 0, 'You\'ve worked your way up through the Brotherhood\'s corporate hierarchy, $r. We have begun to look favorably upon you. Quite an accomplishment!$B$BIf you\'re interested in more work and earning more respect amongst us, listen up.$B$BWe can refine our fiery flux by adding a simple Dark Iron residue to the mix. This Dark Iron residue can be found in Blackrock Depths.$B$BBring me all the Dark Iron residue you find!', 0);
