INSERT INTO `quest_request_items` VALUES (7925, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (7926, 1, 0, 0, 0, 'Yes friend, may I help you?  Do you have a voucher that needs redeeming?', 0);
INSERT INTO `quest_request_items` VALUES (7927, 1, 0, 0, 0, 'I see that you have managed to complete a deck of portals! Congratulations!', 0);
INSERT INTO `quest_request_items` VALUES (7928, 1, 0, 0, 0, 'I see that you have managed to complete a deck of warlords!   Congratulations!', 0);
INSERT INTO `quest_request_items` VALUES (7929, 1, 0, 0, 0, 'I see that you have managed to complete a deck of elementals! Congratulations!', 0);
INSERT INTO `quest_request_items` VALUES (7930, 5, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7931, 1, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7932, 1, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7933, 1, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7934, 1, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7935, 5, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7936, 1, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7937, 1, 0, 0, 0, 'This haystack looks like the one from your vision.', 0);
INSERT INTO `quest_request_items` VALUES (7938, 1, 0, 0, 0, 'This chest looks like the one from your vision...', 0);
INSERT INTO `quest_request_items` VALUES (7939, 1, 0, 0, 0, '$N, thank you for all the help you\'ve given me. I really can\'t thank you enough!$B$BAlthough my need is no longer great... if you bring me more dense grinding stones, I still have more Darkmoon Faire tickets for you.', 0);
INSERT INTO `quest_request_items` VALUES (7940, 1, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (7941, 1, 0, 0, 0, '$N, I must thank you for all your help.  I have plenty of supplies, through no small efforts on your part, but if you wish to bring me more armor kits, then I will gladly trade them for Darkmoon Faire tickets.', 0);
INSERT INTO `quest_request_items` VALUES (7942, 1, 0, 0, 0, '$N, you have been so good to us, bringing me goods without tiring. You have my eternal thanks!$B$BAlthough our need for Thorium widgets is not as great as it was, you may still bring them to me and I will gladly trade them for Darkmoon Faire tickets.', 0);
INSERT INTO `quest_request_items` VALUES (7943, 1, 0, 0, 0, '$N, the attraction I\'m designing will be the scariest event since Gnomeregan was overrun! And it\'s largely thanks to you and all the baubles you\'ve brought me. Many, many thanks!$B$BI don\'t need much else, but... if you bring me more evil bat eyes from the bats of the Eastern Plaguelands... I might have more Darkmoon Faire tickets for you.', 0);
INSERT INTO `quest_request_items` VALUES (7944, 1, 0, 0, 0, 'This chest looks like the one from your vision...', 0);
INSERT INTO `quest_request_items` VALUES (7945, 1, 0, 0, 0, 'This tree stump looks like the one from your vision.', 0);
INSERT INTO `quest_request_items` VALUES (7946, 1, 0, 0, 0, 'I\'m so happy Jubjub is no longer lost. She loves Dark Iron ale so much that when I ran out... she ran away to find more!$B$BNow that Jubjub\'s back, I want as much ale as I can get! I won\'t want her to run away again!$B$BDo you have any Dark Iron Ale? If you do, then I\'ll trade you one of Jubjub\'s frog eggs for a mug...', 0);
INSERT INTO `quest_request_items` VALUES (7981, 5, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (8001, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8041, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8042, 1, 0, 0, 0, 'It is good to see you in good health, $n. The glorious battles you have undertaken affect all life on this planet. Hakkar must never leave the confines of Zul\'Gurub as the world will surely collapse beneath his immense hunger.$b$bGive me your talisman and I shall amplify its strength. Use the Strength of Mugamba to punish our enemies!', 0);
INSERT INTO `quest_request_items` VALUES (8043, 1, 0, 0, 0, 'Master $n, you return! Molthor has sent word of your deeds to the King. Your name is known even in the South Seas. Perhaps one day you will be a legendary $c - a story for the ages.$b$bGive me your talisman so that I may once more amplify its power.', 0);
INSERT INTO `quest_request_items` VALUES (8044, 1, 0, 0, 0, 'King Rastakhan sends his regards, Master $n. Such an honor has never been given to one outside the Zandalar tribe.$b$b<Jin\'rokh bows.>$b$bGive me your talisman so that I may enhance it once more. Know that the Rage of Mugamba is now intrinsically connected to your very soul. ', 0);
INSERT INTO `quest_request_items` VALUES (8045, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8046, 1, 0, 0, 0, 'I may have been too hasty in my judgement, $c. It seems as if your blind faith in this Light has some value after all.$b$bGive me your brand and I shall amplify its power.', 0);
INSERT INTO `quest_request_items` VALUES (8047, 1, 0, 0, 0, 'I must confess, I did not think you had the resolution to see this cause through, $c. Zandalar now considers you an invaluable ally. Well done, indeed.$b$bGive me your brand and I shall once more amplify its power.', 0);
INSERT INTO `quest_request_items` VALUES (8048, 1, 0, 0, 0, 'The King has acknowledged your existence, $c. You are the first of your kind to be accepted by Rastakhan as a true ally of Zandalar.$b$bYou will be rewarded greatly for your efforts. Present your brand and I shall apply the final amplification.', 0);
INSERT INTO `quest_request_items` VALUES (8049, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8050, 1, 0, 0, 0, 'Tales of your battles against the Gurubashi are whispered in the winds, priestess. Even royalty is beginning to talk of your deeds. It is rumored that King Rastakhan even mentioned you by name.$b$bThe time has come to imbue the Eye. Hand me the talisman and I shall perform the service.', 0);
INSERT INTO `quest_request_items` VALUES (8051, 1, 0, 0, 0, 'Welcome $c. The Eye of Zuldazar pulses with energy. You are ready to take the next step. Hand me the talisman and I shall perform the imbue.', 0);
INSERT INTO `quest_request_items` VALUES (8052, 1, 0, 0, 0, 'If only we had ten-thousand more like you, $n. The armies of Hakkar would be scattered to the wind in the blink of an eye.$b$b<Al\'tabim sighs.>$b$bAlas, the Eye is ready to realize its full potential. Give it to me.', 0);
INSERT INTO `quest_request_items` VALUES (8053, 1, 0, 0, 0, 'You have returned?  Do you have the Paragons of Power?  Are you wasting my time?$B$BI hope not, heathen.', 0);
INSERT INTO `quest_request_items` VALUES (8054, 1, 0, 0, 0, 'Your presence means victory?  Do you have the Paragons?  Are you dripping in the remains of your enemies?', 0);
INSERT INTO `quest_request_items` VALUES (8055, 1, 0, 0, 0, 'Do you have the Paragons?  They have mojo inside them.  We must have them.  You will aid us.', 0);
INSERT INTO `quest_request_items` VALUES (8056, 1, 0, 0, 0, 'Got the Paragons of Power from Zul\'Gurub that I need?  These bracers are well worth any effort ya be needin\' to make!', 0);
INSERT INTO `quest_request_items` VALUES (8057, 1, 0, 0, 0, 'Have ya got the Paragons of Power from Zul\'Gurub?  These bracers are worth the effort, $N.  Trust me mon!', 0);
INSERT INTO `quest_request_items` VALUES (8058, 1, 0, 0, 0, 'Have you brought the Paragons of Power?  Has vengeance been claimed in the name of the Zandalar?', 0);
INSERT INTO `quest_request_items` VALUES (8059, 1, 0, 0, 0, 'Have you returned with the Paragons of Power?  By defeating the diabolic minions of the Hakkar, you will not only prove yourself to us, but also your willingness to learn the ways of the demoniac.', 0);
INSERT INTO `quest_request_items` VALUES (8060, 1, 0, 0, 0, '$N - you\'ve returned already?  Were you able to get the Paragons of Power I need?', 0);
INSERT INTO `quest_request_items` VALUES (8061, 1, 0, 0, 0, 'Back from Zul\'Gurub, are you?  Have you succeeded in retrieving the Paragons of Power from the minions of Hakkar?', 0);
INSERT INTO `quest_request_items` VALUES (8062, 1, 0, 0, 0, 'Hunt those in Zul\'Gurub that would possess the Paragons of Power, $N.  They are your prey; they possess that which we both must have.', 0);
INSERT INTO `quest_request_items` VALUES (8063, 1, 0, 0, 0, 'Seek the madness from within Zul\'Gurub and overshadow it with your own, $N!  To do so means success, and success means reward!  Let not the Blood God reign supreme again!', 0);
INSERT INTO `quest_request_items` VALUES (8064, 1, 0, 0, 0, 'Got the Paragons of Power from Zul\'Gurub I need?  The haruspex\'s belt will be yours if ya have them.', 0);
INSERT INTO `quest_request_items` VALUES (8065, 1, 0, 0, 0, 'Got the necessary Paragons of Power from Zul\'Gurub?  The haruspex\'s tunic is well worth any effort ya be needin\' to make.', 0);
INSERT INTO `quest_request_items` VALUES (8066, 1, 0, 0, 0, 'Strike at the insane minions of Hakkar in Zul\'Gurub - they are the ones that hold the Paragons of Power, $N.  Prove your success to them - and to the tribe - as an aspirant to the predator.', 0);
INSERT INTO `quest_request_items` VALUES (8067, 1, 0, 0, 0, 'Have your strikes into Zul\'Gurub yielded success, $N?  Only when you\'ve brought me what I seek - and proven yourself fully to the tribe - will you earn a mantle second to none amongst the Zandalar.', 0);
INSERT INTO `quest_request_items` VALUES (8068, 1, 0, 0, 0, 'How was your foray into Zul\'Gurub?  Did you drive your enemies mad through the power of illusion?  Illusion or not, their deaths - and the Paragons of Power taken from them - will help thwart the rise of Hakkar.', 0);
INSERT INTO `quest_request_items` VALUES (8069, 1, 0, 0, 0, 'Have you returned with the Paragons of Power we need?  I know it will not be easy... but I have long predicted an outsider would come to aid us in our fight against Hakkar.  Let it be you, I say!', 0);
INSERT INTO `quest_request_items` VALUES (8070, 1, 0, 0, 0, 'The Paragons of Power... do you have them?  Only when we have them will we be able to make use of the latent power stored inside them.  It will be good to turn the tables on the minions of the Blood God...', 0);
INSERT INTO `quest_request_items` VALUES (8071, 1, 0, 0, 0, 'Do you have the Paragons of Power from Zul\'Gurub?', 0);
INSERT INTO `quest_request_items` VALUES (8072, 1, 0, 0, 0, 'You\'ve returned - do you have the Paragons of Power I need?$B$BThe legend of Khar\'vaxal the Cracked serves us today as a reminder that no foe - no matter how great a threat they may be - is impossible to overcome.  Chaos will bring everyone to their knees, that much is certain... and perhaps the most non-chaotic elements of chaos.', 0);
INSERT INTO `quest_request_items` VALUES (8073, 1, 0, 0, 0, 'Welcome back to the Isle, $N... have you returned triumphantly with the Paragons of Power in tow?', 0);
INSERT INTO `quest_request_items` VALUES (8074, 1, 0, 0, 0, 'The Paragons of Power are what I need mon - we\'ll tap the power right out of them in our fight against the evil from Zul\'Gurub.  Do ya have them for me?', 0);
INSERT INTO `quest_request_items` VALUES (8075, 1, 0, 0, 0, 'The Paragons of Power are a key source of magic power - the same kind of power that goes into makin\' the augur\'s hauberk.  Bring me what I need, and I\'ll be able to share the finest of vestments any Zandalar augur would be wantin\' as their own.', 0);
INSERT INTO `quest_request_items` VALUES (8076, 1, 0, 0, 0, 'Retrieved the Paragons of Power from Zul\'Gurub?  While we will take the latent power from these items and make them our own, we will give you your own reward of power should you be successful...', 0);
INSERT INTO `quest_request_items` VALUES (8077, 1, 0, 0, 0, 'The Paragons of Power... you have returned with them?  Only once we have them will we share the ultimate symbol of demoniac power with you, $N.', 0);
INSERT INTO `quest_request_items` VALUES (8078, 1, 0, 0, 0, 'Have you brought the Paragons of Power?  Have you struck down the enemies of the tribe?  Hakkar must know the wrath of the vindicator!', 0);
INSERT INTO `quest_request_items` VALUES (8079, 1, 0, 0, 0, 'Your presence means victory?  Do you have the Paragons of Power?  Tell me of the vengeance you have wrought today!', 0);
INSERT INTO `quest_request_items` VALUES (8080, 1, 0, 0, 0, 'Do you have the resource crate, $N? The League of Arathor can\'t fight a decent battle without them...', 0);
INSERT INTO `quest_request_items` VALUES (8081, 1, 0, 0, 0, '$N, the League of Arathor has a standing mission for you to reenter Arathi Basin, procure more resource crates and bring them to me.', 0);
INSERT INTO `quest_request_items` VALUES (8101, 1, 0, 0, 0, 'NULL', 0);
INSERT INTO `quest_request_items` VALUES (8102, 1, 0, 0, 0, 'Welcome back, $c. I can see that the pebble has seen much use. Many of our foes have fallen to your otherworldly abilities. Their suffering has been great. It is time that I enhance the power of the pebble. Give it to me. ', 0);
INSERT INTO `quest_request_items` VALUES (8103, 1, 0, 0, 0, 'Hakkari fear you, $n. They speak of horrors they believed that only their faceless God could perpetrate. You have burned them with the force of Kajaro. They now know fear in two places.$b$bIt is time to further strengthen the pebble. Hand me the talisman.', 0);
INSERT INTO `quest_request_items` VALUES (8104, 1, 0, 0, 0, 'Give me the talisman, $n. I must show you something.', 0);
INSERT INTO `quest_request_items` VALUES (8105, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8106, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8107, 1, 0, 0, 0, 'Honor is earned amongst the Zandalar trolls, $n. With honor comes reward - friendship, alliance...$b$bHand me the talisman so that I may enhance its power.', 0);
INSERT INTO `quest_request_items` VALUES (8108, 1, 0, 0, 0, 'I am ready for you, $c. Once more I will enhance your talisman. I only ask that you continue in your destruction of Hakkar and his minions.$b$bGive me the talisman.', 0);
INSERT INTO `quest_request_items` VALUES (8109, 1, 0, 0, 0, 'Call forth your demons, $c. Let them bask in the energy of Kezan\'s Taint. Command them on the field of battle! Decimate the enemy!$b$bYes... The time has come to apply the final enhancement to Kezan\'s Taint. Give me the talisman.', 0);
INSERT INTO `quest_request_items` VALUES (8110, 1, 0, 0, 0, 'NULL', 0);
INSERT INTO `quest_request_items` VALUES (8111, 1, 0, 0, 0, 'Hey mon! It be good to see you again. The tribe be talking about your killin\' of the Hakkari and all that. Molthor gave me the word to be adding more mojo to your talisman. Just give it here and Maywiki make it better.', 0);
INSERT INTO `quest_request_items` VALUES (8112, 1, 0, 0, 0, 'How be that talisman, mon? It look like it be time to add a little more magic and mojo to its leaves. It need a little bloom in its wilt. Give it here and Maywiki fix it right up.', 0);
INSERT INTO `quest_request_items` VALUES (8113, 1, 0, 0, 0, '$n! It been a long time since I seen you. Did you know that King Rastakhan himself be givin\' me the order to add the final bit of mojo and magic to your talisman? It be true, mon! I wouldn\'t have believed it had I not seen it with me own eyes. Give it here.', 0);
INSERT INTO `quest_request_items` VALUES (8114, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8115, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8116, 1, 0, 0, 0, 'NULL', 0);
INSERT INTO `quest_request_items` VALUES (8117, 1, 0, 0, 0, 'Good news, $n. Molthor be singin\' your praises lately. He say how you be turnin\' into a real hero of Zandalar.$b$bHe also say for Maywiki to polish your orb some more! Give it here so Maywiki can brighten the vision.', 0);
INSERT INTO `quest_request_items` VALUES (8118, 1, 0, 0, 0, 'Sha-mon! Maywiki make a joke!$b$b<Maywiki laughs.>$b$bSo, you been using the spirits and elements against our enemies in Zul\'Gurub, eh? Spirits be praised!$b$bMaywiki gonna brighten your orb. Give it here, $n.', 0);
INSERT INTO `quest_request_items` VALUES (8119, 1, 0, 0, 0, '<Maywiki points to your talisman.>$b$bLook at it, $n! It\'s come alive. The spirits dance around the orb.$b$bGive it to Maywiki so she can make one last adjustment.', 0);
INSERT INTO `quest_request_items` VALUES (8120, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8121, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8122, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8123, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8124, 1, 0, 0, 0, '$N, the Defilers has a standing mission for you to reenter Arathi Basin, procure more resource crates and bring them to me.', 0);
INSERT INTO `quest_request_items` VALUES (8141, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8142, 1, 0, 0, 0, 'Impressive, $n. You have a gift for killing that I have not sensed in another in many years. Even Molthor is aware of the work that you have done for Zandalar. It is time to enhance your talisman further. Give it to me.', 0);
INSERT INTO `quest_request_items` VALUES (8143, 1, 0, 0, 0, 'I sense that you have dealt countless fatalities to the Hakkari, $n. You carry the stink of their mojo.$b$bI assume the Shadow talisman has assisted in the culling? Give it to me and allow me to enhance its power.', 0);
INSERT INTO `quest_request_items` VALUES (8144, 1, 0, 0, 0, 'It yearns to grow, $n. The talisman has soaked in all that you have done. The thousands of troll corpses littering Zul\'Gurub have fueled its power. Hand it to me and I shall make the final enhancement.', 0);
INSERT INTO `quest_request_items` VALUES (8145, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8146, 1, 0, 0, 0, 'Even from here I can hear the sound of your volleys laying waste to our enemies. Their cries echo in agony.$b$bYou have made quite a name for yourself among the trolls of Zandalar, $n. We are grateful for all that you have done.$b$bHand me your talisman so that I may add another weave.', 0);
INSERT INTO `quest_request_items` VALUES (8147, 1, 0, 0, 0, 'Ah, $n, it is good to smell you again.$b$b<Falthir grins.>$b$bYou\'ll have to excuse my sense of humor. It can be most foul at times.$b$bI sense that you have caused great anguish to our enemies. The forces of Hakkar cry out your name in anger. This is most excellent.$b$bYou have earned another weave on your talisman. Hand it to me.', 0);
INSERT INTO `quest_request_items` VALUES (8148, 1, 0, 0, 0, 'Molthor delivers word from King Rastakhan, $n. The royal court is most impressed with your decimation of the Hakkari forces. I am to award you with the final weave in your talisman. Hand it to me.', 0);
INSERT INTO `quest_request_items` VALUES (8149, 1, 0, 0, 0, 'Have you made the journey to Uther\'s Tomb and placed the tribute there?$b$bIt can be a dangerous trip for less experienced adventurers; a safer way of traveling there, relatively speaking, may be to travel north from the river that runs through Hillsbrad into the Plaguelands. It flows from a lake that is adjacent to Sorrow Hill; travel west up through the hills, steering clear of the adjacent tomb... one that is infested with the Scourge.', 0);
INSERT INTO `quest_request_items` VALUES (8150, 1, 0, 0, 0, 'Have you made the journey to Grom\'s Monument and placed his tribute there?$b$bThe site where the monument is still touched by the taint of the Burning Legion. Should you be less experienced in the ways of adventuring, be on your toes when approaching the monument.', 0);
INSERT INTO `quest_request_items` VALUES (8151, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8153, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8154, 1, 0, 0, 0, 'Do you have the resource crate, $N? The League of Arathor can\'t fight a decent battle without them...', 0);
