INSERT INTO `quest_request_items` VALUES (8183, 1, 0, 0, 0, '$N, the reek of an evil soul surrounds you.  Have you been cursed by the Soulflayer?', 0);
INSERT INTO `quest_request_items` VALUES (8184, 1, 0, 0, 0, 'Bring me these things and I will create a powerful enchantment for you!', 0);
