INSERT INTO `quest_request_items` VALUES (8193, 0, 0, 0, 0, 'Today between 2pm and 4pm we have a contest to determine who the greatest angler of them all is! Just be the FIRST PERSON to bring me 40 Tastyfish fished from the Tastyfish schools found along the coast of Stranglethorn before anyone else does and you will be declared the Master Angler!$b$bIf you are not the first person to bring me 40 fish, my apprentice here will still reward you with money for each 5 Tastyfish you bring her.$b$bOh, and don\'t delay, Tastyfish go bad quickly!', 0);
INSERT INTO `quest_request_items` VALUES (8194, 1, 0, 0, 0, 'Even though we already have a contest winner, I will still buy your Tastyfish from you at a reasonable price. Whadda ya say!', 0);
INSERT INTO `quest_request_items` VALUES (8195, 1, 0, 0, 0, 'I seek the Paragons of Power known as the Coins of the Tribes.  They are the currency used by the various denizens of Zul\'Gurub, and each is imbued with subtle but powerful mojo.$B$BThere are nine distinct kinds to be found.  Should you have any extra, I will trade you one of our Honor Tokens for a set of three.  You may use the Tokens with Rin\'wosho the Trader; he offers our heroes special items for them.', 0);
INSERT INTO `quest_request_items` VALUES (8196, 1, 0, 0, 0, 'The extremely potent essence mango grows across many of the islands in the South Seas. A single mango will refresh those who eat it,both physically and mentally. If you\'ve never had one,you do yourself a disservice!$B$BWe have enough of a supply here on the isle to offer you a handful in exchange for a Zandalar Honor Token. Speak with Vinchaxa if you need to learn how to get tokens; otherwise, let\'s get to the business at hand!', 0);
INSERT INTO `quest_request_items` VALUES (8201, 1, 0, 0, 0, 'Do you have the collection of heads, $N?  We must stop Hakkar from gaining more power!', 0);
INSERT INTO `quest_request_items` VALUES (8221, 0, 0, 0, 0, '*Whir* *Click*$b$bI seek rare fish for Fishmaster Bluegill to catalogue. If you bring me a Keefer\'s Angelfish, I will provide you with this fine reward.$b$b*Zzzap* *Whir*', 0);
INSERT INTO `quest_request_items` VALUES (8222, 1, 0, 0, 0, 'In all my time working the Faire, I\'ve learned a lot of things about customers. Here\'s one of those nuggets of wisdom: customers love stuff that glows! It doesn\'t matter what it is - you could take a broken chair leg and make it glow, and every child will come from miles around to get one!$B$BSo, $N, I need glowing scorpid blood. You can find it from the scorpids of Sillithus, or the Blasted Lands, or the Burning Steppes.', 0);
INSERT INTO `quest_request_items` VALUES (8223, 0, 0, 0, 0, 'That scorpid blood is working out great, $N! It\'s amazing how a little sparkle and shine can create a prized bauble out of an otherwise piece of junk. The patrons love the stuff, and love is what it\'s all about, don\'t you think...$B$BYou\'ve been a big help to me, $N, and although I don\'t have a great need for more glowing scorpid blood, if you bring me more then I\'ll still trade you some tickets.', 0);
INSERT INTO `quest_request_items` VALUES (8224, 0, 0, 0, 0, '*Whir* *Click*$b$bI seek rare fish for Fishmaster Bluegill to catalogue. If you bring me a Dezian Queenfish, I will provide you with this fine reward.$b$b*Zzzap* *Whir*', 0);
INSERT INTO `quest_request_items` VALUES (8225, 0, 0, 0, 0, '*Whir* *Click*$b$bI seek rare fish for Fishmaster Bluegill to catalogue. If you bring me a Brownell\'s Blue Striped Racer, I will provide you with this fine reward.$b$b*Zzzap* *Whir*', 0);
INSERT INTO `quest_request_items` VALUES (8227, 1, 0, 0, 0, 'Hello there, $gladdie:lassy;. You here to do some fishing?', 0);
INSERT INTO `quest_request_items` VALUES (8228, 1, 0, 0, 0, '', 0);
