INSERT INTO `quest_request_items` VALUES (8233, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8234, 1, 0, 0, 0, 'Do I know you?', 0);
INSERT INTO `quest_request_items` VALUES (8235, 1, 0, 0, 0, 'Have you found enough fragments to continue my work?', 0);
INSERT INTO `quest_request_items` VALUES (8236, 1, 0, 0, 0, 'The bag has already arrived from Archmage Xylem, have you found the key?', 0);
INSERT INTO `quest_request_items` VALUES (8238, 1, 0, 0, 0, 'I seek the Paragons of Power known as the Coins of the Tribes.  They are the currency used by the various denizens of Zul\'Gurub, and each is imbued with subtle but powerful mojo.$B$BThere are nine distinct kinds to be found.  Should you have any extra, I will trade you one of our Honor Tokens for a set of three.  You may use the Tokens with Rin\'wosho the Trader; he offers our heroes special items for them.', 0);
INSERT INTO `quest_request_items` VALUES (8239, 1, 0, 0, 0, 'I seek the Paragons of Power known as the Coins of the Tribes.  They are the currency used by the various denizens of Zul\'Gurub, and each is imbued with subtle but powerful mojo.$B$BThere are nine distinct kinds to be found.  Should you have any extra, I will trade you one of our Honor Tokens for a set of three.  You may use the Tokens with Rin\'wosho the Trader; he offers our heroes special items for them.', 0);
INSERT INTO `quest_request_items` VALUES (8240, 1, 0, 0, 0, 'Have you destroyed the bijou at the Altar of Zanza? Do so, and then you will be doubly blessed by Zanza!', 0);
INSERT INTO `quest_request_items` VALUES (8241, 1, 0, 0, 0, 'Let\'s not waste more of my precious time with jibber jabber, $r. It\'s time to focus on replenishing our dwindling fiery flux supply.$B$BWhat I\'m gonna need from you is the following:$B$B*Incendosaur scales.$B$B*Iron bars.$B$B*Coal.$B$BI\'ll take all that you can offer!$B$BAnd you\'ll do it fast if you wanna get in good with the Brotherhood.', 0);
INSERT INTO `quest_request_items` VALUES (8242, 0, 0, 0, 0, 'Let\'s not waste more of my precious time with jibber jabber, $r. It\'s time to focus on replenishing our dwindling fiery flux supply.$B$BWhat I\'m gonna need from you is the following:$B$B*Incendosaur scales.$B$B*Heavy Leather.$B$B*Coal.$B$BI\'ll take all that you can offer!$B$BAnd you\'ll do it fast if you wanna get in good with the Brotherhood.\n', 0);
INSERT INTO `quest_request_items` VALUES (8243, 1, 0, 0, 0, 'With your increased status amongst the tribe comes access to some of our more potent potables. Behold... these brews are strong in the mojo - blessed by Zanza and fit for adventurers from all walks of life!$B$BI will allow you to choose one from the three I offer; in exchange, I require one Zandalar Honor Token. Note that only the effects of a single one may course through your spirit at any given time.$B$BLet me know when you\'re ready to barter!', 0);
INSERT INTO `quest_request_items` VALUES (8246, 1, 0, 0, 0, '$N - for someone as exalted among the Zandalar as you are,I have something very special for you. Direct from our home in the South Seas... the Signets of the Zandalar! These signets are used to enhance any shoulder item you may possess. Should you seek might,mojo,or serenity - I have what you need!$B$BI ask for fifteen Zandalar Honor Tokens in exchange for your choice of one signet. If you have the tokens ready,then I\'m ready to make a deal!', 0);
INSERT INTO `quest_request_items` VALUES (8249, 1, 0, 0, 0, 'My rogues need to hone their lockpicking skills, and I need locks of adequate difficulty -- the stuff Zan makes us is unfit for all but the lowliest neophytes.$b$bTell ya what, if you bring me 5 Heavy Junkboxes, I\'ll provide you with some of the finest throwing knives known to roguekind.$b$bYou can unlock the boxes and rifle through them, but you\'ll have to leave at least a few coins in them... even a rogue in training needs motivation.', 0);
INSERT INTO `quest_request_items` VALUES (8250, 1, 0, 0, 0, NULL, 0);
