INSERT INTO `quest_request_items` VALUES (8256, 1, 0, 0, 0, 'We must obtain the ichor quickly. Have you found it?', 0);
INSERT INTO `quest_request_items` VALUES (8257, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8258, 1, 0, 0, 0, 'Time is critical, $N - have you succeeded in stopping Death Knight Darkreaver\'s threat?', 0);
