INSERT INTO `quest_request_items` VALUES (8276, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8277, 1, 0, 0, 0, 'Are you done collecting those samples?  We could lose Noggle any minute now!', 0);
INSERT INTO `quest_request_items` VALUES (8278, 1, 0, 0, 0, 'This is our last chance to save Noggle!  Hurry!', 0);
INSERT INTO `quest_request_items` VALUES (8279, 0, 0, 0, 0, 'Who goes there?  Oh, it\'s you!  Did you find all the Lexicon chapters yet?', 0);
INSERT INTO `quest_request_items` VALUES (8280, 1, 0, 0, 0, 'The dredge strikers are a serious threat and must be dealt with quickly!', 0);
INSERT INTO `quest_request_items` VALUES (8281, 1, 0, 0, 0, 'The dredge crushers are a serious threat and must be dealt with at once!', 0);
INSERT INTO `quest_request_items` VALUES (8282, 0, 0, 0, 0, 'Still haven\'t found my bag?  Well I should count my lucky stars, at least the poison\'s been cleansed.', 0);
INSERT INTO `quest_request_items` VALUES (8283, 1, 0, 0, 0, 'I\'ll need the creature\'s pincer as proof of the deed. No pincer, no reward.', 0);
INSERT INTO `quest_request_items` VALUES (8284, 1, 0, 0, 0, 'The ravaged camp can be found northwest of here.  Come back when you have all the fragments.', 0);
INSERT INTO `quest_request_items` VALUES (8285, 1, 0, 0, 0, 'You!  How did you find me?  Who are you?  You weren\'t followed, were you?  Speak!', 0);
INSERT INTO `quest_request_items` VALUES (8286, 1, 6, 0, 0, 'Has Anachronos returned?', 0);
INSERT INTO `quest_request_items` VALUES (8287, 1, 0, 0, 0, 'What is this you bring to me, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8288, 1, 0, 0, 0, 'It is the favor of the Brood of Nozdormu that you must earn.', 0);
INSERT INTO `quest_request_items` VALUES (8291, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8292, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8293, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8294, 1, 0, 0, 0, 'The blood of our enemies is a mark of honor. Do you have such a mark?', 0);
INSERT INTO `quest_request_items` VALUES (8297, 1, 0, 0, 0, 'Do you have the resource crate, $N? The League of Arathor can\'t fight a decent battle without them...', 0);
INSERT INTO `quest_request_items` VALUES (8298, 1, 0, 0, 0, '$N, the League of Arathor has a standing mission for you to reenter Arathi Basin, procure more resource crates and bring them to me.', 0);
INSERT INTO `quest_request_items` VALUES (8299, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8300, 1, 0, 0, 0, '$N, the Defilers has a standing mission for you to reenter Arathi Basin, procure more resource crates and bring them to me.', 0);
INSERT INTO `quest_request_items` VALUES (8301, 1, 0, 0, 0, 'There is much history rooted IN their distrust of the mortal races; but alas, such is a tale better left for the Brood to tell when the time is right.', 0);
INSERT INTO `quest_request_items` VALUES (8302, 1, 0, 0, 0, 'Perhaps one day the whole of Cenarion Hold will be workINg under your command.', 0);
INSERT INTO `quest_request_items` VALUES (8303, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8304, 1, 5, 0, 0, 'Waste no time, $N!', 0);
INSERT INTO `quest_request_items` VALUES (8305, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8306, 1, 0, 0, 0, 'Natalia?', 0);
INSERT INTO `quest_request_items` VALUES (8307, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8308, 1, 0, 0, 0, 'Oh dear.', 0);
INSERT INTO `quest_request_items` VALUES (8309, 1, 0, 0, 0, 'If you find some crazy night elf lass in one of the hives, be sure to give her a kick in the duff for us.', 0);
INSERT INTO `quest_request_items` VALUES (8310, 1, 0, 0, 0, 'Go play with the monkey, kid. I don\'t have time for this.', 0);
INSERT INTO `quest_request_items` VALUES (8311, 1, 0, 0, 0, 'Have you finished trick-or-treating yet?  I\'m sad that I can\'t go because I\'m sick, but you helping me out makes me feel a little better...', 0);
INSERT INTO `quest_request_items` VALUES (8312, 1, 0, 0, 0, 'Have you finished trick-or-treating yet?  I\'m sad that I can\'t go because I\'m sick, but you helping me out makes me feel a little better...', 0);
INSERT INTO `quest_request_items` VALUES (8313, 1, 0, 0, 0, 'Did you learn the recipe?  You won\'t keep it to yourself, I hope!', 0);
INSERT INTO `quest_request_items` VALUES (8314, 1, 0, 0, 0, 'Oh my! What do you have there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8315, 1, 0, 0, 0, 'You must take the opportunity as it presents itself and strike!', 0);
INSERT INTO `quest_request_items` VALUES (8317, 1, 0, 0, 0, 'How are those dumplings coming along? ', 0);
INSERT INTO `quest_request_items` VALUES (8318, 1, 0, 0, 0, 'Did you bring me some texts?', 0);
INSERT INTO `quest_request_items` VALUES (8319, 1, 0, 0, 0, 'Keep bringing me texts.  We\'ll soon force the Twilight\'s Hammer out of Silithus.', 0);
INSERT INTO `quest_request_items` VALUES (8320, 1, 0, 0, 0, 'Enter the desert and find the Twilight geolords, $N. Return to me after they are slain.', 0);
INSERT INTO `quest_request_items` VALUES (8321, 6, 0, 0, 0, '$N, have you yet defeated Vyral the Vile?  Do you have his signet ring?', 0);
INSERT INTO `quest_request_items` VALUES (8322, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8323, 1, 0, 0, 0, 'Did you find any encrypted texts?  I\'m quite curious to read this month\'s True Believer.', 0);
INSERT INTO `quest_request_items` VALUES (8324, 0, 0, 0, 0, 'Find any more encrypted texts? Bring me a good batch of them, this decoding work takes some time.', 0);
INSERT INTO `quest_request_items` VALUES (8325, 1, 0, 0, 0, 'Our work in rebuilding our society begins here, $N. Once we are able to secure our home, we can look outward and upward.', 0);
INSERT INTO `quest_request_items` VALUES (8326, 1, 0, 0, 0, 'It gives me no pleasure to ask you to destroy these beasts.  While in times past we have lived in relative harmony with woodland creatures, these are different times.  The first order of business for all sin\'dorei is survival; make sure you remember that.', 0);
INSERT INTO `quest_request_items` VALUES (8327, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8328, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8330, 1, 0, 0, 0, 'Have you had a chance to find my belongings?  Once we reassert our dominance over Sunstrider Isle, I will need them in my work.  For now though, I must maintain my watch over the Sunwell... or what remains of it.', 0);
INSERT INTO `quest_request_items` VALUES (8331, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8332, 1, 0, 0, 0, 'Do you have the shard and the crests, Demonhound? I will need them to make the twilight cultist\'s medallion of station.', 0);
INSERT INTO `quest_request_items` VALUES (8333, 0, 0, 0, 0, 'If you need another Twilight cultist\'s medallion of station, then I am happy to oblige. I will, however, need another brilliant shard and some abyssal crests...', 0);
INSERT INTO `quest_request_items` VALUES (8334, 1, 0, 0, 0, 'It is better you learn about survival - and the costs of survival - now rather than later. Making hard choices is something you\'re going to have to get used to as a blood elf.$B$BNo one was there for us when the Scourge ripped our home in two. It was us and us alone who pulled ourselves up by the bootstraps.', 0);
INSERT INTO `quest_request_items` VALUES (8335, 1, 0, 0, 0, 'Heed well this warning - Felendren the Banished is only a symptom of a much larger problem.  His demise will solve our immediate concerns, but all blood elves share the potential same fate as him if we let our addictions get the best of us.', 0);
INSERT INTO `quest_request_items` VALUES (8336, 1, 0, 0, 0, 'Many of the creatures here on the isle were at one point bound into non-aggression and complacency by our magical skills.  When the Scourge destroyed the Sunwell, our hold over these creatures shattered.  Arcane slivers are the remnants of the control we once had, and as such might be usable in fashioning a new device to aid us in regaining their control.$B$BBetter still, perhaps the slivers could be used to see what malaise the isle truly suffers under...', 0);
INSERT INTO `quest_request_items` VALUES (8338, 1, 0, 0, 0, 'From your demeanor, you seem to be on a matter of some urgency.  Is there something specific I can assist you with?', 0);
INSERT INTO `quest_request_items` VALUES (8341, 1, 0, 0, 0, 'Do you have the shards and the signets, $N? I will need them to create the ring of lordship. ', 0);
INSERT INTO `quest_request_items` VALUES (8342, 0, 0, 0, 0, '$N, if you plan to go after the Abyssal High Council again, then you\'ll need another Twilight ring of lordship. Bring me more shards and signets and I\'ll make one for you.', 0);
INSERT INTO `quest_request_items` VALUES (8343, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8344, 1, 0, 0, 0, 'The essences of the wraiths will serve me well as sources of experimentation.  Much like your life as a $c, it is important to learn from what we find in the world... before twisting it to our will.  With demons as the richest source of power, it will be quite the boon if such a taint is truly present on the isle.$B$BWell... a boon for us warlocks, that is.', 0);
INSERT INTO `quest_request_items` VALUES (8345, 1, 0, 0, 0, 'Have you read the plaque on the shrine then, $c?', 0);
INSERT INTO `quest_request_items` VALUES (8346, 1, 0, 0, 0, 'Ah $N. Have you completed your task?', 0);
INSERT INTO `quest_request_items` VALUES (8347, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8348, 1, 0, 0, 0, 'How did it go with the Abyssal Duke? Did it hit hard?', 0);
INSERT INTO `quest_request_items` VALUES (8349, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8350, 1, 0, 0, 0, 'Welcome to my inn, $C.  Am I to understand that you have something for me?', 0);
INSERT INTO `quest_request_items` VALUES (8351, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8352, 1, 0, 0, 0, 'Well, how did it go? I\'d do anything to leave my post and wrestle one of those things myself!', 0);
INSERT INTO `quest_request_items` VALUES (8355, 0, 0, 0, 0, 'Well, go ahead now...', 0);
INSERT INTO `quest_request_items` VALUES (8356, 0, 0, 0, 0, 'No candy until you flex for me, $N...', 0);
INSERT INTO `quest_request_items` VALUES (8357, 0, 0, 0, 0, 'You know how to dance, don\'t you? Try by putting your right foot in... then your right foot out... your right foot in... shake it all about...', 0);
INSERT INTO `quest_request_items` VALUES (8358, 0, 0, 0, 0, 'Well, go ahead now...', 0);
INSERT INTO `quest_request_items` VALUES (8359, 0, 0, 0, 0, 'No candy until you flex for me, $N...', 0);
INSERT INTO `quest_request_items` VALUES (8360, 0, 0, 0, 0, 'You know how to dance, don\'t you? Try by putting your right foot in... then your right foot out... your right foot in... shake it all about...', 0);
INSERT INTO `quest_request_items` VALUES (8361, 0, 0, 0, 0, 'Did you finish the job?', 0);
INSERT INTO `quest_request_items` VALUES (8362, 0, 0, 0, 0, 'You\'ve proved you can handle yourself in a fight, $N.  Let\'s keep the pressure up on the Twilight\'s Hammer.  Go fight some more Abyssal Templars, I\'ll reward you with some of the stuff Huum and I have found in battle.', 0);
INSERT INTO `quest_request_items` VALUES (8363, 0, 0, 0, 0, 'You\'ve shown you\'re more than capable of taking on an Abyssal Duke, $N. I\'m always one to promote good habits. Bring me more signets and I\'ll give you a reward.', 0);
INSERT INTO `quest_request_items` VALUES (8364, 0, 0, 0, 0, 'You\'ve truly exceeded all my expectations, $N. You\'ve been taking on opponents that Huum and I would think long and hard before engaging.$B$BAt this point the best I can do is to continue rewarding your efforts in the fight against the Twilight\'s Hammer and their overlords.$B$BBring me more abyssal scepters and I\'ll do my best to give you a suitable reward.', 0);
INSERT INTO `quest_request_items` VALUES (8365, 1, 0, 0, 0, 'Do you have all 20 hats? I don\'t believe you, let me see them. They better be in pristine condition!', 0);
INSERT INTO `quest_request_items` VALUES (8366, 1, 0, 0, 0, 'Back so soon? I hope you taught those Southsea hoodlums a lesson they won\'t soon forget.', 0);
INSERT INTO `quest_request_items` VALUES (8367, 0, 0, 0, 0, 'Arathi is still wet with the blood of great warriors and the clash of steel still rings throughout Alterac.  Do not waste my time unless you bring news from the front!', 0);
INSERT INTO `quest_request_items` VALUES (8368, 1, 0, 0, 0, 'The battle in Warsong Gulch against the Silverwing Sentinels is of great importance. Under the guise of protecting a forest that doesn\'t belong to them, the Alliance seeks to deny the Horde one of our largest sources for lumber.$B$BDo not let this happen, $N! Come back to me with proof of serving the Horde in a worthy manner!', 0);
INSERT INTO `quest_request_items` VALUES (8369, 1, 0, 0, 0, 'What news do you bring from the lands of the Frostwolves? How does the battle for Alterac Valley fare?', 0);
INSERT INTO `quest_request_items` VALUES (8370, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8371, 1, 0, 0, 0, 'How are yer travels faring laddie?', 0);
INSERT INTO `quest_request_items` VALUES (8372, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8374, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8375, 1, 0, 0, 0, 'What news do you bring from the lands of the Stormpikes? How does the battle for Alterac Valley fare?', 0);
INSERT INTO `quest_request_items` VALUES (8381, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8383, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8384, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8385, 1, 0, 0, 0, 'Ah, $N. I hope you continue to lend your experience to the different battlefronts. A lot of our lads and lasses in the field look up to seasoned veterans like you.', 0);
INSERT INTO `quest_request_items` VALUES (8386, 1, 0, 0, 0, 'Do you bear news from Warsong Gulch, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8387, 1, 0, 0, 0, 'What news do you bring from the lands of the Frostwolves?  How does the battle for Alterac Valley fare?', 0);
INSERT INTO `quest_request_items` VALUES (8388, 1, 0, 0, 0, 'Arathi is still wet with the blood of great warriors and the clash of steel still rings throughout Alterac. Do not waste my time unless you bring news from the front!', 0);
