INSERT INTO `quest_request_items` VALUES (8409, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8410, 0, 0, 0, 0, 'What you got for me, $C?', 0);
INSERT INTO `quest_request_items` VALUES (8411, 1, 0, 0, 0, 'Where\'s the elements, mon?', 0);
INSERT INTO `quest_request_items` VALUES (8412, 1, 0, 0, 0, 'The spirits know what we\'re up to, and they been tryin\' to kill me! I hope you got the parts.', 0);
INSERT INTO `quest_request_items` VALUES (8413, 1, 0, 0, 0, 'Where\'s the feathers, mon?', 0);
INSERT INTO `quest_request_items` VALUES (8414, 6, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8415, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8416, 6, 0, 0, 0, 'Was Thal\'danis able to cleanse the scourgestones?', 0);
INSERT INTO `quest_request_items` VALUES (8417, 1, 0, 0, 0, 'Did Stoley cough up my booze?', 0);
INSERT INTO `quest_request_items` VALUES (8418, 0, 0, 0, 0, 'Have you slain the wretched trolls?', 0);
INSERT INTO `quest_request_items` VALUES (8419, 6, 0, 0, 0, 'Do you have my felcloth?', 0);
INSERT INTO `quest_request_items` VALUES (8420, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8421, 6, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8422, 6, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8423, 1, 0, 0, 0, 'The burning spines of the helboar leave horrific scars. Do not fear the pain and disfigurement, warrior, they are nothing compared to the prison to which I am bound.', 0);
INSERT INTO `quest_request_items` VALUES (8424, 1, 0, 0, 0, 'The shadowsworn are not easily defeated, are they? But you are a warrior, and you will triumph or perish trying.', 0);
INSERT INTO `quest_request_items` VALUES (8425, 1, 0, 0, 0, 'Are you back so soon? Time is not the same to me any more, perhaps it has indeed been a long journey for you...', 0);
INSERT INTO `quest_request_items` VALUES (8426, 1, 0, 0, 0, 'The battle in Warsong Gulch against the Silverwing Sentinels is of great importance. Under the guise of protecting a forest that doesn\'t belong to them, the Alliance seeks to deny the Horde one of our largest sources for lumber.$B$BDo not let this happen, $N! Come back to me with proof of serving the Horde in a worthy manner!', 0);
