INSERT INTO `quest_request_items` VALUES (8438, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8439, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8440, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8441, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8442, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8443, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8446, 1, 0, 0, 0, 'Yes, $R?', 0);
INSERT INTO `quest_request_items` VALUES (8447, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8460, 1, 0, 0, 0, 'Keep at it, $N. If you are to earn our trust, you will need to prove yourself to us.', 0);
INSERT INTO `quest_request_items` VALUES (8461, 1, 0, 0, 0, 'Once you gain the trust of the Timbermaw, I am confident there will be something we will be able to do for you. The Timbermaw do not forget their allies, especially in dark times such as these.', 0);
INSERT INTO `quest_request_items` VALUES (8462, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8463, 1, 0, 0, 0, 'Did you retrieve the stolen goods yet?', 0);
INSERT INTO `quest_request_items` VALUES (8464, 1, 0, 0, 0, 'We very much appreciate what you have done for the Timbermaw, $N. Your continued efforts will surely earn my tribe\'s trust and respect.', 0);
INSERT INTO `quest_request_items` VALUES (8465, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8466, 1, 0, 0, 0, 'While you have proven yourself to me, you may need to continue to work toward proving yourself to the suspicious brethren of my tribe.  To that end, I may be able to continue assisting you.$B$BSome of the Deadwood furbolgs wear a distinctive headdress that may be used as a means of proof in thinning their numbers.  Bring me a feather from any headdresses you acquire; for every set of five you bring me, you will earn recognition amongst the Timbermaw.', 0);
INSERT INTO `quest_request_items` VALUES (8467, 1, 0, 0, 0, 'While you have proven yourself to me, you may need to continue to work toward proving yourself to the suspicious brethren of my tribe.  To that end, I may be able to continue assisting you.$B$BSome of the Deadwood furbolgs wear a distinctive headdress that may be used as a means of proof in thinning their numbers.  Bring me a feather from any headdresses you acquire; for every set of five you bring me, you will earn recognition amongst the Timbermaw.', 0);
INSERT INTO `quest_request_items` VALUES (8468, 1, 0, 0, 0, 'You have something to show me?', 0);
INSERT INTO `quest_request_items` VALUES (8469, 1, 0, 0, 0, 'You\'ve certainly earned my trust, $N, but you may need to continue to earn the trust of my untrusting tribe.  There is something you can do to earn that trust.$B$BThe Winterfall are known to carry spirit beads to ward against foul spirits.  These beads have clearly failed in their purpose, as the Winterfall themselves are the agents of corruption.  Bring to me these spirit beads from fallen Winterfall furbolgs; for every set of five you bring me, you will earn recognition amongst the Timbermaw.', 0);
INSERT INTO `quest_request_items` VALUES (8470, 0, 0, 0, 0, 'Yes $C, what can I assist you with? You walk among us peacefully, though there is assuredly something amiss. I sense something... something troubling...', 0);
INSERT INTO `quest_request_items` VALUES (8471, 0, 0, 0, 0, '$C - you approach us in a peaceful manner, but I sense that you are here on matters that are grave and severe... for both furbolg and $r alike.  What have you come to tell us?', 0);
INSERT INTO `quest_request_items` VALUES (8472, 1, 0, 0, 0, 'Have you succeeded in gathering the arcane cores yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8473, 1, 0, 0, 0, 'I dread to ask, $N... is the task done?', 0);
INSERT INTO `quest_request_items` VALUES (8474, 1, 0, 0, 0, 'You have something to show me?', 0);
INSERT INTO `quest_request_items` VALUES (8475, 1, 0, 0, 0, 'You\'re back, $N. Did you fight off the undead along the Dead Scar yet?', 0);
INSERT INTO `quest_request_items` VALUES (8476, 1, 0, 0, 0, 'You\'ll find Tor\'Watha and Zeb\'Watha southeast of here. Come back when you\'ve killed the trolls.', 0);
INSERT INTO `quest_request_items` VALUES (8477, 1, 0, 0, 0, 'You\'ve brought me Otembe\'s hammer? ', 0);
INSERT INTO `quest_request_items` VALUES (8479, 1, 0, 0, 0, 'You bring me Zul\'Marosh\'s head?', 0);
INSERT INTO `quest_request_items` VALUES (8480, 1, 0, 0, 0, 'Did you gather the lost weapons yet?', 0);
INSERT INTO `quest_request_items` VALUES (8481, 1, 0, 0, 0, 'You have returned to us, $N... does this mean that the demon has been slain?', 0);
INSERT INTO `quest_request_items` VALUES (8482, 1, 0, 0, 0, 'You\'ve got something for me? Let me take a look.', 0);
INSERT INTO `quest_request_items` VALUES (8483, 1, 0, 0, 0, 'Did you take care of the intruder?', 0);
INSERT INTO `quest_request_items` VALUES (8484, 1, 0, 0, 0, '$C, you are welcomed in my domain.  Ironforge should always be considered a home to a hero such as yourself.  Now, what business do you have with me?', 0);
INSERT INTO `quest_request_items` VALUES (8485, 1, 0, 0, 0, 'The warchief\'s greetings are bestowed upon you, $C. Your deeds make the Horde grow stronger in these troubling times.  Now, what business do you have with me?', 0);
INSERT INTO `quest_request_items` VALUES (8486, 1, 0, 0, 0, 'Did you take care of the arcane wraiths?', 0);
INSERT INTO `quest_request_items` VALUES (8487, 1, 0, 0, 0, 'Are you done collecting the samples I asked for, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8488, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8490, 1, 0, 0, 0, 'Have you succeeded in powering the runestone yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8491, 1, 0, 0, 0, 'You\'re back. Did you bring the pelts?', 0);
INSERT INTO `quest_request_items` VALUES (8492, 1, 0, 0, 0, 'Have you collected those twenty bars of copper yet, trooper?', 0);
INSERT INTO `quest_request_items` VALUES (8493, 1, 0, 0, 0, 'Back again, $C? Outstanding! The bars you\'ve provided thus far are really going to help out in making all sorts of things for the war. I know, for example, that the copper is going to be used for parts of the steam tanks that are being built, as well as in a small fleet of gyrocopters that we\'re planning to deploy if time allows.$B$BDon\'t let the stacks here fool you though, we still need more copper bars if you can procure them for the Ahn\'Qiraj war effort.  Will you help us out?', 0);
INSERT INTO `quest_request_items` VALUES (8494, 1, 0, 0, 0, 'If you have those twenty bars of iron, I don\'t want to know where you have them hidden!', 0);
INSERT INTO `quest_request_items` VALUES (8495, 1, 0, 0, 0, 'Back so soon? Stop making me re-evaluate my low opinion of you, $C, you\'re making me feel all gooey inside. So, as you can tell we still don\'t have enough iron bars for all of the weapons, armor, steam tanks and whatnot that need building for the bug hunt. Think you have it in you to bring back another stack of twenty iron bars in between all of those trips to Zul\'Gurub, or wherever it is that you kids hang out these days?', 0);
INSERT INTO `quest_request_items` VALUES (8496, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8497, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8498, 1, 0, 0, 0, 'You\'ve brought something for me? ', 0);
INSERT INTO `quest_request_items` VALUES (8499, 1, 0, 0, 0, 'Oh, a shipment from my brother? Splendid! Fortune truly shines on me today!', 0);
INSERT INTO `quest_request_items` VALUES (8500, 0, 0, 0, 0, 'It is so good to see you again, $N. I hope that you\'ve been doing well. It\'s true that we are still in need of thorium bars. If you have them to spare I am collecting them for the Ahn\'Qiraj war effort.', 0);
INSERT INTO `quest_request_items` VALUES (8501, 1, 0, 0, 0, 'You wish to tell me something, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8502, 1, 0, 0, 0, 'You have something to tell me, $C?', 0);
INSERT INTO `quest_request_items` VALUES (8503, 1, 0, 0, 0, 'It\'s not true! I\'d never skim any stranglekelp off the top of the stacks here. One might be tempted to though considering that it\'s practically a panacea of utilitarian usefulness. *cough* You don\'t happen to have that stranglekelp we discussed earlier?', 0);
INSERT INTO `quest_request_items` VALUES (8504, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8505, 1, 0, 0, 0, 'Do you have the purple lotus herbs that I requested?', 0);
INSERT INTO `quest_request_items` VALUES (8506, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8507, 1, 0, 0, 0, 'You\'ll find Captain Blackanvil\'s force stationed outside Hive\'Zora.  Talk to his lieutenant, Janela Stouthammer, if you can\'t find him.', 0);
INSERT INTO `quest_request_items` VALUES (8508, 1, 0, 0, 0, 'I take it you want those papers signed, $Glad:lass;?', 0);
INSERT INTO `quest_request_items` VALUES (8509, 1, 0, 0, 0, 'What\'s that? Speak up, $C! Have you got that shipment of Arthas\' Tears I asked for?', 0);
INSERT INTO `quest_request_items` VALUES (8510, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8511, 1, 0, 0, 0, '$C, I do so hope that\'s the light leather you promised.', 0);
INSERT INTO `quest_request_items` VALUES (8512, 1, 0, 0, 0, 'Good to see you again, $N. It does appear that we need more light leather for the creation of the various war materiels. If you would bring me a stack of ten, that would be just perfect.', 0);
INSERT INTO `quest_request_items` VALUES (8513, 1, 0, 0, 0, 'Yes sir, I remember you. Is that the medium leather you have with you there?', 0);
INSERT INTO `quest_request_items` VALUES (8514, 1, 0, 0, 0, 'Yes sir, looks like we\'ve collected many pieces of medium leather, but we need more. I can assure you that it will all be put to good use; not one piece will get wasted. I know it\'s a lot to ask, but if you\'re still willing, I could use your help in attempting to put a dent in the rest of my quota.', 0);
INSERT INTO `quest_request_items` VALUES (8515, 1, 0, 0, 0, 'Is that the thick leather you have there in your pack, $C? Is it? I can\'t wait for you to hand it over! Everyone is going to be so pleased with us don\'t you think?', 0);
INSERT INTO `quest_request_items` VALUES (8516, 1, 0, 0, 0, 'Yep, the stack\'s still not high enough. $N, we still haven\'t reached our thick leather goal. Just think of all the things that we can make with all of that leather! All kinds of armor and weapons. Stuff for inside the steam tanks and rifle scopes! And engineering goggles, those are always fun!$B$BYou gonna bring me back some more thick leather?', 0);
INSERT INTO `quest_request_items` VALUES (8517, 1, 0, 0, 0, 'Do you have the twenty linen bandages that I require, $C?', 0);
INSERT INTO `quest_request_items` VALUES (8518, 1, 0, 0, 0, 'Ever am I amazed by the selflessness exhibited when so many would instead turn to selfishness instead. $C, I am still in need of a number of linen bandages before my assignment here is fulfilled. Will you aid me once more in the collection of those bandages?', 0);
INSERT INTO `quest_request_items` VALUES (8519, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8520, 1, 0, 0, 0, 'I need those tunics and headbands made, and I also need that piece of wildvine before I will share with you the knowledge of Wild Leather helmets.$B$BHead gear is highly coveted amongst adventurers, whether it be a disarmingly simple headband or a full-covering helmet. The fundamentals of creating valued head gear remain constant, no matter what the cosmetic appearance of the gear is.', 0);
INSERT INTO `quest_request_items` VALUES (8521, 1, 0, 0, 0, 'It is very kind of you to offer to help me again, $c. It looks like we\'ve collected a goodly number of the silk bandages we\'ve been tasked with, but we still need more. $N, is there any way that you could see fit to put together another bundle and return them to me here? The Alliance and I will be most grateful.', 0);
INSERT INTO `quest_request_items` VALUES (8522, 1, 0, 0, 0, 'The days pass one after the other, and still we go on. $C, have you those runecloth bandages?', 0);
INSERT INTO `quest_request_items` VALUES (8523, 1, 0, 0, 0, 'So it is that we come to discuss pressing matters yet again, $C. Once more I thank you for your previous efforts; it is not everyone who would give so selflessly. But there is still more work to do.$B$B$N, will you once more collect runecloth bandages and return them to me here?', 0);
INSERT INTO `quest_request_items` VALUES (8524, 1, 0, 0, 0, 'I\'m willing to lay odds that you\'ve returned with all of that rainbow fin albacore we were talking about before, right, $C?', 0);
INSERT INTO `quest_request_items` VALUES (8525, 1, 0, 0, 0, 'What! You again? Well I\'ll be a monkey\'s uncle... except that I\'m a $R. Slicky Gastronome to be precise! So you\'re back to help out again, eh? Well, I can\'t say as I blame you. Don\'t you just love the smell of all of that food? <drool>$B$BEnough loitering! Get out there and bring me back more rainbow fin albacore!', 0);
INSERT INTO `quest_request_items` VALUES (8526, 1, 0, 0, 0, 'So do you have all of that roast raptor yet?', 0);
INSERT INTO `quest_request_items` VALUES (8527, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8528, 1, 0, 0, 0, 'I am confident that you are returning so soon with the spotted yellowtail we discussed.', 0);
INSERT INTO `quest_request_items` VALUES (8529, 1, 0, 0, 0, 'If you\'re still willing I\'d like to send you back out to bring in another haul of spotted yellowtail, $N. I\'d imagine with the expertise you gained the first time out that this catch should be much faster and easier. Are you game?', 0);
INSERT INTO `quest_request_items` VALUES (8532, 1, 0, 0, 0, 'I hope that\'s the twenty copper bars you have there with you, $C.', 0);
INSERT INTO `quest_request_items` VALUES (8533, 1, 0, 0, 0, 'Back so soon? You\'ll be a real miner in no time, $C. So, you already know the drill; I need you to go out, mine up a mess of copper ore, smelt it into bars and bring it back to me here. I know that\'s something you\'re capable of, the question is, are you willing?', 0);
INSERT INTO `quest_request_items` VALUES (8534, 1, 0, 0, 0, 'You\'ll find Scout Azenel inside Hive\'Zora. Hurry, $N! Time is of the essence.', 0);
INSERT INTO `quest_request_items` VALUES (8535, 1, 0, 0, 0, 'Is your task done yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8536, 1, 0, 0, 0, 'Is your task done yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8537, 1, 0, 0, 0, 'Is your task done yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8538, 1, 0, 0, 0, 'Is your task done yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8539, 1, 0, 0, 0, 'You have something to tell me, $C?', 0);
INSERT INTO `quest_request_items` VALUES (8540, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8541, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8542, 1, 0, 0, 0, 'The dredge strikers are a serious threat and must be dealt with quickly!', 0);
INSERT INTO `quest_request_items` VALUES (8543, 1, 0, 0, 0, 'Very good, I see that you are serious about the war. I\'m a little edgy waiting for it to start though, as I\'m sure you are as well, $C. It will be glorious when it begins. The Horde running over the sands of the Silithus desert, weapons in hand, charging headlong into the insect masses. Great honor will be had that day by all!$B$BHar! But first we need more tin bars. Funny how such a small thing may make such a huge difference, don\'t you think?', 0);
INSERT INTO `quest_request_items` VALUES (8544, 1, 0, 0, 0, 'Have you collected the components I require?', 0);
INSERT INTO `quest_request_items` VALUES (8545, 1, 0, 0, 0, 'It sure would be nice to be havin\' all of the mithril bars that we be needin\' for the Ahn\'Qiraj war effort. Is that why you be back, mon? You got my bars?', 0);
INSERT INTO `quest_request_items` VALUES (8546, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8547, 1, 0, 0, 0, 'Greetings!  It is a pleasure to meet you!$B$BI see you have a special voucher.  Give it to me and I will offer you something in exchange.', 0);
INSERT INTO `quest_request_items` VALUES (8548, 0, 0, 0, 0, 'It\'s in our best interest to keep our most loyal allies well geared, $N.', 0);
INSERT INTO `quest_request_items` VALUES (8549, 1, 0, 0, 0, 'Go now, $C. Seek out $N.', 0);
INSERT INTO `quest_request_items` VALUES (8550, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8551, 0, 0, 0, 0, 'Ahoy, $N! Did you find Gorlash? That chest was my favorite, and it has a hidden compartment that held my greatest treasures!', 0);
INSERT INTO `quest_request_items` VALUES (8552, 1, 0, 0, 0, 'Hello. Do you have business with me? ', 0);
INSERT INTO `quest_request_items` VALUES (8553, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8554, 1, 0, 0, 0, 'Did you get my cutlass, $N?', 0);
