INSERT INTO `quest_request_items` VALUES (8575, 1, 0, 0, 0, 'Ooooh! Magical pulsing thingy! For me?', 0);
INSERT INTO `quest_request_items` VALUES (8576, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8577, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8578, 1, 0, 0, 0, 'The Molten Core, eh? I hope my goggles are still in one piece!', 0);
INSERT INTO `quest_request_items` VALUES (8579, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8580, 1, 0, 0, 0, 'Are you done collecting those samples? We could lose Noggle any minute now!', 0);
INSERT INTO `quest_request_items` VALUES (8581, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8582, 1, 0, 0, 0, 'Have you found the Ambassador, $N? Is he dead?$B$BWe cannot afford to allow the Scourge to take a foothold on Kalimdor. They are enough of a threat to our own borders to have to deal with them on two fronts.$B$BThe only optimistic sign from the events you\'ve told me about is that the crone seemed uncorrupted. She must know deep in her spirit that the Scourge may bring great power, but that the Barrens would not truly be hers if she were to agree to their deal.', 0);
INSERT INTO `quest_request_items` VALUES (8583, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8584, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8585, 1, 0, 0, 0, 'Mmmmm... Chimaerok...', 0);
INSERT INTO `quest_request_items` VALUES (8586, 1, 0, 0, 0, 'Hurry it up, kid. We don\'t want this meat to go bad. ', 0);
INSERT INTO `quest_request_items` VALUES (8587, 1, 0, 0, 0, 'What is that scrumptious smell? ', 0);
INSERT INTO `quest_request_items` VALUES (8588, 1, 0, 0, 0, 'I\'ve got no time for games if you\'re just here to jibber-jabber, $C. There are too many stacks of heavy leather that need curing. Come back when you have at least ten for me.', 0);
INSERT INTO `quest_request_items` VALUES (8589, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8590, 1, 0, 0, 0, '$C, have you returned so soon with the ten thick leather that we discussed?', 0);
INSERT INTO `quest_request_items` VALUES (8591, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8592, 1, 0, 0, 0, 'Did you bring me the components I asked for, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8593, 1, 0, 0, 0, 'Did you bring the components I require, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8594, 1, 0, 0, 0, 'Have you collected the components I require?', 0);
INSERT INTO `quest_request_items` VALUES (8595, 1, 0, 0, 0, 'Killing one Qiraji lord is a notable accomplishment for a mortal, $n. They are however, numerous and powerful. Continue to defeat them to prove your worth as our champion.', 0);
INSERT INTO `quest_request_items` VALUES (8596, 1, 0, 0, 0, 'You\'ve acquired the items I requested, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8597, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8598, 1, 0, 0, 0, 'Say, what\'s the matter?', 0);
INSERT INTO `quest_request_items` VALUES (8599, 1, 0, 0, 0, 'You smell like fish!', 0);
INSERT INTO `quest_request_items` VALUES (8600, 1, 0, 0, 0, 'It couldn\'t possibly be taking you this long to slice off ten rugged leather for me! Perhaps you should sharpen your skinning knife? Or, perhaps I am mistaken and you have them there in your pack?', 0);
INSERT INTO `quest_request_items` VALUES (8601, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8602, 1, 0, 0, 0, 'Have you collected the components I require?', 0);
INSERT INTO `quest_request_items` VALUES (8603, 1, 0, 0, 0, 'At his dwelling in Ahn\'Qiraj, dread C\'Thun awaits in slumber.', 0);
INSERT INTO `quest_request_items` VALUES (8604, 1, 0, 0, 0, 'The dredge strikers are a serious threat and must be dealt with quickly!', 0);
INSERT INTO `quest_request_items` VALUES (8605, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8606, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8607, 1, 0, 0, 0, 'Do not fail and make me look bad, $C! Return here as quickly as possible with the mageweave bandages we discussed.', 0);
INSERT INTO `quest_request_items` VALUES (8608, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8609, 1, 0, 0, 0, 'Did you get the venom?', 0);
INSERT INTO `quest_request_items` VALUES (8610, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8611, 1, 0, 0, 0, 'The sprite darters can be dangerous critters when provoked. Be careful when dealing with them, $C. And be even more careful of any night elves in the area. The pestering fools tend to hold up in the forests also.$B$BWhen you\'ve gotten enough of the wings, let me know, I\'ll be sure to reward you well!', 0);
INSERT INTO `quest_request_items` VALUES (8612, 1, 0, 0, 0, '', 0);
