INSERT INTO `quest_request_items` VALUES (8843, 0, 0, 0, 0, 'I accept commendation signets from adventurers who have received them in the line of duty. For each set of ten that you hand to me, I\'ll make sure that you receive a significant acknowledgement of your deeds with Thunder Bluff. I also accept single tokens, but at a much reduced rate of recognition. We are much more interested in greater feats of duty, though no feat will be ignored.$B$BWith that said, I\'ll gladly take your signets if you are ready to hand in a set.', 0);
INSERT INTO `quest_request_items` VALUES (8844, 1, 0, 0, 0, 'For those adventurers who have but a single commendation signet, I\'ll exchange it for a small amount of recognition with the Darkspear tribe.$B$BPlease bear in mind that it is better to hand over a stack of ten signets at once; your efforts will receive greater recognition in doing so.  We offer a single signet exchange as a service for those who don\'t have enough for a full stack of ten.$B$BWith that being said, I stand ready to assist you if you still wish to hand in a single signet.', 0);
