INSERT INTO `quest_request_items` VALUES (8860, 0, 0, 0, 0, 'Greetings! Are you here for the party! Or perhaps you just need to rest those weary feet of yours...', 0);
INSERT INTO `quest_request_items` VALUES (8861, 0, 0, 0, 0, 'Good day, $C! Did you come to Thunder Bluff for our celebrations?  Or are you here to rest a weary hoof between hunts?', 0);
INSERT INTO `quest_request_items` VALUES (8862, 1, 0, 0, 0, 'Elune\'s candle is an artifact of great reverence to the disciples of the Lunar Festival. Stored within the candle is true moonlight, ready to be unleashed!$b$bThis light is harmless to most creatures, but you will find that Omen and his minions are burned and dazzled by it.', 0);
INSERT INTO `quest_request_items` VALUES (8864, 1, 0, 0, 0, 'I have a selection of dresses that may be of interest to you.  Such dresses have been worn in times past during the Lunar Festival, and the selection I have today is perhaps the finest I have ever seen.  Each is hand-crafted with only the finest and softest of components.$B$BIn exchange for some coins of ancestry, I will let you choose one of the three styles I have to keep as your own.  Is this acceptable to you?', 0);
INSERT INTO `quest_request_items` VALUES (8865, 1, 0, 0, 0, 'I am please to inform you that I have a fine selection of festive pant suits available for you to own... but only in trade for coins of ancestry.  If fashion is important to you, then these are what you\'re looking for!  I assure you that you will not find pant suits like these anywhere else.$B$BIn exchange for some Coins of Ancestry, I will let you choose one of the three styles I have to keep as your own.  Is this acceptable to you?', 0);
