INSERT INTO `quest_request_items` VALUES (8881, 1, 0, 0, 0, 'Large cluster rockets require vast resources and skill to create, but their brilliance and beauty is worth that effort! Bring me coins of ancestry and I will grant you the knowledge of their crafting.', 0);
INSERT INTO `quest_request_items` VALUES (8882, 1, 0, 0, 0, 'The most splendid fireworks shows must include cluster rockets, and those cluster rockets must be fired from cluster launchers! Is it not then logical for you to learn the secrets of making cluster launchers? Bring me coins of ancestry and I will give this knowledge to you.', 0);
INSERT INTO `quest_request_items` VALUES (8884, 1, 0, 0, 0, 'We rangers of the Farstrider Retreat are dedicated to setting right the damage that has been wreaked upon our fair lands. We will go to any length to do so.$B$BI trust that you have returned with the murloc heads I tasked you to gather? ', 0);
INSERT INTO `quest_request_items` VALUES (8885, 1, 0, 0, 0, 'You are the instrument of my success and revenge!$B$BHave you the ring? ', 0);
INSERT INTO `quest_request_items` VALUES (8886, 1, 0, 0, 0, 'I am grateful for the assistance of someone like you, $N. It almost puts a smile on my face. But then I realize what these monsters have done to my ship and what\'s happening to Quel\'Thalas.$B$BHave you managed to retrieve any of my cargo?', 0);
INSERT INTO `quest_request_items` VALUES (8887, 1, 0, 0, 0, 'Hello, $C, you\'re a sight for sore eyes. I know, it\'s crazy for me to be here, what with the anchorage overrun by the Wretched. Velendris and his rangers have sworn to protect me on the condition that I get out of here as soon as I\'ve recovered my cargo.$B$BWhat\'s that you have there... it looks vaguely familiar?', 0);
INSERT INTO `quest_request_items` VALUES (8888, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (8889, 1, 0, 0, 0, 'I can\'t be certain from this distance... have you already shut down the power to Duskwither Spire?', 0);
INSERT INTO `quest_request_items` VALUES (8890, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (8891, 1, 0, 0, 0, 'What\'s this? It looks familiar. Oh no, this journal... my investigations... this is what caused all of this in the first place.', 0);
INSERT INTO `quest_request_items` VALUES (8892, 1, 0, 0, 0, 'Did you teach those Wretched a lesson?', 0);
INSERT INTO `quest_request_items` VALUES (8893, 0, 0, 0, 0, 'The Super Egg-O-Matic is the latest of Curgle Cranklehop\'s inventions. It is quite an impressive piece of machinery.$B$BThe Super Egg-O-Matic sputters wildly as you approach the control panel.', 0);
INSERT INTO `quest_request_items` VALUES (8894, 1, 0, 0, 0, 'Have you taken care of it then? Did you deal with a good number of those magical anomalies? What would I do if Magister Duskwither were to reappear with all of these things lurking about?', 0);
