INSERT INTO `quest_request_items` VALUES (8961, 1, 0, 0, 0, 'It was our folly... our doom that we took that last job. If only we hadn\'t inadvertently stolen Lord Valthalak\'s spirit, which was contained in the amulet; if only there weren\'t those in our mercenary group that had been so greedy and divided it up amongst themselves. I\'d be alive today, maybe tossing back a beer, or tossing one of my kids into the air.$B$B$N, don\'t let the avarice of the ignoble in our old mercenary company be your doom as well.', 0);
INSERT INTO `quest_request_items` VALUES (8962, 1, 0, 0, 0, 'Have you returned already then, $C, with what I sent you out to gather?', 0);
INSERT INTO `quest_request_items` VALUES (8963, 1, 0, 0, 0, 'Have you returned already then, $C, with what I sent you out to gather?', 0);
