INSERT INTO `quest_request_items` VALUES (8966, 1, 0, 0, 0, 'Then it is done? You have retrieved the left piece of Lord Valthalak\'s amulet and finally put to rest the spirit of my old companion, Mor Grayhoof?', 0);
INSERT INTO `quest_request_items` VALUES (8967, 1, 0, 0, 0, 'Surely you haven\'t already dealt with the salvation of Isalien\'s spirit and the retrieval of the left piece of Lord Valthalak\'s amulet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (8968, 1, 0, 0, 0, 'Does this mean then, $C, that you\'ve already put the souls of those two fools to rest and retrieved the left piece of Lord Valthalak\'s amulet?', 0);
INSERT INTO `quest_request_items` VALUES (8969, 1, 0, 0, 0, 'I commend you, $N, if you have returned with the left piece of the amulet. If not, however, please take care of that as there is no time to waste, I assure you!', 0);
INSERT INTO `quest_request_items` VALUES (8970, 1, 0, 0, 0, 'Bloodkelp, $N, a big stack of it, that\'s what I need to power my divinatory spells. You\'re likely to need to take at least a couple of friends along with you to Alcaz Island to gather it up... those Strashaz are a nasty lot!', 0);
