INSERT INTO `quest_request_items` VALUES (8989, 1, 0, 0, 0, 'Then it is done? You have retrieved the right piece of Lord Valthalak\'s amulet, recombined the amulet into one whole, and finally put to rest the spirit of my old companion, Mor Grayhoof?', 0);
INSERT INTO `quest_request_items` VALUES (8990, 1, 0, 0, 0, 'Surely you haven\'t already dealt with the salvation of Isalien\'s spirit and the retrieval of the right piece of Lord Valthalak\'s amulet, $N? Be sure to recombine the pieces of the amulet before handing it to me.', 0);
INSERT INTO `quest_request_items` VALUES (8991, 1, 0, 0, 0, 'Does this mean then, $C, that you\'ve already put the souls of those two fools to rest and recombined the pieces of Lord Valthalak\'s amulet?', 0);
INSERT INTO `quest_request_items` VALUES (8992, 1, 0, 0, 0, 'I commend you, $N, if you have returned with the completed amulet. If not, however, please take care of that as there is no time to waste, I assure you!', 0);
INSERT INTO `quest_request_items` VALUES (8993, 6, 0, 0, 0, 'Have you come to deliver a present of love and adoration to your favorite leader?', 0);
INSERT INTO `quest_request_items` VALUES (8994, 1, 0, 0, 0, 'We\'ve come a long way, $N, and I just wanted to say that no matter what happens, thank you! You\'ve put yourself in mortal danger to try to help the surviving members of our mercenary company, The Veiled Blade, and as far as I\'m concerned, you\'re one of us now.', 0);
INSERT INTO `quest_request_items` VALUES (8995, 1, 0, 0, 0, '$C, you dare disturb my rest!', 0);
INSERT INTO `quest_request_items` VALUES (8996, 1, 0, 0, 0, '$N, you\'re back and still alive! Well, at least that makes one of us.$B$BYou\'re going to have to tell me all about it!', 0);
