INSERT INTO `quest_request_items` VALUES (9121, 1, 0, 0, 0, 'None have entered Naxxramas and lived to tell the tale.', 0);
INSERT INTO `quest_request_items` VALUES (9122, 1, 0, 0, 0, 'None have entered Naxxramas and lived to tell the tale.', 0);
INSERT INTO `quest_request_items` VALUES (9123, 1, 0, 0, 0, 'None have entered Naxxramas and lived to tell the tale.', 0);
INSERT INTO `quest_request_items` VALUES (9124, 1, 0, 0, 0, 'How goes the hunt?', 0);
INSERT INTO `quest_request_items` VALUES (9125, 1, 0, 0, 0, 'You did an exemplary job on the first bundle, $n. If you have more, I will take them now. For every bundle that you turn in, I will reward you with another insignia.', 0);
INSERT INTO `quest_request_items` VALUES (9126, 1, 0, 0, 0, 'I can direct you to skeleton infested locales, $c.', 0);
INSERT INTO `quest_request_items` VALUES (9127, 1, 0, 0, 0, 'A man in my line of work can never have too many bone fragments, $n. Whenever you have a surplus of fragments, bring them to me and I\'ll reward you with another insignia.', 0);
INSERT INTO `quest_request_items` VALUES (9128, 1, 0, 0, 0, 'I can only steer you in the right direction, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9129, 1, 0, 0, 0, 'Truth be told, I use the cores to create Frostfire armor. It is the armor used by the mages battling in Naxxramas. Without you and others like you, we would most definitely be losing this war.$B$BWith that said, bring me more cores and I shall grant you more insignias.\n', 0);
INSERT INTO `quest_request_items` VALUES (9130, 1, 0, 0, 0, 'Yes. what\'s this?', 0);
INSERT INTO `quest_request_items` VALUES (9131, 1, 0, 0, 0, '<Korfax growls at you.>$B$BWhat do you want? Directions? I can provide those...', 0);
INSERT INTO `quest_request_items` VALUES (9132, 25, 0, 0, 0, 'For every armful of the scraps, I\'ll give you an insignia - the more the better. Now get out of my sight before I split you in two!\n', 0);
INSERT INTO `quest_request_items` VALUES (9133, 1, 0, 0, 0, 'That\'s quite a list you have there, friend. Let me take a look at it.', 0);
INSERT INTO `quest_request_items` VALUES (9134, 1, 0, 0, 0, 'Wow, that box of goods you have there looks heavy! You want to load that up on one of my flying beauties?', 0);
INSERT INTO `quest_request_items` VALUES (9135, 1, 0, 0, 0, '$C, back so soon?  Are those the goods that I sent you for?  Doesn\'t look like it could possibly be everything that I asked for!', 0);
INSERT INTO `quest_request_items` VALUES (9136, 6, 2, 0, 0, 'I have intimate knowledge of the flora in our world. Do you require direction?', 0);
INSERT INTO `quest_request_items` VALUES (9137, 1, 2, 0, 0, 'For every bundle of fronds that you deliver to me, I will pay you with your choice of an insignia of the Dawn or the Crusade.$b$bInsignias may be turned in to the Quartermaster for various rewards.', 0);
INSERT INTO `quest_request_items` VALUES (9138, 1, 0, 0, 0, 'With your aid we\'ll get the Scourge problem contained, $c. Dar\'Khan will be dealt with!$B$BHave you handled the nerubian problem at Suncrown Village yet?', 0);
INSERT INTO `quest_request_items` VALUES (9139, 1, 0, 0, 0, 'I\'ve learned much about fighting the Scourge in the time that I\'ve been here. They can be beaten back, but it must be done in small steps. The obscene manner in which they can take your fallen and add them to their own ranks as the newly risen makes it imperative that you make no mistakes along the way.$B$BNow, how goes the fight against Goldenmist Village?', 0);
INSERT INTO `quest_request_items` VALUES (9140, 1, 0, 0, 0, '$C, has Windrunner Village been liberated? Those damned magisters at the Sanctum of the Sun have been berating me to get their hands on those Scourge remnants I asked you to gather.$B$BDon\'t worry about that, though. You take your time and get the job done right. I\'ll deal with the magisters.', 0);
INSERT INTO `quest_request_items` VALUES (9141, 6, 0, 0, 0, '<Commander Metz chews on his cigar.>$B$BWhat is it? I\'m a busy man.', 0);
INSERT INTO `quest_request_items` VALUES (9142, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9143, 1, 0, 0, 0, 'You get those troll ears yet?$B$BYou know, if we could get some help from Tranquillien every once in a while this wouldn\'t be such a problem. I\'m just glad that you\'re here.', 0);
INSERT INTO `quest_request_items` VALUES (9144, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9145, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9146, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9147, 1, 0, 0, 0, 'Well? Did you bring me what I need? Hurry, or the pretty Blood Elf boy is a goner!', 0);
INSERT INTO `quest_request_items` VALUES (9148, 1, 0, 0, 0, 'You have the letter?', 0);
INSERT INTO `quest_request_items` VALUES (9149, 1, 0, 0, 0, 'Have you obtained the specimens I asked of you, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9150, 1, 0, 0, 0, 'Did you obtain the essences, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9151, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9152, 1, 0, 0, 0, 'Just as soon as I get the rest of my supplies. I\'ll be open for business. The forces here aren\'t going to get very far if they can\'t purchase what they need to ply their trades.$B$BWar zones can be such profitable places, wouldn\'t you agree, $c? Now, did you manage to fight your way to my cart through all of those ghouls?', 0);
INSERT INTO `quest_request_items` VALUES (9153, 1, 0, 0, 0, 'It will take time to prevail against this threat. How have you fared, $N?', 0);
