INSERT INTO `quest_request_items` VALUES (9159, 1, 0, 0, 0, 'Have you completed the task I asked of you, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9160, 1, 0, 0, 0, '$C. what word do you bring concerning An\'daroth and what the night elves were up to there?', 0);
INSERT INTO `quest_request_items` VALUES (9161, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9162, 1, 0, 0, 0, 'Tell me, $N, what did you find out?', 0);
INSERT INTO `quest_request_items` VALUES (9163, 1, 0, 0, 0, 'How fare our efforts to uncover the night elf plot on Shalandis Isle, $c?', 0);
INSERT INTO `quest_request_items` VALUES (9164, 1, 0, 0, 0, 'What became of the prisoners in Deatholme? Have you ventured there yet?', 0);
INSERT INTO `quest_request_items` VALUES (9165, 1, 0, 0, 0, 'Name, rank and serial number!', 0);
INSERT INTO `quest_request_items` VALUES (9166, 1, 0, 0, 0, 'Oh, thank goodness for you! ', 0);
INSERT INTO `quest_request_items` VALUES (9167, 1, 0, 0, 0, 'Is it done, then?  Has Dar\'Khan been destroyed?', 0);
INSERT INTO `quest_request_items` VALUES (9169, 1, 0, 0, 0, 'Is it over then, $c? Did you deactivate the night elf moon crystal at An\'owyn?', 0);
INSERT INTO `quest_request_items` VALUES (9170, 1, 0, 0, 0, 'Have you succeeded in severing the Scourge\'s chain of command, $N? Are Dar\'Khan\'s lieutenants dead?', 0);
INSERT INTO `quest_request_items` VALUES (9171, 1, 0, 0, 0, 'I believe I can hear the dame\'s belly rumbling even from here!  I take it that you are here talking to me because you have what I asked you to obtain?', 0);
INSERT INTO `quest_request_items` VALUES (9172, 1, 0, 0, 0, 'You wish to speak to me?', 0);
INSERT INTO `quest_request_items` VALUES (9173, 1, 0, 0, 0, 'I trust that you return to me with news that Windrunner Spire has been cleansed of its Scourge infection?', 0);
INSERT INTO `quest_request_items` VALUES (9174, 1, 0, 0, 0, 'Has Aquantion been destroyed yet? ', 0);
