INSERT INTO `quest_request_items` VALUES (9248, 6, 0, 0, 0, 'Fandu-dath-belore? Oh, pardon me, $N. I did not recognize you. Have you the scepter?\n', 0);
INSERT INTO `quest_request_items` VALUES (9249, 1, 0, 0, 0, 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!', 0);
INSERT INTO `quest_request_items` VALUES (9250, 1, 0, 0, 0, 'It was her time, mortal.', 0);
INSERT INTO `quest_request_items` VALUES (9251, 1, 0, 0, 0, 'In its current form, the staff is far too dangerous to be in the hands of a mortal.', 0);
INSERT INTO `quest_request_items` VALUES (9252, 1, 0, 0, 0, 'We will prevail, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9253, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9254, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9255, 1, 0, 0, 0, 'You\'ve something for me?', 0);
INSERT INTO `quest_request_items` VALUES (9256, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9258, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9259, 1, 0, 0, 0, 'That mangy dog, Revilgaz, has offered to pardon any former Bloodsails willing to turn on their cap\'n!  That bilge sucker asked me to go an\' off me ole\' mates and to bring back their bandannas as proof.$b$bI don\'t have it in me heart to do that, nor will I ask ye to.  Bring me some silk cloth and red dye and I\'ll make suitable replicas.  I\'ll tell the Baron you went turncoat, but be warned... the Bloodsails are not gonna like it!', 0);
INSERT INTO `quest_request_items` VALUES (9260, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9261, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9262, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9263, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9264, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9265, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9266, 1, 0, 0, 0, 'You must\'ve done something really bad to us or our friends, $n.  At any rate, I\'m here to offer you a way to get our good graces back.$b$bAs you know, Winterspring is quite cold.  With so many of us goblins coming from other cities, we could use a hand keeping warm.  Bring me some runecloth and coal and I\'ll put in the good word for ya.  Be warned though, our enemies are not going to take kindly to your helping us.', 0);
INSERT INTO `quest_request_items` VALUES (9267, 1, 0, 0, 0, 'You\'d better think twice before setting foot in Ratchet, $n! Word\'s been getting around of your dirty deeds.$b$bYou\'re in luck though, a ship just arrived with many wounded from an encounter with the Bloodsail Buccaneers. This is your chance to prove you\'re not a complete scoundrel. Lend us a hand by bringing linen cloth for bandages and empty vials for potions.', 0);
INSERT INTO `quest_request_items` VALUES (9268, 1, 0, 0, 0, 'You seek to befriend the goblins of Tanaris once again, $N? We\'re in need of materials for sails and guns to fight off our old enemies, the Bloodsail Buccaneers. Bring me mageweave and strong flux and we\'ll be on our way to pardoning your trespasses.', 0);
INSERT INTO `quest_request_items` VALUES (9269, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9270, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9271, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9272, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9274, 1, 0, 0, 0, 'You\'ve done what I asked of you, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9275, 1, 0, 0, 0, 'Isn\'t this exciting? I really do take great pride in my work; I hope you appreciate it, $c.$B$BSo, I trust that you have \'seasoned\' the food at the troll camps in Zeb\'Nowa?', 0);
INSERT INTO `quest_request_items` VALUES (9276, 1, 0, 0, 0, 'How are you doing with the attack on Zeb\'Tela?', 0);
INSERT INTO `quest_request_items` VALUES (9277, 1, 0, 0, 0, 'Is your assault on Zeb\'Nowa complete already?', 0);
INSERT INTO `quest_request_items` VALUES (9278, 1, 0, 0, 0, 'Greetings! It is a pleasure to meet you!$B$BI see you have a special voucher. Give it to me and I will offer you something in exchange.', 0);
INSERT INTO `quest_request_items` VALUES (9279, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9280, 1, 0, 0, 0, '$N, have you harvested the necessary moth blood for the healing crystals yet?  With survivors scattered all over the vale, time is of the essence!', 0);
INSERT INTO `quest_request_items` VALUES (9281, 1, 0, 0, 0, 'Did you take care of the business we discussed, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9282, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9283, 1, 0, 0, 0, 'We\'ll survive this yet with your help.', 0);
INSERT INTO `quest_request_items` VALUES (9287, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9288, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9289, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9290, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9291, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9292, 1, 0, 0, 0, 'Is there something you need?', 0);
INSERT INTO `quest_request_items` VALUES (9293, 1, 0, 0, 0, 'I\'ll need all of the samples in good condition if we\'re to have a chance of cleansing the lake.$B$BWe don\'t have much time, $c!', 0);
INSERT INTO `quest_request_items` VALUES (9294, 1, 0, 0, 0, 'The sooner you disperse the agent at the lake, the fewer native creatures that will be mutated by drinking the water, including ourselves!$B$BI\'m sorry that we can\'t do anything to help the poor creatures that have already been infected. If only my lab equipment were intact.', 0);
INSERT INTO `quest_request_items` VALUES (9295, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9299, 1, 0, 0, 0, 'Yes? What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9300, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9301, 1, 0, 0, 0, 'Yes? What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9302, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9303, 1, 0, 0, 0, 'The more we can do to clear up Nestlewood, the faster Zhanaa can get back to work.', 0);
INSERT INTO `quest_request_items` VALUES (9304, 1, 0, 0, 0, 'Yes? What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9305, 1, 0, 0, 0, 'When we have those spare parts, I know that we\'ll get this emitter repaired. With any luck there will be someone else out there left to talk to.', 0);
INSERT INTO `quest_request_items` VALUES (9309, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9310, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9311, 1, 0, 0, 0, 'Then it is true... a scouting party of blood elves here in Ammen Vale! How did they follow us?$B$BI\'ll get someone out there immediately to bring Tolaan back.', 0);
INSERT INTO `quest_request_items` VALUES (9312, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9313, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9314, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9315, 1, 0, 0, 0, 'A nerubian leader? None of the scouting missions reported anything about this Anok\'suten!', 0);
INSERT INTO `quest_request_items` VALUES (9317, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9318, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9319, 1, 0, 0, 0, 'Have you found your way through the dark?', 0);
INSERT INTO `quest_request_items` VALUES (9320, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9321, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9322, 1, 0, 0, 0, 'Are the flames of Kalimdor burning brightly?', 0);
INSERT INTO `quest_request_items` VALUES (9323, 1, 0, 0, 0, 'It will take time to prevail against this threat. How have you fared, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9324, 1, 0, 0, 0, 'You\'re practically glowing, $r. What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9325, 1, 0, 0, 0, 'You\'re practically glowing, $r. What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9326, 1, 0, 0, 0, 'You\'re practically glowing, $r. What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9327, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9328, 1, 0, 0, 0, 'You seek audience with me, $c?  I do not recall hearing of an appointment.', 0);
INSERT INTO `quest_request_items` VALUES (9329, 1, 0, 0, 0, 'I know it seems strange, but the Forsaken are here to help. You should speak with their leader, High Executor Mavren. He\'s in the tower on the west side of town.$B$BAnd, $C, when you\'re done talking with him return to me; I have something dire that needs to be dealt with immediately!', 0);
INSERT INTO `quest_request_items` VALUES (9330, 1, 0, 0, 0, 'You\'re practically glowing, $r. What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9331, 1, 0, 0, 0, 'You\'re practically glowing, $r. What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9332, 1, 0, 0, 0, 'You\'re practically glowing, $r. What do you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9333, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9334, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9335, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9336, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9337, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9338, 0, 0, 0, 0, 'Even if you have no need for the material rewards we offer, these badges still mark our mutual trust and friendship.$B$BBring them to me.  I\'ll make due note of your service should your performance go above and beyond the call of duty.', 0);
INSERT INTO `quest_request_items` VALUES (9339, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9340, 1, 0, 0, 0, 'You\'ve returned. Is the task done?', 0);
INSERT INTO `quest_request_items` VALUES (9341, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9342, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9343, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9344, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9345, 0, 0, 0, 0, 'Have you brought the plants?', 0);
INSERT INTO `quest_request_items` VALUES (9349, 6, 0, 0, 0, 'You have those eggs yet?$B$B<Legassi\'s stomach grumbles in anticipation.>', 0);
INSERT INTO `quest_request_items` VALUES (9351, 1, 0, 0, 0, 'Were you able to get the essence?', 0);
INSERT INTO `quest_request_items` VALUES (9352, 1, 0, 0, 0, 'Have you uncovered anything? Are the night elves behind this?', 0);
INSERT INTO `quest_request_items` VALUES (9355, 1, 0, 0, 0, 'Were you able to clear the road?', 0);
INSERT INTO `quest_request_items` VALUES (9356, 1, 0, 0, 0, 'I can\'t wait to see the look on his face when he digs in. Ever since the crash, he\'s been complaining that all I can think of is food. Well, someone\'s got to feed us while he tinkers with the zeppelin!', 0);
INSERT INTO `quest_request_items` VALUES (9358, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9359, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9360, 1, 0, 0, 0, 'What do you want to show me?', 0);
INSERT INTO `quest_request_items` VALUES (9361, 1, 0, 0, 0, 'Were you successful in purifying the helboar meat?', 0);
INSERT INTO `quest_request_items` VALUES (9362, 1, 0, 0, 0, 'There is not time to waste!  Have you the shell? ', 0);
INSERT INTO `quest_request_items` VALUES (9363, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9364, 1, 0, 0, 0, 'Have you collected the magic? ', 0);
INSERT INTO `quest_request_items` VALUES (9365, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9366, 1, 0, 0, 0, 'The felblood... did you obtain it, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9367, 0, 0, 0, 0, 'Are the fires burning?', 0);
INSERT INTO `quest_request_items` VALUES (9368, 1, 0, 0, 0, 'Have you had any luck, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9369, 0, 0, 0, 0, 'Have you harvested the necessary moth blood for the healing crystals yet? With survivors scattered all over the vale, time is of the essence!', 0);
INSERT INTO `quest_request_items` VALUES (9370, 0, 0, 0, 0, 'You\'ve returned, $N.  Did you put an end to the draenei\'s folly?', 0);
INSERT INTO `quest_request_items` VALUES (9371, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9372, 1, 0, 0, 0, 'Were you able to collect the blood samples?', 0);
INSERT INTO `quest_request_items` VALUES (9373, 1, 0, 0, 0, 'Good day, $c. What brings you to my encampment?', 0);
INSERT INTO `quest_request_items` VALUES (9374, 1, 0, 0, 0, 'Any luck, $N?  You\'ll find the Pools of Aggonar north of Hellfire Citadel.', 0);
INSERT INTO `quest_request_items` VALUES (9375, 1, 0, 0, 0, 'What do you need, $c?', 0);
INSERT INTO `quest_request_items` VALUES (9376, 1, 0, 0, 0, 'Things aren\'t going well. At this rate, she\'ll never make it back onto the road. Were you able to find that pack?', 0);
INSERT INTO `quest_request_items` VALUES (9381, 1, 0, 0, 0, 'Were you able to get all the feathers?', 0);
INSERT INTO `quest_request_items` VALUES (9382, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9383, 1, 0, 0, 0, 'Have you used the crystal\'s magic against an uncontrolled voidwalker?', 0);
INSERT INTO `quest_request_items` VALUES (9385, 1, 0, 0, 0, 'Have you made any progress against the ravagers?', 0);
INSERT INTO `quest_request_items` VALUES (9386, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9387, 0, 0, 0, 0, 'Have you obtained the samples?', 0);
INSERT INTO `quest_request_items` VALUES (9388, 0, 0, 0, 0, 'The fires cannot die until the festival is done!', 0);
INSERT INTO `quest_request_items` VALUES (9389, 0, 0, 0, 0, 'Have you seen to your task?', 0);
INSERT INTO `quest_request_items` VALUES (9391, 0, 0, 0, 0, 'Have you done what I asked of you, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9392, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9393, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9394, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9395, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9396, 1, 0, 0, 0, 'Have you obtained the scrolls yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9397, 1, 0, 0, 0, 'You\'ve returned.  Did you bring me the kaliri female?', 0);
INSERT INTO `quest_request_items` VALUES (9398, 1, 0, 0, 0, 'Welcome back, $N. Have you completed the task I asked of you?', 0);
INSERT INTO `quest_request_items` VALUES (9399, 1, 0, 0, 0, 'You\'ve returned! Did you complete your task?', 0);
INSERT INTO `quest_request_items` VALUES (9400, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9401, 1, 0, 0, 0, 'Tell me, is the assassin dead?', 0);
INSERT INTO `quest_request_items` VALUES (9402, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9403, 1, 0, 0, 0, 'Only water from the Elrendar Falls has the purity required for use with magic.  Do you have it? ', 0);
INSERT INTO `quest_request_items` VALUES (9404, 1, 0, 0, 0, 'Do you have the living branch?  Hand it over quickly! ', 0);
INSERT INTO `quest_request_items` VALUES (9405, 1, 0, 0, 0, 'Tell me what you seek, so that I may help you find it.', 0);
INSERT INTO `quest_request_items` VALUES (9406, 1, 0, 0, 0, 'What do you bring us, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9409, 1, 0, 0, 0, 'Hello, $c.  What have you there? Is it for me?', 0);
INSERT INTO `quest_request_items` VALUES (9410, 1, 0, 0, 0, 'You are lucky to be alive.', 0);
INSERT INTO `quest_request_items` VALUES (9415, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9416, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9417, 1, 0, 0, 0, 'You\'re back!  How did you do?', 0);
INSERT INTO `quest_request_items` VALUES (9418, 0, 0, 0, 0, 'The freedom I\'ve yearned for is finally mine!', 0);
INSERT INTO `quest_request_items` VALUES (9419, 1, 0, 0, 0, 'Be careful out there, but also be quick. We have no time to lose.', 0);
INSERT INTO `quest_request_items` VALUES (9420, 0, 0, 0, 0, 'Did you bring me the kaliri feathers, $c?', 0);
INSERT INTO `quest_request_items` VALUES (9422, 1, 0, 0, 0, 'Be wary of the dangers of the desert, $n. With the Alliance lurking in the dunes, any step could be your last.', 0);
INSERT INTO `quest_request_items` VALUES (9424, 0, 0, 0, 0, 'Did you avenge Sedai for Makuru?', 0);
INSERT INTO `quest_request_items` VALUES (9426, 0, 0, 0, 0, 'Have you completed your task, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9427, 0, 0, 0, 0, 'You return, $N.  Are the waters cleansed?', 0);
INSERT INTO `quest_request_items` VALUES (9429, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9430, 0, 0, 0, 0, 'Did you retrieve the Sha\'naar relics, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9431, 1, 0, 0, 0, 'Magistrix Elosai\'s note was a bit cryptic, but I think I understand what she wants me to do. If you have the earth she talked about, I can put it into the vessel you\'ll need for the moonwell water.', 0);
INSERT INTO `quest_request_items` VALUES (9432, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9433, 1, 0, 0, 0, 'Did it do the job?', 0);
INSERT INTO `quest_request_items` VALUES (9434, 1, 0, 0, 0, 'Were you and Wizlo able to gather the reagents?', 0);
INSERT INTO `quest_request_items` VALUES (9435, 1, 0, 0, 0, 'Were you able to retrieve the crystals from the Forsaken?', 0);
INSERT INTO `quest_request_items` VALUES (9436, 6, 0, 0, 0, 'Do not fail me, $N. If we can bend this Bloodscalp magic to our will, my people may yet eliminate the Amani threat.', 0);
INSERT INTO `quest_request_items` VALUES (9437, 1, 1, 0, 0, 'Have you freed Ithania and reclaimed my cargo from those glorified privateers?', 0);
INSERT INTO `quest_request_items` VALUES (9438, 1, 0, 0, 0, 'You bring news from Outland, $C?  Speak at once!', 0);
INSERT INTO `quest_request_items` VALUES (9439, 1, 0, 0, 0, 'For Sunstrider\'s sake, don\'t stare at me! It\'s bad enough I\'m forced to endure out here in my soiled clothing! After all I\'ve been through, the last thing I need is to be gawked at. Did you manage to collect my possessions from that hole-in-the-ground those Dark Irons call a fortress?', 0);
INSERT INTO `quest_request_items` VALUES (9440, 1, 0, 0, 0, 'Did you feed their captured animals all of the morsels?  Wait!  You didn\'t give any to that stupid human they have out there in the cage, did you?$B$BOh, good!  That would have been a waste!', 0);
INSERT INTO `quest_request_items` VALUES (9442, 0, 0, 0, 0, 'Did you obtain the mushroom I need, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9443, 1, 0, 0, 0, 'When you\'ve managed to retrieve his \'mark\', we\'re going to change it a bit; make it better.', 0);
INSERT INTO `quest_request_items` VALUES (9444, 1, 0, 0, 0, 'It is done, then?  Uther\'s Tomb is defiled?', 0);
INSERT INTO `quest_request_items` VALUES (9446, 1, 0, 0, 0, 'Aren\'t you supposed to be walking to Uther\'s Tomb with Anchorite Truuen?', 0);
INSERT INTO `quest_request_items` VALUES (9447, 0, 0, 0, 0, 'You\'ve returned, $N.  Is your task complete?', 0);
INSERT INTO `quest_request_items` VALUES (9448, 1, 0, 0, 0, 'You are doing the right thing, hunter. The Lost Ones have suffered so much already. They shouldn\'t have to suffer this further indignity.', 0);
INSERT INTO `quest_request_items` VALUES (9449, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9450, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9451, 1, 0, 0, 0, 'Together, the Broken and the draenei will regain a deeper understanding of the mysteries that the elements hold.$B$BHave you returned with that which is necessary for the creation of your earth totem?', 0);
INSERT INTO `quest_request_items` VALUES (9452, 1, 0, 0, 0, 'Watch out for murlocs: Strange and extremely annoying little creatures.', 0);
INSERT INTO `quest_request_items` VALUES (9453, 1, 0, 0, 0, 'What do you think of my armor? Crafted it myself! It\'s a little different than what we\'d traditionally wear but extremely comfortable.\n', 0);
INSERT INTO `quest_request_items` VALUES (9454, 1, 0, 0, 0, 'The stag hides are frail, which tends to make for tender, succulent flesh.', 0);
INSERT INTO `quest_request_items` VALUES (9455, 1, 0, 0, 0, 'You found what? Where?', 0);
INSERT INTO `quest_request_items` VALUES (9456, 1, 0, 0, 0, 'We can\'t risk this contamination spreading. The reports I\'ve heard come from Blood Watch are bad enough. This has to be stopped now!', 0);
INSERT INTO `quest_request_items` VALUES (9457, 1, 0, 0, 0, 'What news of Naias, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9460, 1, 0, 0, 0, 'Did you get something? ', 0);
INSERT INTO `quest_request_items` VALUES (9461, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9462, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9463, 1, 0, 0, 0, 'I fear that her health is in steady decline.', 0);
INSERT INTO `quest_request_items` VALUES (9464, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9465, 1, 0, 0, 0, 'You have the torch?', 0);
INSERT INTO `quest_request_items` VALUES (9466, 1, 0, 0, 0, 'You have news regarding Blacktalon?', 0);
INSERT INTO `quest_request_items` VALUES (9467, 1, 0, 0, 0, 'Do not speak to me again until you have Hauteur\'s ashes.', 0);
INSERT INTO `quest_request_items` VALUES (9468, 1, 0, 0, 0, 'You look a bit singed around the edges.  How fared your communion with the flame, $C?', 0);
INSERT INTO `quest_request_items` VALUES (9469, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9470, 1, 1, 0, 0, 'Have you returned with news of Witch Doctor Mai\'jin\'s death?', 0);
INSERT INTO `quest_request_items` VALUES (9471, 1, 1, 0, 0, 'Have you culled the silvermane population?', 0);
INSERT INTO `quest_request_items` VALUES (9472, 1, 0, 0, 0, 'Well, $N. Is it done?', 0);
INSERT INTO `quest_request_items` VALUES (9473, 1, 0, 0, 0, 'Do not waste time, $g boy:girl;.', 0);
INSERT INTO `quest_request_items` VALUES (9474, 1, 0, 0, 0, 'The Mark of the Lightbringer is a powerful symbol of Uther\'s faith in the Light.', 0);
INSERT INTO `quest_request_items` VALUES (9475, 1, 0, 0, 0, 'The look on your face marks you as the bearer of bad news. What have you discovered?', 0);
INSERT INTO `quest_request_items` VALUES (9476, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9483, 0, 0, 0, 0, 'Just because we\'re on this pilgrimage doesn\'t mean we have to give up all of life\'s pleasures.  It\'s been ages since I had a good wine.$B$BI\'d literally kill for a bottle of cenarion spirits!$B$BI know, I know, how unfashionable of me to enjoy a drink brewed by night elves.', 0);
INSERT INTO `quest_request_items` VALUES (9484, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9485, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9486, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9487, 1, 0, 0, 0, 'Didn\'t get too close to the brutes, I hope? ', 0);
INSERT INTO `quest_request_items` VALUES (9488, 1, 0, 0, 0, 'The robe cannot be completed without the necessary supplies.  But you knew that, didn\'t you? ', 0);
INSERT INTO `quest_request_items` VALUES (9489, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9490, 0, 0, 0, 0, 'Did you bring back proof of Blacktalon\'s death, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9491, 1, 0, 0, 0, 'Please tell me you found the ring. It won\'t be long before that merchant finds his own $C.', 0);
INSERT INTO `quest_request_items` VALUES (9492, 1, 0, 0, 0, 'Have you returned with proof of \'Warchief\' Kargath Bladefist\'s demise?', 0);
INSERT INTO `quest_request_items` VALUES (9493, 1, 0, 0, 0, 'I am not so naive as to think that the defeat of the Shattered Hand legionnaires heralds our victory over the Fel Horde, but is a good first step.', 0);
INSERT INTO `quest_request_items` VALUES (9494, 0, 0, 0, 0, 'Did you bring the, err, ember?', 0);
INSERT INTO `quest_request_items` VALUES (9495, 0, 0, 0, 0, 'Have you proof of Kargath Bladefist\'s defeat?', 0);
INSERT INTO `quest_request_items` VALUES (9496, 0, 0, 0, 0, 'Once the Shattered Hand legionnaires have been broken, we can begin to make progress in our campaign against the Fel Horde. Have you carried out your mission, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9498, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9499, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9500, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9501, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9502, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9503, 1, 0, 0, 0, 'Have you collected the foul essences of my unfortunate sisters so soon, $N? ', 0);
INSERT INTO `quest_request_items` VALUES (9504, 1, 0, 0, 0, 'You have the pure water from the ruins? ', 0);
INSERT INTO `quest_request_items` VALUES (9505, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9506, 1, 0, 0, 0, 'Any luck, stranger?\n', 0);
INSERT INTO `quest_request_items` VALUES (9508, 1, 0, 0, 0, 'Have you succeeded?', 0);
INSERT INTO `quest_request_items` VALUES (9509, 1, 0, 0, 0, 'The elements have spoken to me of the great deeds you have accomplished.  Come, let us speak.', 0);
INSERT INTO `quest_request_items` VALUES (9512, 1, 0, 0, 0, 'Arrr... Yarr... Shiver me timbers... Er, sorry $g lad:lass;, I gotta practice me pirate lest I forget it...', 0);
INSERT INTO `quest_request_items` VALUES (9513, 1, 0, 0, 0, 'You do a good thing for my people, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9514, 1, 0, 0, 0, 'You\'ve found something?', 0);
INSERT INTO `quest_request_items` VALUES (9515, 1, 0, 0, 0, 'Remain vigilant!', 0);
INSERT INTO `quest_request_items` VALUES (9516, 1, 0, 0, 0, 'Are there demons yet standing?', 0);
INSERT INTO `quest_request_items` VALUES (9517, 1, 0, 0, 0, '<The ancient creaks as it turns toward you.>$B$BArchitect Nemos said that you might be bringing wood salvaged from the deforesters\' encampment and befouled Satyrnaar.', 0);
INSERT INTO `quest_request_items` VALUES (9518, 1, 0, 0, 0, 'As long as Overseer Gorthak lives, I will oppose him. What news from the lumber camp?', 0);
INSERT INTO `quest_request_items` VALUES (9519, 1, 0, 0, 0, 'Can you feel it, $N, the touch of corruption upon the wind? If we do nothing, it will continue to advance. That is why I seek the Chalice of Elune. Were you able to find it?', 0);
INSERT INTO `quest_request_items` VALUES (9520, 1, 0, 0, 0, 'What do you have there, $gsir:ma\'am;?', 0);
INSERT INTO `quest_request_items` VALUES (9521, 1, 0, 0, 0, 'What\'s that you have there, $C?', 0);
INSERT INTO `quest_request_items` VALUES (9522, 1, 0, 0, 0, 'Our night elf scouts report that preparations for the attack may still be ongoing. Those dreadlords must die soon, $N!', 0);
INSERT INTO `quest_request_items` VALUES (9523, 1, 0, 0, 0, 'Don\'t come back without some ancient relics.\n', 0);
INSERT INTO `quest_request_items` VALUES (9525, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9526, 1, 0, 0, 0, 'Surely you have not yet planted all of my seeds?', 0);
INSERT INTO `quest_request_items` VALUES (9527, 1, 0, 0, 0, 'My wife was named Thalrisa and my daughter, Magwin.', 0);
INSERT INTO `quest_request_items` VALUES (9528, 1, 0, 0, 0, 'Hail, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9529, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9530, 1, 0, 0, 0, 'I love it when a plan comes together...', 0);
INSERT INTO `quest_request_items` VALUES (9531, 1, 0, 0, 0, 'That traitor is going to wish he never messed with Alliance Naval Command!', 0);
INSERT INTO `quest_request_items` VALUES (9532, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9533, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9534, 1, 5, 0, 0, 'Are there not demons yet standing?  You call yourself a $r?  This is no time to be taking a break from the fighting!', 0);
INSERT INTO `quest_request_items` VALUES (9535, 1, 0, 0, 0, 'What do you have there, scout?', 0);
INSERT INTO `quest_request_items` VALUES (9536, 1, 0, 0, 0, 'Those dreadlords must die soon, $N!', 0);
INSERT INTO `quest_request_items` VALUES (9537, 1, 0, 0, 0, 'Did you find the lying dog?', 0);
INSERT INTO `quest_request_items` VALUES (9538, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9539, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9540, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9541, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9542, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9544, 1, 0, 0, 0, '[Furbolg] So the prophecy of Akida is true... A hero has been delivered to us.', 0);
INSERT INTO `quest_request_items` VALUES (9545, 0, 0, 0, 0, 'Have you seen the vision yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9547, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9548, 1, 0, 0, 0, 'Did you manage to find my equipment?', 0);
INSERT INTO `quest_request_items` VALUES (9549, 1, 0, 0, 0, 'Do you have those samples for me to send back to Ironforge?', 0);
INSERT INTO `quest_request_items` VALUES (9550, 1, 0, 0, 0, 'Perhaps this old journal is what the map is referencing.', 0);
INSERT INTO `quest_request_items` VALUES (9551, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9552, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9553, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9554, 1, 0, 0, 0, 'Back so soon?  Your hair looks ruffled.$B$B<Nobundo grins knowingly.> ', 0);
INSERT INTO `quest_request_items` VALUES (9555, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9557, 1, 0, 0, 0, 'The Light shine upon you in all your endeavors, $c. What is it you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9559, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9560, 1, 0, 0, 0, 'They are ugly little creatures. Even the Blind Watcher could see them... and he\'s blind.', 0);
INSERT INTO `quest_request_items` VALUES (9561, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9562, 1, 0, 0, 0, 'A murloc kicked me in the behind and spit on me... in broad daylight!\n', 0);
INSERT INTO `quest_request_items` VALUES (9563, 0, 0, 0, 0, 'Having trouble finding the bitter?  Good old Bernie at Nethergarde Keep should stock barrels of it.$B$BUnless he\'s run out... that would be disastrous!', 0);
INSERT INTO `quest_request_items` VALUES (9564, 1, 0, 0, 0, 'Is that what I think it is?\n', 0);
INSERT INTO `quest_request_items` VALUES (9565, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9566, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9567, 1, 0, 0, 0, 'Were you successful in obtaining knowledge of the Nazzivus satyr?', 0);
INSERT INTO `quest_request_items` VALUES (9569, 1, 0, 0, 0, '<Vindicator Aalesia seems to look through you rather than at you, her mind fixed on dealing with the satyr.>$B$BHave you moved against the satyr leader as I have asked?', 0);
INSERT INTO `quest_request_items` VALUES (9570, 1, 0, 0, 0, '<Kurz grunts at you.>', 0);
INSERT INTO `quest_request_items` VALUES (9571, 1, 0, 0, 0, 'Hello, hero!', 0);
INSERT INTO `quest_request_items` VALUES (9572, 1, 0, 0, 0, '$N, right?  Stok\'ton told me to be expecting your report.$B$BI trust that you bring good news?', 0);
INSERT INTO `quest_request_items` VALUES (9573, 1, 0, 0, 0, 'Is the task complete?', 0);
INSERT INTO `quest_request_items` VALUES (9574, 1, 0, 0, 0, 'Were you able to get the samples I need?', 0);
INSERT INTO `quest_request_items` VALUES (9575, 5, 0, 0, 0, '$N, right?  Chadwick told me to be expecting your report.$B$BWHAT are you doing in my presence?!  Is your assignment complete?  Are you a complete and utter lackwit?  You make me want to vomit!$B$BNow get your worthless hide up on those ramparts and do what you were instructed to do!  Do you hear me?!', 0);
INSERT INTO `quest_request_items` VALUES (9576, 1, 0, 0, 0, 'What is it you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9578, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9579, 1, 0, 0, 0, '<Morae looks at you hopefully.>$B$BDid your search turn up any trace of Galaen?', 0);
INSERT INTO `quest_request_items` VALUES (9580, 1, 0, 0, 0, 'How goes the hunt, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9581, 1, 0, 0, 0, 'Were you able to gather the first crystal sample?', 0);
INSERT INTO `quest_request_items` VALUES (9582, 1, 0, 0, 0, 'Have you put down the beast? ', 0);
INSERT INTO `quest_request_items` VALUES (9584, 1, 0, 0, 0, 'Do you have the second crystal sample?', 0);
INSERT INTO `quest_request_items` VALUES (9585, 1, 0, 0, 0, 'Have you returned with the last sample for my set?', 0);
INSERT INTO `quest_request_items` VALUES (9586, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9587, 6, 0, 0, 0, 'What\'s that you have there, $g son : ma\'am;?', 0);
INSERT INTO `quest_request_items` VALUES (9588, 1, 0, 0, 0, 'What is that letter you have there, $C?', 0);
INSERT INTO `quest_request_items` VALUES (9589, 6, 0, 0, 0, 'You have that blood, darlin\'?  Might be kind of important if we asked you to get it, you know?', 0);
INSERT INTO `quest_request_items` VALUES (9590, 1, 0, 0, 0, 'Surely you have not collected all of the blood so quickly?', 0);
INSERT INTO `quest_request_items` VALUES (9591, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9592, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9593, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9594, 1, 0, 0, 0, 'Yes, $C? What is it you have there?', 0);
INSERT INTO `quest_request_items` VALUES (9595, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9598, 1, 0, 0, 0, 'Welcome back, $N', 0);
INSERT INTO `quest_request_items` VALUES (9600, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9601, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9602, 1, 0, 0, 0, 'You have returned!', 0);
INSERT INTO `quest_request_items` VALUES (9603, 1, 0, 0, 0, 'Good day, $N. Are you interested in renting a hippogryph?', 0);
INSERT INTO `quest_request_items` VALUES (9604, 1, 0, 0, 0, 'Greetings, friend. You look like you\'ve come a long way. How can I help you?', 0);
INSERT INTO `quest_request_items` VALUES (9605, 1, 0, 0, 0, 'Where are you headed, $c?', 0);
INSERT INTO `quest_request_items` VALUES (9606, 1, 0, 0, 0, 'Welcome back, $N. Was Nurguni able to gather everything on the list?', 0);
INSERT INTO `quest_request_items` VALUES (9607, 0, 0, 0, 0, 'Private, report! Have you scouted all of the Blood Furnace yet?', 0);
INSERT INTO `quest_request_items` VALUES (9608, 1, 0, 0, 0, 'Have you scouted all of the Blood Furnace yet?  What do you have to tell me?', 0);
INSERT INTO `quest_request_items` VALUES (9609, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9610, 1, 0, 0, 0, 'I look forward to you gathering enough of the Atal\'ai artifacts so that I might begin to study them.  I\'m eager to discover what happened to their once-great civilization.', 0);
INSERT INTO `quest_request_items` VALUES (9612, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9616, 1, 0, 0, 0, 'Yes? I\'m very busy, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9617, 1, 0, 0, 0, 'Yes?', 0);
INSERT INTO `quest_request_items` VALUES (9618, 1, 0, 0, 0, 'Were you able to locate Keltus? ', 0);
INSERT INTO `quest_request_items` VALUES (9619, 1, 0, 0, 0, 'Have you followed the path revealed by the voidstone? ', 0);
INSERT INTO `quest_request_items` VALUES (9620, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9621, 1, 0, 0, 0, 'Ah, a visitor from Quel\'Thalas!  What news do you bring?', 0);
INSERT INTO `quest_request_items` VALUES (9622, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9623, 1, 0, 0, 0, '<Torallius adjusts his eyepatch to look at you.>$B$BThis is the best we can offer the Hand of Argus?', 0);
INSERT INTO `quest_request_items` VALUES (9624, 1, 0, 0, 0, 'The sand pears are getting harder to find and, of course, that means less pie and fewer treats for the elekk here. Were you able to gather all the fruit I\'ll need?', 0);
INSERT INTO `quest_request_items` VALUES (9625, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9626, 1, 0, 0, 0, 'You\'ve come to see me, $r?  Speak and be quick.  I\'ve no time for the formalities of your race. ', 0);
INSERT INTO `quest_request_items` VALUES (9627, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9628, 1, 0, 0, 0, 'Were you able to find out what was keeping the survey team from returning?', 0);
INSERT INTO `quest_request_items` VALUES (9629, 1, 0, 0, 0, 'Did the device work? Have you marked the murlocs for my research?', 0);
INSERT INTO `quest_request_items` VALUES (9631, 1, 0, 0, 0, 'Alturus sent you. The stars spoke of your arrival.', 0);
INSERT INTO `quest_request_items` VALUES (9632, 1, 0, 0, 0, 'Greetings, $c. What have you there? ', 0);
INSERT INTO `quest_request_items` VALUES (9633, 1, 0, 0, 0, 'Welcome to Auberdine, friend. What brings you to Darkshore?', 0);
INSERT INTO `quest_request_items` VALUES (9634, 1, 0, 0, 0, 'We must act before the ravager displaces Bloodmyst Isle\'s native predators. Have you begun culling the ravager population?', 0);
INSERT INTO `quest_request_items` VALUES (9635, 1, 0, 0, 0, 'You got those parts yet?  I\'ve got some diving to do.', 0);
INSERT INTO `quest_request_items` VALUES (9636, 1, 0, 0, 0, 'You got those parts yet?  I\'ve got a compression coil to fix before Anchorite Ahuurn starts breathing down my neck!', 0);
INSERT INTO `quest_request_items` VALUES (9637, 1, 0, 0, 0, 'Have you obtained the tomes I seek, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9638, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9639, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9640, 1, 0, 0, 0, 'Weren\'t you looking for a journal or something?', 0);
INSERT INTO `quest_request_items` VALUES (9641, 1, 0, 0, 0, 'Have you gathered crystal shards from the creatures of Bloodmyst?', 0);
INSERT INTO `quest_request_items` VALUES (9642, 1, 0, 0, 0, 'If you have more of the irradiated crystal shards, I\'d be happy to exchange them for another of my crystals.', 0);
INSERT INTO `quest_request_items` VALUES (9643, 1, 0, 0, 0, 'Did you manage to get the constrictor vines?', 0);
INSERT INTO `quest_request_items` VALUES (9644, 1, 0, 0, 0, 'What news do you bring, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9645, 1, 0, 0, 0, 'You\'ve returned! What news do you bring?', 0);
INSERT INTO `quest_request_items` VALUES (9646, 1, 0, 0, 0, 'How can I help you, $c?', 0);
INSERT INTO `quest_request_items` VALUES (9647, 1, 0, 0, 0, 'Have you culled the moths?', 0);
INSERT INTO `quest_request_items` VALUES (9648, 1, 0, 0, 0, 'Remember, the mushrooms I requested are each unique to the different environments of Bloodmyst.', 0);
INSERT INTO `quest_request_items` VALUES (9649, 1, 0, 0, 0, 'Back so soon?', 0);
INSERT INTO `quest_request_items` VALUES (9663, 1, 0, 0, 0, 'This is no time to relax!', 0);
INSERT INTO `quest_request_items` VALUES (9664, 1, 0, 0, 0, 'When the towers are under our control, we will soon be able to surround the Forsaken. After that, it is only a matter of time before we can crush them.', 0);
INSERT INTO `quest_request_items` VALUES (9665, 1, 0, 0, 0, 'They must be fools to think that we would allow them to establish bases so close to one of our capitals.$B$BWe will bleed their numbers until they turn tail and retreat back to the south.', 0);
INSERT INTO `quest_request_items` VALUES (9666, 1, 0, 0, 0, 'Is it done?', 0);
INSERT INTO `quest_request_items` VALUES (9667, 1, 0, 0, 0, 'I don\'t have much longer, $N. They will kill me soon...', 0);
INSERT INTO `quest_request_items` VALUES (9668, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9669, 1, 0, 0, 0, 'It was a terrible mess... ', 0);
INSERT INTO `quest_request_items` VALUES (9670, 1, 0, 0, 0, 'Any luck?', 0);
INSERT INTO `quest_request_items` VALUES (9671, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9672, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9673, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9674, 1, 0, 0, 0, 'They\'re nasty creatures...', 0);
INSERT INTO `quest_request_items` VALUES (9675, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9676, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9677, 1, 0, 0, 0, 'yes?', 0);
INSERT INTO `quest_request_items` VALUES (9678, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9680, 1, 0, 0, 0, 'Have you retrieved the bone fragment I require, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9681, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9682, 1, 0, 0, 0, 'Do not mourn their demise, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9683, 1, 0, 0, 0, 'Atoph must be lured out!', 0);
INSERT INTO `quest_request_items` VALUES (9684, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9685, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9686, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9687, 1, 0, 0, 0, 'The dragon wars have long since passed. All that remains are bones and the agitated remnants of Ysera\'s brood.', 0);
INSERT INTO `quest_request_items` VALUES (9688, 1, 0, 0, 0, 'It pains me to watch. Please, let us not speak of this any further.', 0);
INSERT INTO `quest_request_items` VALUES (9689, 1, 0, 0, 0, 'I recommend that you bring allies, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9690, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9691, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9692, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9693, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9694, 1, 0, 0, 0, 'There are so many of them that I cannot help but think that they are somehow multiplying.', 0);
INSERT INTO `quest_request_items` VALUES (9696, 1, 0, 0, 0, 'I\'m a bit busy here, agent $N. This better be important. ', 0);
INSERT INTO `quest_request_items` VALUES (9697, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9698, 1, 0, 0, 0, '<Velen smiles.>$B$BGreetings, $N. I have been expecting you.', 0);
INSERT INTO `quest_request_items` VALUES (9699, 1, 0, 0, 0, 'Well?', 0);
INSERT INTO `quest_request_items` VALUES (9700, 1, 0, 0, 0, 'I\'ve been hearing reports of strange creatures appearing in the area. Whether they are mutated indigenous animals or true void anomalies is something that you need to find out.', 0);
INSERT INTO `quest_request_items` VALUES (9701, 1, 0, 0, 0, 'Back so soon? Your observation of the Sporeggar sporelings is critical to my research. I hope you aren\'t the type to rush things. Show patience and make certain that you have explored the entirety of the Spawning Glen before giving me your final report.', 0);
INSERT INTO `quest_request_items` VALUES (9702, 5, 0, 0, 0, 'Be sure that you collect all of the evidence carefully, $c!  We\'re fitting the pieces of a giant puzzle together here.  A mistake on your part could lead us to the wrong conclusions.$B$BThen where would we be in our understanding of Zangarmarsh\'s ecology?', 0);
INSERT INTO `quest_request_items` VALUES (9703, 6, 0, 0, 0, 'Was the information accurate?', 0);
INSERT INTO `quest_request_items` VALUES (9704, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9705, 1, 0, 0, 0, 'What did you find, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9706, 6, 0, 0, 0, 'What have you got there, $N? Is that a journal?', 0);
INSERT INTO `quest_request_items` VALUES (9707, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9708, 6, 0, 0, 0, 'Do you have those samples yet?', 0);
INSERT INTO `quest_request_items` VALUES (9709, 1, 0, 0, 0, 'You have all of the mushrooms that we need to create a new garden for the bog lords?', 0);
INSERT INTO `quest_request_items` VALUES (9710, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9711, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9712, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9714, 1, 0, 0, 0, 'We can still use more of the sanguine hibiscus from the shamblers, bog giants and underbats of the Underbog at Coilfang Reservoir.  Bring them to me in bunches of five and I will be most grateful.', 0);
INSERT INTO `quest_request_items` VALUES (9715, 6, 0, 0, 0, 'Do you have all of the hibiscus that I asked you to gather?', 0);
INSERT INTO `quest_request_items` VALUES (9716, 1, 0, 0, 0, 'Did you discover anything, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9717, 1, 0, 0, 0, 'The Underbog is a very dangerous place.  I would not consider you a coward if you were to balk at going there.  I also wouldn\'t be appreciative of you if you did not return with what I\'ve asked for.', 0);
INSERT INTO `quest_request_items` VALUES (9718, 0, 0, 0, 0, 'Hail, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9719, 6, 0, 0, 0, 'You have returned.  Does this mean that The Black Stalker is no more?', 0);
INSERT INTO `quest_request_items` VALUES (9720, 0, 0, 0, 0, 'Is it done, $c?', 0);
INSERT INTO `quest_request_items` VALUES (9721, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9722, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9723, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9724, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9725, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9726, 1, 0, 0, 0, 'Have you paid the naga a visit yet?', 0);
INSERT INTO `quest_request_items` VALUES (9727, 1, 0, 0, 0, 'Have you paid the naga a visit yet?', 0);
INSERT INTO `quest_request_items` VALUES (9728, 0, 0, 0, 0, 'It\'s good to see you again, $N.  How\'s your hunt for the naga going?', 0);
INSERT INTO `quest_request_items` VALUES (9729, 1, 0, 0, 0, 'Is Fwhoor alright? Have you recovered the ark?', 0);
INSERT INTO `quest_request_items` VALUES (9730, 1, 0, 0, 0, 'You want to talk about the bounty for Haghazed?  Well, is he dead?  There isn\'t much else to talk about!', 0);
INSERT INTO `quest_request_items` VALUES (9731, 0, 0, 0, 0, 'What news do you bring, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9732, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9735, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9736, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9737, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9738, 1, 6, 0, 0, 'Have you discovered the whereabouts of my four companions yet?', 0);
INSERT INTO `quest_request_items` VALUES (9739, 0, 0, 0, 0, 'The spore sacs!  Did you get them?', 0);
INSERT INTO `quest_request_items` VALUES (9740, 1, 0, 0, 0, 'You must take out their portal controllers before you can destroy the gate itself!', 0);
INSERT INTO `quest_request_items` VALUES (9741, 1, 0, 0, 0, 'Void critters grow into void anomalies. Truth be told, we really don\'t know what these creatures are... the name is more of a classification.', 0);
INSERT INTO `quest_request_items` VALUES (9742, 1, 0, 0, 0, 'Have you rescued any more spore sacs, $R?', 0);
INSERT INTO `quest_request_items` VALUES (9743, 0, 0, 0, 0, 'How\'s the bog lord slaying going?  Teach those brutes not to come into sporeling territory!', 0);
INSERT INTO `quest_request_items` VALUES (9744, 0, 0, 0, 0, 'You killed many giants, but there are still many more left.  And they\'re still attacking our spore sacs!', 0);
INSERT INTO `quest_request_items` VALUES (9746, 1, 0, 0, 0, 'Their leader can\'t hide from us forever. We will systematically eliminate every possible hiding place until Sironas is found.', 0);
INSERT INTO `quest_request_items` VALUES (9747, 1, 0, 0, 0, 'You\'ve returned; are Kataru and the Umbrafen slavers dead?', 0);
INSERT INTO `quest_request_items` VALUES (9748, 5, 0, 0, 0, 'Don\'t drink the water, $N!', 0);
INSERT INTO `quest_request_items` VALUES (9749, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9751, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9752, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9753, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9756, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9757, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9758, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9759, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9760, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9761, 1, 0, 0, 0, 'Do you see any unusually brave and powerful draenei around here?', 0);
INSERT INTO `quest_request_items` VALUES (9762, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9763, 0, 0, 0, 0, 'What of Kalithresh? Is he dead yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9764, 6, 0, 0, 0, 'What\'s that you have there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9765, 0, 0, 0, 0, 'Have you obtained the armaments I seek, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9766, 0, 0, 0, 0, 'We will forge the naga\'s own steel into weapons to use against them.  Bring me all the armaments you manage to salvage from Coilfang Reservoir.', 0);
INSERT INTO `quest_request_items` VALUES (9769, 1, 0, 0, 0, 'What\'s that, there? Been bitten by the wing bug, have ya?$B$B<Magasha chuckles at her own joke.>', 0);
INSERT INTO `quest_request_items` VALUES (9770, 1, 1, 0, 0, 'I still see marshfangs, $N. Surely you can\'t be done so soon.', 0);
INSERT INTO `quest_request_items` VALUES (9771, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9772, 1, 0, 0, 0, 'You\'re back, but Jyoba\'s not with you. What became of him?', 0);
INSERT INTO `quest_request_items` VALUES (9773, 20, 0, 0, 0, 'Tell me you haven\'t come back empty-handed. $N.', 0);
INSERT INTO `quest_request_items` VALUES (9774, 1, 0, 0, 0, 'I see you smirking. Yes, my armor\'s going to look a bit odd until I\'ve replaced all the old metal, but it\'s better this than unprotected.', 0);
INSERT INTO `quest_request_items` VALUES (9775, 0, 0, 0, 0, 'You don\'t look like one of my men. Speak your piece, $r.', 0);
INSERT INTO `quest_request_items` VALUES (9776, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9777, 1, 0, 0, 0, 'From the looks of things, we\'ll need to replenish our spores soon.', 0);
INSERT INTO `quest_request_items` VALUES (9778, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9779, 1, 0, 0, 0, 'Back so soon? Have you found the missive?', 0);
INSERT INTO `quest_request_items` VALUES (9780, 1, 0, 0, 0, 'Have you any fish to contribute to our stores?', 0);
INSERT INTO `quest_request_items` VALUES (9781, 1, 0, 0, 0, 'How goes the hunt, friend?', 0);
INSERT INTO `quest_request_items` VALUES (9782, 1, 0, 0, 0, 'Were you able to get a sample of the soil in the Dead Mire?', 0);
INSERT INTO `quest_request_items` VALUES (9783, 1, 0, 0, 0, 'It pains me to kill the creatures of the Dead Mire, but they are beyond saving. The best we can do is work to restore the area and nurture a new generation.', 0);
INSERT INTO `quest_request_items` VALUES (9784, 0, 0, 0, 0, 'I could still use some more plant parts.  With the lakes losing their water, I\'ve a feeling the number of invasive species is on the rise.  I need more numbers to back up my theory, however.', 0);
INSERT INTO `quest_request_items` VALUES (9785, 1, 0, 0, 0, 'Have you spoken to the ancients yet, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9786, 1, 0, 0, 0, 'Have you examined the Boha\'mu Ruins? Can you imagine what they were like in their full splendor?', 0);
INSERT INTO `quest_request_items` VALUES (9787, 1, 0, 0, 0, 'Do you have the idols?', 0);
INSERT INTO `quest_request_items` VALUES (9788, 0, 0, 0, 0, 'Did you find my belongings, $N?  The cave is not far from Umbrafen, near the border with Nagrand.', 0);
INSERT INTO `quest_request_items` VALUES (9789, 1, 1, 0, 0, 'The clefthoof of Nagrand are a good challenge.  I\'ve bagged myself quite a few.$B$BHow are you doing with that?', 0);
INSERT INTO `quest_request_items` VALUES (9790, 1, 0, 0, 0, 'Did you manage to gather any diaphanous wings?', 0);
INSERT INTO `quest_request_items` VALUES (9791, 1, 0, 0, 0, 'Have you been successful in your marshfang hunt?', 0);
INSERT INTO `quest_request_items` VALUES (9792, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9793, 1, 0, 0, 0, 'How may I help you?', 0);
INSERT INTO `quest_request_items` VALUES (9794, 1, 0, 0, 0, '<Kialon eyes you suspiciously.>$B$BI don\'t know you, $R. Do you have business with me?', 0);
INSERT INTO `quest_request_items` VALUES (9795, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9796, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9797, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9798, 1, 0, 0, 0, 'What have you got there?', 0);
INSERT INTO `quest_request_items` VALUES (9799, 1, 0, 0, 0, 'Hello, $c.  Do you have those flowers yet?', 0);
INSERT INTO `quest_request_items` VALUES (9800, 1, 0, 0, 0, '<Elementalist Lo\'ap makes two fists and shakes his head in disapproval.>$B$BOgre sized...', 0);
INSERT INTO `quest_request_items` VALUES (9801, 1, 0, 0, 0, 'Have you gathered the reagents?', 0);
INSERT INTO `quest_request_items` VALUES (9802, 0, 0, 0, 0, 'Did you find any plant parts, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9803, 1, 0, 0, 0, 'Did you speak with the Feralfen elder?', 0);
INSERT INTO `quest_request_items` VALUES (9804, 0, 0, 0, 0, 'Use the Nagrand cherries before delving too deeply into the lake.', 0);
INSERT INTO `quest_request_items` VALUES (9805, 1, 1, 0, 0, 'With great shame I tell you that it is my own kin who seek to drudge up the waters of Nagrand and create marshland.', 0);
INSERT INTO `quest_request_items` VALUES (9806, 0, 0, 0, 0, 'You\'re back, $N.  Did you obtain the fertile spores?', 0);
INSERT INTO `quest_request_items` VALUES (9807, 1, 0, 0, 0, 'We can always use more fertile spores, $R. Tallstalks are incredibly useful mushrooms. Being able to grow them lets us do many things with them.', 0);
INSERT INTO `quest_request_items` VALUES (9808, 0, 0, 0, 0, 'Did you find any glowcaps, $N?  They\'re literally everywhere in the marsh.$B$BYou can spot their bright glow from far away if you pay attention.', 0);
INSERT INTO `quest_request_items` VALUES (9809, 0, 0, 0, 0, 'I\'ll take more glowcaps if you have them.  Our village can always use more of them.', 0);
INSERT INTO `quest_request_items` VALUES (9810, 0, 1, 0, 0, 'The Earthen Ring will help in any way possible.\n', 0);
INSERT INTO `quest_request_items` VALUES (9811, 1, 0, 0, 0, 'You seek audience with me?  I do not recall hearing of an appointment. ', 0);
INSERT INTO `quest_request_items` VALUES (9812, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9813, 1, 0, 0, 0, 'Yes, $C?', 0);
INSERT INTO `quest_request_items` VALUES (9814, 1, 0, 0, 0, 'Have you got the mushrooms, mon?', 0);
INSERT INTO `quest_request_items` VALUES (9815, 1, 0, 0, 0, 'Do not leave any tainted muck behind!', 0);
INSERT INTO `quest_request_items` VALUES (9816, 1, 11, 0, 0, '<Witch Doctor Tor\'gash grins.>$B$BDid the lil\' Lost Ones like their gift?', 0);
INSERT INTO `quest_request_items` VALUES (9817, 1, 0, 0, 0, 'You\'re here to claim the bounty for Fyashe? That\'s the best news I\'ve heard all day.', 0);
INSERT INTO `quest_request_items` VALUES (9819, 0, 0, 0, 0, 'Do they sleep?', 0);
INSERT INTO `quest_request_items` VALUES (9820, 1, 0, 0, 0, 'What do you have there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9821, 0, 0, 0, 0, 'Gordawg eats this rock. Gordawg finds usurper. Bring rock!', 0);
INSERT INTO `quest_request_items` VALUES (9822, 1, 0, 0, 0, 'Have you found proof of the ogres\' intentions?', 0);
INSERT INTO `quest_request_items` VALUES (9823, 1, 1, 0, 0, 'The threat of the Ango\'rosh looms over us. Have you eliminated their leader?', 0);
INSERT INTO `quest_request_items` VALUES (9824, 0, 0, 0, 0, 'The readings, $N. Did you complete them?', 0);
INSERT INTO `quest_request_items` VALUES (9825, 0, 0, 0, 0, 'Have you obtained the ghostly essences I require, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9826, 0, 0, 0, 0, 'Alturus entrusted you with this information? That old fool.$B$BI suppose the damage is done, we might as well make use of you. I suppose you will cooperate?', 0);
INSERT INTO `quest_request_items` VALUES (9827, 6, 0, 0, 0, 'What is it you have there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9828, 1, 0, 0, 0, 'What is it you have there, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9830, 1, 0, 0, 0, 'I hope to demonstrate the uses of bleeder venom to Anchorite Ahuurn and the others at Telredor. That\'s going to require me to double my supply.', 0);
INSERT INTO `quest_request_items` VALUES (9831, 0, 0, 0, 0, 'Have you obtained the fragment, $c?  You would do well not to waste any time in this matter.', 0);
INSERT INTO `quest_request_items` VALUES (9832, 0, 0, 0, 0, 'How goes your search for the key fragments, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9833, 1, 0, 0, 0, 'Have you made progress in securing the roads?', 0);
INSERT INTO `quest_request_items` VALUES (9834, 1, 0, 0, 0, 'Does $N have hides for Maktu?', 0);
INSERT INTO `quest_request_items` VALUES (9835, 1, 0, 0, 0, 'How goes the fight against the Ango\'rosh?', 0);
INSERT INTO `quest_request_items` VALUES (9836, 0, 0, 0, 0, 'Who are you and what do you want?', 0);
INSERT INTO `quest_request_items` VALUES (9837, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9839, 1, 0, 0, 0, 'Is it done? Have you dealt with Overlord Gorefist?', 0);
INSERT INTO `quest_request_items` VALUES (9841, 1, 1, 0, 0, 'The sound seems to have receded into the distance. Is that wishful thinking or have you really done something about the problem?', 0);
INSERT INTO `quest_request_items` VALUES (9842, 1, 0, 0, 0, 'Have you managed to scare up some of those marshfang blades?', 0);
INSERT INTO `quest_request_items` VALUES (9843, 0, 0, 0, 0, 'Keanna\'s log... did you find it?', 0);
INSERT INTO `quest_request_items` VALUES (9844, 0, 0, 0, 0, 'I dread to ask, $N. What has become of the situation inside Karazhan?', 0);
INSERT INTO `quest_request_items` VALUES (9845, 1, 0, 0, 0, 'Is it safe for me to fish again?', 0);
INSERT INTO `quest_request_items` VALUES (9846, 1, 0, 0, 0, 'Have you gathered those totems?', 0);
INSERT INTO `quest_request_items` VALUES (9847, 1, 1, 0, 0, 'Were you able to summon the Feralfen spirit?', 0);
INSERT INTO `quest_request_items` VALUES (9848, 1, 0, 0, 0, 'Did your search of Daggerfen Village yield the information I need in order to get to the bottom of this poison puzzle?', 0);
INSERT INTO `quest_request_items` VALUES (9849, 0, 0, 0, 0, 'Gordawg wants the boulder returned.', 0);
INSERT INTO `quest_request_items` VALUES (9850, 1, 0, 0, 0, 'You think the clefthoof bulls are just going to fall dead at your feet here in front of the campfire?', 0);
INSERT INTO `quest_request_items` VALUES (9851, 1, 0, 0, 0, 'A warm fire and a $g woman : man; at your side for idle chit-chat is something you can get at home.  Here we hunt big game or die trying.', 0);
INSERT INTO `quest_request_items` VALUES (9852, 0, 0, 0, 0, 'There\'s no shame in admitting that you haven\'t the spine to hunt the mightiest of animals this land has to offer, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9853, 0, 0, 0, 0, 'Gordawg eat Gurok power.', 0);
INSERT INTO `quest_request_items` VALUES (9854, 1, 6, 0, 0, 'Have you come to know the peace that comes with knowing your place in nature?  Are you the hunter or the hunted?', 0);
INSERT INTO `quest_request_items` VALUES (9855, 1, 6, 0, 0, 'Have you learned yet to calm the beating of your heart?  To be as still as a calm lake and patient, waiting for the right moment to strike down your quarry?', 0);
INSERT INTO `quest_request_items` VALUES (9856, 0, 0, 0, 0, 'Have you faced Gutripper yet?', 0);
INSERT INTO `quest_request_items` VALUES (9857, 1, 0, 0, 0, 'I\'m just going to lay here a little while longer.  I should be fine soon.', 0);
INSERT INTO `quest_request_items` VALUES (9858, 1, 0, 0, 0, 'I don\'t suppose...<cough>... you\'ve taken care of those...<cough>... thorngrazers yet?', 0);
INSERT INTO `quest_request_items` VALUES (9859, 0, 0, 0, 0, '<Harold looks up at you weakly, but manages a smile.>$B$BYou have...<cough>... the hoof?', 0);
INSERT INTO `quest_request_items` VALUES (9860, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9861, 5, 0, 0, 0, 'Give it here! Quickly!', 0);
INSERT INTO `quest_request_items` VALUES (9862, 0, 0, 0, 0, 'The air spirit claims that the Murkblood are searching for something at Sunspring...', 0);
INSERT INTO `quest_request_items` VALUES (9863, 1, 0, 0, 0, 'Do this for us because we cannot do it for ourselves. ', 0);
INSERT INTO `quest_request_items` VALUES (9864, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9865, 1, 5, 0, 0, 'For each of my kin that they slew, ten of them must die!', 0);
INSERT INTO `quest_request_items` VALUES (9866, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9867, 1, 0, 0, 0, 'Bring me their leader\'s head, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9868, 1, 0, 0, 0, '<Garrosh barely acknowledges your presence. He appears deeply depressed.>', 0);
INSERT INTO `quest_request_items` VALUES (9869, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9870, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9871, 1, 0, 0, 0, 'What is it?', 0);
INSERT INTO `quest_request_items` VALUES (9872, 6, 0, 0, 0, 'What is it?', 0);
INSERT INTO `quest_request_items` VALUES (9873, 1, 0, 0, 0, 'Remember, $N, Ortor is a shaman of great power.', 0);
INSERT INTO `quest_request_items` VALUES (9874, 1, 0, 0, 0, 'The orcs will not understand what we are doing but it must be done. For the good of both orc and Broken. ', 0);
INSERT INTO `quest_request_items` VALUES (9875, 0, 0, 0, 0, 'You have something to show me?', 0);
INSERT INTO `quest_request_items` VALUES (9876, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9877, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9878, 1, 0, 0, 0, 'Murkblood are a nefarious tribe of Broken, $N. They may look like Kurenai but they are most assuredly savage, murdering beasts.', 0);
INSERT INTO `quest_request_items` VALUES (9879, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9882, 0, 0, 0, 0, 'Have you retrieved the crystal fragments I asked of you, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9883, 0, 0, 0, 0, 'You\'ve got more crystal fragments?  Make sure you\'re not taking any that are still attached to the mountain; we wouldn\'t want to stir up trouble with the naaru.', 0);
INSERT INTO `quest_request_items` VALUES (9884, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9885, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9886, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9887, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9889, 1, 0, 0, 0, 'I submit! I submit!', 0);
INSERT INTO `quest_request_items` VALUES (9890, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9891, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9892, 1, 0, 0, 0, 'Have you obtained any more warbeads? You\'ll find plenty of ogres to the far north, near the border with Zangarmarsh.', 0);
INSERT INTO `quest_request_items` VALUES (9893, 1, 0, 0, 0, 'How are those ogres treating you, $N? Tough bunch, aren\'t they?', 0);
INSERT INTO `quest_request_items` VALUES (9894, 1, 1, 0, 0, 'Have you located and dealt with Lord Klaq?', 0);
INSERT INTO `quest_request_items` VALUES (9895, 1, 0, 0, 0, 'Have you encountered Boglash?', 0);
INSERT INTO `quest_request_items` VALUES (9896, 1, 0, 0, 0, 'Did you manage to get the stinger? Remember, it\'s useless to me if it\'s damaged.', 0);
INSERT INTO `quest_request_items` VALUES (9897, 1, 0, 0, 0, 'Kristen is a very nice...<cough>... person to share her skins, wouldn\'t you agree?', 0);
INSERT INTO `quest_request_items` VALUES (9898, 1, 0, 0, 0, 'My luck is about to change - I can feel it.', 0);
INSERT INTO `quest_request_items` VALUES (9899, 1, 1, 0, 0, 'There\'s no changing his mind, I swear. I think I\'m going to have to ask Shadow Hunter Denjai for a transfer back to Zabra\'jin.', 0);
INSERT INTO `quest_request_items` VALUES (9900, 1, 0, 0, 0, 'You\'ve returned, $r.  Is Gava\'xi dead?', 0);
INSERT INTO `quest_request_items` VALUES (9901, 1, 0, 0, 0, 'Did you manage to track down Sporewing?', 0);
INSERT INTO `quest_request_items` VALUES (9902, 1, 0, 0, 0, 'I am ashamed that I cannot do more to help my enslaved brethren. but at least we have prevented more needless deaths.', 0);
INSERT INTO `quest_request_items` VALUES (9903, 1, 1, 0, 0, 'Have you \"retired\" old Mragesh?', 0);
INSERT INTO `quest_request_items` VALUES (9904, 0, 1, 0, 0, 'I take it Terrorclaw lives no more?', 0);
INSERT INTO `quest_request_items` VALUES (9905, 1, 0, 0, 0, 'Long time ago, Maktu might have used Mragesh\'s hide to make strong armor. Mragesh far too old for that now. Hide too soft for good armor.', 0);
INSERT INTO `quest_request_items` VALUES (9906, 1, 0, 0, 0, 'I\'m sending out a small organized search party for the rest of the villagers.', 0);
INSERT INTO `quest_request_items` VALUES (9907, 1, 0, 0, 0, 'They must be reminded that we are a force to be reckoned with in this region.', 0);
INSERT INTO `quest_request_items` VALUES (9910, 1, 0, 0, 0, 'Respect from fear! It is as good as any other kind. ', 0);
INSERT INTO `quest_request_items` VALUES (9911, 1, 0, 0, 0, '<The watcher blinks several times in surprise.>$B$BWhere did you get that... thing?', 0);
INSERT INTO `quest_request_items` VALUES (9912, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9913, 1, 0, 0, 0, '', 0);
INSERT INTO `quest_request_items` VALUES (9914, 0, 0, 0, 0, 'It\'s ivory that I\'m after, not excuses.  Of course, if you\'d rather, we can renegotiate your percentage of the profits.  I doubt that you\'d be pleased with the result.', 0);
INSERT INTO `quest_request_items` VALUES (9915, 0, 0, 0, 0, 'I still have a need for more pairs of ivory tusks from the wild elekk that roam this land.  Unfortunately, my budget will no longer handle your cut of the profits.  If you continue to provide me what I need, however, you will be ingratiating yourself with the Consortium.', 0);
INSERT INTO `quest_request_items` VALUES (9916, 0, 0, 0, 0, 'The children might be able to go a day without feeling hunger pangs.', 0);
INSERT INTO `quest_request_items` VALUES (9917, 1, 0, 0, 0, 'Have you found any new information?', 0);
INSERT INTO `quest_request_items` VALUES (9918, 1, 0, 0, 0, 'He\'ll probably be asleep on a ridge.', 0);
INSERT INTO `quest_request_items` VALUES (9919, 0, 0, 0, 0, 'You\'ve something to show me, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9920, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9921, 1, 0, 0, 0, 'We have only recently taken back Telaar. We will not lose it again!', 0);
INSERT INTO `quest_request_items` VALUES (9922, 1, 0, 0, 0, 'Beware the elementals in the basin, $N.', 0);
INSERT INTO `quest_request_items` VALUES (9923, 1, 0, 0, 0, 'That boy...$B$B<Arechron shakes his head in disapproval.>$B$BHe\'ll be the death of me.', 0);
INSERT INTO `quest_request_items` VALUES (9924, 1, 0, 0, 0, 'Did you find him?', 0);
INSERT INTO `quest_request_items` VALUES (9925, 1, 0, 0, 0, 'Did you take care of the voidspawn, $N?', 0);
INSERT INTO `quest_request_items` VALUES (9927, 1, 0, 0, 0, '<Lantresor\'s eyes open in bewilderment.>Is it done? ', 0);
INSERT INTO `quest_request_items` VALUES (9928, 1, 0, 0, 0, 'We will ignite a hatred heretofore unseen between the two clans! ', 0);
INSERT INTO `quest_request_items` VALUES (9929, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9930, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9931, 1, 0, 0, 0, 'Can you predict what will happen next? ', 0);
INSERT INTO `quest_request_items` VALUES (9932, 1, 0, 0, 0, 'Do you now understand why you could never win a war against me? ', 0);
INSERT INTO `quest_request_items` VALUES (9933, 1, 0, 0, 0, 'Peace you say? ', 0);
INSERT INTO `quest_request_items` VALUES (9934, 1, 0, 0, 0, '<Garrosh seems unmoved by the offering.>', 0);
INSERT INTO `quest_request_items` VALUES (9935, 1, 6, 0, 0, 'Are you here to collect a reward?', 0);
INSERT INTO `quest_request_items` VALUES (9936, 1, 0, 0, 0, 'Are you here to collect a reward?', 0);
INSERT INTO `quest_request_items` VALUES (9937, 0, 0, 0, 0, 'For the Mag\'har!', 0);
INSERT INTO `quest_request_items` VALUES (9938, 0, 0, 0, 0, 'Waste no time! Durn must be stopped!', 0);
INSERT INTO `quest_request_items` VALUES (9939, 1, 0, 0, 0, 'Are you here to collect a reward?', 0);
INSERT INTO `quest_request_items` VALUES (9940, 1, 0, 0, 0, 'Are you here to collect a reward?', 0);
INSERT INTO `quest_request_items` VALUES (9941, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9942, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9943, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9944, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9945, 1, 0, 0, 0, 'This is merely one step in a long process. Ogres, like dogs, must be shown the difference between right and wrong. Telling them does no good.', 0);
INSERT INTO `quest_request_items` VALUES (9946, 0, 0, 0, 0, 'He will undoubtedly be heavily guarded.', 0);
INSERT INTO `quest_request_items` VALUES (9947, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9948, 1, 0, 0, 0, '<Ungriz sighs.>$B$BI know it\'s a lot to ask for, $N; but bring them back alive...', 0);
INSERT INTO `quest_request_items` VALUES (9949, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9950, 1, 0, 0, 0, 'Rokag has told me about his plan. You have the eyes?', 0);
INSERT INTO `quest_request_items` VALUES (9951, 1, 1, 0, 0, 'We should never have invited them to dinner.  That much is certain!$B$BOr, at least, we should have insisted upon a couple of courses before the dessert that they brought.', 0);
INSERT INTO `quest_request_items` VALUES (9952, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9953, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9954, 1, 0, 0, 0, NULL, 0);
INSERT INTO `quest_request_items` VALUES (9955, 1, 0, 0, 0, 'Where\'s Corki?', 0);
INSERT INTO `quest_request_items` VALUES (9956, 1, 0, 0, 0, 'I feel so stupid. Arechron\'s son, Corki, asked me what happened and I told him. Now he\'s gone missing again! ', 0);
